oFF.AuContextMenuCreator.createWithProcess = function(process)
{
	let instance = new oFF.AuContextMenuCreator();
	let dataApplication = process.findEntity(oFF.ProcessEntity.DATA_APPLICATION);
	instance.m_menuManager = oFF.isNull(dataApplication) ? null : dataApplication.getMenuManager();
	return instance;
};
oFF.AuContextMenuCreator.prototype.m_menuManager = null;
oFF.AuContextMenuCreator.prototype.checkBuilderMenu = function(context, uiContext, booleanConsumer)
{
	let contextAccess = oFF.CMEFactory.createContextAccess(context, uiContext);
	this.m_menuManager.checkHasMenu(contextAccess, booleanConsumer);
};
oFF.AuContextMenuCreator.prototype.createContextMenuAtEvent = function(genesis, context, uiContext, controlEvent, beforeShowMenu, afterShowMenu)
{
	let contextAccess = oFF.CMEFactory.createContextAccess(context, uiContext);
	let control = controlEvent.getControl();
	let beforeLambda = (b) => {
		if (oFF.notNull(beforeShowMenu))
		{
			beforeShowMenu(b);
		}
	};
	let afterLambda = (a) => {
		if (oFF.notNull(afterShowMenu))
		{
			afterShowMenu(a);
		}
	};
	if (oFF.notNull(control) && control.getUiType().isTypeOf(oFF.UiType.BUTTON))
	{
		this.m_menuManager.updateMenu(genesis, contextAccess, control, 0, 0, beforeLambda, afterLambda, null);
	}
	else
	{
		let xCoordinate = controlEvent.getParameters().getIntegerByKeyExt(oFF.UiEventParams.PARAM_CLICK_X, 0);
		let yCoordinate = controlEvent.getParameters().getIntegerByKeyExt(oFF.UiEventParams.PARAM_CLICK_Y, 0);
		this.m_menuManager.updateMenu(genesis, contextAccess, null, xCoordinate, yCoordinate, beforeLambda, afterLambda, null);
	}
};
oFF.AuContextMenuCreator.prototype.createContextMenuAtWidget = function(genesis, context, uiContext, referenceControl, beforeShowMenu, afterShowMenu)
{
	let contextAccess = oFF.CMEFactory.createContextAccess(context, uiContext);
	this.m_menuManager.updateMenu(genesis, contextAccess, referenceControl, 0, 0, (b) => {
		beforeShowMenu(b);
	}, (a) => {
		afterShowMenu(a);
	}, null);
};

