oFF.AuGdsQbMemberDecoratorHelper = {

	decorateCartesianFilterMembers:function(cartesianFilter)
	{
			return oFF.AuGdsQbMemberDecoratorHelper.decorateMembers(oFF.AuGdsQbMemberDecoratorHelper.getCartesianFilterMembers(cartesianFilter));
	},
	decorateFilterExpressionMembers:function(filters)
	{
			let promiseList = oFF.XPromiseList.create();
		if (oFF.notNull(filters) && filters.isCartesianProduct())
		{
			let cartesianProduct = filters.getCartesianProduct();
			for (let i = 0; i < cartesianProduct.size(); i++)
			{
				let cartesianChild = cartesianProduct.getCartesianChild(i);
				promiseList.add(oFF.AuGdsQbMemberDecoratorHelper.decorateCartesianFilterMembers(cartesianChild));
			}
		}
		return oFF.XPromise.all(promiseList);
	},
	decorateMembers:function(membersList)
	{
			let membersMissingDescription = oFF.XCollectionUtils.filter(membersList, (m) => {
			return m.needsFieldValueRetrieval();
		});
		if (membersMissingDescription.isEmpty())
		{
			return oFF.XPromise.resolve(null);
		}
		return oFF.AuGdsQbMemberDecoratorHelper.decorateMissingFieldValues(membersList).onThenExt((memberDetailsRetrieved) => {
			if (!memberDetailsRetrieved.isEmpty())
			{
				oFF.AuGdsQbMemberDecoratorHelper.updateDimensionMembersSupplements(memberDetailsRetrieved);
			}
			return memberDetailsRetrieved;
		});
	},
	decorateMissingFieldValues:function(membersList)
	{
			let fieldValueRetriever = oFF.AuGdsDimensionMemberFieldValueRetriever.create(membersList.get(0).getDimension());
		let memberDetailsList = oFF.XList.create();
		oFF.XStream.of(membersList).forEach((member) => {
			memberDetailsList.add(member.getDimensionMemberDetailsLow());
			if (member.getDimensionMemberDetailsHigh() !== null)
			{
				memberDetailsList.add(member.getDimensionMemberDetailsHigh());
			}
		});
		if (!memberDetailsList.isEmpty())
		{
			fieldValueRetriever.setHierarchySelector(memberDetailsList.get(0).getHierarchyName());
		}
		return fieldValueRetriever.retrieve(memberDetailsList);
	},
	getCartesianFilterMembers:function(cartesianFilter)
	{
			let members = oFF.XList.create();
		if (oFF.isNull(cartesianFilter))
		{
			return members;
		}
		for (let j = 0; j < cartesianFilter.size(); j++)
		{
			let detailsGenerator = oFF.AuGdsDimensionMemberDetailsGenerator.create(cartesianFilter, cartesianFilter.getOp(j), cartesianFilter.getDimension());
			let detailsLow = detailsGenerator.generateFromLow();
			let detailsHigh = detailsGenerator.generateFromHigh();
			let filterOperation = cartesianFilter.getOp(j);
			let presentationType = cartesianFilter.getField().getPresentationType();
			let member = oFF.AuGdsFilterLineItemMemberFactory.create(filterOperation.getSetSign(), filterOperation.getComparisonOperator(), detailsLow, detailsHigh, detailsGenerator.getTargetFilterType(), null, presentationType);
			members.add(member);
		}
		return members;
	},
	updateDimensionMemberSupplement:function(memberDetails)
	{
			if (memberDetails.getDisplayIdField().isPresent())
		{
			memberDetails.getSourceFilterValueBag().updateSupplementValue(memberDetails.getDisplayIdField().get().getName(), memberDetails.getDisplayId());
		}
		if (memberDetails.getDescriptionField().isPresent())
		{
			memberDetails.getSourceFilterValueBag().updateSupplementValue(memberDetails.getDescriptionField().get().getName(), memberDetails.getDescription());
		}
	},
	updateDimensionMembersSupplements:function(memberDetails)
	{
			oFF.XStream.of(memberDetails).filter((memberDetail) => {
			return memberDetail.hasValueBagAndField();
		}).forEach(oFF.AuGdsQbMemberDecoratorHelper.updateDimensionMemberSupplement);
	}
};

