		{
			this.m_tableDefinitionLinker.putLinkedDefinitionName(oFF.OlapVisualizationConstants.TABLE_ALTERNATING_ROWS_LINK, oFF.OlapVisualizationConstants.TABLE_TEMPLATE_ALTERNATING_ROWS_NAME);
		}
