oFF.AuGdsChartQueryManager.prototype.resetValues = function(legendCheckbox, legendAlignment, legendPlacement, legendPlacementForPie)
{
	let needsReFetch = false;
	if (oFF.notNull(this.m_queryManager))
	{
		let cmd = this.m_queryManager.getConvenienceCommands();
		cmd.clearAllUniqueAxisProperties();
		cmd.toggleUniqueAxisProperties(null, oFF.UniqueAxisPropertyType.NUMERIC_SHIFT, true);
		cmd.toggleUniqueAxisProperties(null, oFF.UniqueAxisPropertyType.UNIT_INDEX, true);
		cmd.toggleUniqueAxisProperties(null, oFF.UniqueAxisPropertyType.CELL_VALUE_TYPES, true);
		let chartDefinition = this.getActiveChartDefinition();
		if (oFF.notNull(chartDefinition))
		{
			let legendEnabled = chartDefinition.getVisualizationVariableHolder().getOrCreateSimpleTypeVariable(oFF.XValueType.BOOLEAN, oFF.OlapVisualizationConstants.LEGEND_STYLE_VARIABLE_ENABLED, oFF.OlapVisualizationConstants.LEGEND_STYLE_VARIABLE_ENABLED, false);
			legendEnabled.setBoolean(false);
			legendCheckbox.setValue(legendEnabled.getValue());
			let alignmentEnabled = chartDefinition.getVisualizationVariableHolder().getOrCreateSimpleTypeVariable(oFF.XValueType.STRING, oFF.OlapVisualizationConstants.LEGEND_STYLE_VARIABLE_HORIZONTAL_ALIGNMENT, oFF.OlapVisualizationConstants.LEGEND_STYLE_VARIABLE_HORIZONTAL_ALIGNMENT, false);
			alignmentEnabled.setString(oFF.CellAlignmentHorizontal.CENTER.getName());
			legendAlignment.setValue(alignmentEnabled.getValue());
			chartDefinition.getChartSetting().getChartStyle().getLegendStyle().setHorizontalAlignment(oFF.CellAlignmentHorizontal.CENTER);
			chartDefinition.invalidateVisualizationContainer();
			let placementEnabled = chartDefinition.getVisualizationVariableHolder().getOrCreateSimpleTypeVariable(oFF.XValueType.STRING, oFF.OlapVisualizationConstants.CHART_STYLE_PLACEMENT_ABOVE, oFF.OlapVisualizationConstants.CHART_STYLE_PLACEMENT_ABOVE, false);
			placementEnabled.setString(oFF.CellAlignmentVertical.TOP.getName());
			chartDefinition.invalidateVisualizationContainer();
			chartDefinition.getChartSetting().getChartStyle().getLegendStyle().setVerticalAlignment(oFF.CellAlignmentVertical.TOP);
			chartDefinition.invalidateVisualizationContainer();
			legendPlacement.setValue(oFF.XStringValue.create(oFF.OlapVisualizationConstants.CHART_STYLE_PLACEMENT_ABOVE));
			legendPlacementForPie.setValue(oFF.XStringValue.create(oFF.OlapVisualizationConstants.CHART_STYLE_PLACEMENT_ABOVE));
		}
		needsReFetch = true;
	}
	let obj = new oFF.AuGdsChartLegendView();
	obj.updateUi();
	if (needsReFetch)
	{
		this._notifyChangeListener();
	}
};
