oFF.AuGdsChartQueryManager.prototype.setLegendPositioning = function(isHorizontal, legendPositioningString)
{
	let chartDefinition = this.getActiveChartDefinition();
	if (oFF.notNull(chartDefinition))
	{
		if (isHorizontal)
		{
			this.m_horizontal = oFF.CellAlignmentHorizontal.lookup(legendPositioningString);
		}
		else
		{
			this.m_vertical = oFF.CellAlignmentVertical.lookup(legendPositioningString);
		}
		if (oFF.XString.isEqual(legendPositioningString, oFF.OlapVisualizationConstants.CHART_STYLE_LABEL_DIRECTION_INLINE))
		{
			chartDefinition.getChartSetting().getChartStyle().getLegendStyle().setVerticalAlignment(oFF.CellAlignmentVertical.MIDDLE);
			chartDefinition.getChartSetting().getChartStyle().getLegendStyle().setHorizontalAlignment(oFF.CellAlignmentHorizontal.CENTER);
		}
		else if (oFF.XString.isEqual(legendPositioningString, oFF.CellAlignmentVertical.MIDDLE.getName()))
		{
			chartDefinition.getChartSetting().getChartStyle().getLegendStyle().setVerticalAlignment(oFF.CellAlignmentVertical.MIDDLE);
			chartDefinition.getChartSetting().getChartStyle().getLegendStyle().setHorizontalAlignment(oFF.CellAlignmentHorizontal.RIGHT);
		}
		else
		{
			this._setPlacementChange(this.m_vertical);
			this._setAlignmentChanged(this.m_horizontal);
		}
		chartDefinition.invalidateVisualizationContainer();
		this._notifyChangeListener();
	}
};
