oFF.AuGdsQbCfDatapointStylesUpdaterBW.prototype._ff_c = "AuGdsQbCfDatapointStylesUpdaterBW";

oFF.AuGdsQbCfDatapointStylesUpdaterBW.create = function(queryModel)
{
	oFF.XObjectExt.assertNotNullExt(queryModel, "queryModel is null");
	oFF.XObjectExt.assertTrueExt(queryModel.getSystemType().isTypeOf(oFF.SystemType.BW), "System type is not BW");
	let instance = new oFF.AuGdsQbCfDatapointStylesUpdaterBW();
	instance.m_queryModel = queryModel;
	return instance;
};
oFF.AuGdsQbCfDatapointStylesUpdaterBW.prototype.m_queryModel = null;
oFF.AuGdsQbCfDatapointStylesUpdaterBW.prototype.update = function(newExceptionNameByOldExceptionName)
{
	let tableDefs = oFF.XStream.of(this.m_queryModel.getVisualizationManager().getVisualizationDefinitions()).filter((vizDef2) => {
		return vizDef2.getProtocolBindingType().isEqualTo(oFF.ProtocolBindingType.SAC_TABLE_GRID);
	}).map((vizDef) => {
		return vizDef;
	}).collect(oFF.XStreamCollector.toList());
	if (tableDefs.isEmpty())
	{
		return;
	}
	oFF.XCollectionUtils.forEach(newExceptionNameByOldExceptionName.getKeysAsReadOnlyList(), (oldExceptionName) => {
		let tableDefinitionOpt = oFF.XStream.of(tableDefs).find((tableDef) => {
			return !tableDef.getDataPointStyleByExceptionName(oldExceptionName).isEmpty();
		});
		if (!tableDefinitionOpt.isPresent())
		{
			return;
		}
		let tableDefinition = tableDefinitionOpt.get();
		let newExceptionName = newExceptionNameByOldExceptionName.getByKey(oldExceptionName);
		let dataPointStyleByExceptionName = tableDefinition.getDataPointStyleByExceptionName(oldExceptionName);
		if (oFF.notNull(dataPointStyleByExceptionName) && !dataPointStyleByExceptionName.isEmpty())
		{
			oFF.XStream.of(dataPointStyleByExceptionName).forEach((dataPointStyle) => {
				dataPointStyle.setExceptionName(newExceptionName);
			});
		}
		else
		{
			dataPointStyleByExceptionName = tableDefinition.getDataPointStyleByExceptionName(oFF.XString.substring(oldExceptionName, 0, oFF.XString.size(oldExceptionName) - 1));
			if (oFF.notNull(dataPointStyleByExceptionName))
			{
				oFF.XStream.of(dataPointStyleByExceptionName).forEach((dataPointStyle) => {
					let clonedDataPointStyle = tableDefinition.addNewDataPointStyle(dataPointStyle.getName(), dataPointStyle.getText());
					clonedDataPointStyle.copyFrom(dataPointStyle, null);
					clonedDataPointStyle.setExceptionName(oFF.XString.replace(newExceptionName, oFF.AuGdsQbConditionalFormattingConstants.FIRST_RANGE_PART, oFF.AuGdsQbConditionalFormattingConstants.SECOND_RANGE_PART));
					tableDefinition.addDataPointStyle(clonedDataPointStyle);
					dataPointStyle.setExceptionName(oFF.XString.replace(newExceptionName, oFF.AuGdsQbConditionalFormattingConstants.SECOND_RANGE_PART, oFF.AuGdsQbConditionalFormattingConstants.FIRST_RANGE_PART));
				});
			}
		}
	});
};

oFF.AuGdsQbCfEvaluatesUpdaterBW = function() {};
oFF.AuGdsQbCfEvaluatesUpdaterBW.prototype = new oFF.XObject();
