oFF.AuGdsQbCfEvaluatesUpdaterBW.create = function(queryModel)
{
	oFF.XObjectExt.assertNotNullExt(queryModel, "queryModel is null");
	oFF.XObjectExt.assertTrueExt(queryModel.getSystemType().isTypeOf(oFF.SystemType.BW), "System type is not BW");
	let instance = new oFF.AuGdsQbCfEvaluatesUpdaterBW();
	instance.m_queryModel = queryModel;
	return instance;
};
oFF.AuGdsQbCfEvaluatesUpdaterBW.prototype.m_queryModel = null;
oFF.AuGdsQbCfEvaluatesUpdaterBW.prototype.evaluateExists = function(formulaException, structure)
{
	return oFF.XStream.of(formulaException.getEvaluates()).find((evaluate) => {
		return evaluate.getDimension().isEqualTo(structure.getDimension()) && (evaluate.getLowValue() !== null && oFF.XString.isEqual(evaluate.getLowValue().toString(), structure.getName()) || evaluate.getHighValue() !== null && oFF.XString.isEqual(evaluate.getHighValue().toString(), structure.getName()));
	}).isPresent();
};
oFF.AuGdsQbCfEvaluatesUpdaterBW.prototype.update = function(formulaExceptions)
{
	let uniqueExceptionToExceptionNames = oFF.XHashMapByString.create();
	let uniqueExceptionToStructures = oFF.XHashMapByString.create();
	oFF.XStream.of(formulaExceptions).forEach((formulaException) => {
		let hashIndex = oFF.XString.indexOf(formulaException.getName(), oFF.AuGdsQbConditionalFormattingConstants.FORMULA_EXCEPTION_SEPARATOR);
		if (hashIndex !== -1 && formulaException.getStructure().isPresent())
		{
			let uniqueExceptionName = oFF.XString.substring(formulaException.getName(), 0, hashIndex);
			if (uniqueExceptionToExceptionNames.getByKey(uniqueExceptionName) === null)
			{
				uniqueExceptionToExceptionNames.put(uniqueExceptionName, oFF.XList.create());
			}
			uniqueExceptionToExceptionNames.getByKey(uniqueExceptionName).add(formulaException.getName());
			if (uniqueExceptionToStructures.getByKey(uniqueExceptionName) === null)
			{
				uniqueExceptionToStructures.put(uniqueExceptionName, oFF.XList.create());
			}
			uniqueExceptionToStructures.getByKey(uniqueExceptionName).add(formulaException.getStructure().get());
		}
	});
	oFF.XCollectionUtils.forEach(uniqueExceptionToExceptionNames.getKeysAsReadOnlyList(), (uniqueExceptionName) => {
		let exceptionNames = uniqueExceptionToExceptionNames.getByKey(uniqueExceptionName);
		let structures = uniqueExceptionToStructures.getByKey(uniqueExceptionName);
		oFF.XCollectionUtils.forEach(exceptionNames, (exceptionName) => {
			oFF.XCollectionUtils.forEach(structures, (struct) => {
				if (!this.evaluateExists(this.m_queryModel.getFormulaExceptionManager().getByKey(exceptionName), struct))
				{
					this.m_queryModel.getFormulaExceptionManager().getByKey(exceptionName).addNewEvaluate(struct.getDimension(), oFF.XStringValue.create(struct.getName()));
				}
			});
		});
	});
};

