oFF.AuGdsQbConditionalFormattingFilterValidator.create = function()
{
	let validator = new oFF.AuGdsQbConditionalFormattingFilterValidator();
	return validator;
};
oFF.AuGdsQbConditionalFormattingFilterValidator.prototype.fetchMembers = function(filter)
{
	let memberManager = oFF.QMemberManager.create(filter.getDimension());
	let names = oFF.XStream.of(filter.getValues()).collect(oFF.XStreamCollector.toListOfString((value) => {
		return value.getStringRepresentation();
	}));
	return memberManager.getMembersByName(names);
};
oFF.AuGdsQbConditionalFormattingFilterValidator.prototype.findValue = function(members, value)
{
	for (let i = 0; i < members.size(); i++)
	{
		let member = members.get(i);
		if (oFF.XString.isEqual(member.getDimensionMember().getValueAsString(), value.getStringRepresentation()))
		{
			return true;
		}
	}
	return false;
};
oFF.AuGdsQbConditionalFormattingFilterValidator.prototype.getLocalization = function()
{
	return oFF.AuGdsQbConditionalFormattingI18n.getLocalization();
};
oFF.AuGdsQbConditionalFormattingFilterValidator.prototype.onValuehelpExecuted = function(extResult, resultSetContainer, customIdentifier, resolve, reject)
{
	if (!extResult.hasErrors())
	{
		let data = extResult.getData();
		let nodeNameList = oFF.XList.create();
		for (let i = 0; i < data.size(); i++)
		{
			if (data.get(i).getParentNode() === null)
			{
				let nodeValue = data.get(i).getDimensionMember().getValueAsString();
				if (oFF.XStringUtils.isNotNullAndNotEmpty(nodeValue))
				{
					nodeNameList.add(nodeValue);
				}
			}
		}
		if (oFF.XCollectionUtils.hasElements(nodeNameList))
		{
			resolve(nodeNameList);
		}
	}
	else
	{
		reject(oFF.XError.createWithMessage(extResult.getFirstError()));
	}
};
oFF.AuGdsQbConditionalFormattingFilterValidator.prototype.validate = function(filter)
{
	let queryModel = filter.getDimension().getQueryManager().getQueryModel();
	let validationResult = oFF.MessageManager.createMessageManagerExt(queryModel.getSession());
	let qmWrapper = oFF.AuGdsQbCFQueryModelWrapper.create(queryModel);
	if (qmWrapper.isBW())
	{
		return oFF.XPromise.resolve(validationResult);
	}
	if (filter.getValidation().isPresent())
	{
		return oFF.XPromise.resolve(filter.getValidation().get());
	}
	let dimension = queryModel.getDimensionByName(filter.getDimension().getName());
	if (oFF.isNull(dimension))
	{
		validationResult.addError(oFF.ErrorCodes.INVALID_DIMENSION, this.getLocalization().getText(oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_THRESHOLD_FILTER_INVALID));
		return oFF.XPromise.resolve(validationResult);
	}
	return oFF.XPromise.create((resolve, reject) => {
		this.fetchMembers(filter).onThen((members) => {
			if (oFF.XStream.of(filter.getValues()).find((value) => {
				return !this.findValue(members, value);
			}).isPresent())
			{
				validationResult.addError(oFF.ErrorCodes.INVALID_FIELD, this.getLocalization().getText(oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_THRESHOLD_FILTER_INVALID));
			}
			filter.setValidation(validationResult);
			resolve(validationResult);
		}).onCatch(reject);
	});
};

