oFF.AuGdsQbConditionalFormattingRuleValidator.prototype.addThresholdMeasureNotFoundError = function(validationResult, text)
{
	validationResult.addError(oFF.ErrorCodes.THRESHOLD_MEASURE_NOT_FOUND, oFF.AuGdsQbConditionalFormattingRuleValidator.getLocalization().getTextWithPlaceholder(oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_THRESHOLD_MEASURE_NOT_FOUND, text));
};
oFF.AuGdsQbConditionalFormattingRuleValidator.prototype.decorateFormulaExceptionValidation = function(validationResult, formulaValidationResult, text)
{
	oFF.XStream.of(formulaValidationResult.getErrors()).forEach((err) => {
		if (err.getCode() === oFF.ErrorCodes.THRESHOLD_MISSING_REFERENCE_MEASURE)
		{
			this.addThresholdMeasureNotFoundError(validationResult, err.getExtendedInfo().toString());
		}
		else
		{
			validationResult.addMessage(err);
		}
	});
};
oFF.AuGdsQbConditionalFormattingRuleValidator.prototype.hasError = function(validationResult, code)
{
	return oFF.XStream.of(validationResult.getErrors()).find((msg) => {
		return msg.getCode() === code;
	}).isPresent();
};
oFF.AuGdsQbConditionalFormattingRuleValidator.prototype.isStructureMemberFound = function(structureMember)
{
	let queryModel = structureMember.getQueryModel();
	let structureName = structureMember.getDimension().getName();
	if (oFF.XStringUtils.isNullOrEmpty(structureName))
	{
		return false;
	}
	let structure = queryModel.getDimensionByName(structureName);
	if (oFF.isNull(structure))
	{
		return false;
	}
	return structure.getStructureMember(structureMember.getName()) !== null && oFF.AuGdsQbConditionalFormattingRuleValidator.validateMeasureVisibility(structureMember) !== oFF.AuGdsQbCfRuleValidationState.INVALID;
};
oFF.AuGdsQbConditionalFormattingRuleValidator.prototype.releaseObject = function()
{
	this.m_filterValidator = oFF.XObjectExt.release(this.m_filterValidator);
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.AuGdsQbConditionalFormattingRuleValidator.prototype.validate = function(rule)
{
	let structureMember = rule.getStructureMember();
	let queryModel = structureMember.getQueryModel();
	let formulaExceptionManager = queryModel.getFormulaExceptionManager();
	let validationResult = oFF.MessageManager.createMessageManagerExt(queryModel.getSession());
	let ruleId = rule.getId();
	let formulaException = formulaExceptionManager.getByKey(ruleId);
	if (oFF.notNull(formulaException))
	{
		this.decorateFormulaExceptionValidation(validationResult, formulaException.validateWithDataModelScope(queryModel), structureMember.getText());
	}
	if (oFF.AuGdsQbConditionalFormattingRuleValidator.validateStructureMember(structureMember) === oFF.AuGdsQbCfRuleValidationState.INVALID)
	{
		validationResult.addError(oFF.ErrorCodes.THRESHOLD_STRUCTURE_MEASURE_INVALID, oFF.AuGdsQbConditionalFormattingRuleValidator.getLocalization().getTextWithPlaceholder(oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_THRESHOLD_MEASURE_INVALID, structureMember.getText()));
	}
	if (!this.hasError(validationResult, oFF.ErrorCodes.THRESHOLD_MEASURE_NOT_FOUND) && !this.isStructureMemberFound(structureMember))
	{
		this.addThresholdMeasureNotFoundError(validationResult, structureMember.getText());
	}
	return validationResult;
};
oFF.AuGdsQbConditionalFormattingRuleValidator.prototype.validateFilters = function(rule)
{
	let filterValidations = oFF.XStream.of(rule.getFilters()).map((filter) => {
		return this.m_filterValidator.validate(filter);
	}).collect(oFF.XStreamCollector.toList());
	let promiseResult = oFF.XPromise.create((resolve, reject) => {
		let allFilterValidationPromises = oFF.XPromise.all(oFF.XPromiseList.createFromList(filterValidations));
		allFilterValidationPromises.then((validations) => {
			let structureMember = rule.getStructureMember();
			let queryModel = structureMember.getQueryModel();
			let validationResult = oFF.MessageManager.createMessageManagerExt(queryModel.getSession());
			let invalidFilter = oFF.XStream.of(rule.getFilters()).find((filterValidated) => {
				return filterValidated.getValidation().isPresent() && filterValidated.getValidation().get().hasErrors();
			});
			if (invalidFilter.isPresent())
			{
				validationResult.addError(oFF.ErrorCodes.INVALID_DIMENSION, oFF.AuGdsQbConditionalFormattingRuleValidator.getLocalization().getText(oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_RULE_FILTER_INVALID));
			}
			resolve(validationResult);
			return validations;
		}, null);
	});
	return promiseResult;
};

