oFF.AuGdsQbCartesianFilterTokensBuilder.create = function(type, filters, filterPredicate, displayType)
{
	let instance = new oFF.AuGdsQbCartesianFilterTokensBuilder();
	instance.m_type = type;
	instance.m_filters = filters;
	instance.m_displayType = displayType;
	instance.m_filterPredicate = oFF.notNull(filterPredicate) ? filterPredicate : (cartesianChild) => {
		return true;
	};
	return instance;
};
oFF.AuGdsQbCartesianFilterTokensBuilder.prototype.m_displayType = null;
oFF.AuGdsQbCartesianFilterTokensBuilder.prototype.m_filterPredicate = null;
oFF.AuGdsQbCartesianFilterTokensBuilder.prototype.m_filters = null;
oFF.AuGdsQbCartesianFilterTokensBuilder.prototype.m_type = null;
oFF.AuGdsQbCartesianFilterTokensBuilder.prototype._build = function()
{
	let infoTokenList = oFF.XList.create();
	let cartesianProduct = this.m_filters.getCartesianProduct();
	for (let i = 0; i < cartesianProduct.size(); i++)
	{
		let cartesianChild = cartesianProduct.getCartesianChild(i);
		if (!this.m_filterPredicate(cartesianChild))
		{
			continue;
		}
		let filterInfoExtractor = oFF.AuGdsQbFilterInfoExtractor.create(cartesianChild, this.m_displayType);
		let identifier = cartesianChild.getName();
		let title = filterInfoExtractor.getTitle();
		let subtitle = filterInfoExtractor.getDescription();
		if (!filterInfoExtractor.hasVariablePlaceholder())
		{
			infoTokenList.add(oFF.AuGdsQbInfoToken.create(this.m_type, identifier, title, subtitle));
		}
	}
	return infoTokenList.getValuesAsReadOnlyList();
};
oFF.AuGdsQbCartesianFilterTokensBuilder.prototype.build = function()
{
	let infoTokenList = oFF.XList.create();
	if (oFF.notNull(this.m_filters))
	{
		oFF.XObjectExt.assertTrueExt(this.m_filters.isCartesianProduct(), "Filter expression is not a cartesian product.");
		infoTokenList.addAll(this._build());
	}
	return infoTokenList.getValuesAsReadOnlyList();
};
oFF.AuGdsQbCartesianFilterTokensBuilder.prototype.releaseObject = function()
{
	this.m_filterPredicate = null;
	this.m_type = null;
	this.m_filters = null;
	this.m_displayType = null;
	oFF.XObject.prototype.releaseObject.call( this );
};

oFF.AuGdsQbComplexFilterTokensBuilder = function() {};
oFF.AuGdsQbComplexFilterTokensBuilder.prototype = new oFF.XObject();
oFF.AuGdsQbComplexFilterTokensBuilder.prototype._ff_c = "AuGdsQbComplexFilterTokensBuilder";

oFF.AuGdsQbComplexFilterTokensBuilder.MEMBER_SEPARATOR = " + ";
oFF.AuGdsQbComplexFilterTokensBuilder.create = function(type, filters)
{
	let instance = new oFF.AuGdsQbComplexFilterTokensBuilder();
	instance.m_filters = filters;
	return instance;
};
oFF.AuGdsQbComplexFilterTokensBuilder.prototype.m_filters = null;
oFF.AuGdsQbComplexFilterTokensBuilder.prototype.m_type = null;
oFF.AuGdsQbComplexFilterTokensBuilder.prototype._build = function()
{
	let infoTokenList = oFF.XList.create();
	let filterElement = this.m_filters.getComplexRoot();
	if (oFF.notNull(filterElement))
	{
		let complexTree = oFF.AuGdsFilterLineComplexFilterNodeFactory.create(filterElement);
		let members = this.geFilterMembers(filterElement);
		let tokenString = this.getTokenString(members, complexTree.getDimensionList());
		let title = oFF.XStringUtils.concatenate4(tokenString, " (", oFF.XInteger.convertToString(complexTree.getDimensionList().size()), ")");
		let subtitle = tokenString;
		infoTokenList.add(oFF.AuGdsQbInfoToken.create(this.m_type, filterElement.getUniqueId(), title, subtitle));
	}
	return infoTokenList.getValuesAsReadOnlyList();
};
oFF.AuGdsQbComplexFilterTokensBuilder.prototype.build = function()
{
	let infoTokenList = oFF.XList.create();
	if (oFF.notNull(this.m_filters))
	{
		oFF.XObjectExt.assertFalseExt(this.m_filters.isCartesianProduct(), "Filter expression is not a complex filter, it is a cartesian product.");
		infoTokenList.addAll(this._build());
	}
	return infoTokenList.getValuesAsReadOnlyList();
};
oFF.AuGdsQbComplexFilterTokensBuilder.prototype.geFilterMembers = function(filterElement)
{
	let complexTree = oFF.AuGdsFilterLineComplexFilterNodeFactory.create(filterElement);
	let complexFormula = complexTree.toString();
	let detailsLow = oFF.AuGdsDimensionMemberDetails.create("FF_COMPLEX_FILTER", complexFormula, null);
	let member = oFF.AuGdsFilterLineItemMemberFactory.create(oFF.SetSign.INCLUDING, oFF.ComparisonOperator.EQUAL, detailsLow, null, oFF.AuGdsFilterLineItemType.COMPLEX, null, null);
	let members = oFF.XList.create();
	members.add(member);
	return members;
};
oFF.AuGdsQbComplexFilterTokensBuilder.prototype.getDescriptionFromDimension = function(dimension)
{
	return oFF.XStringValue.create(oFF.XStringUtils.isNotNullAndNotEmpty(dimension.getDisplayDescription()) ? dimension.getDisplayDescription() : dimension.getDisplayName());
};
oFF.AuGdsQbComplexFilterTokensBuilder.prototype.getTokenString = function(members, dimensionList)
{
	let dimTxt = oFF.XStream.of(dimensionList).map(this.getDescriptionFromDimension.bind(this)).collect(oFF.XStreamCollector.toListOfString((ixStr) => {
		return ixStr.getString();
	}));
	return oFF.XCollectionUtils.join(dimTxt, oFF.AuGdsQbComplexFilterTokensBuilder.MEMBER_SEPARATOR);
};
oFF.AuGdsQbComplexFilterTokensBuilder.prototype.releaseObject = function()
{
	this.m_filters = null;
	this.m_type = null;
	oFF.XObject.prototype.releaseObject.call( this );
};

