oFF.AuGdsQbVariablesTokensBuilder = function() {};
oFF.AuGdsQbVariablesTokensBuilder.prototype = new oFF.XObject();
oFF.AuGdsQbVariablesTokensBuilder.prototype._ff_c = "AuGdsQbVariablesTokensBuilder";

oFF.AuGdsQbVariablesTokensBuilder.create = function(type, variables)
{
	return oFF.AuGdsQbVariablesTokensBuilder.createExt(type, variables, null, null);
};
oFF.AuGdsQbVariablesTokensBuilder.createExt = function(type, variables, filterVariablePredicate, displayType)
{
	let instance = new oFF.AuGdsQbVariablesTokensBuilder();
	instance.m_type = type;
	instance.m_variables = variables;
	instance.m_filterVariablePredicate = oFF.notNull(filterVariablePredicate) ? filterVariablePredicate : (variable) => {
		return true;
	};
	instance.m_displayType = displayType;
	return instance;
};
oFF.AuGdsQbVariablesTokensBuilder.prototype.m_displayType = null;
oFF.AuGdsQbVariablesTokensBuilder.prototype.m_filterVariablePredicate = null;
oFF.AuGdsQbVariablesTokensBuilder.prototype.m_type = null;
oFF.AuGdsQbVariablesTokensBuilder.prototype.m_variables = null;
oFF.AuGdsQbVariablesTokensBuilder.prototype.build = function()
{
	let variableInfoTokens = oFF.XList.create();
	if (oFF.notNull(this.m_variables))
	{
		for (let i = 0; i < this.m_variables.size(); i++)
		{
			let variable = this.m_variables.get(i);
			if (!this.m_filterVariablePredicate(variable))
			{
				continue;
			}
			if (oFF.VdImportExport.getValuesFromVariable(variable).isEmpty())
			{
				continue;
			}
			let variableType = variable.getVariableType();
			let tokenTitle = variable.getText();
			let tokenDescription = variable.getValueByString();
			if (variableType.isTypeOf(oFF.VariableType.DIMENSION_MEMBER_VARIABLE))
			{
				let dimVar = variable;
				let memberFilter = dimVar.getMemberFilter();
				let filterInfoExtractor = oFF.AuGdsQbFilterInfoExtractor.create(memberFilter, this.m_displayType);
				if (filterInfoExtractor.hasVariablePlaceholder())
				{
					continue;
				}
				tokenDescription = filterInfoExtractor.getDescription();
			}
			variableInfoTokens.add(oFF.AuGdsQbInfoToken.create(this.m_type, variable.getName(), tokenTitle, tokenDescription));
		}
	}
	return variableInfoTokens.getValuesAsReadOnlyList();
};
oFF.AuGdsQbVariablesTokensBuilder.prototype.releaseObject = function()
{
	this.m_type = null;
	this.m_displayType = null;
	this.m_filterVariablePredicate = null;
	this.m_variables = null;
	oFF.XObject.prototype.releaseObject.call( this );
};

