oFF.AuGdsQbSacModelHandler._adjustDataSourceSystemIfNecessary = function(dataSource, file)
{
	if (oFF.notNull(file))
	{
		let originSystem = null;
		let metadata = file.getCachedMetadata();
		if (oFF.notNull(metadata) && metadata.containsKey(oFF.XFileAttribute.SYSTEM_NAME))
		{
			originSystem = metadata.getStringByKey(oFF.XFileAttribute.SYSTEM_NAME);
		}
		if (oFF.XString.isEqual(dataSource.getSystemName(), oFF.OdpSacModelHandler.DEFAULT_SYSTEM_NAME) && !oFF.XString.isEqual(originSystem, oFF.OdpSacModelHandler.DEFAULT_SYSTEM_NAME))
		{
			dataSource.setSystemName(originSystem);
		}
	}
};
oFF.AuGdsQbSacModelHandler.getDataSourceFromRepoJson = function(inaRepoJson, file)
{
	return oFF.AuGdsQbSacModelHandler.getDataSourceFromSfxJson(inaRepoJson, file);
};
oFF.AuGdsQbSacModelHandler.getDataSourceFromSfxJson = function(sfxJson, file)
{
	if (oFF.notNull(sfxJson) && sfxJson.hasElements())
	{
		let newDataSource = oFF.QFactory.createDataSource();
		newDataSource.setSystemName(oFF.OdpSacModelHandler.DEFAULT_SYSTEM_NAME);
		newDataSource.deserializeFromElementExt(oFF.QModelFormat.INA_REPOSITORY, sfxJson);
		oFF.AuGdsQbSacModelHandler._adjustDataSourceSystemIfNecessary(newDataSource, file);
		return newDataSource;
	}
	return null;
};
oFF.AuGdsQbSacModelHandler.getInaRepoJsonFromModelJson = function(application, modelJson)
{
	return oFF.AuGdsQbSacModelHandler.getSfxJsonFromModelJson(application, modelJson);
};
oFF.AuGdsQbSacModelHandler.getSfxJsonFromModelJson = function(application, modelJson)
{
	if (oFF.notNull(modelJson))
	{
		let jsonToProcess = modelJson;
		if (!jsonToProcess.containsKey(oFF.AuGdsQbSacContentlibConstants.CDATA))
		{
			jsonToProcess = oFF.PrFactory.createStructure();
			jsonToProcess.put(oFF.AuGdsQbSacContentlibConstants.CDATA, modelJson);
		}
		let modellerResponse = oFF.XContent.createJsonObjectContent(oFF.QModelFormat.SFX, jsonToProcess);
		let docConverter = oFF.DocConverterFactory.createDocConverter(oFF.QModelFormat.SFX, oFF.QModelFormat.INA_REPOSITORY);
		let extConverterResult = docConverter.convert(application, modellerResponse, oFF.QModelFormat.INA_REPOSITORY);
		let inaRepoData = extConverterResult.getData();
		if (oFF.notNull(inaRepoData))
		{
			let inaRepoJson = inaRepoData.getJsonContent();
			if (oFF.notNull(inaRepoJson) && inaRepoJson.isStructure())
			{
				return inaRepoJson.asStructure();
			}
		}
	}
	return null;
};
