oFF.AuGdsQbSacModelHandler.isValidModel = function(file, modelJson)
{
	if (oFF.notNull(file))
	{
		let metadata = file.getCachedMetadata();
		if (oFF.notNull(metadata) && !metadata.isEmpty())
		{
			let resourceType = metadata.getStringByKeyExt(oFF.XFileAttribute.NODE_TYPE, "");
			if (!oFF.XString.isEqual(oFF.AuGdsQbSacContentlibConstants.MODEL, resourceType))
			{
				return false;
			}
		}
	}
	if (oFF.isNull(modelJson))
	{
		return false;
	}
	let modelContent = modelJson;
	if (modelJson.containsKey(oFF.AuGdsQbSacContentlibConstants.CDATA))
	{
		modelContent = modelJson.getStructureByKey(oFF.AuGdsQbSacContentlibConstants.CDATA);
	}
	let hasId = modelContent.containsKey(oFF.AuGdsQbSacContentlibConstants.ID);
	let hasName = modelContent.containsKey(oFF.AuGdsQbSacContentlibConstants.NAME);
	let hasType = modelContent.containsKey(oFF.AuGdsQbSacContentlibConstants.TYPE);
	let hasMode = modelContent.containsKey(oFF.AuGdsQbSacContentlibConstants.MODE);
	let isValidStatus = modelContent.containsKey(oFF.AuGdsQbSacContentlibConstants.STATUS) && oFF.XString.isEqual(oFF.AuGdsQbSacContentlibConstants.VALID, modelContent.getStringByKey(oFF.AuGdsQbSacContentlibConstants.STATUS));
	return hasId && hasName && hasType && hasMode && isValidStatus;
};
