oFF.AuGdsQbOrcaInteropHandler = {

	addModelInformationToDocContenIfExists:function(docContent)
	{
			let orcaSpecificInteropSettings = docContent.getCustomStructure(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_INTEROP_SETTTINGS_KEY);
		let sfxMetadata = orcaSpecificInteropSettings.containsKey(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_SFX_METADATA) ? orcaSpecificInteropSettings.getStructureByKey(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_SFX_METADATA) : null;
		let data = oFF.notNull(sfxMetadata) ? sfxMetadata.getStructureByKey(oFF.AuGdsQbSacContentlibConstants.DATA) : null;
		let cdata = oFF.notNull(data) ? data.getStructureByKey(oFF.AuGdsQbSacContentlibConstants.CDATA) : null;
		if (oFF.notNull(cdata))
		{
			let datasource = cdata.getStructureByKey(oFF.AuGdsQbSacContentlibConstants.DATASOURCE);
			let dataSourcePackageName = cdata.getStringByKey(oFF.AuGdsQbSacContentlibConstants.DATASOURCE_PACKAGE_NAME);
			let datasourceObjectType = oFF.notNull(datasource) ? datasource.getStringByKeyExt(oFF.AuGdsQbSacContentlibConstants.DATASOURCE_TYPE, "") : "";
			let isTransient = oFF.XStringUtils.isNotNullAndNotEmpty(dataSourcePackageName) && oFF.XString.indexOf(dataSourcePackageName, "Transient.") === 0;
			let isDatasourceOfModelType = oFF.XString.isEqual(datasourceObjectType, oFF.AuGdsQbSacContentlibConstants.MODEL_TYPE_PLANNING) || oFF.XString.isEqual(datasourceObjectType, oFF.AuGdsQbSacContentlibConstants.MODEL_TYPE_ANALYTIC);
			if (!isTransient || isDatasourceOfModelType)
			{
				docContent.setCustomStructure(oFF.AuGdsQbSacContentlibConstants.MODEL_DEPENDENCY, cdata);
				let modelInfo = oFF.PrStructure.create();
				modelInfo.putString(oFF.OuQueryInformationDialogConstants.MODEL_DISPLAY_NAME_KEY, cdata.getStringByKey(oFF.AuGdsQbSacContentlibConstants.DISPLAY_NAME));
				modelInfo.putString(oFF.OuQueryInformationDialogConstants.MODEL_SUBTYPE_KEY, cdata.getStringByKey(oFF.AuGdsQbSacContentlibConstants.TYPE));
				docContent.setCustomStructure(oFF.AuGdsQbSacContentlibConstants.MODEL_INFO, modelInfo);
			}
		}
	},
	applyOrcaSfxMetadataToQueryManager:function(qbDocContent, queryManager)
	{
			let orcaInteropSettings = qbDocContent.getCustomStructure(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_INTEROP_SETTTINGS_KEY);
		if (oFF.isNull(orcaInteropSettings) || oFF.isNull(queryManager))
		{
			return;
		}
		let sfxMetadata = orcaInteropSettings.getStructureByKey(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_SFX_METADATA);
		if (oFF.notNull(sfxMetadata))
		{
			let contentSFX = oFF.XContent.createJsonObjectContent(oFF.QModelFormat.SFX, sfxMetadata);
			let docConverter = oFF.DocConverterFactory.createDocConverter(oFF.QModelFormat.SFX, oFF.QModelFormat.INA_REPOSITORY);
			let extConverterResult = docConverter.convert(queryManager.getApplication(), contentSFX, oFF.QModelFormat.INA_REPOSITORY);
			let inaRepoData = extConverterResult.getData();
			let originalIsBasicMeasureAggregationExportedInRepo = queryManager.getQueryModel().isBasicMeasureAggregationExportedInRepo();
			let originalIsBasicMeasureSettingsExportedInRepo = queryManager.getQueryModel().isBasicMeasureSettingsExportedInRepo();
			queryManager.getQueryModel().setBasicMeasureAggregationExportForRepo(true);
			queryManager.getQueryModel().setBasicMeasureSettingsExportedInRepo(true);
			queryManager.getQueryModel().stopEventing();
			queryManager.getQueryModel().deserializeFromContent(inaRepoData);
			queryManager.getQueryModel().resumeEventing();
			queryManager.getQueryModel().setBasicMeasureAggregationExportForRepo(originalIsBasicMeasureAggregationExportedInRepo);
			queryManager.getQueryModel().setBasicMeasureSettingsExportedInRepo(originalIsBasicMeasureSettingsExportedInRepo);
		}
	},
	checkForMigratedInsightFile:function(controller, docJson, argJson)
	{
			if (oFF.notNull(docJson))
		{
			let interopSettings = docJson.getStructureByKey(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_INTEROP_SETTTINGS_KEY);
			if (oFF.notNull(interopSettings) && interopSettings.getBooleanByKey(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_IS_INSIGHT_MIGRATION))
			{
				return controller.getFileManager().createFileByPath(argJson.getStringByKey(oFF.DfProgram.PARAM_FILE));
			}
		}
		return null;
	}
};

oFF.AuGdsQbDebugUtils = {

	CONFIG_DEBUG_SETTINGS:"DebugSettings",
	CONFIG_SKYLIGHTS_URL:"SkylightsUrl",
	CONFIG_STUDIO_URL:"StudioUrl",
	QUERY_NAME_PATTERN:"{{QUERY_NAME}}",
	SYSTEM_NAME_PATTERN:"{{SYSTEM_NAME}}",
	URL_PATTERN:"{{URL}}",
	URL_TEMPLATE:"{{URL}}#{%22views%22:[{%22c%22:%22GalaxyDataStudio%22,%22u%22:{%22datasource%22:%22{{QUERY_NAME}}%22,%22docType%22:%22QueryBuilder%22,%22model%22:null,%22system%22:%22{{SYSTEM_NAME}}%22}}]}",
	_openDataSourceWithUrl:function(dataSource, destinationUrl)
	{
			if (oFF.notNull(dataSource) && oFF.XStringUtils.isNotNullAndNotEmpty(destinationUrl))
		{
			let systemName = dataSource.getSystemName();
			let fullQualifiedQueryName = dataSource.getFullQualifiedName();
			let urlString = oFF.XString.replace(oFF.AuGdsQbDebugUtils.URL_TEMPLATE, oFF.AuGdsQbDebugUtils.URL_PATTERN, destinationUrl);
			urlString = oFF.XString.replace(urlString, oFF.AuGdsQbDebugUtils.SYSTEM_NAME_PATTERN, systemName);
			urlString = oFF.XString.replace(urlString, oFF.AuGdsQbDebugUtils.QUERY_NAME_PATTERN, fullQualifiedQueryName);
			oFF.UiFramework.currentFramework().openUrl(urlString, "_blank");
		}
	},
	generateDebugMenu:function(genesis, configJson, queryManager)
	{
			let debugMenu = null;
		if (oFF.notNull(genesis))
		{
			let debugSettings = null;
			if (oFF.notNull(configJson))
			{
				debugSettings = configJson.getStructureByKey(oFF.AuGdsQbDebugUtils.CONFIG_DEBUG_SETTINGS);
			}
			let studioUrl = oFF.notNull(debugSettings) ? debugSettings.getStringByKey(oFF.AuGdsQbDebugUtils.CONFIG_STUDIO_URL) : null;
			let skylightsUrl = oFF.notNull(debugSettings) ? debugSettings.getStringByKey(oFF.AuGdsQbDebugUtils.CONFIG_SKYLIGHTS_URL) : null;
			let dataSource = oFF.notNull(queryManager) ? queryManager.getDataSource() : null;
			debugMenu = genesis.newControl(oFF.UiType.MENU);
			debugMenu.addNewItem().setText("Open in studio...").setIcon("internet-browser").setEnabled(oFF.notNull(dataSource) && oFF.XStringUtils.isNotNullAndNotEmpty(studioUrl)).registerOnPress(oFF.UiLambdaPressListener.create((controlEvent) => {
				oFF.AuGdsQbDebugUtils._openDataSourceWithUrl(dataSource, studioUrl);
			}));
			debugMenu.addNewItem().setText("Open in skylights...").setIcon("internet-browser").setEnabled(oFF.notNull(queryManager) && oFF.XStringUtils.isNotNullAndNotEmpty(skylightsUrl)).registerOnPress(oFF.UiLambdaPressListener.create((controlEvent) => {
				oFF.AuGdsQbDebugUtils._openDataSourceWithUrl(dataSource, skylightsUrl);
			}));
		}
		return debugMenu;
	}
};

oFF.AuGdsQbViewFactory = {

	createByViewType:function(viewType, qbDoc, genesis)
	{
			let newView = null;
		if (oFF.notNull(viewType) && oFF.notNull(qbDoc))
		{
			let documentConfigJson = qbDoc.getGdsConfiguration().getConfigJsonForDocumentType(qbDoc.getDocumentType());
			let queryController = qbDoc.getQueryController();
			if (viewType === oFF.AuGdsViewType.TABLE)
			{
				let tableView = oFF.AuGdsQbInteractiveTableView.create(genesis);
				tableView.setMessageConsumer((messageType, messageText) => {
					let messageCenter = qbDoc.getMessageCenter();
					if (messageType === oFF.UiMessageType.INFORMATION)
					{
						messageCenter.showInfoToast(messageText);
					}
					else if (messageType === oFF.UiMessageType.WARNING)
					{
						messageCenter.showWarningToast(messageText);
					}
					else if (messageType === oFF.UiMessageType.ERROR)
					{
						messageCenter.showErrorToast(messageText);
					}
					else if (messageType === oFF.UiMessageType.SUCCESS)
					{
						messageCenter.showSuccessToast(messageText);
					}
				});
				tableView.addContextFiller(qbDoc);
				tableView.setMenuPopulator(qbDoc.getMenuManager());
				let qbDocument = qbDoc;
				tableView.registerOnTableDataUpdated(qbDocument.onTableDataUpdated.bind(qbDocument));
				tableView.registerOnBackendRequestStarted(qbDocument.onBackendRequestStarted.bind(qbDocument));
				tableView.registerOnBackendRequestFinished(qbDocument.onBackendRequestFinished.bind(qbDocument));
				tableView.registerOnSelectionChange(qbDoc);
				if (tableView.canUseDataProvider())
				{
					tableView.setUseDataProviderForDataFetch(documentConfigJson.getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_DATA_PROVIDER_AUTO_FETCH));
					tableView.setDataProvider(qbDoc.getDataProvider());
				}
				else
				{
					tableView.queryManagerUpdated(qbDoc.getQueryManager());
				}
				tableView.setEnableDragDropFromBuilderToTable(documentConfigJson.getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_DRAG_DROP_FROM_BUILDER_PANEL_TO_TABLE));
				tableView.setEnableDragDropOptimizedExperience(documentConfigJson.getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_DRAG_DROP_OPTIMIZED_EXPERIENCE));
				tableView.setFilterHighlightHintConfig(documentConfigJson.getStructureByKey(oFF.AuGdsQbConstants.CONFIG_TABLE_HIGHLIGHT_HINT_FOR_FILTER));
				tableView.setWindowingConfig(documentConfigJson.getStructureByKey(oFF.AuGdsQbConstants.CONFIG_WINDOWING));
				tableView.setUpdateProcedure(qbDocument.notifyEditAction.bind(qbDocument));
				tableView.setTileRequester((vp, trs) => {
					return queryController.requestTableTileIfNeeded(vp.getFirstObject(), vp.getSecondObject(), trs.getIntegerByKey(oFF.AuGdsQbConstants.QB_TABLE_ROW_START), trs.getIntegerByKey(oFF.AuGdsQbConstants.QB_TABLE_ROW_END), trs.getIntegerByKey(oFF.AuGdsQbConstants.QB_TABLE_COLUMN_START), trs.getIntegerByKey(oFF.AuGdsQbConstants.QB_TABLE_COLUMN_END));
				});
				queryController.registerResultEmptyListener(tableView);
				queryController.registerRenderingPauseEndListener(tableView);
				newView = tableView;
			}
			else if (viewType === oFF.AuGdsViewType.CHART)
			{
				newView = oFF.AuGdsQbChartView.create(qbDoc);
			}
			else if (viewType === oFF.AuGdsViewType.SPREADSHEET)
			{
				let spreadSheetView = oFF.AuGdsQbSpreadsheetView.createForQb(qbDoc);
				spreadSheetView.setTableDefinition(qbDoc.getTableView().getTableDefinition());
				spreadSheetView.setSourceSelectionProvider(qbDoc.getTableView());
				queryController.registerResultReadyListener(spreadSheetView);
				newView = spreadSheetView;
			}
		}
		return newView;
	},
	createViewByViewData:function(viewData, qbDoc, genesis)
	{
			let newView = null;
		if (oFF.notNull(viewData) && oFF.notNull(qbDoc))
		{
			let viewTypeStr = viewData.getStringByKey(oFF.AuGdsQbConstants.QD_VIEW_DATA_VIEW_TYPE);
			let viewType = oFF.AuGdsViewType.lookup(viewTypeStr);
			if (oFF.notNull(viewType))
			{
				newView = oFF.AuGdsQbViewFactory.createByViewType(viewType, qbDoc, genesis);
				if (oFF.notNull(newView))
				{
					newView.setupFromSaveData(viewData);
				}
			}
		}
		return newView;
	}
};

