oFF.AuGdsDimensionMemberDetailsGenerator.prototype._ff_c = "AuGdsDimensionMemberDetailsGenerator";

oFF.AuGdsDimensionMemberDetailsGenerator.FILTER_PART_HIGH = "HIGH";
oFF.AuGdsDimensionMemberDetailsGenerator.FILTER_PART_LOW = "LOW";
oFF.AuGdsDimensionMemberDetailsGenerator.create = function(filterCartesianListOfDimensionMembers, thisMemberElement, dimension)
{
	let instance = new oFF.AuGdsDimensionMemberDetailsGenerator();
	instance.m_filterCartesianListOfDimensionMembers = filterCartesianListOfDimensionMembers;
	instance.m_filterOperation = oFF.XObjectExt.assertNotNull(thisMemberElement);
	instance.m_dimension = oFF.XObjectExt.assertNotNull(dimension);
	return instance;
};
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.m_dimension = null;
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.m_filterCartesianListOfDimensionMembers = null;
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.m_filterOperation = null;
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.generateDisplayValuesFromFilterValueBag = function(filterPart)
{
	let filterValueBag = oFF.XString.isEqual(filterPart, oFF.AuGdsDimensionMemberDetailsGenerator.FILTER_PART_HIGH) ? this.m_filterOperation.getHigh() : this.m_filterOperation.getLow();
	let fieldValue = filterValueBag.getFieldValue();
	let field = filterValueBag.getField() !== null ? filterValueBag.getField() : this.m_filterOperation.getField();
	let description = null;
	let displayId = null;
	let key = fieldValue.getString();
	let hasDisplayIdBeenFound = false;
	let hasDescriptionBeenFound = false;
	let dateRange = null;
	if (this.m_filterOperation.getOlapComponentType() === oFF.FilterComponentType.DATE_RANGE_OPERATION)
	{
		dateRange = this.m_filterOperation.getDateRange();
	}
	else if (this.isDimensionMemberBasedDateFilter() && oFF.notNull(this.m_filterCartesianListOfDimensionMembers))
	{
		let dateRangeIfExists = oFF.FilterDialogValueFactory.newDateRangeItemFromCartesianElement(this.m_filterCartesianListOfDimensionMembers, this.m_filterOperation, this.m_dimension);
		dateRange = oFF.notNull(dateRangeIfExists) ? dateRangeIfExists.getDateRange() : null;
	}
	if (oFF.notNull(dateRange))
	{
		displayId = oFF.FilterDialogI18nUtils.getDateRangeTextForDimension(dateRange, this.m_filterOperation.getDimension());
		description = displayId;
		hasDisplayIdBeenFound = true;
		hasDescriptionBeenFound = true;
	}
	if (!filterValueBag.getSupplementValues().isEmpty())
	{
		let descriptionSuppText = this.getDescriptionFromSupplements(filterValueBag);
		let hasDescriptionSupplementBeenFound = oFF.XStringUtils.isNotNullAndNotEmpty(descriptionSuppText);
		if (hasDescriptionSupplementBeenFound)
		{
			description = descriptionSuppText;
			hasDescriptionBeenFound = true;
		}
		if (oFF.notNull(this.m_filterCartesianListOfDimensionMembers))
		{
			let displayKeySuppText = this.getDisplayIdFromSupplements(filterValueBag);
			let hasDisplayKeySupplementBeenFound = oFF.XStringUtils.isNotNullAndNotEmpty(displayKeySuppText);
			if (hasDisplayKeySupplementBeenFound)
			{
				displayId = displayKeySuppText;
				hasDisplayIdBeenFound = true;
			}
		}
	}
	let dimensionMember = fieldValue.getDimensionMember();
	let isVariable = filterValueBag.getFilterValueType() === oFF.XValueType.VARIABLE;
	if (oFF.notNull(dimensionMember))
	{
		let dimensionMemberValueExtractor = oFF.AuGdsDimensionMemberValueExtractor.create(dimensionMember);
		if (oFF.isNull(description))
		{
			description = dimensionMemberValueExtractor.getDescription();
		}
		if (oFF.XStringUtils.isNullOrEmpty(displayId))
		{
			displayId = dimensionMemberValueExtractor.getDisplayId();
			hasDisplayIdBeenFound = oFF.isNull(field) || !field.isHierarchyKeyField();
		}
		key = oFF.XStringUtils.isNullOrEmpty(key) ? dimensionMemberValueExtractor.getKey() : key;
	}
	else if (oFF.isNull(key) && (oFF.isNull(displayId) || oFF.XString.isEqual(displayId, "") && isVariable))
	{
		displayId = oFF.XLocalizationCenter.getCenter().getText(oFF.AuGdsFilterLineI18n.NULL_VALUE);
		hasDisplayIdBeenFound = true;
		key = oFF.AuGdsDimensionMemberDetails.NULL_KEY;
	}
	else if (oFF.notNull(key) && oFF.XString.isEqual(key, ""))
	{
		key = oFF.AuGdsDimensionMemberDetails.NO_VALUE_KEY;
	}
	if (oFF.XStringUtils.isNullOrEmpty(displayId))
	{
		displayId = key;
		hasDisplayIdBeenFound = oFF.isNull(field) || !field.isHierarchyKeyField();
	}
	if (oFF.XString.isEqual(description, ""))
	{
		description = displayId;
		hasDescriptionBeenFound = true;
	}
	let memberDetails = oFF.AuGdsDimensionMemberDetails.create(key, displayId, description);
	memberDetails.setDimension(this.m_dimension);
	memberDetails.setSourceFilterValueBag(filterValueBag);
	memberDetails.setValueType(fieldValue.getValueType());
	memberDetails.setHierarchyName(this.getHierarchyName());
	memberDetails.setFilteredField(field);
	memberDetails.setDisplayIdField(this.getDisplayIdField());
	memberDetails.setDescriptionField(this.getDescriptionField());
	memberDetails.setDisplayIdNeedsUpdate(!hasDisplayIdBeenFound);
	memberDetails.setDescriptionNeedsUpdate(!hasDescriptionBeenFound);
	return memberDetails;
};
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.generateFromHigh = function()
{
	let isDateRangeOperation = this.m_filterOperation.getOlapComponentType() === oFF.FilterComponentType.DATE_RANGE_OPERATION || this.isDimensionMemberBasedDateFilter();
	if (this.m_filterOperation.getComparisonOperator() === oFF.ComparisonOperator.BETWEEN && !isDateRangeOperation)
	{
		return this.generateDisplayValuesFromFilterValueBag(oFF.AuGdsDimensionMemberDetailsGenerator.FILTER_PART_HIGH);
	}
	return null;
};
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.generateFromLow = function()
{
	return this.generateDisplayValuesFromFilterValueBag(oFF.AuGdsDimensionMemberDetailsGenerator.FILTER_PART_LOW);
};
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.getDescriptionField = function()
{
	return oFF.QDimensionUtil.getTextFieldUsedInResultSet(this.m_dimension, this.m_dimension.isSelectorHierarchyActive());
};
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.getDescriptionFromSupplements = function(filterValueBag)
{
	let textFieldFromRS = this.getDescriptionField();
	return oFF.notNull(textFieldFromRS) ? filterValueBag.getSupplementValueString(textFieldFromRS.getName()) : filterValueBag.getTextSupplement(this.m_filterCartesianListOfDimensionMembers);
};
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.getDisplayIdField = function()
{
	return this.m_dimension.getSelectorDisplayKeyField();
};
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.getDisplayIdFromSupplements = function(filterValueBag)
{
	return filterValueBag.getSupplementValueString(this.getDisplayIdField().getName());
};
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.getHierarchyName = function()
{
	let hierarchyName = this.m_filterOperation.getHierarchyName();
	if (oFF.XStringUtils.isNullOrEmpty(hierarchyName) && oFF.notNull(this.m_filterCartesianListOfDimensionMembers) && oFF.XStringUtils.isNotNullAndNotEmpty(this.m_filterCartesianListOfDimensionMembers.getHierarchyName()))
	{
		hierarchyName = this.m_filterCartesianListOfDimensionMembers.getHierarchyName();
	}
	return hierarchyName;
};
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.getTargetFilterType = function()
{
	return this.m_filterOperation.getOlapComponentType() === oFF.FilterComponentType.DATE_RANGE_OPERATION || this.isDimensionMemberBasedDateFilter() ? oFF.AuGdsFilterLineItemType.DATE_DIMENSION : oFF.AuGdsFilterLineItemType.DIMENSION;
};
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.isDimensionMemberBasedDateFilter = function()
{
	let supportsDateRangeFilter = oFF.QFilterUtil.supportsDateRangeFilter(this.m_dimension.getFlatKeyField());
	let isProperDateRangeOperation = this.m_filterOperation.getOlapComponentType() === oFF.FilterComponentType.DATE_RANGE_OPERATION;
	if (supportsDateRangeFilter && !isProperDateRangeOperation)
	{
		return oFF.notNull(this.m_filterCartesianListOfDimensionMembers) && oFF.FilterDialogValueFactory.newDateRangeItemFromCartesianElement(this.m_filterCartesianListOfDimensionMembers, this.m_filterOperation, this.m_dimension) !== null;
	}
	return false;
};
oFF.AuGdsDimensionMemberDetailsGenerator.prototype.releaseObject = function()
{
	this.m_filterOperation = null;
	this.m_filterCartesianListOfDimensionMembers = null;
	this.m_dimension = null;
	oFF.XObject.prototype.releaseObject.call( this );
};

