oFF.AuGdsDimensionMemberValueExtractor.prototype.m_description = null;
oFF.AuGdsDimensionMemberValueExtractor.prototype.m_dimensionMember = null;
oFF.AuGdsDimensionMemberValueExtractor.prototype.m_displayId = null;
oFF.AuGdsDimensionMemberValueExtractor.prototype.m_key = null;
oFF.AuGdsDimensionMemberValueExtractor.prototype.getDescription = function()
{
	return this.m_description;
};
oFF.AuGdsDimensionMemberValueExtractor.prototype.getDisplayId = function()
{
	if (oFF.isNull(this.m_displayId))
	{
		this.setupKeyAndDisplayId();
	}
	return this.m_displayId;
};
oFF.AuGdsDimensionMemberValueExtractor.prototype.getKey = function()
{
	if (oFF.isNull(this.m_key))
	{
		this.setupKeyAndDisplayId();
	}
	return this.m_key;
};
oFF.AuGdsDimensionMemberValueExtractor.prototype.releaseObject = function()
{
	this.m_dimensionMember = null;
	this.m_key = null;
	this.m_displayId = null;
	this.m_description = null;
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.AuGdsDimensionMemberValueExtractor.prototype.setupInternal = function()
{
	if (this.m_dimensionMember.getDimensionMemberNameValueException() === oFF.ValueException.NULL_VALUE)
	{
		this.m_displayId = oFF.XLocalizationCenter.getCenter().getText(oFF.AuGdsFilterLineI18n.NULL_VALUE);
		this.m_key = oFF.AuGdsDimensionMemberDetails.NULL_KEY;
		return;
	}
	let descriptionFieldFromRS = oFF.QDimensionUtil.getTextFieldUsedInResultSet(this.m_dimensionMember.getDimension(), this.m_dimensionMember.getDimension().isSelectorHierarchyActive());
	let descriptionFieldFromRSValue = this.m_dimensionMember.getFieldValue(descriptionFieldFromRS);
	if (oFF.notNull(descriptionFieldFromRS) && oFF.notNull(descriptionFieldFromRSValue))
	{
		this.m_description = descriptionFieldFromRSValue.getValue().toString();
	}
	else
	{
		this.m_description = this.m_dimensionMember.isDisplayDescriptionSet() ? this.m_dimensionMember.getDisplayDescription() : this.m_dimensionMember.getText();
	}
};
oFF.AuGdsDimensionMemberValueExtractor.prototype.setupKeyAndDisplayId = function()
{
	this.m_key = this.m_dimensionMember.getName();
	let dimension = this.m_dimensionMember.getDimension();
	if (oFF.notNull(dimension))
	{
		if (dimension.getSelectorDisplayKeyField() !== null)
		{
			let selectorKeyFieldValue = this.m_dimensionMember.getFieldValue(dimension.getSelectorDisplayKeyField());
			if (oFF.notNull(selectorKeyFieldValue))
			{
				this.m_displayId = selectorKeyFieldValue.getString();
			}
		}
		if (oFF.XStringUtils.isNullOrEmpty(this.m_displayId) && dimension.getDisplayKeyField() !== null)
		{
			let fieldValue = this.m_dimensionMember.getFieldValue(dimension.getDisplayKeyField());
			if (oFF.notNull(fieldValue))
			{
				this.m_displayId = fieldValue.getString();
			}
		}
	}
	if (oFF.XStringUtils.isNullOrEmpty(this.m_displayId) && oFF.XStringUtils.isNotNullAndNotEmpty(this.m_key))
	{
		let splitTechnicalKey = oFF.XStringTokenizer.splitString(this.m_key, ".");
		if (splitTechnicalKey.size() > 1)
		{
			let displayKey = splitTechnicalKey.get(splitTechnicalKey.size() - 1);
			let startIndex = oFF.XString.indexOf(displayKey, oFF.AuGdsDimensionMemberValueExtractor.OPEN_SQAURE_BRACKET);
			this.m_displayId = oFF.XString.substring(displayKey, startIndex + 1, oFF.XString.size(displayKey) - 1);
		}
	}
	if (oFF.XStringUtils.isNullOrEmpty(this.m_displayId))
	{
		this.m_displayId = this.m_key;
	}
	if (oFF.XString.isEqual(this.m_displayId, oFF.AuGdsDimensionMemberValueExtractor.EMPTY_STRING))
	{
		this.m_displayId = oFF.XLocalizationCenter.getCenter().getText(oFF.AuGdsFilterLineI18n.NO_VALUE);
	}
	if (oFF.XString.isEqual(this.m_key, oFF.AuGdsDimensionMemberValueExtractor.EMPTY_STRING))
	{
		this.m_key = oFF.AuGdsDimensionMemberDetails.NO_VALUE_KEY;
	}
};

