oFF.AuGdsFilterLineDimensionFilterManager.prototype.openDialog = function(dimension, context)
{
	oFF.XObjectExt.assertNotNullExt(dimension, "A dimension must be specified to open the filter dialog, current value is null.");
	let filterDialogTitle = this.getFilterDialogTitle(dimension);
	let storedDisplayInfoForFilterDialog = this.getStoredDisplayInfoForFilterDialog(dimension);
	let versionName = this.m_queryManager.getQueryModel().getVersionDimensionName();
	let isVersionDim = oFF.XString.isEqual(versionName, dimension.getName()) && !this.isVersionDimensionPresentOnAxis();
	let runner = oFF.FilterDialogProgramRunnerFactory.createForDimensionFilter(this.m_queryManager.getProcess(), this.m_queryManager, dimension.getName(), filterDialogTitle);
	let config = oFF.PrFactory.createStructure();
	config.putBoolean(oFF.FilterDialog.PARAM_OFFER_READMODE_CHANGE, true);
	config.putBoolean(oFF.FilterDialog.PARAM_OFFER_CLIPBOARD, true);
	config.putBoolean(oFF.FilterDialog.PARAM_OFFER_EXCLUDE, true);
	config.putBoolean(oFF.FilterDialog.PARAM_OFFER_HIERARCHY_CHANGE, true);
	config.putBoolean(oFF.FilterDialog.PARAM_OFFER_LIST_VIEW, true);
	config.putBoolean(oFF.FilterDialog.PARAM_OFFER_RANGE_VIEW, true);
	config.putBoolean(oFF.FilterDialog.PARAM_SELECTION_REQUIRED, isVersionDim);
	config.putString(oFF.FilterDialog.PARAM_SELECTION_MODE, isVersionDim ? oFF.UiTableSelectionMode.SINGLE.getName() : oFF.UiTableSelectionMode.MULTI_TOGGLE.getName());
	config.putString(oFF.FilterDialog.PARAM_DISPLAY_INFO, storedDisplayInfoForFilterDialog.isPresent() ? storedDisplayInfoForFilterDialog.get().getName() : null);
	config.putBoolean(oFF.FilterDialog.PARAM_OFFER_READMODE_EXTENDED_SETTINGS, true);
	let storedReadMode = this.getStoredReadModeForFilterDialog(dimension);
	config.putString(oFF.FilterDialog.PARAM_READMODE, storedReadMode.isPresent() ? storedReadMode.get().getName() : null);
	runner.setConfigStructure(config);
	runner.getProgramStartData().putXObject(oFF.FilterDialog.PRG_DATA_LISTENER_BEFORE_FILTER_CHANGE, this.m_beforeFilterChangeListenerFunction(dimension));
	runner.getProgramStartData().putXObject(oFF.FilterDialog.PRG_DATA_LISTENER_CLOSE, oFF.FilterDialogLambdaCloseListener.create((selection) => {
		this.m_updateCommand(dimension.getName());
	}, () => {
		this.m_focusOnPreviousConsumer(context);
	}));
	runner.setStringArgument(oFF.FilterDialog.ARG_USAGE_TRACKING_CONSUMER, oFF.notNull(context) ? oFF.FilterDialogUsageTrackingConsumer.FILTER_LINE_TOKEN.getName() : oFF.FilterDialogUsageTrackingConsumer.FILTER_LINE.getName());
	runner.runProgram();
};
