oFF.AuGdsFilterLineMeasureFilterManager.prototype.updateFilter = function(filterKey, filter)
{
	let filterExpression = filter.getLinkedFilters().getByKey(filterKey);
	let filterElement = filterExpression.getFilterRootElement();
	if (oFF.notNull(filterElement) && filterElement.getOlapComponentType() === oFF.FilterComponentType.FILTER_MEASURE_BASED)
	{
		let mbf = filterElement;
		let memberName = oFF.FilterDialogMBFUtils.getMemberName(mbf);
		this.getStructureDimensionMember(memberName).onThen((dimensionMemberOptional) => {
			if (dimensionMemberOptional.isPresent())
			{
				let dimensionMember = dimensionMemberOptional.get();
				let fliBuilder = oFF.AuGdsFilterLineItemMeasureBuilder.create(this, dimensionMember, filterKey, mbf.getDimensionsFromContext());
				if (oFF.FilterDialogViewType.MEASURE_BASED_FILTER.isSupportedByMember(dimensionMember) && this.processFilterRanges(dimensionMember, mbf, fliBuilder))
				{
					this.createFli(memberName, fliBuilder, filterKey, filter);
				}
			}
		});
	}
};
oFF.AuGdsFilterLineMeasureFilterManager.prototype.updateFilterLine = function()
{
	this.m_selectedMembers.clear();
	let filter = this.m_queryManager.getQueryModel().getFilter();
	let linkedFilters = filter.getLinkedFilters();
	if (this.checkDimensionsExistForUpdate() && oFF.notNull(linkedFilters))
	{
		let filterIterator = linkedFilters.getKeysAsIterator();
		while (filterIterator.hasNext())
		{
			this.updateFilter(filterIterator.next(), filter);
		}
	}
	return oFF.XPromise.resolve(null);
};

