oFF.AuGdsIQFilterCartesianProductFiltered.prototype = new oFF.XObject();
oFF.AuGdsIQFilterCartesianProductFiltered.prototype._ff_c = "AuGdsIQFilterCartesianProductFiltered";

oFF.AuGdsIQFilterCartesianProductFiltered.create = function(cartesianProduct)
{
	let instance = new oFF.AuGdsIQFilterCartesianProductFiltered();
	oFF.XObjectExt.assertNotNull(cartesianProduct);
	instance.m_cartesianProductFiltered = oFF.AuGdsIQFilterCartesianProductFiltered.filter(cartesianProduct);
	return instance;
};
oFF.AuGdsIQFilterCartesianProductFiltered.filter = function(cartesianProduct)
{
	let result = oFF.XList.create();
	for (let i = 0; i < cartesianProduct.size(); i++)
	{
		let cartesianChild = cartesianProduct.getCartesianChild(i);
		let dimension = cartesianChild.getDimension();
		let isDimensionTypeAccount = dimension.getDimensionType() === oFF.DimensionType.ACCOUNT;
		let isDimensionStructure = dimension.isStructure();
		if (!oFF.AuGdsIQFilterCartesianProductFiltered.isMeasureStructureFilter(cartesianChild) && !oFF.AuGdsIQFilterCartesianProductFiltered.hasNoDimensionMembers(cartesianChild) && !isDimensionTypeAccount && !isDimensionStructure)
		{
			let groupingDimensions = dimension.getGroupingDimensions();
			let isCategory = dimension.getDimensionType().isTypeOf(oFF.DimensionType.GENERAL_VERSION) || oFF.notNull(groupingDimensions) && groupingDimensions.size() === 1 && groupingDimensions.get(0).getDimensionType().isTypeOf(oFF.DimensionType.GENERAL_VERSION);
			let isInputSchedule = oFF.XString.isEqual(cartesianChild.getCartesianElement(0).getValueAt(0).getFieldValue().getSelectValue(), oFF.QModelConstants.FILTER_CATEGORY_INPUT_SCHEDULE);
			if (!(isCategory && isInputSchedule))
			{
				result.add(cartesianChild);
			}
		}
	}
	return result;
};
oFF.AuGdsIQFilterCartesianProductFiltered.hasNoDimensionMembers = function(cartesianChild)
{
	return cartesianChild.isEmpty();
};
oFF.AuGdsIQFilterCartesianProductFiltered.isMeasureStructureFilter = function(cartesianChild)
{
	return cartesianChild.getDimension() !== null && cartesianChild.getDimension().isMeasureStructure();
};
