oFF.AuGdsFilterLineComplexFilterManager.prototype.createCartesianIntersectFilterLineItem = function(ciFilter, setSign, comparisonOperator)
{
	if (oFF.notNull(ciFilter))
	{
		return this.createComplexFilterLineItem(ciFilter, setSign, comparisonOperator);
	}
	return null;
};
oFF.AuGdsFilterLineComplexFilterManager.prototype.createComplexFilterLineItem = function(filterElement, setSign, comparisonOperator)
{
	let complexTree = oFF.AuGdsFilterLineComplexFilterNodeFactory.create(filterElement);
	if (oFF.isNull(complexTree))
	{
		return null;
	}
	complexTree.setIsExclude(setSign === oFF.SetSign.EXCLUDING);
	let complexFormula = complexTree.toString();
	let dimensionList = complexTree.getDimensionList();
	if (oFF.XStringUtils.isNotNullAndNotEmpty(complexFormula) && !dimensionList.isEmpty())
	{
		let hierarchyNameMap = complexTree.getHierarchyNameByDimensionName();
		oFF.XCollectionUtils.forEach(complexTree.getDimensionMembersDetails(), (memberDetails) => {
			memberDetails.setHierarchyName(hierarchyNameMap.getByKey(memberDetails.getDimension().getName()));
		});
		let fliBuilder = oFF.AuGdsFilterLineItemComplexBuilder.create(this, dimensionList, complexTree);
		let detailsLow = oFF.AuGdsDimensionMemberDetails.create("FF_COMPLEX_FILTER", complexFormula, null);
		let member = oFF.AuGdsFilterLineItemMemberFactory.create(setSign, comparisonOperator, detailsLow, null, oFF.AuGdsFilterLineItemType.COMPLEX, null, null);
		fliBuilder.addMember(member);
		return fliBuilder.build();
	}
	return null;
};
