oFF.AuGdsFilterLineComplexFilterManager.prototype.resumeProcessing = function()
{
	this.m_isProcessingActive = true;
	return this.updateFilterLineDescriptions().onThenExt((promiseReturns) => {
		this.m_updateFinishedResolver(null);
		return null;
	});
};
oFF.AuGdsFilterLineComplexFilterManager.prototype.updateFilterLine = function()
{
	this.m_descriptionUpdaters.clear();
	let tupleFilterMap = oFF.TupleFilterApplicationUtil.getTupleFilters(this.m_queryManager.getQueryModel(), false, false);
	let keys = tupleFilterMap.getKeysAsIterator();
	while (keys.hasNext())
	{
		let tupleFilter = tupleFilterMap.getByKey(keys.next());
		let tupleFli = this.createTupleFilterLineItem(tupleFilter, oFF.TupleFilterApplicationUtil.getSetSignForTupleFilterExpression(tupleFilter, false), oFF.ComparisonOperator.EQUAL);
		if (oFF.notNull(tupleFli) && tupleFli.needsFieldValueRetrieval())
		{
			this.m_descriptionUpdaters.add(() => {
				return this.m_descriptionUpdater.update(tupleFli);
			});
		}
		this.addTokenForFilter(tupleFli, this.createDeleteButtonCallbackProcedureForTuple(tupleFilter));
	}
	let complexCartesianIntersectFilters = oFF.ComplexFilterSeparationUtil.getIsolatedCartesianIntersectFilters(this.m_queryManager.getQueryModel());
	keys = complexCartesianIntersectFilters.getKeysAsIterator();
	while (keys.hasNext())
	{
		let dimensionName = keys.next();
		let ciFilter = complexCartesianIntersectFilters.getByKey(dimensionName);
		let ciFli = this.createCartesianIntersectFilterLineItem(ciFilter, oFF.SetSign.INCLUDING, oFF.ComparisonOperator.EQUAL);
		if (oFF.notNull(ciFli) && ciFli.needsFieldValueRetrieval())
		{
			this.m_descriptionUpdaters.add(() => {
				return this.m_descriptionUpdater.update(ciFli);
			});
		}
		this.addTokenForFilter(ciFli, this.createDeleteButtonCallbackProcedureForCartesianIntersect(dimensionName));
	}
	let complexFilter = oFF.ComplexFilterSeparationUtil.getIsolatedComplexFilter(this.m_queryManager.getQueryModel(), false);
	if (oFF.notNull(complexFilter))
	{
		let complexRoot = complexFilter.getComplexRoot();
		let complexFli = this.createCartesianIntersectFilterLineItem(complexRoot, oFF.SetSign.INCLUDING, oFF.ComparisonOperator.EQUAL);
		if (oFF.notNull(complexFli) && complexFli.needsFieldValueRetrieval())
		{
			this.m_descriptionUpdaters.add(() => {
				return this.m_descriptionUpdater.update(complexFli);
			});
		}
		this.addTokenForFilter(complexFli, this.createDeleteButtonCallbackProcedureForComplexFilter());
	}
	return oFF.XPromise.create((resolve, reject) => {
		this.m_updateFinishedResolver = resolve;
		if (this.m_isProcessingActive)
		{
			this.updateFilterLineDescriptions().onThen((returnedPromises) => {
				resolve(null);
			});
		}
	});
};
oFF.AuGdsFilterLineComplexFilterManager.prototype.updateFilterLineDescriptions = function()
{
	let updaters = oFF.XPromiseList.create();
	oFF.XCollectionUtils.forEach(this.m_descriptionUpdaters, (descriptionUpdater) => {
		updaters.add(descriptionUpdater());
	});
	this.m_descriptionUpdaters.clear();
	return oFF.XPromise.all(updaters);
};

oFF.AuGdsFilterLineComplexFilterNodeFactory = {

	create:function(filterElement)
	{
			let node = null;
		let olapComponentType = filterElement.getOlapComponentType();
		if (olapComponentType.isTypeOf(oFF.FilterComponentType.BOOLEAN_ALGEBRA))
		{
			node = oFF.AuGdsFilterLineComplexFilterAlgebraNode.create(filterElement);
		}
		else if (olapComponentType.isTypeOf(oFF.FilterComponentType.OPERATION))
		{
			node = oFF.AuGdsFilterLineComplexFilterOperationNode.create(filterElement);
		}
		return node;
	}
};

