oFF.DfAuGdsFilterLineItemDescriptionUpdater = function() {};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype = new oFF.XObject();
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype._ff_c = "DfAuGdsFilterLineItemDescriptionUpdater";

oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.m_memberDetailsList = null;
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.m_membersList = null;
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.getAllMemberDetailsByDimension = function()
{
	let memberDetailsByDimension = oFF.XSimpleMap.create();
	oFF.XStream.of(this.m_memberDetailsList).forEach((memberDetails) => {
		let dimension = memberDetails.getDimension();
		if (!memberDetailsByDimension.containsKey(dimension))
		{
			memberDetailsByDimension.put(dimension, oFF.XList.create());
		}
		memberDetailsByDimension.getByKey(dimension).add(memberDetails);
	});
	return memberDetailsByDimension;
};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.releaseObject = function()
{
	this.m_membersList = null;
	this.m_memberDetailsList = null;
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.retrieveMissingFieldValues = function()
{
	let memberDetailsByDimension = this.getAllMemberDetailsByDimension();
	let retrievalPromises = oFF.XPromiseList.create();
	oFF.XCollectionUtils.forEach(memberDetailsByDimension.getKeysAsReadOnlyList(), (dimension) => {
		let fieldValueRetriever = oFF.AuGdsDimensionMemberFieldValueRetriever.create(dimension);
		let memberDetailsList = memberDetailsByDimension.getByKey(dimension);
		let hierarchyName = memberDetailsList.get(0) !== null ? memberDetailsList.get(0).getHierarchyName() : null;
		fieldValueRetriever.setHierarchySelector(hierarchyName);
		retrievalPromises.add(fieldValueRetriever.retrieve(memberDetailsList).then((updatedDimensionMemberDetails) => {
			let memberDetailsPartialMap = oFF.XSimpleMap.create();
			memberDetailsPartialMap.put(dimension, updatedDimensionMemberDetails);
			return memberDetailsPartialMap;
		}, null));
	});
	return oFF.XPromise.all(retrievalPromises).then((retrievalResults) => {
		let retrievedFieldValuesByDimension = oFF.XSimpleMap.create();
		oFF.XCollectionUtils.forEach(retrievalResults, (retrievalResult) => {
			let memberDimension = retrievalResult.getKeysAsReadOnlyList().get(0);
			retrievedFieldValuesByDimension.put(memberDimension, retrievalResult.getByKey(memberDimension));
		});
		return retrievedFieldValuesByDimension;
	}, null);
};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.setMemberDetailsList = function(memberDetails)
{
	this.m_memberDetailsList = memberDetails;
};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.setMembersList = function(members)
{
	this.m_membersList = members;
};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.updateDimensionMembersSupplements = function(memberDetailsByDimension)
{
	oFF.XStream.of(memberDetailsByDimension).forEach(oFF.AuGdsQbMemberDecoratorHelper.updateDimensionMembersSupplements);
};
oFF.DfAuGdsFilterLineItemDescriptionUpdater.prototype.updateInternal = function(fli)
{
	return this.retrieveMissingFieldValues().onThenExt((memberDetailsRetrieved) => {
		if (!memberDetailsRetrieved.isEmpty())
		{
			this.updateDimensionMembersSupplements(memberDetailsRetrieved);
			this.updateFLI(fli, memberDetailsRetrieved);
		}
		return null;
	});
};

oFF.DfAuGdsFilterLineItemUpdater = function() {};
oFF.DfAuGdsFilterLineItemUpdater.prototype = new oFF.XObject();
oFF.DfAuGdsFilterLineItemUpdater.prototype._ff_c = "DfAuGdsFilterLineItemUpdater";

oFF.DfAuGdsFilterLineItemUpdater.prototype.m_fli = null;
oFF.DfAuGdsFilterLineItemUpdater.prototype.releaseObject = function()
{
	this.m_fli = null;
	oFF.XObject.prototype.releaseObject.call( this );
};
oFF.DfAuGdsFilterLineItemUpdater.prototype.setupCommon = function(filterLineItem)
{
	this.m_fli = filterLineItem;
};
oFF.DfAuGdsFilterLineItemUpdater.prototype.updateFieldValues = function(memberDetailsWithNewFieldValuesByKey)
{
	let fliBuilder = this.createFLIBuilderFromFLI();
	oFF.XCollectionUtils.forEach(this.m_fli.getMembers(), (currentMember) => {
		let lowKey = currentMember.getDimensionMemberDetailsLow().getKey();
		let isDateRange = currentMember.getMemberType() === oFF.AuGdsFilterLineItemMemberType.RANGE && currentMember.getTargetFilterType() === oFF.AuGdsFilterLineItemType.DATE_DIMENSION;
		if (!isDateRange && memberDetailsWithNewFieldValuesByKey.containsKey(lowKey))
		{
			let lowDetails = memberDetailsWithNewFieldValuesByKey.getByKey(lowKey);
			let highDetails = null;
			if (currentMember.getDimensionMemberDetailsHigh() !== null)
			{
				let highKey = currentMember.getDimensionMemberDetailsHigh().getKey();
				highDetails = memberDetailsWithNewFieldValuesByKey.containsKey(highKey) ? memberDetailsWithNewFieldValuesByKey.getByKey(highKey) : null;
			}
			let updatedMember = oFF.AuGdsFilterLineItemMemberFactory.create(currentMember.getSetSign(), currentMember.getComparisonOperator(), lowDetails, highDetails, currentMember.getTargetFilterType(), null, currentMember.getPresentationType());
			fliBuilder.addMember(updatedMember);
		}
		else
		{
			fliBuilder.addMember(currentMember);
		}
	});
	return fliBuilder.build();
};

