oFF.AuGdsDocumentActionsRegistrator.openFilterDialog = function(actionContext, viewType)
{
	let document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(actionContext);
	let actionDimension = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdh(actionContext);
	if (oFF.notNull(actionDimension) && oFF.notNull(document))
	{
		let uiContext = actionContext.getUiContext();
		let consumer = null;
		if (oFF.XString.isEqual(uiContext, oFF.AuGdsContextmenuConstants.UI_CONTEXT_GDS_QB_TABLE_CONTEXT_MENU))
		{
			consumer = oFF.FilterDialogUsageTrackingConsumer.CONTEXT_MENU_TABLE;
		}
		else if (oFF.XString.isEqual(uiContext, oFF.AuGdsContextmenuConstants.UI_CONTEXT_GDS_QB_BUILDER_CONTEXT_MENU))
		{
			consumer = oFF.FilterDialogUsageTrackingConsumer.CONTEXT_MENU_BUILDER;
		}
		document.openFilterDialog(actionDimension, viewType, consumer);
	}
};
oFF.AuGdsDocumentActionsRegistrator.prototype.fillRriTargets = function(optionsList, optionsConsumer, contextRetriever, strict)
{
	let targetManager = this.prepareTargetManager(contextRetriever);
	let queryBuilderDocumentOptions = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(contextRetriever);
	targetManager.getRriTargetsOfTargetTypes(oFF.SyncType.NON_BLOCKING, oFF.AuGdsLambdaRriListener.create((targets) => {
		oFF.XCollectionUtils.forEach(targets, (target) => {
			if (!strict || oFF.XStringUtils.isNotNullAndNotEmpty(target.getTargetUrl()) || target.getDataSource() !== null)
			{
				let targetOption = oFF.CMESelectionOption.create();
				targetOption.setNameProvider((ton) => {
					return target.getKey();
				});
				targetOption.setTextProvider((tot) => {
					let tate = target.getText();
					return oFF.XStringUtils.isNullOrEmpty(tate) ? target.getKey() : tate;
				});
				targetOption.setCustomObject(target);
				optionsList.add(targetOption);
			}
		});
		optionsConsumer(optionsList);
	}, null), null, queryBuilderDocumentOptions.getSupportedTargetTypes());
};
