oFF.AuGdsDocumentActionsRegistrator.prototype.registerGoToTarget = function(registry, xLocalizationProvider)
{
	let jumpToTarget = oFF.CMEFactory.createSingleSelectAction();
	jumpToTarget.setNameProvider((nameContext) => {
		return oFF.AuGdsDocumentActionsRegistrator.ACTION_JUMP_TO_TARGET;
	});
	jumpToTarget.setTextProvider((textContext) => {
		return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.RRI_JUMP_TO_TARGET);
	});
	jumpToTarget.setIconProvider((iconContext) => {
		return "fpa/link";
	});
	jumpToTarget.setAvailableProvider((availableContext) => {
		let avQma = oFF.AuGdsGenericContextResolveUtil.resolveQueryManager(availableContext);
		let avQmo = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(availableContext);
		let avQbd = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(availableContext);
		return oFF.notNull(avQmo) && avQmo.hasRriTarget() && oFF.notNull(avQma) && avQma.getRriTargetManager() !== null && oFF.notNull(avQbd) && avQbd.isRriEnabled() && this.isUniqueRriSelection(availableContext);
	});
	jumpToTarget.setDeferredOptionsRetriever(false, (contextRetriever, optionsConsumer) => {
		let queryModelRetriever = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(contextRetriever);
		let optionsList = oFF.XList.create();
		if (queryModelRetriever.getModelCapabilities().supportsRRI3())
		{
			let staticTargets = queryModelRetriever.getStaticRriTargets();
			oFF.XCollectionUtils.forEach(staticTargets, (staticTarget) => {
				let targetOption = oFF.CMESelectionOption.create();
				targetOption.setNameProvider((ton) => {
					return staticTarget.getKey();
				});
				targetOption.setTextProvider((tot) => {
					let tate = staticTarget.getText();
					return oFF.XStringUtils.isNullOrEmpty(tate) ? staticTarget.getKey() : tate;
				});
				targetOption.setCustomObject(staticTarget);
				optionsList.add(targetOption);
			});
			if (queryModelRetriever.hasDynamicRriTarget())
			{
				this.fillRriTargets(optionsList, optionsConsumer, contextRetriever, false);
			}
			else
			{
				optionsConsumer(optionsList);
			}
		}
		else
		{
			this.fillRriTargets(optionsList, optionsConsumer, contextRetriever, true);
		}
	});
	jumpToTarget.setSelectionConsumer((selectionContext, selectionOptions) => {
		let queryModelSelection = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(selectionContext);
		let queryBuilderDocumentSelection = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(selectionContext);
		let selectedTarget = selectionOptions.getCustomObject();
		if (queryModelSelection.getModelCapabilities().supportsRRI3())
		{
			let targetManagerSelection = this.prepareTargetManager(selectionContext);
			targetManagerSelection.retrieveDetailsOfTarget(oFF.SyncType.NON_BLOCKING, oFF.AuGdsLambdaRriListener.create((lc) => {
				if (oFF.XCollectionUtils.size(lc) === 1)
				{
					this.selectTarget(lc.get(0), queryBuilderDocumentSelection);
				}
			}, null), null, selectedTarget.getKey(), null);
		}
		else
		{
			this.selectTarget(selectedTarget, queryBuilderDocumentSelection);
		}
	});
	registry.registerAction(oFF.AuGdsDocumentActionsRegistrator.ACTION_JUMP_TO_TARGET, jumpToTarget);
};
