	resolveInnerMostTupleElements:function(selectionContext)
	{
			let tupleElementList = oFF.AuGdsGenericContextResolveUtil.resolveTupleElements(selectionContext, null);
		let maxIndex;
		let getTupleElementIndexOnAxis = (tel) => {
			return oFF.XIntegerValue.create((tel.getDimension().isUniversalDisplayHierarchyDimension() && tel.getDrillGroupDimension() !== null) ? tel.getDrillGroupDimension().getIndexOnAxis() : tel.getIndexOnAxis());
		};
		if (oFF.isNull(tupleElementList))
		{
			maxIndex = -1;
		}
		else
		{
			maxIndex = oFF.XStream.of(tupleElementList).map((te) => {
				return getTupleElementIndexOnAxis(te);
			}).reduce(oFF.XIntegerValue.create(0), (a, b) => {
				return oFF.XIntegerValue.create(oFF.XMath.max(a.getInteger(), b.getInteger()));
			}).getInteger();
		}
		let finalTupleElementList = oFF.XList.create();
		let parentTuples = oFF.XList.create();
		for (let i = maxIndex; i >= 0; i--)
		{
			let index = i;
			oFF.XCollectionUtils.forEach(tupleElementList, (tupleElement) => {
				if (getTupleElementIndexOnAxis(tupleElement).getInteger() === index)
				{
					let firstTuple = tupleElement.getFirstTuple();
					if (!parentTuples.contains(firstTuple))
					{
						finalTupleElementList.add(tupleElement);
					}
					if (index > 0 && firstTuple.size() > index)
					{
						parentTuples.add(firstTuple.getTupleElementAt(index - 1).getFirstTuple());
					}
				}
			});
		}
		return finalTupleElementList;
	},
