oFF.AuGdsQbDimAttrFieldMoveActionsRegistrator.create = function()
{
	return new oFF.AuGdsQbDimAttrFieldMoveActionsRegistrator();
};
oFF.AuGdsQbDimAttrFieldMoveActionsRegistrator.getResultSetFields = function(dimension, attribute)
{
	if (dimension.getFieldLayoutType() === oFF.FieldLayoutType.FIELD_BASED)
	{
		return dimension.getResultSetFields();
	}
	else if (oFF.isNull(attribute))
	{
		if (dimension.getMainAttribute() === null)
		{
			return dimension.getResultSetFields();
		}
		else
		{
			return dimension.getMainAttribute().getResultSetFields();
		}
	}
	else
	{
		return attribute.getResultSetFields();
	}
};
oFF.AuGdsQbDimAttrFieldMoveActionsRegistrator.moveAttributes = function(dimension, attributeList, offset)
{
	let resultSetAttributes = dimension.getResultSetAttributes();
	let dimensionName = dimension.getName();
	let index = 0;
	let i;
	for (i = attributeList.size() - 1; i >= 0; i--)
	{
		let attribute = attributeList.get(i);
		index = resultSetAttributes.getIndex(attribute);
		resultSetAttributes.removeAt(index);
		dimension.getConvenienceCommands().removeAttributeFromResultSet(dimensionName, attribute.getName());
	}
	for (i = 0; i < attributeList.size(); i++)
	{
		dimension.getConvenienceCommands().insertAttributeToResultSet(dimensionName, attributeList.get(i).getName(), index + offset + i);
	}
};
oFF.AuGdsQbDimAttrFieldMoveActionsRegistrator.moveFields = function(dimension, attributeOrig, fieldList, offset)
{
	let resultSetFields = oFF.AuGdsQbDimAttrFieldMoveActionsRegistrator.getResultSetFields(dimension, attributeOrig);
	let index = 0;
	let i;
	let fieldBased = dimension.getFieldLayoutType() === oFF.FieldLayoutType.FIELD_BASED;
	let attribute = attributeOrig;
	if (!fieldBased && oFF.isNull(attributeOrig))
	{
		if (dimension.getMainAttribute() !== null)
		{
			attribute = dimension.getMainAttribute();
		}
		else
		{
			fieldBased = true;
		}
	}
	let attributeName = oFF.isNull(attribute) ? null : attribute.getName();
	let dimensionName = dimension.getName();
	for (i = fieldList.size() - 1; i >= 0; i--)
	{
		let field = fieldList.get(i);
		index = resultSetFields.getIndex(field);
		if (fieldBased)
		{
			dimension.getConvenienceCommands().removeField(null, dimensionName, null, field.getName(), oFF.QContextType.RESULT_SET);
		}
		else
		{
			dimension.getConvenienceCommands().removeAttributeField(null, dimensionName, attributeName, null, field.getName(), oFF.QContextType.RESULT_SET);
		}
	}
	for (i = 0; i < fieldList.size(); i++)
	{
		if (fieldBased)
		{
			dimension.getConvenienceCommands().insertField(null, dimensionName, null, fieldList.get(i).getName(), oFF.QContextType.RESULT_SET, index + offset + i);
		}
		else
		{
			dimension.getConvenienceCommands().insertAttributeField(null, dimensionName, attributeName, null, fieldList.get(i).getName(), oFF.QContextType.RESULT_SET, index + offset + i);
		}
	}
};
oFF.AuGdsQbDimAttrFieldMoveActionsRegistrator.prototype.appendDimensionsAfter = function(tDimensions, freeDimension)
{
	let inserter = 0;
	let axis = null;
	for (let i = 0; i < tDimensions.size(); i++)
	{
		let dimension = tDimensions.get(i);
		if (oFF.isNull(axis))
		{
			axis = dimension.getAxis();
		}
		else if (axis !== dimension.getAxis())
		{
			axis = null;
			break;
		}
		inserter = oFF.XMath.max(dimension.getIndexOnAxis(), inserter);
	}
	this.tryMoveDimensionOnAxisTo(freeDimension, axis, inserter + 1);
};
oFF.AuGdsQbDimAttrFieldMoveActionsRegistrator.prototype.exchangeDimensionsBy = function(tDimensions, freeDimension)
{
	let cmd = freeDimension.getConvenienceCommands();
	let inserter = 0;
	let axis = null;
	for (let i = 0; i < tDimensions.size(); i++)
	{
		let dimension = tDimensions.get(i);
		axis = dimension.getAxis();
		inserter = dimension.getIndexOnAxis();
		this.removeDimensionFromAxis(cmd, dimension);
	}
	this.tryMoveDimensionOnAxisTo(freeDimension, axis, inserter);
};
oFF.AuGdsQbDimAttrFieldMoveActionsRegistrator.prototype.getAxisTypeForDimension = function(dimension)
{
	return oFF.notNull(dimension) ? dimension.getAxisType() : oFF.AxisType.ROWS;
};
