oFF.AuGdsQbFilterActionsRegistrator.prototype.complementHighlightingPathsFromTupleElements = function(reference, tupleElements, axis)
{
	for (let i = 0; i < tupleElements.size(); i++)
	{
		let tupleElement = tupleElements.get(i);
		let firstTuple = tupleElement.getFirstTuple();
		let axisPath = reference.addNewAxisPath();
		let j;
		if (firstTuple.size() === 1 && firstTuple.get(0).getDimension().isUniversalDisplayHierarchyDimension())
		{
			let axisTupleElement = firstTuple.get(0);
			let drillGroupDimension = axisTupleElement.getDrillGroupDimension();
			let udhKey = axisTupleElement.getDimensionMember().getUdhKey();
			firstTuple.get(0).getDrillGroupDimension();
			if (oFF.notNull(udhKey))
			{
				for (j = 0; j < axis.size(); j++)
				{
					let dimension = axis.get(j);
					let memberName = udhKey.getHierarchyKeyByDimension(dimension);
					if (oFF.notNull(memberName))
					{
						let axisPathElementUdh = axisPath.addNewElement();
						axisPathElementUdh.setDimension(dimension);
						axisPathElementUdh.addMemberName(memberName);
					}
					if (dimension === drillGroupDimension)
					{
						break;
					}
				}
			}
		}
		else
		{
			for (j = 0; j < firstTuple.size(); j++)
			{
				let subTupleElement = firstTuple.getTupleElementAt(j);
				let subTupleDimension = subTupleElement.getDimension();
				let dimensionMemberName = subTupleElement.getDimensionMember() === null ? null : subTupleElement.getDimensionMember().getName();
				if (oFF.notNull(dimensionMemberName))
				{
					let axisPathElement = axisPath.addNewElement();
					axisPathElement.setDimension(subTupleDimension);
					axisPathElement.addMemberName(dimensionMemberName);
				}
				if (subTupleElement === tupleElement)
				{
					break;
				}
			}
		}
	}
};
oFF.AuGdsQbFilterActionsRegistrator.prototype.complementHighlightingPathsFromTuples = function(reference, relevantDimensions, tuples, axis)
{
	if (oFF.XCollectionUtils.hasElements(tuples))
	{
		let dimensionRestrictionEmpty = !oFF.XCollectionUtils.hasElements(relevantDimensions);
		for (let i = 0; i < tuples.size(); i++)
		{
			let tuple = tuples.get(i);
			let axisPath = reference.addNewAxisPath();
			let elements = tuple.getElements();
			let j;
			if (elements.size() === 1 && elements.get(0).getDimension().isUniversalDisplayHierarchyDimension())
			{
				let axisTupleElement = elements.get(0);
				let drillGroupDimension = axisTupleElement.getDrillGroupDimension();
				let udhKey = axisTupleElement.getDimensionMember().getUdhKey();
				elements.get(0).getDrillGroupDimension();
				if (oFF.notNull(udhKey))
				{
					for (j = 0; j < axis.size(); j++)
					{
						let dimension = axis.get(j);
						let memberName = udhKey.getHierarchyKeyByDimension(dimension);
						if (oFF.notNull(memberName) && (dimensionRestrictionEmpty || oFF.XCollectionUtils.containsElement(relevantDimensions, dimension)))
						{
							let axisPathElementUdh = axisPath.addNewElement();
							axisPathElementUdh.setDimension(dimension);
							axisPathElementUdh.addMemberName(memberName);
						}
						if (dimension === drillGroupDimension)
						{
							break;
						}
					}
				}
			}
			else
			{
				for (j = 0; j < elements.size(); j++)
				{
					let element = elements.get(j);
					let dimensionMemberName = oFF.DfNameObject.getSafeName(element.getDimensionMember());
					if (oFF.notNull(dimensionMemberName) && (dimensionRestrictionEmpty || oFF.XCollectionUtils.containsElement(relevantDimensions, element.getDimension())))
					{
						let axisPathElement = axisPath.addNewElement();
						axisPathElement.setDimension(element.getDimension());
						axisPathElement.addMemberName(dimensionMemberName);
					}
				}
			}
		}
	}
};
oFF.AuGdsQbFilterActionsRegistrator.prototype.complementMemberMap = function(dimMembers, udhDimensionNames, dimName, member)
{
	if (member.getDimension().isUniversalDisplayHierarchyDimension())
	{
		let udhKey = member.getUdhKey();
		if (oFF.notNull(udhKey))
		{
			let dgdn = udhKey.getDrillGroupDimensionName();
			if (!dimMembers.containsKey(dgdn))
			{
				dimMembers.put(dgdn, oFF.XList.create());
			}
			dimMembers.getByKey(dgdn).add(udhKey.getHierarchyKey());
			udhDimensionNames.put(dgdn, dimName);
		}
	}
	else
	{
		if (!dimMembers.containsKey(dimName))
		{
			dimMembers.put(dimName, oFF.XList.create());
		}
		dimMembers.getByKey(dimName).add(member.getName());
	}
};
oFF.AuGdsQbFilterActionsRegistrator.prototype.createHighlighting = function(tableDefinition, dimMembers, udhDimensionNames, getReference, getOrthogonalReference, color)
{
	let queryModel = tableDefinition.getQueryModel();
	if (oFF.XCollectionUtils.hasElements(dimMembers))
	{
		let sortedDimensions = oFF.XStream.ofString(dimMembers.getKeysAsReadOnlyList()).map((str) => {
			return queryModel.getDimensionByName(str.getString());
		}).sorted(oFF.XComparatorLambda.create((a, b) => {
			return oFF.XIntegerValue.create(a.getIndexOnAxis() - b.getIndexOnAxis());
		})).collect(oFF.XStreamCollector.toList());
		for (let i = 0; i < sortedDimensions.size(); i++)
		{
			let dimension = sortedDimensions.get(i);
			let highlightingArea = tableDefinition.addNewHighlightArea();
			let hsi = getOrthogonalReference(highlightingArea).addNewHeaderSectionInfo();
			let udhDimName = udhDimensionNames.getByKey(dimension.getName());
			if (oFF.XStringUtils.isNotNullAndNotEmpty(udhDimName))
			{
				hsi.setDimension(queryModel.getDimensionByName(udhDimName));
			}
			else
			{
				hsi.setDimension(dimension);
			}
			hsi.setExactHeaderLevel(false);
			let axisElement = getReference(highlightingArea).addNewAxisPath().addNewElement();
			if (oFF.XStringUtils.isNotNullAndNotEmpty(udhDimName))
			{
				axisElement.setIncludeHeaderBand(oFF.TriStateBool._TRUE);
			}
			axisElement.setDimensionName(dimension.getName());
			oFF.XCollectionUtils.forEach(dimMembers.getByKey(dimension.getName()), (dm) => {
				axisElement.addMemberName(dm);
			});
			highlightingArea.setHighlightColor(color);
		}
	}
};
oFF.AuGdsQbFilterActionsRegistrator.prototype.extractAxisTypeFromDimensionMemberMap = function(queryModel, membersMap)
{
	let axisType = null;
	if (oFF.notNull(queryModel) && oFF.notNull(membersMap))
	{
		let keys = membersMap.getKeysAsReadOnlyList();
		if (oFF.XCollectionUtils.hasElements(keys))
		{
			axisType = queryModel.getDimensionByName(keys.get(0)).getAxisType();
		}
	}
	return axisType;
};
