oFF.AuGdsQbFilterActionsRegistrator.prototype.highlightOnMemberSelection = function(triggerMembers, setSign, tableDefinition, tableView)
{
	tableDefinition.clearHighlightAreas();
	let color = setSign === oFF.SetSign.INCLUDING ? tableView.getFilterHighlightIncludeColor() : tableView.getFilterHighlightExcludeColor();
	let rowDimMembers = oFF.XHashMapByString.create();
	let colDimMembers = oFF.XHashMapByString.create();
	let udhDimensionNames = oFF.XHashMapByString.create();
	oFF.XCollectionUtils.forEach(triggerMembers, (member) => {
		let dim = member.getDimension();
		let dimName = dim.getName();
		let axis = dim.getAxisType();
		if (axis === oFF.AxisType.COLUMNS)
		{
			this.complementMemberMap(colDimMembers, udhDimensionNames, dimName, member);
		}
		else if (axis === oFF.AxisType.ROWS)
		{
			this.complementMemberMap(rowDimMembers, udhDimensionNames, dimName, member);
		}
	});
	let getColReference = (cha) => {
		return cha.getColumnsReference();
	};
	let getRowReference = (rha) => {
		return rha.getRowsReference();
	};
	this.createHighlighting(tableDefinition, rowDimMembers, udhDimensionNames, getRowReference, getColReference, color);
	this.createHighlighting(tableDefinition, colDimMembers, udhDimensionNames, getColReference, getRowReference, color);
	tableView.applyHighlighting();
};
oFF.AuGdsQbFilterActionsRegistrator.prototype.highlightOnTupleElements = function(tupleElements, setSign, tableDefinition, tableView)
{
	tableDefinition.clearHighlightAreas();
	let color = setSign === oFF.SetSign.INCLUDING ? tableView.getFilterHighlightIncludeColor() : tableView.getFilterHighlightExcludeColor();
	let rowTupleElements = oFF.XList.create();
	let columnTupleElements = oFF.XList.create();
	oFF.XCollectionUtils.forEach(tupleElements, (tuple) => {
		let tat = tuple.getAxis().getType();
		if (tat === oFF.AxisType.ROWS)
		{
			rowTupleElements.add(tuple);
		}
		else if (tat === oFF.AxisType.COLUMNS)
		{
			columnTupleElements.add(tuple);
		}
	});
	let queryModel = tableDefinition.getQueryModel();
	if (oFF.XCollectionUtils.hasElements(rowTupleElements))
	{
		let rowHighlightArea = tableDefinition.addNewHighlightArea();
		rowHighlightArea.getColumnsReference().setMatchFullDataSection(true);
		rowHighlightArea.getColumnsReference().setMatchFullHeaderSection(true);
		this.complementHighlightingPathsFromTupleElements(rowHighlightArea.getRowsReference(), rowTupleElements, queryModel.getRowsAxis());
		rowHighlightArea.setHighlightColor(color);
	}
	if (oFF.XCollectionUtils.hasElements(columnTupleElements))
	{
		let colHighlightArea = tableDefinition.addNewHighlightArea();
		colHighlightArea.getRowsReference().setMatchFullDataSection(true);
		colHighlightArea.getRowsReference().setMatchFullHeaderSection(true);
		this.complementHighlightingPathsFromTupleElements(colHighlightArea.getColumnsReference(), columnTupleElements, queryModel.getColumnsAxis());
		colHighlightArea.setHighlightColor(color);
	}
	tableView.applyHighlighting();
};
