oFF.AuGdsQbFilterActionsRegistrator.prototype.remapMembersToDimensions = function(members)
{
	let memberDimensions = oFF.XHashMapByString.create();
	oFF.XCollectionUtils.forEach(members, (member) => {
		let dimension = member.getDimension();
		if (oFF.notNull(dimension))
		{
			let dimensionName = null;
			if (dimension.isUniversalDisplayHierarchyDimension())
			{
				let udhKey = member.getUdhKey();
				if (oFF.notNull(udhKey))
				{
					dimensionName = udhKey.getDrillGroupDimensionName();
				}
			}
			else
			{
				dimensionName = dimension.getName();
			}
			if (oFF.notNull(dimensionName))
			{
				if (!memberDimensions.containsKey(dimensionName))
				{
					memberDimensions.put(dimensionName, oFF.XList.create());
				}
				let lll = memberDimensions.getByKey(dimensionName);
				if (!lll.contains(member))
				{
					lll.add(member);
				}
			}
		}
	});
	return memberDimensions;
};

