oFF.AuGdsQbHierarchyActionsRegistrator.getTupleElementsSupportingDrillState = function(availableContext, drillState)
{
	let result = null;
	let dimension = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionPreferablyUdh(availableContext);
	let tuples = oFF.AuGdsGenericContextResolveUtil.resolveTuples(availableContext);
	let checker;
	if (drillState === oFF.DrillState.DRILLED)
	{
		checker = (d) => {
			return oFF.notNull(d) && oFF.AuGdsQbInteractiveTableView.supportsTupleElementDrill(d);
		};
	}
	else if (drillState === oFF.DrillState.EXPANDED)
	{
		checker = (e) => {
			return oFF.notNull(e) && oFF.AuGdsQbInteractiveTableView.supportsTupleElementExpand(e);
		};
	}
	else
	{
		checker = (c) => {
			return oFF.notNull(c) && oFF.AuGdsQbInteractiveTableView.supportsTupleElementCollapse(c);
		};
	}
	if (oFF.notNull(dimension) && oFF.XCollectionUtils.hasElements(tuples))
	{
		let list = oFF.XStream.of(tuples).map((tu) => {
			return tu.getTupleElementByDimension(dimension);
		}).filter(checker).collect(oFF.XStreamCollector.toList());
		if (oFF.XCollectionUtils.hasElements(list))
		{
			result = list;
		}
	}
	return result;
};
oFF.AuGdsQbHierarchyActionsRegistrator.getTupleElementsSupportingDrillStateSelective = function(availableContext, drillState)
{
	let result = null;
	let dimension = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionPreferablyUdh(availableContext);
	let tuplesElements = oFF.AuGdsGenericContextResolveUtil.resolveTupleElements(availableContext, null);
	let checker;
	if (drillState === oFF.DrillState.DRILLED)
	{
		checker = (d) => {
			return oFF.notNull(d) && oFF.AuGdsQbInteractiveTableView.supportsTupleElementDrill(d);
		};
	}
	else if (drillState === oFF.DrillState.EXPANDED)
	{
		checker = (e) => {
			return oFF.notNull(e) && oFF.AuGdsQbInteractiveTableView.supportsTupleElementExpand(e);
		};
	}
	else
	{
		checker = (c) => {
			return oFF.notNull(c) && oFF.AuGdsQbInteractiveTableView.supportsTupleElementCollapse(c);
		};
	}
	if (oFF.notNull(dimension) && oFF.XCollectionUtils.hasElements(tuplesElements))
	{
		let list = oFF.XStream.of(tuplesElements).filter((tu) => {
			return tu.getDimension() === dimension;
		}).filter(checker).collect(oFF.XStreamCollector.toList());
		if (oFF.XCollectionUtils.hasElements(list))
		{
			result = list;
		}
	}
	return result;
};
oFF.AuGdsQbHierarchyActionsRegistrator.tryApplyDrill = function(triggerContext, drillState, relativeLevelCount)
{
	let elements = oFF.AuGdsQbHierarchyActionsRegistrator.getTupleElementsSupportingDrillState(triggerContext, drillState);
	let relevant = oFF.XCollectionUtils.hasElements(elements);
	if (relevant)
	{
		oFF.XCollectionUtils.forEach(elements, (element) => {
			let drillOperation = element.setNextDrillState(drillState);
			if (relativeLevelCount > -1)
			{
				if (drillState === oFF.DrillState.EXPANDED)
				{
					drillOperation.setRelativeLevelCount(oFF.XMath.max(0, relativeLevelCount - element.getDisplayLevel()));
				}
				else if (drillState === oFF.DrillState.DRILLED)
				{
					drillOperation.setRelativeLevelCount(oFF.XMath.max(0, relativeLevelCount - element.getDrillGroupDimension().getIndexOnAxis()));
				}
			}
		});
	}
	return relevant;
};
