oFF.AuGdsQbHierarchyActionsRegistrator.tryApplyZoomSelective = function(triggerContext)
{
	let elements = oFF.AuGdsQbHierarchyActionsRegistrator.getTupleElementsSupportingDrillStateSelective(triggerContext, oFF.DrillState.EXPANDED);
	let firstOptional = oFF.XCollectionUtils.getOptionalAtIndex(elements, 0);
	let success = firstOptional.isPresent();
	if (success)
	{
		let dimension = firstOptional.get().getDimension();
		dimension.getDrillManager().pushEmptyZoomDrillForDimension(dimension);
		oFF.XCollectionUtils.forEach(elements, (element) => {
			dimension.getDrillManager().addZoomDrillPath(element.getDrillPath(), true);
		});
	}
	return success;
};
oFF.AuGdsQbHierarchyActionsRegistrator.prototype.createHierarchyCatalogDialog = function(process, updateProcedure, queryModel, dimension, xLocalizationProvider)
{
	let runner = oFF.FilterDialogProgramRunnerFactory.createForHierarchyCatalog(process, queryModel.getQueryManager(), dimension.getName(), xLocalizationProvider.getText(oFF.OuHierarchyDialogI18n.TITLE));
	runner.getProgramStartData().putXObject(oFF.FilterDialog.PRG_DATA_LISTENER_CLOSE, oFF.FilterDialogLambdaCloseListener.create((selection) => {
		let newValue = oFF.XCollectionUtils.hasElements(selection) ? selection.get(0).getName() : null;
		let wasHierarchyActive = dimension.isHierarchyActive();
		queryModel.getConvenienceCommands().setDimensionHierarchy(dimension.getName(), newValue, true, dimension.getInitialDrillLevel());
		if (!wasHierarchyActive)
		{
			dimension.getConvenienceCommands().refreshFieldContainerDisplayForDimension(dimension.getName(), null);
		}
		updateProcedure();
	}, null));
	runner.setConfigStructure(oFF.PrFactory.createStructure());
	runner.runProgram();
};
