oFF.AuGdsQbHierarchyActionsRegistrator.prototype.deferredHierarchyLevelOptions = function(levelConsumer, dimension, fallbackDrillLevelOrig)
{
	if (oFF.notNull(dimension) && dimension.getHierarchy() !== null)
	{
		let hierarchy = dimension.getLeveledHierarchy(dimension.getHierarchyName());
		let fallbackDrillLevel;
		if (oFF.notNull(hierarchy) && oFF.XCollectionUtils.hasElements(hierarchy.getHierarchyLevels()))
		{
			fallbackDrillLevel = oFF.XMath.min(hierarchy.getHierarchyLevels().size(), 30);
		}
		else
		{
			fallbackDrillLevel = fallbackDrillLevelOrig;
		}
		let hierarchyUniqueName = dimension.getHierarchyUniqueName(dimension.getHierarchyName());
		let levelFetcher = oFF.HierarchyCatalogCallbackLambda.createForResult((levelResult) => {
			let levelsFromFetcher = fallbackDrillLevel;
			if (levelResult.isValid())
			{
				let hcr = levelResult.getData();
				if (oFF.notNull(hcr) && hcr.getObjects().size() === 1)
				{
					levelsFromFetcher = oFF.XCollectionUtils.size(hcr.getObjects().get(0).getHierarchyLevels());
				}
			}
			levelConsumer(oFF.XIntegerValue.create(levelsFromFetcher));
		});
		let hierarchyFetcher = oFF.HierarchyCatalogCallbackLambda.createForResult((hierarchyResult) => {
			if (hierarchyResult.isValid())
			{
				dimension.fetchHierarchyLevels(oFF.SyncType.NON_BLOCKING, levelFetcher, null, hierarchyUniqueName);
			}
			else
			{
				levelConsumer(oFF.XIntegerValue.create(fallbackDrillLevel));
			}
		});
		try
		{
			dimension.fetchHierarchyCatalog(oFF.SyncType.NON_BLOCKING, hierarchyFetcher, null);
		}
		catch (catalogFetchError)
		{
			levelConsumer(oFF.XIntegerValue.create(fallbackDrillLevel));
		}
	}
};
