oFF.AuGdsQbHierarchyActionsRegistrator.prototype.registerBottomUpAxis = function(registry, xLocalizationProvider)
{
	let parentsAbove = oFF.CMEFactory.createSelectionOption();
	parentsAbove.setNameProvider((aboveName) => {
		return oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_AXIS_NODE_ALIGNMENT_PARENTS_ABOVE;
	});
	parentsAbove.setTextProvider((aboveText) => {
		let aboveAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(aboveText);
		if (oFF.AxisType.getTypeOfAxis(aboveAxis) === oFF.AxisType.COLUMNS)
		{
			return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_LEFT);
		}
		else
		{
			return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_ABOVE);
		}
	});
	parentsAbove.setCustomObject(oFF.Alignment.CHILDREN_BELOW_PARENT);
	registry.registerAction(oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_AXIS_NODE_ALIGNMENT_PARENTS_ABOVE, parentsAbove);
	let parentsBelow = oFF.CMEFactory.createSelectionOption();
	parentsBelow.setNameProvider((belowName) => {
		return oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_AXIS_NODE_ALIGNMENT_PARENTS_BELOW;
	});
	parentsBelow.setTextProvider((belowText) => {
		let belowAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(belowText);
		if (oFF.AxisType.getTypeOfAxis(belowAxis) === oFF.AxisType.COLUMNS)
		{
			return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_RIGHT);
		}
		else
		{
			return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_BELOW);
		}
	});
	parentsBelow.setCustomObject(oFF.Alignment.CHILDREN_ABOVE_PARENT);
	registry.registerAction(oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_AXIS_NODE_ALIGNMENT_PARENTS_BELOW, parentsBelow);
	let dimenisonDefault = oFF.CMEFactory.createSelectionOption();
	dimenisonDefault.setNameProvider((defaultName) => {
		return oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_AXIS_NODE_ALIGNMENT_DEFAULT;
	});
	dimenisonDefault.setTextProvider((defaultText) => {
		return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_DIMENSION_DEFAULT);
	});
	dimenisonDefault.setCustomObject(oFF.Alignment.DEFAULT_VALUE);
	registry.registerAction(oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_AXIS_NODE_ALIGNMENT_DEFAULT, dimenisonDefault);
	let options = oFF.XList.create();
	options.add(parentsAbove);
	options.add(parentsBelow);
	options.add(dimenisonDefault);
	let action = oFF.CMEFactory.createSingleSelectAction();
	action.setNameProvider((nameContext) => {
		return oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_AXIS_NODE_ALIGNMENT;
	});
	action.setTextProvider((textContext) => {
		return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_ARRANGE);
	});
	action.setExplanationProvider((explanationContext) => {
		let explanationAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(explanationContext);
		let explanation = null;
		let explainedByUdh = this.isUdhActiveOnAxis(explanationAxis);
		if (!this.supportsNodeAlignmentOnAxis(explanationAxis) && !explainedByUdh)
		{
			explanation = xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_AXIS_NO_CHANGE_OF_NODE_ALIGNMENT_POSSIBLE);
		}
		else if (explainedByUdh && !explanationAxis.getSession().hasFeature(oFF.FeatureToggleOlap.UDH_ALIGNMENT))
		{
			explanation = xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.PARENT_NODES_POSITION_BLOCKED_UDH);
		}
		return explanation;
	});
	action.setAvailableProvider((availableContext) => {
		let availableAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(availableContext);
		return oFF.notNull(availableAxis) && availableAxis.getModelCapabilities().supportsExpandBottomUp();
	});
	action.setEnabledProvider((enabledContext) => {
		let enabledAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(enabledContext);
		let enabledByUdh = this.isUdhActiveOnAxis(enabledAxis);
		return this.supportsNodeAlignmentOnAxis(enabledAxis) && !enabledByUdh || enabledByUdh && enabledAxis.getSession().hasFeature(oFF.FeatureToggleOlap.UDH_ALIGNMENT);
	});
	action.setOptionsRetriever((optionsContext) => {
		return options;
	});
	action.setSelectionRetriever((selectionContext) => {
		let selectionAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(selectionContext);
		let selectedOption = dimenisonDefault;
		if (oFF.notNull(selectionAxis))
		{
			if (!this.isUdhActiveOnAxis(selectionAxis))
			{
				let selectedAlignment = selectionAxis.getEffectiveLowerLevelNodeAlignment();
				if (selectedAlignment === oFF.Alignment.CHILDREN_ABOVE_PARENT)
				{
					selectedOption = parentsBelow;
				}
				else if (selectedAlignment === oFF.Alignment.CHILDREN_BELOW_PARENT)
				{
					selectedOption = parentsAbove;
				}
			}
			else
			{
				let selectedRsAlignment = selectionAxis.getResultAlignment();
				if (selectedRsAlignment === oFF.ResultAlignment.BOTTOM)
				{
					selectedOption = parentsBelow;
				}
				else if (selectedRsAlignment === oFF.ResultAlignment.TOP)
				{
					selectedOption = parentsAbove;
				}
			}
		}
		return selectedOption;
	});
	action.setSelectionConsumer((consumerContext, selectionOption) => {
		let consumerAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(consumerContext);
		let updateProcedure = oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(consumerContext);
		if (oFF.notNull(consumerAxis) && oFF.notNull(updateProcedure))
		{
			let consumerAlignment = selectionOption.getCustomObject();
			if (!this.isUdhActiveOnAxis(consumerAxis))
			{
				consumerAxis.setLowerLevelNodeAlignment(consumerAlignment);
			}
			else
			{
				if (consumerAlignment === oFF.Alignment.CHILDREN_ABOVE_PARENT)
				{
					consumerAxis.setResultAlignment(oFF.ResultAlignment.BOTTOM);
				}
				else if (consumerAlignment === oFF.Alignment.CHILDREN_BELOW_PARENT)
				{
					consumerAxis.setResultAlignment(oFF.ResultAlignment.TOP);
				}
			}
			updateProcedure();
		}
	});
	registry.registerAction(oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_AXIS_NODE_ALIGNMENT, action);
};
