oFF.AuGdsQbHierarchyActionsRegistrator.prototype.registerUdhDrillDimension = function(registry)
{
	let action = oFF.CMEFactory.createToggleAction();
	action.setNameProvider((nameContext) => {
		return oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_SPECIFY_UDH_DRILL_DIMENSION;
	});
	action.setTextProvider((textContext) => {
		let iterationDimensionText = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimension(textContext);
		return oFF.isNull(iterationDimensionText) ? null : iterationDimensionText.getText();
	});
	action.setAvailableProvider((availableContext) => {
		let iterationDimensionAvailable = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimension(availableContext);
		let axisAv = oFF.isNull(iterationDimensionAvailable) ? null : iterationDimensionAvailable.getAxis();
		let queryModelAv = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(availableContext);
		let udhAv = null;
		if (oFF.notNull(queryModelAv) && oFF.XCollectionUtils.hasElements(axisAv) && queryModelAv.getModelCapabilities().supportsUniversalDisplayHierarchies())
		{
			udhAv = queryModelAv.getUniversalDisplayHierarchies().getByAxisType(axisAv.getType());
		}
		return oFF.notNull(udhAv) && udhAv.isActive();
	});
	action.setConsumer((triggerContext, bv) => {
		let iterationDimension = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimension(triggerContext);
		let axisTrigger = oFF.isNull(iterationDimension) ? null : iterationDimension.getAxis();
		let queryModelTrigger = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(triggerContext);
		let indexOffsetTrigger = oFF.notNull(queryModelTrigger) && queryModelTrigger.getModelCapabilities().supportsUniversalDisplayHierarchiesZeroBased() ? 0 : 1;
		let udhTrigger = null;
		if (oFF.notNull(queryModelTrigger) && oFF.XCollectionUtils.hasElements(axisTrigger) && queryModelTrigger.getModelCapabilities().supportsUniversalDisplayHierarchies())
		{
			udhTrigger = queryModelTrigger.getUniversalDisplayHierarchies().getByAxisType(axisTrigger.getType());
		}
		let updateProcedure = oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(triggerContext);
		let triggerQueryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(triggerContext);
		if (oFF.notNull(udhTrigger) && oFF.notNull(updateProcedure) && oFF.notNull(iterationDimension) && oFF.notNull(triggerQueryModel))
		{
			triggerQueryModel.getConvenienceCommands().removeDrillOperationsByAxisType(axisTrigger.getType());
			let levelTrigger = udhTrigger.getDimensionNames().getIndex(iterationDimension.getName());
			udhTrigger.setInitialDrillLevel(levelTrigger + indexOffsetTrigger);
			updateProcedure();
		}
	});
	action.setProvider((providerContext) => {
		let iterationDimensionProvider = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimension(providerContext);
		let axisProvider = oFF.isNull(iterationDimensionProvider) ? null : iterationDimensionProvider.getAxis();
		let queryModelProvider = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(providerContext);
		let indexOffsetProvider = oFF.notNull(queryModelProvider) && queryModelProvider.getModelCapabilities().supportsUniversalDisplayHierarchiesZeroBased() ? 0 : 1;
		let udhProvider = null;
		if (oFF.notNull(queryModelProvider) && oFF.XCollectionUtils.hasElements(axisProvider) && queryModelProvider.getModelCapabilities().supportsUniversalDisplayHierarchies())
		{
			udhProvider = queryModelProvider.getUniversalDisplayHierarchies().getByAxisType(axisProvider.getType());
		}
		let result = false;
		if (oFF.notNull(udhProvider) && oFF.notNull(iterationDimensionProvider))
		{
			let levelProvider = udhProvider.getDimensionNames().getIndex(iterationDimensionProvider.getName());
			result = levelProvider + indexOffsetProvider === udhProvider.getInitialDrillLevel();
		}
		return result;
	});
	registry.registerAction(oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_SPECIFY_UDH_DRILL_DIMENSION, action);
};
oFF.AuGdsQbHierarchyActionsRegistrator.prototype.registerUdhLevelAction = function(registry, xLocalizationProvider)
{
	let action = oFF.CMEFactory.createSingleSelectAction();
	action.setNameProvider((nameContext) => {
		return oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_SPECIFY_UDH_DRILL_LEVEL;
	});
	action.setTextProvider((textContext) => {
		return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_INITIAL_DISPLAY_LEVEL);
	});
	action.setAvailableProvider((availableContext) => {
		let availableAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(availableContext);
		return oFF.notNull(availableAxis) && availableAxis.getModelCapabilities().supportsUniversalDisplayHierarchies();
	});
	action.setEnabledProvider((enabledContext) => {
		let enabledAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(enabledContext);
		let enabled = false;
		if (oFF.notNull(enabledAxis))
		{
			let eUdh = enabledAxis.getQueryModel().getUniversalDisplayHierarchies().getByAxisType(enabledAxis.getType());
			enabled = oFF.notNull(eUdh) && eUdh.isActive();
		}
		return enabled;
	});
	action.setOptionsRetriever((retrieverContext) => {
		let options = oFF.XList.create();
		let optionsAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(retrieverContext);
		if (oFF.notNull(optionsAxis))
		{
			let oUdh = optionsAxis.getQueryModel().getUniversalDisplayHierarchies().getByAxisType(optionsAxis.getType());
			if (oFF.notNull(oUdh) && oUdh.isActive())
			{
				let maxLevel = oFF.XMath.min(oUdh.getDimensionNames().size(), 30);
				for (let i = -1; i < maxLevel; i++)
				{
					options.add(registry.getOptionByKey(oFF.XStringUtils.concatenate3(oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_SPECIFY_DRILL_LEVEL, "_", oFF.XInteger.convertToString(i))));
				}
			}
		}
		return options;
	});
	action.setSelectionRetriever((selectionContext) => {
		let selectionAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(selectionContext);
		let option = null;
		if (oFF.notNull(selectionAxis))
		{
			let sUdh = selectionAxis.getQueryModel().getUniversalDisplayHierarchies().getByAxisType(selectionAxis.getType());
			if (oFF.notNull(sUdh) && sUdh.isActive())
			{
				option = registry.getOptionByKey(oFF.XStringUtils.concatenate3(oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_SPECIFY_DRILL_LEVEL, "_", oFF.XInteger.convertToString(sUdh.getInitialDrillLevel())));
			}
		}
		return option;
	});
	action.setSelectionConsumer((consumerContext, selectOption) => {
		let consumerAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(consumerContext);
		let updateProcedure = oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(consumerContext);
		if (oFF.notNull(consumerAxis) && oFF.notNull(updateProcedure))
		{
			consumerAxis.getConvenienceCommands().setUniversalDisplayHierarchy(consumerAxis.getDimensionNames().createListCopy(), oFF.XInteger.convertFromString(selectOption.getName(consumerContext)), true);
			updateProcedure();
		}
	});
	registry.registerAction(oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_SPECIFY_UDH_DRILL_LEVEL, action);
};
oFF.AuGdsQbHierarchyActionsRegistrator.prototype.registerUdhNodeLevelAction = function(registry, xLocalizationProvider)
{
	let action = oFF.CMEFactory.createSingleSelectAction();
	action.setNameProvider((nameContext) => {
		return oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_SPECIFY_UDH_NODE_DRILL_DIMENSION;
	});
	action.setTextProvider((textContext) => {
		return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.EXPAND_TO_DIMENSION);
	});
	action.setAvailableProvider((availableContext) => {
		return oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdhOnRowsOrColumns(availableContext) !== null && oFF.XCollectionUtils.hasElements(oFF.AuGdsQbHierarchyActionsRegistrator.getTupleElementsSupportingDrillState(availableContext, oFF.DrillState.DRILLED));
	});
	action.setOptionsRetriever((retrieverContext) => {
		let reDim = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdhOnRowsOrColumns(retrieverContext);
		let options = oFF.XList.create();
		if (oFF.notNull(reDim))
		{
			let minimumDrillLevel = reDim.getIndexOnAxis() + 1;
			let selectAxis = reDim.getAxis();
			let maximumDrillLevel = selectAxis.size();
			for (let i = minimumDrillLevel; i < maximumDrillLevel; i++)
			{
				options.add(this.createLevelOption(oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_SPECIFY_UDH_NODE_DRILL_DIMENSION, i, selectAxis.get(i).getText()));
			}
		}
		return options;
	});
	action.setSelectionRetriever((selectionContext) => {
		return null;
	});
	action.setSelectionConsumer((selectContext, selectOption) => {
		let updateProcedure = oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(selectContext);
		if (oFF.notNull(updateProcedure) && oFF.AuGdsQbHierarchyActionsRegistrator.tryApplyDrill(selectContext, oFF.DrillState.DRILLED, selectOption.getCustomObject().getInteger()))
		{
			updateProcedure();
		}
	});
	registry.registerAction(oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_SPECIFY_UDH_NODE_DRILL_DIMENSION, action);
};
oFF.AuGdsQbHierarchyActionsRegistrator.prototype.registerZoomIn = function(registry, xLocalizationProvider)
{
	let action = oFF.CMEFactory.createTriggerAction();
	action.setNameProvider((nameContext) => {
		return oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_CHART_ZOOM_IN;
	});
	action.setTextProvider((textContext) => {
		return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_ZOOM_IN);
	});
	action.setIconProvider((iconContext) => {
		return "zoom-in";
	});
	action.setAvailableProvider((availableContext) => {
		return oFF.XCollectionUtils.hasElements(oFF.AuGdsQbHierarchyActionsRegistrator.getTupleElementsSupportingDrillStateSelective(availableContext, oFF.DrillState.EXPANDED));
	});
	action.setTrigger((triggerContext) => {
		let updateProcedure = oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(triggerContext);
		if (oFF.notNull(updateProcedure) && oFF.AuGdsQbHierarchyActionsRegistrator.tryApplyZoomSelective(triggerContext))
		{
			updateProcedure();
		}
	});
	registry.registerAction(oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_CHART_ZOOM_IN, action);
};
oFF.AuGdsQbHierarchyActionsRegistrator.prototype.registerZoomOut = function(registry, xLocalizationProvider)
{
	let action = oFF.CMEFactory.createTriggerAction();
	action.setNameProvider((nameContext) => {
		return oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_CHART_ZOOM_OUT;
	});
	action.setTextProvider((textContext) => {
		return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DRILL_ZOOM_OUT);
	});
	action.setIconProvider((iconContext) => {
		return "zoom-out";
	});
	action.setAvailableProvider((availableContext) => {
		let availableContextDimension = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionPreferablyUdh(availableContext);
		return oFF.notNull(availableContextDimension) && availableContextDimension.getDrillManager().hasZoomDrill(availableContextDimension);
	});
	action.setTrigger((triggerContext) => {
		let updateProcedure = oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(triggerContext);
		let triggerDimension = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionPreferablyUdh(triggerContext);
		if (oFF.notNull(updateProcedure) && oFF.notNull(triggerDimension) && triggerDimension.getDrillManager().hasZoomDrill(triggerDimension))
		{
			triggerDimension.getDrillManager().popZoomDrill(triggerDimension);
			updateProcedure();
		}
	});
	registry.registerAction(oFF.AuGdsQbHierarchyActionsRegistrator.ACTION_CHART_ZOOM_OUT, action);
};
oFF.AuGdsQbHierarchyActionsRegistrator.prototype.supportsDimensionHierarchySelection = function(avDim)
{
	return oFF.notNull(avDim) && avDim.supportsHierarchy() && !avDim.isDisplayHierarchyFixInFilter() && (!avDim.getDimensionType().isTypeOf(oFF.DimensionType.ACCOUNT) || avDim.getHierarchies() !== null && avDim.getHierarchies().getObjects().size() > 1);
};
oFF.AuGdsQbHierarchyActionsRegistrator.prototype.supportsNodeAlignmentOnAxis = function(axis)
{
	let caps = oFF.isNull(axis) ? null : axis.getModelCapabilities();
	return oFF.notNull(caps) && caps.supportsExpandBottomUp() && oFF.XStream.of(axis).anyMatch((dim) => {
		return dim.isHierarchyActive();
	}) && axis.getEffectiveLowerLevelNodeAlignment() !== oFF.Alignment.INHERIT_FROM_FIRST_DIMENSION_ON_AXIS;
};

