oFF.AuGdsQbPresentationActionsRegistrator.prototype.registerKeyDisplayDefaultToggle = function(registry, xLocalizationProvider)
{
	let action = oFF.CMEFactory.createToggleAction();
	action.setNameProvider((nameContext) => {
		let nameFieldContainer = oFF.AuGdsGenericContextResolveUtil.resolveSingleVisibleFieldContainer(nameContext);
		return oFF.isNull(nameFieldContainer) || nameFieldContainer.getOlapComponentType().isTypeOf(oFF.OlapComponentType.ABSTRACT_DIMENSION) ? oFF.AuGdsQbPresentationActionsRegistrator.ACTION_DIMENSION_PRESENTATION_KEY_DISPLAY_DEFAULT : oFF.AuGdsQbPresentationActionsRegistrator.ACTION_ATTRIBUTE_PRESENTATION_KEY_DISPLAY_DEFAULT;
	});
	action.setTextProvider((textContext) => {
		return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.PRESENTATION_TYPE_DEFAULT);
	});
	action.setAvailableProvider((availableContext) => {
		let availFieldContainer = oFF.AuGdsGenericContextResolveUtil.resolveSingleVisibleFieldContainer(availableContext);
		let availCmd = oFF.AuGdsGenericContextResolveUtil.resolveConvenienceCommands(availableContext);
		return oFF.notNull(availCmd) && oFF.notNull(availFieldContainer) && oFF.XCollectionUtils.size(availCmd.getAvailableFieldContainerKeyDisplays(this.getFcDimName(availFieldContainer), this.getFcAttrName(availFieldContainer))) > 1 && availCmd.isFieldContainerKeyViewActive(this.getFcDimName(availFieldContainer), this.getFcAttrName(availFieldContainer));
	});
	action.setProvider((providerContext) => {
		let provFieldContainer = oFF.AuGdsGenericContextResolveUtil.resolveSingleVisibleFieldContainer(providerContext);
		let provCmd = oFF.AuGdsGenericContextResolveUtil.resolveConvenienceCommands(providerContext);
		return oFF.notNull(provCmd) && oFF.notNull(provFieldContainer) && provCmd.isFieldContainerKeyViewDefault(this.getFcDimName(provFieldContainer), this.getFcAttrName(provFieldContainer));
	});
	action.setConsumer((consumerContext, toggleValue) => {
		let updateProcedure = oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(consumerContext);
		let selectFieldContainer = oFF.AuGdsGenericContextResolveUtil.resolveSingleVisibleFieldContainer(consumerContext);
		let consumerCmd = oFF.AuGdsGenericContextResolveUtil.resolveConvenienceCommands(consumerContext);
		if (oFF.notNull(selectFieldContainer) && oFF.notNull(consumerCmd) && oFF.notNull(updateProcedure))
		{
			consumerCmd.resetFieldContainerKeyViewToDefault(this.getFcDimName(selectFieldContainer), this.getFcAttrName(selectFieldContainer));
			updateProcedure();
		}
	});
	registry.registerAction(oFF.AuGdsQbPresentationActionsRegistrator.ACTION_DIMENSION_PRESENTATION_KEY_DISPLAY_DEFAULT, action);
	registry.registerAction(oFF.AuGdsQbPresentationActionsRegistrator.ACTION_ATTRIBUTE_PRESENTATION_KEY_DISPLAY_DEFAULT, action);
};
