oFF.AuGdsQbPresentationActionsRegistrator.prototype.registerToggleFieldAction = function(registry)
{
	let toggleResultSetField = oFF.CMEFactory.createToggleAction();
	toggleResultSetField.setNameProvider((nameContext) => {
		let nameField = oFF.AuGdsGenericContextResolveUtil.resolveSingleField(nameContext);
		let name = oFF.AuGdsQbPresentationActionsRegistrator.ACTION_RESULT_SET_FIELD;
		if (oFF.notNull(nameField))
		{
			name = nameField.getName();
		}
		return name;
	});
	toggleResultSetField.setTextProvider((textContext) => {
		let textField = oFF.AuGdsGenericContextResolveUtil.resolveSingleField(textContext);
		let text = oFF.AuGdsQbPresentationActionsRegistrator.ACTION_RESULT_SET_FIELD;
		if (oFF.notNull(textField))
		{
			text = textField.getText();
			if (oFF.XStringUtils.isNullOrEmpty(text))
			{
				text = textField.getName();
			}
		}
		return text;
	});
	toggleResultSetField.setProvider((providerContext) => {
		let providerField = oFF.AuGdsGenericContextResolveUtil.resolveSingleField(providerContext);
		let status = false;
		if (oFF.notNull(providerField))
		{
			let dimension = providerField.getDimension();
			status = dimension.getResultSetFields().contains(providerField);
		}
		return status;
	});
	toggleResultSetField.setConsumer((context, select) => {
		let consumerField = oFF.AuGdsGenericContextResolveUtil.resolveSingleField(context);
		let queryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(context);
		let updateProcedure = oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(context);
		if (oFF.notNull(consumerField) && oFF.notNull(queryModel) && oFF.notNull(updateProcedure))
		{
			let cDimension = consumerField.getDimension();
			let cmd = queryModel.getConvenienceCommands();
			if (select.getBoolean())
			{
				cmd.addField(cDimension.getDimensionType(), cDimension.getName(), consumerField.getPresentationType(), consumerField.getName(), oFF.QContextType.RESULT_SET);
			}
			else
			{
				cmd.removeField(cDimension.getDimensionType(), cDimension.getName(), consumerField.getPresentationType(), consumerField.getName(), oFF.QContextType.RESULT_SET);
			}
			updateProcedure();
		}
	});
	registry.registerAction(oFF.AuGdsQbPresentationActionsRegistrator.ACTION_RESULT_SET_FIELD, toggleResultSetField);
};

