oFF.AuGdsQbReadModeSuppressionActionsRegistrator.prototype.getZeroSuppressionMessage = function(consumerAxis, newSuppressionType)
{
	let finalMessageKey = null;
	if (newSuppressionType !== oFF.ZeroSuppressionType.NONE)
	{
		if (oFF.XStream.of(consumerAxis).anyMatch((cdim) => {
			return cdim.getReadMode(oFF.QContextType.RESULT_SET).isTypeOf(oFF.QMemberReadMode.MASTER);
		}))
		{
			finalMessageKey = oFF.AuGdsQueryBuilderI18n.MSG_ZERO_SUPPRESSION_ON_UNBOOKED_OFF;
		}
		else if (consumerAxis.getType() === oFF.AxisType.ROWS)
		{
			finalMessageKey = oFF.AuGdsQueryBuilderI18n.MSG_ZERO_SUPPRESSION_ON_ROWS;
		}
		else if (consumerAxis.getType() === oFF.AxisType.COLUMNS)
		{
			finalMessageKey = oFF.AuGdsQueryBuilderI18n.MSG_ZERO_SUPPRESSION_ON_COLUMNS;
		}
	}
	return finalMessageKey;
};
