oFF.AuGdsQbReadModeSuppressionActionsRegistrator.prototype.registerReadmodeUnBookedGracefulToggleSync = function(registry, xLocalizationProvider)
{
	let action = oFF.CMEFactory.createToggleAction();
	action.setNameProvider((nameContext) => {
		return oFF.AuGdsQbReadModeSuppressionActionsRegistrator.ACTION_SET_DIMENSION_READMODE_GRACEFUL_UNBOOKED_SYNC;
	});
	action.setTextProvider((textContext) => {
		return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.READMODE_UNBOOKED);
	});
	action.setAvailableProvider(this.getReadModeAvailabilityProvider());
	action.setProvider(this.getReadModeToggledProvider(oFF.QMemberReadMode.MASTER));
	action.setConsumer((consumerContext, toggleValue) => {
		let coDims = this.getDimensionsForReadModeSelection(consumerContext);
		let updateProcedure = oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(consumerContext);
		let cmd = oFF.AuGdsGenericContextResolveUtil.resolveConvenienceCommands(consumerContext);
		if (oFF.XCollectionUtils.hasElements(coDims) && oFF.notNull(updateProcedure) && oFF.notNull(cmd))
		{
			let targetReadMode = toggleValue.getBoolean() ? oFF.QMemberReadMode.MASTER : oFF.QMemberReadMode.BOOKED;
			let axis = coDims.get(0).getAxis();
			let messageKey = null;
			if (targetReadMode.isTypeOf(oFF.QMemberReadMode.MASTER) && axis.isSuppressingZerosOrNulls())
			{
				messageKey = oFF.AuGdsQueryBuilderI18n.MSG_UNBOOKED_ON_ZERO_SUPPRESSION_OFF;
			}
			else if (targetReadMode.isTypeOf(oFF.QMemberReadMode.MASTER) && coDims.get(coDims.size() - 1).hasSubsequentBookedReadModes(oFF.QContextType.RESULT_SET))
			{
				messageKey = oFF.AuGdsQueryBuilderI18n.MSG_UNBOOKED_ON_BELOW;
			}
			else if (targetReadMode.isTypeOf(oFF.QMemberReadMode.BOOKED) && coDims.get(0).hasPreviousMasterReadModes(oFF.QContextType.RESULT_SET))
			{
				messageKey = oFF.AuGdsQueryBuilderI18n.MSG_UNBOOKED_OFF_ABOVE;
			}
			oFF.XCollectionUtils.forEach(coDims, (coDim) => {
				cmd.setDimensionMemberReadModeGracefulExt(coDim.getName(), oFF.QContextType.RESULT_SET, targetReadMode, true);
			});
			updateProcedure();
			this.displayMessage(consumerContext, xLocalizationProvider, messageKey);
		}
	});
	registry.registerAction(oFF.AuGdsQbReadModeSuppressionActionsRegistrator.ACTION_SET_DIMENSION_READMODE_GRACEFUL_UNBOOKED_SYNC, action);
};
