oFF.AuGdsQbReadModeSuppressionActionsRegistrator.prototype.registerZeroSuppressionAction = function(registry, xLocalizationProvider)
{
	let allCellsAreNull = oFF.CMEFactory.createSelectionOption();
	allCellsAreNull.setNameProvider((acanName) => {
		return oFF.AuGdsQbReadModeSuppressionActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_ALL_CELLS_ARE_NULL;
	});
	allCellsAreNull.setCustomObject(oFF.ZeroSuppressionType.ALL_CELLS_ARE_NULL);
	allCellsAreNull.setTextProvider((acanText) => {
		return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.ZERO_SUPPRESSION_TYPE_ALL_CELLS_ARE_NULL);
	});
	registry.registerAction(oFF.AuGdsQbReadModeSuppressionActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_ALL_CELLS_ARE_NULL, allCellsAreNull);
	let allCellsAreZero = oFF.CMEFactory.createSelectionOption();
	allCellsAreZero.setNameProvider((acazName) => {
		return oFF.AuGdsQbReadModeSuppressionActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_ALL_CELLS_ARE_ZERO;
	});
	allCellsAreZero.setCustomObject(oFF.ZeroSuppressionType.ALL_CELLS_ARE_ZERO);
	allCellsAreZero.setTextProvider((acazText) => {
		return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.ZERO_SUPPRESSION_TYPE_ALL_CELLS_ARE_ZERO);
	});
	registry.registerAction(oFF.AuGdsQbReadModeSuppressionActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_ALL_CELLS_ARE_ZERO, allCellsAreZero);
	let totalIsZero = oFF.CMEFactory.createSelectionOption();
	totalIsZero.setNameProvider((tizName) => {
		return oFF.AuGdsQbReadModeSuppressionActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_TOTALS_ARE_ZERO;
	});
	totalIsZero.setCustomObject(oFF.ZeroSuppressionType.TOTAL_IS_ZERO);
	totalIsZero.setTextProvider((tizText) => {
		return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.ZERO_SUPPRESSION_TYPE_TOTAL_IS_ZERO);
	});
	registry.registerAction(oFF.AuGdsQbReadModeSuppressionActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_TOTALS_ARE_ZERO, totalIsZero);
	let none = oFF.CMEFactory.createSelectionOption();
	none.setNameProvider((nonName) => {
		return oFF.AuGdsQbReadModeSuppressionActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_NONE;
	});
	none.setCustomObject(oFF.ZeroSuppressionType.NONE);
	none.setTextProvider((nonText) => {
		return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.ZERO_SUPPRESSION_TYPE_NONE);
	});
	registry.registerAction(oFF.AuGdsQbReadModeSuppressionActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_NONE, totalIsZero);
	let optionMapper = (zst) => {
		if (zst === oFF.ZeroSuppressionType.NONE)
		{
			return none;
		}
		else if (zst === oFF.ZeroSuppressionType.ALL_CELLS_ARE_ZERO)
		{
			return allCellsAreZero;
		}
		else if (zst === oFF.ZeroSuppressionType.ALL_CELLS_ARE_NULL)
		{
			return allCellsAreNull;
		}
		else if (zst === oFF.ZeroSuppressionType.TOTAL_IS_ZERO)
		{
			return totalIsZero;
		}
		else
		{
			return null;
		}
	};
	let optionsRetriever = (retrieverContext) => {
		let rAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(retrieverContext);
		return oFF.isNull(rAxis) ? null : oFF.XStream.of(rAxis.getAvailableZeroSuppressionTypes()).map(optionMapper).collect(oFF.XStreamCollector.toList());
	};
	let availableProvider = (availableContext) => {
		let axis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(availableContext);
		return oFF.notNull(axis) && axis.supportsZeroSuppression();
	};
	let selectionRetriever = (selectionContext) => {
		let sAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(selectionContext);
		let option = null;
		if (oFF.notNull(sAxis))
		{
			option = optionMapper(sAxis.getZeroSuppressionType());
		}
		return option;
	};
	let action = oFF.CMEFactory.createSingleSelectAction();
	action.setNameProvider((nameContext) => {
		return oFF.AuGdsQbReadModeSuppressionActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION;
	});
	action.setTextProvider((textContext) => {
		return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.ZERO_SUPPRESSION);
	});
	action.setAvailableProvider(availableProvider);
	action.setOptionsRetriever(optionsRetriever);
	action.setSelectionRetriever(selectionRetriever);
	action.setSelectionConsumer((selectContext, selectOption) => {
		let cAxis = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(selectContext);
		let updateProcedure = oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(selectContext);
		if (oFF.notNull(cAxis))
		{
			cAxis.getConvenienceCommands().setAxisZeroSuppressionTypeExt(cAxis.getType(), selectOption.getCustomObject(), false);
			updateProcedure();
		}
	});
	registry.registerAction(oFF.AuGdsQbReadModeSuppressionActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION, action);
	action = oFF.CMEFactory.createSingleSelectAction();
	action.setNameProvider((nameContext2) => {
		return oFF.AuGdsQbReadModeSuppressionActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_SYNC;
	});
	action.setTextProvider((textContext2) => {
		return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.ZERO_SUPPRESSION);
	});
	action.setAvailableProvider(availableProvider);
	action.setOptionsRetriever(optionsRetriever);
	action.setSelectionRetriever(selectionRetriever);
	action.setSelectionConsumer((selectContext2, selectOption2) => {
		let cAxis2 = oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(selectContext2);
		let updateProcedure2 = oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(selectContext2);
		if (oFF.notNull(cAxis2))
		{
			let newSuppressionType = selectOption2.getCustomObject();
			let messageString = this.getZeroSuppressionMessage(cAxis2, newSuppressionType);
			cAxis2.getConvenienceCommands().setAxisZeroSuppressionTypeExt(cAxis2.getType(), newSuppressionType, true);
			this.displayMessage(selectContext2, xLocalizationProvider, messageString);
			updateProcedure2();
		}
	});
	registry.registerAction(oFF.AuGdsQbReadModeSuppressionActionsRegistrator.ACTION_SPECIFY_ZERO_SUPPRESSION_SYNC, action);
};
