{
	return new oFF.AuGdsQbSortingActionsRegistrator();
};
oFF.AuGdsQbSortingActionsRegistrator.prototype.canEmulateFieldSortByDimensionSort = function(queryModel, field)
{
	let dimension = field.getDimension();
	return field.getAttribute() === dimension.getMainAttribute() && queryModel.getModelCapabilities().supportsDimensionSorting(dimension, this.getDimensionSortTypeForPresentationType(field.getPresentationType()));
};
oFF.AuGdsQbSortingActionsRegistrator.prototype.doDimensionSort = function(queryModel, dimension, dimensionSortType, direction)
{
	let sortingManager = queryModel.getSortingManager();
	let cmd = queryModel.getConvenienceCommands();
	cmd.clearSort(oFF.SortType.ABSTRACT_DIMENSION_SORT, dimension.getName());
	let orthogonalAxisType = oFF.AxisType.getOrthogonalTypeForAxis(dimension.getAxisType());
	cmd.clearSort(oFF.SortType.COMPLEX, null);
	if (oFF.notNull(orthogonalAxisType))
	{
		cmd.clearSort(oFF.SortType.DATA_CELL_VALUE, orthogonalAxisType.getName());
		if (queryModel.getMeasureDimension() !== null && queryModel.getMeasureDimension().getAxisType() === orthogonalAxisType)
		{
			cmd.clearSort(oFF.SortType.MEASURE, null);
		}
	}
	if (direction === oFF.XSortDirection.DEFAULT_VALUE)
	{
		if (dimension.getDimensionType().isTypeOf(oFF.DimensionType.MEASURE_STRUCTURE) && queryModel.getQueryManager().getSystemType().isTypeOf(oFF.SystemType.BW))
		{
			let dimensionSorting = sortingManager.getDimensionSorting(dimension, true);
			dimensionSorting.setSortByKey();
			dimensionSorting.setDirection(direction);
			dimensionSorting.setCustomSort(oFF.XStream.of(dimension.getStructureLayout()).collect(oFF.XStreamCollector.toListOfString((input) => {
				return input.getName();
			})));
		}
	}
	else
	{
		queryModel.getConvenienceCommands().sort(dimensionSortType, dimension.getDimensionType(), dimension.getName(), null, null, null, direction);
	}
};
oFF.AuGdsQbSortingActionsRegistrator.prototype.getAscendingTextForValueType = function(datValueType, xLocalizationProvider)
{
	let datText = xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.SORT_ASCENDING_ALPHABETICALLY);
	if (oFF.isNull(datValueType))
	{
		datText = xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.SORT_ASCENDING_ALPHABETICALLY);
	}
	else if (datValueType.isDateTime())
	{
		datText = xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.SORT_ASCENDING_TIME_BASED);
	}
	else if (datValueType.isNumber())
	{
		datText = xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.SORT_ASCENDING_VALUE_BASED);
	}
	else if (datValueType.isString())
	{
		datText = xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.SORT_ASCENDING_ALPHABETICALLY);
	}
	return datText;
};
