oFF.AuGdsQbSortingActionsRegistrator.prototype.getDimensionSortTypeForPresentationType = function(presentationType)
{
	return oFF.XConstantWithParent.isObjectTypeOf(presentationType, oFF.PresentationType.ABSTRACT_KEY) ? oFF.SortType.MEMBER_KEY : oFF.SortType.MEMBER_TEXT;
};
oFF.AuGdsQbSortingActionsRegistrator.prototype.getLeadingFieldValueType = function(field)
{
	let resultField = field;
	let valueType = null;
	if (oFF.notNull(resultField))
	{
		let dimension = field.getDimension();
		if (resultField.getValueType().isString() && resultField === dimension.getDisplayKeyField())
		{
			resultField = dimension.getKeyField();
		}
		if (resultField === dimension.getKeyField() && resultField.getValueType().isString())
		{
			valueType = dimension.getValueType();
		}
		else
		{
			valueType = resultField.getValueType();
		}
	}
	return valueType;
};
