		let selectRsc = oFF.AuGdsGenericContextResolveUtil.resolveSingleResultStructureController(selectContext);
		let selectModelLevel = oFF.AuGdsGenericContextResolveUtil.resolveSingleResultStructureControllerModelLevel(selectContext);
