oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.executeQuickAction = function(selectAction, consumerContext)
{
	let actionType = selectAction.getOlapComponentType();
	let queryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(consumerContext);
	let tupleElementsR = oFF.AuGdsGenericContextResolveUtil.resolveTupleElements(consumerContext, oFF.AxisType.ROWS);
	let tupleElementsC = oFF.AuGdsGenericContextResolveUtil.resolveTupleElements(consumerContext, oFF.AxisType.COLUMNS);
	let rowTuples = oFF.AuGdsGenericContextResolveUtil.resolveRowTuples(consumerContext);
	let columnTuples = oFF.AuGdsGenericContextResolveUtil.resolveColumnTuples(consumerContext);
	let axisType = oFF.AxisType.getTypeOfAxis(oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(consumerContext));
	let dimensions = oFF.AuGdsGenericContextResolveUtil.resolveDimensions(consumerContext);
	let attributes = oFF.AuGdsGenericContextResolveUtil.resolveAttributes(consumerContext);
	let fields = oFF.AuGdsGenericContextResolveUtil.resolveFields(consumerContext);
	let rowTupleElements = this.extractPaths(tupleElementsR, rowTuples, oFF.AxisType.ROWS);
	let columnTupleElements = this.extractPaths(tupleElementsC, columnTuples, oFF.AxisType.COLUMNS);
	if (actionType === oFF.OlapComponentType.QUICK_ACTION_DATAPROVIDER)
	{
		let commandPairs = selectAction.resolveDpCommandPairs(queryModel, axisType, dimensions, attributes, fields, rowTupleElements, columnTupleElements);
		let executor = oFF.AuGdsGenericContextResolveUtil.resolveDpCommandExecutor(consumerContext);
		if (oFF.XCollectionUtils.hasElements(commandPairs))
		{
			oFF.XCollectionUtils.forEach(commandPairs, (pair) => {
				executor.accept(pair.getFirstObject().getString(), pair.getSecondObject());
			});
		}
	}
	else if (actionType === oFF.OlapComponentType.QUICK_ACTION_URL)
	{
		let uri = selectAction.resolveUri(queryModel, axisType, dimensions, attributes, fields, rowTupleElements, columnTupleElements);
		if (oFF.notNull(uri) && oFF.XStringUtils.isNotNullAndNotEmpty(uri.getUrl()))
		{
			oFF.UiFramework.currentFramework().openUrl(uri.getUrl(), "_blank");
		}
	}
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.extractPaths = function(tupleElements, tuples, axisType)
{
	let result = null;
	if (oFF.XCollectionUtils.hasElements(tupleElements))
	{
		result = oFF.XStream.of(tupleElements).filter((te) => {
			return te.getAxis().getType() === axisType;
		}).map((tel) => {
			let tupleElementsMapped = oFF.XList.create();
			let tupleSub = tel.getFirstTuple();
			for (let i = 0; i <= tel.getIndexOnAxis(); i++)
			{
				tupleElementsMapped.add(tupleSub.getTupleElementAt(i));
			}
			return tupleElementsMapped;
		}).collect(oFF.XStreamCollector.toList());
	}
	else if (oFF.XCollectionUtils.hasElements(tuples))
	{
		result = oFF.XStream.of(tuples).filter((tu) => {
			return tu.getAxis().getType() === axisType;
		}).map((tup) => {
			let fiva = oFF.XList.create();
			for (let j = 0; j < tup.size(); j++)
			{
				fiva.add(tup.getTupleElementAt(j));
			}
			return fiva;
		}).collect(oFF.XStreamCollector.toList());
	}
	return result;
};
