oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.getTopNExplanationText = function(enabledContext, xLocalizationProvider)
{
	let queryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(enabledContext);
	if (oFF.isNull(queryModel))
	{
		return null;
	}
	let modelCapabilities = queryModel.getModelCapabilities();
	if (oFF.isNull(modelCapabilities))
	{
		return null;
	}
	let isVersionDimensionInDatasource = this.isVersionDimensionInDatasource(queryModel);
	if (!this.isTopNEnabled(enabledContext))
	{
		if (!oFF.AuGdsQueryDetails.isNonVersionDimensionSelected(queryModel))
		{
			let messageKey = isVersionDimensionInDatasource ? oFF.AuGdsQueryBuilderI18n.MSG_TOP_N_BLOCKED_MISSING_NON_VERSION_DIM : oFF.AuGdsQueryBuilderI18n.MSG_TOP_N_BLOCKED_MISSING_DIM;
			return xLocalizationProvider.getText(messageKey);
		}
		if (oFF.AuGdsQueryDetails.isBwAndNoFlatDimensionSelected(queryModel))
		{
			return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.MSG_TOP_N_BLOCKED_BW_HIERARCHY);
		}
		if (oFF.XConstantWithParent.isObjectTypeOf(queryModel.getModelCapabilities().getSystemType(), oFF.SystemType.HANA))
		{
			return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.MSG_TOP_N_BLOCKED_FOR_HANA);
		}
	}
	return null;
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.isTopNEnabled = function(enabledContext)
{
	let queryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(enabledContext);
	if (oFF.isNull(queryModel))
	{
		return false;
	}
	let modelCapabilities = queryModel.getModelCapabilities();
	if (oFF.isNull(modelCapabilities))
	{
		return false;
	}
	let isBW = oFF.XConstantWithParent.isObjectTypeOf(modelCapabilities.getSystemType(), oFF.SystemType.BW);
	if (oFF.AuGdsQueryDetails.isBwAndNoFlatDimensionSelected(queryModel))
	{
		return false;
	}
	let isNonVersionDimensionSelected = oFF.AuGdsQueryDetails.isNonVersionDimensionSelected(queryModel);
	return (isBW || modelCapabilities.supportsConditionsWithHiddenMeasures()) && isNonVersionDimensionSelected;
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.isVersionDimensionInDatasource = function(queryModel)
{
	return queryModel.getVersionDimension() !== null;
};
oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.registerActivateCellChart = function(registry, xLocalizationProvider)
{
	let action = oFF.CMEFactory.createToggleAction();
	action.setNameProvider((nameContext) => {
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_TOGGLE_CELL_CHART;
	});
	action.setTextProvider((textContext) => {
		return xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.CELLCHART_SHOW);
	});
	action.setAvailableProvider((availableContext) => {
		return oFF.AuGdsGenericContextResolveUtil.resolveSingleStructureMemberFromTupleElement(availableContext) !== null;
	});
	action.setProvider((providerContext) => {
		let providerMember = oFF.AuGdsGenericContextResolveUtil.resolveSingleStructureMemberFromTupleElement(providerContext);
		return oFF.notNull(providerMember) && providerMember.isShowCellChart();
	});
	action.setConsumer((consumerContext, value) => {
		let consumerMember = oFF.AuGdsGenericContextResolveUtil.resolveSingleStructureMemberFromTupleElement(consumerContext);
		let updateProcedure = oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(consumerContext);
		if (oFF.notNull(updateProcedure) && oFF.notNull(consumerMember))
		{
			consumerMember.setShowCellChart(value.getBoolean());
			updateProcedure();
		}
	});
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_TOGGLE_CELL_CHART, action);
};
