oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.registerDimensionDialogAction = function(registry, xLocalizationProvider)
{
	let action = oFF.CMEFactory.createTriggerAction();
	action.setNameProvider((nameContext) => {
		return oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_DIMENSION_DIALOG;
	});
	action.setAvailableProvider((availableContext) => {
		return oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdh(availableContext) !== null;
	});
	action.setTextProvider((textContext) => {
		let textDimension = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdh(textContext);
		let text = xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DIMENSION);
		if (oFF.notNull(textDimension))
		{
			let textDimensionType = textDimension.getDimensionType();
			if (textDimensionType === oFF.DimensionType.ACCOUNT)
			{
				text = xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DIMENSION_ACCOUNT);
			}
			else if (textDimensionType === oFF.DimensionType.MEASURE_STRUCTURE)
			{
				text = xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DIMENSION_MEASURE_STRUCTURE);
			}
			else if (textDimensionType === oFF.DimensionType.CALCULATED_DIMENSION)
			{
				text = xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DIMENSION_CALCULATED);
			}
			else if (textDimensionType === oFF.DimensionType.SECONDARY_STRUCTURE)
			{
				text = xLocalizationProvider.getText(oFF.AuGdsQueryBuilderI18n.DIMENSION_SECONDARY_STRUCTURE);
			}
		}
		return oFF.XStringUtils.concatenate2(text, " ...");
	});
	action.setEnabledProvider((enabledContext) => {
		return oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdh(enabledContext) !== null && oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(enabledContext) !== null;
	});
	action.setTrigger((actionContext) => {
		let actionDimension = oFF.AuGdsGenericContextResolveUtil.resolveSingleDimensionNonUdh(actionContext);
		let wasHierarchyActive = oFF.notNull(actionDimension) && actionDimension.isHierarchyActive();
		let updateProcedure = oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(actionContext);
		let queryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(actionContext);
		if (oFF.notNull(actionDimension) && oFF.notNull(actionContext) && oFF.notNull(updateProcedure) && oFF.notNull(queryModel))
		{
			oFF.AuGdsQbDialogHelper.openDimensionDialog(queryModel.getProcess(), actionDimension.getQueryManager(), actionDimension.getName(), () => {
				if (actionDimension.isHierarchyActive() !== wasHierarchyActive)
				{
					actionDimension.getConvenienceCommands().refreshFieldContainerDisplayForDimension(actionDimension.getName(), null);
				}
				updateProcedure();
			});
		}
	});
	registry.registerAction(oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.ACTION_DIMENSION_DIALOG, action);
};
