oFF.AuGdsQueryBuilderAdvancedActionsRegistrator.prototype.resolveMatchingQuickActions = function(av)
{
	let result = null;
	let queryModelAv = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(av);
	if (oFF.notNull(queryModelAv))
	{
		let tupleElementsR = oFF.AuGdsGenericContextResolveUtil.resolveTupleElements(av, oFF.AxisType.ROWS);
		let tupleElementsC = oFF.AuGdsGenericContextResolveUtil.resolveTupleElements(av, oFF.AxisType.COLUMNS);
		let rowTuples = oFF.AuGdsGenericContextResolveUtil.resolveRowsTuples(av);
		let columnTuples = oFF.AuGdsGenericContextResolveUtil.resolveColumnTuples(av);
		result = oFF.XStream.of(queryModelAv.getQuickActionManager()).filter((ca) => {
			return ca.isApplicableSimpleParameters(queryModelAv, oFF.AxisType.getTypeOfAxis(oFF.AuGdsGenericContextResolveUtil.resolveSingleAxis(av)), oFF.AuGdsGenericContextResolveUtil.resolveDimensions(av), oFF.AuGdsGenericContextResolveUtil.resolveAttributes(av), oFF.AuGdsGenericContextResolveUtil.resolveFields(av), this.extractPaths(tupleElementsR, rowTuples, oFF.AxisType.ROWS), this.extractPaths(tupleElementsC, columnTuples, oFF.AxisType.COLUMNS));
		}).collect(oFF.XStreamCollector.toList());
	}
	return result;
};

