oFF.AuGdsQueryBuilderBasicActionsRegistrator.prototype.openCurrencyConversionDialog = function(context)
{
	let queryManager = oFF.AuGdsGenericContextResolveUtil.resolveQueryManager(context);
	let updateProcedure = oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(context);
	if (oFF.notNull(queryManager) && oFF.notNull(updateProcedure))
	{
		let prgStartData = oFF.ProgramStartData.create();
		prgStartData.putXObject(oFF.DfOuDialogProgram.PRG_DATA_QUERY_MANAGER, queryManager);
		prgStartData.putXObject(oFF.DfOuDialogProgram.PRG_DATA_OK_PROCEDURE, oFF.XProcedureHolder.create(updateProcedure));
		let ccDlg = oFF.ProgramRunner.createRunner(queryManager.getApplication().getProcess(), oFF.OuCurrencyConversionDialog.DEFAULT_PROGRAM_NAME);
		ccDlg.setProgramStartData(prgStartData);
		ccDlg.runProgram();
	}
};
