oFF.AuGdsQueryBuilderBasicActionsRegistrator.prototype.reset = function(context)
{
	let queryManager = oFF.AuGdsGenericContextResolveUtil.resolveQueryManager(context);
	let updateProcedure = oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(context);
	if (oFF.notNull(queryManager) && oFF.notNull(updateProcedure))
	{
		let cmds = queryManager.getConvenienceCommands();
		cmds.resetToDefault();
		cmds.clearAllFiltersExt(oFF.FilterLayer.EXTERNAL, oFF.FilterScopeVariables.IGNORE);
		updateProcedure();
	}
};
