oFF.AuGdsQueryBuilderDevActionsRegistrator.prototype.addHierarchyStyle = function(tableDefinition, hierarchyLevel, axisLevel, name, color, width)
{
	let markupHier = tableDefinition.addNewTableMarkup(name, name);
	let rowsScope1 = markupHier.getRowsScope();
	let axisPathElement1 = rowsScope1.addNewAxisPath().addNewElement();
	axisPathElement1.setExactHierarchyLevel(true);
	axisPathElement1.setAxisLevel(axisLevel);
	axisPathElement1.setHierarchyLevel(hierarchyLevel);
	let scopedStyle1 = tableDefinition.addNewScopedStyle(name, name);
	let headerScope = scopedStyle1.getOrthogonalColumnsScope().addNewHeaderSectionInfo();
	headerScope.setDimensionLevel(true);
	headerScope.setAxisLevel(axisLevel);
	let formattingStyle = tableDefinition.addNewFormattingStyle(name, name);
	let line = formattingStyle.getStyledLineTop();
	line.setColor(color);
	line.setWidth(width);
	scopedStyle1.setStyle(formattingStyle);
	markupHier.addScopedStyle(scopedStyle1);
};
oFF.AuGdsQueryBuilderDevActionsRegistrator.prototype.applyDimensionsPathToTableMarkup = function(dimensions, tuple, tableMarkup)
{
	let scope = dimensions.get(0).getAxisType() === oFF.AxisType.ROWS ? tableMarkup.getRowsScope() : tableMarkup.getColumnsScope();
	let axisPath = scope.addNewAxisPath();
	for (let i = 0; i < dimensions.size(); i++)
	{
		let tupleElement = tuple.getTupleElementByDimension(dimensions.get(i));
		let element = axisPath.addNewElement();
		element.setDimension(dimensions.get(i));
		element.addMemberName(tupleElement.getDimensionMember().getName());
	}
};
