oFF.AuGdsQueryBuilderDevActionsRegistrator.prototype.registerKpiAction = function(registry, xLocalizationProvider, actionName, visualization, label)
{
	let action = oFF.CMEFactory.createTriggerAction();
	action.setNameProvider((nameContext) => {
		return actionName;
	});
	action.setTextProvider((textContext) => {
		return label;
	});
	action.setTrigger((triggerContext) => {
		let cmd = oFF.AuGdsGenericContextResolveUtil.resolveConvenienceCommands(triggerContext);
		cmd.setVisualizationSynchronizationMode(oFF.Viz2QmSynchronizationMode.NONE);
		let selectionPath = oFF.AuGdsGenericContextResolveUtil.resolveSelectionPath(triggerContext);
		cmd.clearSelectionPath(visualization);
		oFF.XCollectionUtils.forEach(selectionPath.getKeysAsReadOnlyList(), (dimSel) => {
			cmd.putSelectionPathElement(visualization, dimSel, selectionPath.getByKey(dimSel));
		});
		cmd.clearMemberRestrictions(visualization);
		let restrictionPath = oFF.AuGdsGenericContextResolveUtil.resolveRestrictionPath(triggerContext);
		oFF.XCollectionUtils.forEach(restrictionPath.getKeysAsReadOnlyList(), (dimRes) => {
			oFF.XCollectionUtils.forEach(restrictionPath.getByKey(dimRes), (memRes) => {
				cmd.putMemberRestriction(visualization, dimRes, memRes);
			});
		});
		let memberList = oFF.AuGdsGenericContextResolveUtil.resolveSecondaryMembers(triggerContext);
		if (oFF.XCollectionUtils.hasElements(memberList))
		{
			cmd.setKpiStructureType(visualization, oFF.DimensionType.SECONDARY_STRUCTURE);
		}
		else
		{
			memberList = oFF.AuGdsGenericContextResolveUtil.resolveMeasureMembers(triggerContext);
			cmd.setKpiStructureType(visualization, oFF.DimensionType.MEASURE_STRUCTURE);
		}
		if (oFF.XCollectionUtils.hasElements(memberList))
		{
			let size = memberList.size();
			cmd.setKpiMemberMain(visualization, memberList.get(0).getName());
			cmd.setKpiMemberTarget(visualization, memberList.get(oFF.XMath.min(1, size - 1)).getName());
			cmd.setKpiMemberDeviation(visualization, memberList.get(oFF.XMath.min(2, size - 1)).getName());
			cmd.setKpiMemberTrend(visualization, memberList.get(oFF.XMath.min(3, size - 1)).getName());
			cmd.setKpiMemberException(visualization, memberList.get(0).getName());
		}
		oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(triggerContext)();
	});
	registry.registerAction(actionName, action);
};
