oFF.AuGdsQueryBuilderDevActionsRegistrator.prototype.registerToggleTagMeasureVariance = function(registry, xLocalizationProvider)
{
	let action = oFF.CMEFactory.createToggleAction();
	action.setNameProvider((nameContext) => {
		return oFF.AuGdsQueryBuilderDevActionsRegistrator.ACTION_TOGGLE_MEASURE_TAG_VARIANCE;
	});
	action.setTextProvider((textContext) => {
		return "TAG VARIANCE";
	});
	action.setAvailableProvider((availableContext) => {
		return oFF.AuGdsGenericContextResolveUtil.resolveSingleStructureMemberFromTupleElement(availableContext) !== null;
	});
	action.setProvider((providerContext) => {
		let providerMember = oFF.AuGdsGenericContextResolveUtil.resolveSingleStructureMemberFromTupleElement(providerContext);
		return oFF.notNull(providerMember) && providerMember.getTagging().containsKey(oFF.OlapVisualizationConstants.STRUCTURE_MEMBER_VARIANCE_TAG);
	});
	action.setConsumer((consumerContext, value) => {
		let consumerMember = oFF.AuGdsGenericContextResolveUtil.resolveSingleStructureMemberFromTupleElement(consumerContext);
		let updateProcedure = oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(consumerContext);
		if (oFF.notNull(updateProcedure) && oFF.notNull(consumerMember))
		{
			if (value.getBoolean())
			{
				consumerMember.getTagging().putIfAbsent(oFF.OlapVisualizationConstants.STRUCTURE_MEMBER_VARIANCE_TAG, oFF.OlapVisualizationConstants.STRUCTURE_MEMBER_VARIANCE_TAG);
			}
			else
			{
				consumerMember.getTagging().remove(oFF.OlapVisualizationConstants.STRUCTURE_MEMBER_VARIANCE_TAG);
			}
			updateProcedure();
		}
	});
	registry.registerAction(oFF.AuGdsQueryBuilderDevActionsRegistrator.ACTION_TOGGLE_MEASURE_TAG_VARIANCE, action);
};
