oFF.AuGdsQueryBuilderDevActionsRegistrator.prototype.stylePath = function(context, name, formatter)
{
	let queryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(context);
	let updateProcedure = oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(context);
	let tableDefinition = oFF.AuGdsGenericContextResolveUtil.resolveTableDefinition(context);
	let tuple = oFF.AuGdsGenericContextResolveUtil.resolveSingleTuple(context);
	let dimensions = oFF.AuGdsGenericContextResolveUtil.resolveDimensions(context);
	if (oFF.notNull(queryModel) && oFF.notNull(updateProcedure) && oFF.notNull(tableDefinition) && oFF.XCollectionUtils.hasElements(dimensions) && oFF.notNull(tuple))
	{
		let tableMarkup = tableDefinition.getOrCreateTableMarkup(name, name);
		this.applyDimensionsPathToTableMarkup(dimensions, tuple, tableMarkup);
		formatter(tableMarkup);
		updateProcedure();
	}
};

