oFF.AuGdsPinnedToStoryUtils = function() {};
oFF.AuGdsPinnedToStoryUtils.prototype = new oFF.XObject();
oFF.AuGdsPinnedToStoryUtils.prototype._ff_c = "AuGdsPinnedToStoryUtils";

oFF.AuGdsPinnedToStoryUtils.create = function(process, currentFile)
{
	let instance = new oFF.AuGdsPinnedToStoryUtils();
	instance.m_currentFile = currentFile;
	instance.m_process = process;
	return instance;
};
oFF.AuGdsPinnedToStoryUtils.getPinnedStoryMetadata = function(currentFile)
{
	return oFF.XPromise.create((resolve, reject) => {
		currentFile.getAttributesForChanges().putBoolean(oFF.XFileAttribute.SAC_FETCH_LINKED_STORY, true);
		currentFile.processFetchMetadata(oFF.SyncType.NON_BLOCKING, oFF.XLambdaFileFetchMetadataListener.create((extResult, metadata) => {
			let resultTmp = extResult;
			if (resultTmp.hasErrors() || oFF.isNull(metadata))
			{
				resolve(null);
			}
			else
			{
				resolve(metadata);
			}
		}), null, oFF.XFileCachingType.ENFORCE_UPDATE);
	});
};
oFF.AuGdsPinnedToStoryUtils.prototype.m_currentFile = null;
oFF.AuGdsPinnedToStoryUtils.prototype.m_process = null;
oFF.AuGdsPinnedToStoryUtils.prototype._getInsightStoryLink = function()
{
	let buildLink = (metadata) => {
		let link = null;
		if (oFF.notNull(metadata) && oFF.XStringUtils.isNotNullAndNotEmpty(metadata.getStringByKey(oFF.XFileAttribute.SAC_LINKED_STORY_ID)))
		{
			let baseAppUrl = oFF.XStringTokenizer.splitString(this.m_process.getNetworkLocation().getUrl(), "#").get(0);
			link = oFF.PrFactory.createStructure();
			link.putString(oFF.OuQueryInformationDialog.MODEL_LINK_NAME, metadata.getStringByKey(oFF.XFileAttribute.SAC_LINKED_STORY_NAME));
			link.putString(oFF.OuQueryInformationDialog.MODEL_LINK_SRC, oFF.XStringUtils.concatenate4(baseAppUrl, "#/story2&/s2/", metadata.getStringByKey(oFF.XFileAttribute.SAC_LINKED_STORY_ID), "/?mode=view"));
			link.putString(oFF.OuQueryInformationDialog.MODEL_LINK_ICON, "sap-icon://fpa/stories");
		}
		return link;
	};
	return oFF.XPromise.create((resolve, reject) => {
		let attributes = this.m_currentFile.getAttributes();
		if (attributes.containsKey(oFF.XFileAttribute.SAC_EPM_OBJECT_ID) && !attributes.containsKey(oFF.XFileAttribute.SAC_LINKED_STORY_ID))
		{
			oFF.AuGdsPinnedToStoryUtils.getPinnedStoryMetadata(this.m_currentFile).onThen((metadata) => {
				resolve(buildLink(metadata));
			}).onFinally(() => {
				resolve(null);
			});
		}
		else
		{
			resolve(buildLink(this.m_currentFile.getAttributes()));
		}
	});
};
oFF.AuGdsPinnedToStoryUtils.prototype.getPinnedInsightLink = function()
{
	if (oFF.notNull(this.m_currentFile) && this.m_currentFile.getAttributes() !== null && this.m_currentFile.getAttributes().containsKey(oFF.XFileAttribute.UNIQUE_ID))
	{
		return this._getInsightStoryLink();
	}
	return oFF.XPromise.resolve(null);
};

