oFF.AuChartActionsRegistrator.prototype.checkAvailableDimensionMove = function(availableContext, color)
{
	let chartDefinition = oFF.AuChartContextUtil.resolveCurrentChartDefinitionViaQueryModel(availableContext);
	let chartTypesToExclude = oFF.XSetOfNameObject.create();
	chartTypesToExclude.add(oFF.ChartType.DOUGHNUT);
	chartTypesToExclude.add(oFF.ChartType.PIE);
	return this.isChartingPhase2(availableContext) && oFF.notNull(chartDefinition) && !chartTypesToExclude.contains(chartDefinition.getChartSetting().getChartType());
};
oFF.AuChartActionsRegistrator.prototype.checkAvailableMeasureMove = function(availableContext, value)
{
	let chartDefinition = oFF.AuChartContextUtil.resolveCurrentChartDefinitionViaQueryModel(availableContext);
	return this.isChartingPhase2(availableContext) && oFF.notNull(chartDefinition) && chartDefinition.getChartSetting().getChartType() === oFF.ChartType.LINE;
};
oFF.AuChartActionsRegistrator.prototype.checkAvailableMeasureMoveOnCombinationChart = function(availableContext, value)
{
	let chartDefinition = oFF.AuChartContextUtil.resolveCurrentChartDefinitionViaQueryModel(availableContext);
	if (!this.isChartingPhase3(availableContext) || oFF.isNull(chartDefinition))
	{
		return false;
	}
	let chartType = chartDefinition.getChartSetting().getChartType();
	return chartType === oFF.ChartType.COMB_COLUMN_LINE || chartType === oFF.ChartType.COMB_STACKED_COLUMN_LINE;
};
oFF.AuChartActionsRegistrator.prototype.checkEnabledDimensionMove = function(availableContext, valueType)
{
	let chartDefinition = oFF.AuChartContextUtil.resolveCurrentChartDefinitionViaQueryModel(availableContext);
	let chartTypesToExclude = oFF.XSetOfNameObject.create();
	let triggerDims = oFF.AuGdsGenericContextResolveUtil.resolveDimensions(availableContext);
	chartTypesToExclude.add(oFF.ChartType.DOUGHNUT);
	chartTypesToExclude.add(oFF.ChartType.PIE);
	let tvs = oFF.isNull(chartDefinition) || chartTypesToExclude.contains(chartDefinition.getChartSetting().getChartType()) ? null : chartDefinition.getChartSetting().getTypedValueSelectionsForType(valueType);
	let enabled = false;
	if (oFF.notNull(tvs))
	{
		let dimensionList = oFF.XStream.of(tvs).filter((a) => {
			return a.getDimensionMember() !== null;
		}).map((b) => {
			return b.getDimensionMember().getDimension();
		}).collect(oFF.XStreamCollector.toList());
		enabled = !oFF.XStream.of(triggerDims).allMatch((td) => {
			return dimensionList.contains(td);
		});
	}
	return enabled;
};
oFF.AuChartActionsRegistrator.prototype.checkEnabledMeasureMove = function(enabledContext, valueType)
{
	let chartDefinition = oFF.AuChartContextUtil.resolveCurrentChartDefinitionViaQueryModel(enabledContext);
	let triggerMem = oFF.AuGdsGenericContextResolveUtil.resolveSingleStructureMember(enabledContext);
	let tvs = oFF.isNull(chartDefinition) || oFF.ChartType.LINE !== chartDefinition.getChartSetting().getChartType() ? null : chartDefinition.getChartSetting().getTypedValueSelectionsForType(valueType);
	let enabled = false;
	if (oFF.notNull(tvs))
	{
		let memberList = oFF.XStream.of(tvs).map((b) => {
			return b.getDimensionMember();
		}).filterNullValues().collect(oFF.XStreamCollector.toList());
		enabled = !memberList.contains(triggerMem);
	}
	return enabled;
};
oFF.AuChartActionsRegistrator.prototype.checkEnabledMeasureMoveOnCombinationChart = function(enabledContext, valueType)
{
	let chartDefinition = oFF.AuChartContextUtil.resolveCurrentChartDefinitionViaQueryModel(enabledContext);
	if (oFF.isNull(chartDefinition))
	{
		return false;
	}
	let chartType = chartDefinition.getChartSetting().getChartType();
	if (chartType !== oFF.ChartType.COMB_COLUMN_LINE && chartType !== oFF.ChartType.COMB_STACKED_COLUMN_LINE)
	{
		return false;
	}
	let triggerMem = oFF.AuGdsGenericContextResolveUtil.resolveSingleStructureMember(enabledContext);
	let tvs = chartDefinition.getChartSetting().getTypedValueSelectionsForType(valueType);
	let enabled = false;
	if (oFF.notNull(tvs))
	{
		let memberList = oFF.XStream.of(tvs).map((b) => {
			return b.getDimensionMember();
		}).filterNullValues().collect(oFF.XStreamCollector.toList());
		enabled = !memberList.contains(triggerMem);
	}
	return enabled;
};
oFF.AuChartActionsRegistrator.prototype.getLocalizedActionWrapper = function(xLocalizationProvider)
{
	let registry = oFF.CMEMultiActionWrapper.create();
	this.registerMoveDimensionsToColors(registry, xLocalizationProvider);
	this.registerMoveDimensionsToCategories(registry, xLocalizationProvider);
	this.registerMoveMeasuresToYAxisLeft(registry, xLocalizationProvider);
	this.registerMoveMeasuresToYAxisRight(registry, xLocalizationProvider);
	this.registerMoveMeasuresToColumn(registry, xLocalizationProvider);
	this.registerMoveMeasuresToLine(registry, xLocalizationProvider);
	this.registerChartTypeActions(registry, xLocalizationProvider);
	this.registerChartOrientationActions(registry, xLocalizationProvider);
	this.registerChartStacking(registry, xLocalizationProvider);
	let valuePredicate = (ctpv, ctsv) => {
		return oFF.XBooleanValue.create(ctpv.isTypeOf(oFF.ChartType.BAR_COLUMN) || ctpv === oFF.ChartType.LINE || ctpv === oFF.ChartType.AREA || ctpv === oFF.ChartType.SCATTER_PLOT || ctpv === oFF.ChartType.BUBBLE || ctpv === oFF.ChartType.VARI_WIDE);
	};
	let valueSecondaryPredicate = (ctpvs, ctsvs) => {
		return oFF.XBooleanValue.create(ctpvs.isTypeOf(oFF.ChartType.BAR_COLUMN) && ctsvs !== oFF.ChartType.NONE || ctpvs === oFF.ChartType.SCATTER_PLOT || ctpvs === oFF.ChartType.BUBBLE || ctpvs === oFF.ChartType.VARI_WIDE);
	};
	let weightPredicate = (ctpw, ctsw) => {
		return oFF.XBooleanValue.create(ctpw === oFF.ChartType.TREE_MAP);
	};
	let sizePredicate = (ctps, ctss) => {
		return oFF.XBooleanValue.create(ctps === oFF.ChartType.BUBBLE || ctps === oFF.ChartType.PIE || ctps === oFF.ChartType.DOUGHNUT);
	};
	let colorPredicate = (ctpc, ctsc) => {
		return oFF.XBooleanValue.create(ctpc === oFF.ChartType.TREE_MAP || ctpc === oFF.ChartType.HEAT_MAP);
	};
	this.registerKeyFigureSelection(registry, xLocalizationProvider, oFF.VisualizationValueType.VALUE, oFF.AuChartActionsRegistrator.SELECTION_VISUALIZATION_VALUE_TYPE_VALUE, oFF.AuChartViewI18n.I18N_CV_CHART_VALUE, valuePredicate);
	this.registerKeyFigureSelection(registry, xLocalizationProvider, oFF.VisualizationValueType.VALUE_B, oFF.AuChartActionsRegistrator.SELECTION_VISUALIZATION_VALUE_TYPE_VALUE_SECONDARY, oFF.AuChartViewI18n.I18N_CV_CHART_VALUE_SECONDARY, valueSecondaryPredicate);
	this.registerKeyFigureSelection(registry, xLocalizationProvider, oFF.VisualizationValueType.WEIGHT, oFF.AuChartActionsRegistrator.SELECTION_VISUALIZATION_VALUE_TYPE_WEIGHT, oFF.AuChartViewI18n.I18N_CV_CHART_WEIGHT, weightPredicate);
	this.registerKeyFigureSelection(registry, xLocalizationProvider, oFF.VisualizationValueType.SIZE, oFF.AuChartActionsRegistrator.SELECTION_VISUALIZATION_VALUE_TYPE_SIZE, oFF.AuChartViewI18n.I18N_CV_CHART_SIZE, sizePredicate);
	this.registerKeyFigureSelection(registry, xLocalizationProvider, oFF.VisualizationValueType.COLOR, oFF.AuChartActionsRegistrator.SELECTION_VISUALIZATION_VALUE_TYPE_COLOR, oFF.AuChartViewI18n.I18N_CV_CHART_COLOR, colorPredicate);
	return registry;
};
oFF.AuChartActionsRegistrator.prototype.getTextDimensionMove = function(xLocalizationProvider, textContext, valType)
{
	let text = "";
	if (valType === oFF.VisualizationValueType.COLOR)
	{
		text = xLocalizationProvider.getText(oFF.AuChartViewI18n.I18N_CV_MOVE_DIMENSION_TO_COLORS);
	}
	else if (valType === oFF.VisualizationValueType.CATEGORY)
	{
		let chartDefinition = oFF.AuChartContextUtil.resolveCurrentChartDefinitionViaQueryModel(textContext);
		let chartType = null;
		if (oFF.notNull(chartDefinition) && chartDefinition.getChartSetting() !== null)
		{
			chartType = chartDefinition.getChartSetting().getChartType();
		}
		if (oFF.notNull(chartType) && (chartType.isTypeOf(oFF.ChartType.BAR) || chartType.isTypeOf(oFF.ChartType.STACKED_BAR)))
		{
			text = xLocalizationProvider.getText(oFF.AuChartViewI18n.I18N_CV_MOVE_DIMENSION_TO_Y_AXIS);
		}
		else
		{
			text = xLocalizationProvider.getText(oFF.AuChartViewI18n.I18N_CV_MOVE_DIMENSION_TO_X_AXIS);
		}
	}
	return text;
};
oFF.AuChartActionsRegistrator.prototype.isChartingPhase2 = function(availableContext)
{
	let document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(availableContext);
	let docConfig = oFF.isNull(document) ? null : document.getGdsConfiguration().getConfigJsonForDocumentType(document.getDocumentType());
	return oFF.isNull(docConfig) || docConfig.getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_CHARTING_PHASE2);
};
oFF.AuChartActionsRegistrator.prototype.isChartingPhase3 = function(availableContext)
{
	let document = oFF.AuGdsGenericContextResolveUtil.resolveQueryBuilderDocument(availableContext);
	let docConfig = oFF.isNull(document) ? null : document.getGdsConfiguration().getConfigJsonForDocumentType(document.getDocumentType());
	return oFF.isNull(docConfig) || docConfig.getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_NEW_CHART_TYPES);
};
oFF.AuChartActionsRegistrator.prototype.moveDimensionToFeed = function(triggerContext, valueType)
{
	let queryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(triggerContext);
	let triggerDims = oFF.AuGdsGenericContextResolveUtil.resolveDimensions(triggerContext);
	let chartDefinition = oFF.AuChartContextUtil.resolveCurrentChartDefinitionViaQueryModel(triggerContext);
	let updateCommand = oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(triggerContext);
	if (oFF.notNull(chartDefinition) && oFF.notNull(updateCommand) && oFF.notNull(queryModel) && oFF.XCollectionUtils.hasElements(triggerDims))
	{
		let cmd = queryModel.getChartCommands(chartDefinition.getName());
		for (let i = 0; i < triggerDims.size(); i++)
		{
			let triggerDim = triggerDims.get(i);
			cmd.moveDimensionToFeedAtIndex(triggerDim, valueType, -1);
		}
		updateCommand();
	}
};
oFF.AuChartActionsRegistrator.prototype.moveMeasureToFeed = function(triggerContext, valueType, oppositeValueType)
{
	let queryModel = oFF.AuGdsGenericContextResolveUtil.resolveQueryModel(triggerContext);
	let triggerValueHelpHierarchyNode = oFF.AuGdsGenericContextResolveUtil.resolveValueHelpHierarchyNode(triggerContext);
	let triggerMem = oFF.AuGdsGenericContextResolveUtil.resolveSingleStructureMember(triggerContext);
	let chartDefinition = oFF.AuChartContextUtil.resolveCurrentChartDefinitionViaQueryModel(triggerContext);
	let updateCommand = oFF.AuGdsGenericContextResolveUtil.resolveQueryUpdateProcedure(triggerContext);
	if (oFF.notNull(chartDefinition) && oFF.notNull(updateCommand) && oFF.notNull(queryModel) && (oFF.notNull(triggerValueHelpHierarchyNode) || oFF.notNull(triggerMem)))
	{
		if (oFF.notNull(triggerValueHelpHierarchyNode))
		{
			this.moveNodeToFeedRecursive(queryModel, chartDefinition.getChartSetting(), triggerValueHelpHierarchyNode, oppositeValueType, valueType);
		}
		else
		{
			this.moveMemberToFeedInternal(queryModel, chartDefinition.getChartSetting(), triggerMem, oppositeValueType, valueType);
		}
		updateCommand();
	}
};
oFF.AuChartActionsRegistrator.prototype.moveMemberToFeedInternal = function(queryModel, chartSetting, member, oppositeValueType, valueType)
{
	let newKeyfigureSelection = oFF.QKeyFigureSelection.create(queryModel, member, chartSetting.getChartDefinition(), valueType);
	chartSetting.removeTypedValueSelectionForDimensionMember(member, oppositeValueType);
	chartSetting.addTypedValueSelection(valueType, newKeyfigureSelection);
};
oFF.AuChartActionsRegistrator.prototype.moveNodeToFeedRecursive = function(queryModel, chartSetting, hierarchyValueHelpNode, oppositeValueType, valueType)
{
	this.moveMemberToFeedInternal(queryModel, chartSetting, hierarchyValueHelpNode.getDimensionMember(), oppositeValueType, valueType);
	oFF.XCollectionUtils.forEach(hierarchyValueHelpNode.getChildren(), (childNode) => {
		this.moveNodeToFeedRecursive(queryModel, chartSetting, childNode, oppositeValueType, valueType);
	});
};
oFF.AuChartActionsRegistrator.prototype.registerChartOrientationActions = function(registry, xLocalizationProvider)
{
	let chartOrientationHorizontal = oFF.CMEFactory.createSelectionOption();
	chartOrientationHorizontal.setNameProvider((horizontalName) => {
		return oFF.AuChartActionsRegistrator.SELECTION_CHART_ORIENTATION_HORIZONTAL;
	});
	chartOrientationHorizontal.setTextProvider((horizontalText) => {
		return xLocalizationProvider.getText(oFF.AuChartViewI18n.I18N_CV_CHART_ORIENTATION_HORIZONTAL);
	});
	chartOrientationHorizontal.setCustomObject(oFF.ChartOrientation.HORIZONTAL);
	registry.registerAction(oFF.AuChartActionsRegistrator.SELECTION_CHART_ORIENTATION_HORIZONTAL, chartOrientationHorizontal);
	let chartOrientationVertical = oFF.CMEFactory.createSelectionOption();
	chartOrientationVertical.setNameProvider((verticalName) => {
		return oFF.AuChartActionsRegistrator.SELECTION_CHART_ORIENTATION_VERTICAL;
	});
	chartOrientationVertical.setTextProvider((verticalText) => {
		return xLocalizationProvider.getText(oFF.AuChartViewI18n.I18N_CV_CHART_ORIENTATION_VERTICAL);
	});
	chartOrientationVertical.setCustomObject(oFF.ChartOrientation.VERTICAL);
	registry.registerAction(oFF.AuChartActionsRegistrator.SELECTION_CHART_ORIENTATION_VERTICAL, chartOrientationVertical);
	let primarySelectOptions = oFF.XList.create();
	primarySelectOptions.add(chartOrientationHorizontal);
	primarySelectOptions.add(chartOrientationVertical);
	let chartOrientation = oFF.CMEFactory.createSingleSelectAction();
	chartOrientation.setNameProvider((chartOrientationName) => {
		return oFF.AuChartActionsRegistrator.SELECTION_CHART_ORIENTATION;
	});
	chartOrientation.setTextProvider((chartOrientationText) => {
		return xLocalizationProvider.getText(oFF.AuChartViewI18n.I18N_CV_CHART_ORIENTATION);
	});
	chartOrientation.setOptionsRetriever((coo) => {
		return primarySelectOptions;
	});
	chartOrientation.setSelectionRetriever((cosr) => {
		let chartDefinitionCOSR = oFF.AuChartContextUtil.resolveChartDefinition(cosr);
		let cosrResult = chartOrientationHorizontal;
		if (oFF.notNull(chartDefinitionCOSR))
		{
			cosrResult = oFF.XStream.of(primarySelectOptions).find((pspo) => {
				return pspo.getCustomObject() === chartDefinitionCOSR.getChartSetting().getChartOrientation();
			}).orElse(chartOrientationHorizontal);
		}
		return cosrResult;
	});
	chartOrientation.setSelectionConsumer((cosc, coso) => {
		let chartDefinitionCOSC = oFF.AuChartContextUtil.resolveChartDefinition(cosc);
		let chartViewCOSC = oFF.AuChartContextUtil.resolveChartView(cosc);
		if (oFF.notNull(chartDefinitionCOSC) && oFF.notNull(chartViewCOSC))
		{
			chartDefinitionCOSC.getChartSetting().setChartOrientation(coso.getCustomObject());
			chartViewCOSC.updateChart();
		}
	});
	registry.registerAction(oFF.AuChartActionsRegistrator.SELECTION_CHART_ORIENTATION, chartOrientation);
};
