oFF.AuChartActionsRegistrator.prototype.registerKeyFigureSelection = function(registry, xLocalizationProvider, valueType, menuName, localizationKey, availabilityPredicate)
{
	let action = oFF.CMEFactory.createMultiSelectAction();
	action.setNameProvider((nameContext) => {
		return menuName;
	});
	action.setTextProvider((textContext) => {
		return xLocalizationProvider.getText(localizationKey);
	});
	action.setAvailableProvider((availabilityContext) => {
		let avChartDefinition = oFF.AuChartContextUtil.resolveChartDefinition(availabilityContext);
		let avChartSetting = oFF.isNull(avChartDefinition) ? null : avChartDefinition.getChartSetting();
		return oFF.notNull(avChartSetting) && availabilityPredicate(avChartSetting.getChartType(), avChartSetting.getChartType2()).getBoolean();
	});
	action.setSelectionRetriever((retrieverContext) => {
		let retrieverChartDefinition = oFF.AuChartContextUtil.resolveChartDefinition(retrieverContext);
		let selectedOptions = oFF.XList.create();
		if (oFF.notNull(retrieverChartDefinition))
		{
			selectedOptions = oFF.XStream.of(retrieverChartDefinition.getChartSetting().getTypedValueSelectionsForType(valueType)).map((retrieverKfs) => {
				let retrieverOption = oFF.CMEFactory.createSelectionOption();
				retrieverOption.setNameProvider((ron) => {
					return retrieverKfs.getDimensionMember().getName();
				});
				retrieverOption.setTextProvider((rot) => {
					return retrieverKfs.getDimensionMember().getText();
				});
				retrieverOption.setCustomObject(retrieverKfs.getDimensionMember());
				return retrieverOption;
			}).collect(oFF.XStreamCollector.toList());
		}
		return selectedOptions;
	});
	action.setSelectionConsumer((consumerContext, consumerOption, consumerValue) => {
		let consumerChartDefinition = oFF.AuChartContextUtil.resolveChartDefinition(consumerContext);
		let consumerChartView = oFF.AuChartContextUtil.resolveChartView(consumerContext);
		if (oFF.notNull(consumerChartView) && oFF.notNull(consumerChartDefinition))
		{
			let consumerChartSetting = consumerChartDefinition.getChartSetting();
			let consumerChartType = consumerChartSetting.getChartType();
			if (consumerChartType === oFF.ChartType.BUBBLE || consumerChartType === oFF.ChartType.PACKED_BUBBLE || consumerChartType === oFF.ChartType.PIE || consumerChartType === oFF.ChartType.HEAT_MAP || consumerChartType === oFF.ChartType.TREE_MAP || consumerChartType === oFF.ChartType.SCATTER_PLOT || consumerChartType === oFF.ChartType.VARI_WIDE && valueType === oFF.VisualizationValueType.VALUE_B)
			{
				consumerChartSetting.clearTypedValueSelectionsForType(valueType);
			}
			consumerChartSetting.addTypedValueSelection(valueType, oFF.QKeyFigureSelection.create(consumerChartDefinition.getContext(), consumerOption.getCustomObject(), consumerChartDefinition, valueType));
			consumerChartView.updateChart();
		}
	});
	action.setOptionsRetriever((optionsContext) => {
		let optionsChartConfiguration = oFF.AuChartContextUtil.resolveChartDefinition(optionsContext);
		let availableOptions = oFF.XList.create();
		if (oFF.notNull(optionsChartConfiguration))
		{
			let keyFigureDimension = optionsChartConfiguration.getKeyFigureDimension();
			let structureMembers = keyFigureDimension.getAllStructureMembers();
			availableOptions = oFF.XStream.of(structureMembers).map((optionsKfs) => {
				let availableOption = oFF.CMEFactory.createSelectionOption();
				availableOption.setNameProvider((aon) => {
					return optionsKfs.getName();
				});
				availableOption.setTextProvider((aot) => {
					return optionsKfs.getText();
				});
				availableOption.setCustomObject(optionsKfs);
				return availableOption;
			}).collect(oFF.XStreamCollector.toList());
		}
		return availableOptions;
	});
	registry.registerAction(menuName, action);
};
