oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater = function() {};
oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.prototype = new oFF.XObject();
oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.prototype._ff_c = "AuGdsQbConditionalFormattingFilterItemTokenUpdater";

oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.NO_VALUE_FILTER_VALUE = "";
oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.create = function(filterToken)
{
	let updater = new oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater();
	updater.m_filterToken = filterToken;
	return updater;
};
oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.prototype.m_filterToken = null;
oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.prototype.constructText = function(listDisplayTexts)
{
	let fullText = "";
	for (let i = 0; i < listDisplayTexts.size() - 1; )
	{
		let displayText = listDisplayTexts.get(i);
		if (listDisplayTexts.size() === 1)
		{
			continue;
		}
		fullText = oFF.XStringUtils.concatenate3(fullText, displayText.getStringRepresentation(), ", ");
		listDisplayTexts.removeElement(displayText);
	}
	if (listDisplayTexts.size() > 0)
	{
		fullText = oFF.XStringUtils.concatenate2(fullText, listDisplayTexts.get(0).getStringRepresentation());
	}
	return fullText;
};
oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.prototype.fetchAndUpdateMemberText = function()
{
	let dimension = this.m_filterToken.getFilterItem().getDimension();
	let values = this.m_filterToken.getFilterItem().getValues();
	oFF.XStream.of(values).filter((value1) => {
		return oFF.notNull(value1) && !oFF.XString.isEqual(value1.getStringRepresentation(), oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.NO_VALUE_FILTER_VALUE);
	}).forEach((value2) => {
		dimension.addSelectorFilterForKey(value2.getStringRepresentation(), oFF.ComparisonOperator.EQUAL);
	});
	dimension.processValueHelp(oFF.SyncType.NON_BLOCKING, this, null);
};
oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.prototype.getDimensionMemberFromFilterDialogValue = function(filterDialogValue)
{
	let filterDialogValueValueHelp = oFF.FilterDialogValueUtils.mapToValueHelpValue(filterDialogValue);
	if (oFF.notNull(filterDialogValueValueHelp))
	{
		return oFF.XOptional.ofNullable(filterDialogValueValueHelp.getValueHelpNode().getDimensionMember());
	}
	return oFF.XOptional.empty();
};
oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.prototype.getMemberNameFromFilterDialogValue = function(filterDialogValue)
{
	let dimensionMemberOpt = this.getDimensionMemberFromFilterDialogValue(filterDialogValue);
	return dimensionMemberOpt.isPresent() ? dimensionMemberOpt.get().getDisplayName() : filterDialogValue.getName();
};
oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.prototype.getMemberTextFromFilterDialogValue = function(filterDialogValue)
{
	let dimensionMemberOpt = this.getDimensionMemberFromFilterDialogValue(filterDialogValue);
	return dimensionMemberOpt.isPresent() ? dimensionMemberOpt.get().getDisplayDescription() : filterDialogValue.getText();
};
oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.prototype.getStaticValueDisplayText = function(value)
{
	if (oFF.isNull(value))
	{
		return oFF.XOptional.of(oFF.XStringValue.create(oFF.XLocalizationCenter.getCenter().getText(oFF.AuGdsFilterLineI18n.NULL_VALUE)));
	}
	if (oFF.XString.isEqual(value.getStringRepresentation(), oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.NO_VALUE_FILTER_VALUE))
	{
		return oFF.XOptional.of(oFF.XStringValue.create(oFF.XLocalizationCenter.getCenter().getText(oFF.AuGdsFilterLineI18n.NO_VALUE)));
	}
	return oFF.XOptional.empty();
};
oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.prototype.onValuehelpExecuted = function(extResult, resultSetContainer, customIdentifier)
{
	if (extResult.hasErrors())
	{
		oFF.XException.createRuntimeException(oFF.XStringUtils.concatenate3("Error getting descriptions for dimension members for dimension named '", this.m_filterToken.getFilterItem().getDimension().getName(), "'"));
	}
	let nodes = extResult.getData();
	let listDisplayTexts = oFF.XList.create();
	oFF.XStream.of(this.m_filterToken.getFilterItem().getValues()).forEach((value) => {
		let staticValueDisplayText = this.getStaticValueDisplayText(value);
		if (staticValueDisplayText.isPresent())
		{
			listDisplayTexts.add(staticValueDisplayText.get());
		}
		else
		{
			let nodeMatch = oFF.XStream.of(nodes).find((node) => {
				return (node.getDimensionMember().getValue().isEqualTo(value));
			});
			if (nodeMatch.isPresent())
			{
				let dimensionMemberText = nodeMatch.get().getDimensionMember().getDisplayDescription();
				if (oFF.notNull(dimensionMemberText) && oFF.XString.size(dimensionMemberText) > 0)
				{
					listDisplayTexts.add(oFF.XStringValue.create(dimensionMemberText));
				}
				else
				{
					listDisplayTexts.add(oFF.XStringValue.create(nodeMatch.get().getDimensionMember().getDisplayName()));
				}
			}
		}
	});
	let displayTokenDesc = this.constructText(listDisplayTexts);
	this.m_filterToken.setText(displayTokenDesc);
};
oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.prototype.updateFilterItemMemberText = function(filterSelection)
{
	if (oFF.isNull(filterSelection) || filterSelection.size() === 0)
	{
		this.fetchAndUpdateMemberText();
	}
	else
	{
		this.updateMemberText(filterSelection);
	}
};
oFF.AuGdsQbConditionalFormattingFilterItemTokenUpdater.prototype.updateMemberText = function(filterSelection)
{
	let listDisplayTexts = oFF.XList.create();
	oFF.XStream.of(filterSelection).forEach((selection) => {
		let filterValues = this.m_filterToken.getFilterItem().getValues();
		let staticValueDisplayText = this.getStaticValueDisplayText(selection.isNull() ? null : oFF.XStringValue.create(selection.getName()));
		if (staticValueDisplayText.isPresent())
		{
			listDisplayTexts.add(staticValueDisplayText.get());
		}
		else
		{
			let matchedSelection = oFF.XStream.of(filterValues).find((fValue) => {
				return oFF.notNull(fValue) && oFF.XString.isEqual(fValue.getStringRepresentation(), selection.getName());
			});
			if (matchedSelection.isPresent())
			{
				let dimensionMemberText = this.getMemberTextFromFilterDialogValue(selection);
				if (oFF.notNull(dimensionMemberText) && oFF.XString.size(dimensionMemberText) > 0)
				{
					listDisplayTexts.add(oFF.XStringValue.create(dimensionMemberText));
				}
				else
				{
					listDisplayTexts.add(oFF.XStringValue.create(this.getMemberNameFromFilterDialogValue(selection)));
				}
			}
		}
	});
	if (!listDisplayTexts.isEmpty())
	{
		let displayTokenDesc = this.constructText(listDisplayTexts);
		this.m_filterToken.setText(displayTokenDesc);
	}
};

oFF.AuGdsQbCFQueryModelDataProvider = function() {};
