oFF.AuGdsQbCFQueryModelDataProvider.prototype._ff_c = "AuGdsQbCFQueryModelDataProvider";

oFF.AuGdsQbCFQueryModelDataProvider.prototype.m_measureInputDataProvider = null;
oFF.AuGdsQbCFQueryModelDataProvider.prototype.m_primaryStructure = null;
oFF.AuGdsQbCFQueryModelDataProvider.prototype.getDimensionsToFilter = function()
{
	return oFF.XStream.of(this.m_queryModel.getDimensions()).filter((dimension) => {
		return this.shouldDimensionBeShown(dimension) && oFF.AuGdsQbCFQueryModelWrapper.isDimensionFilter(dimension);
	}).collect(oFF.XStreamCollector.toList());
};
oFF.AuGdsQbCFQueryModelDataProvider.prototype.getSecondaryStructure = function()
{
	if (this.m_queryModel.getSecondaryCalculationDimension() === null)
	{
		return oFF.XOptional.empty();
	}
	let secondaryStructure = this.m_queryModel.getSecondaryCalculationDimension() === this.m_primaryStructure ? this.m_queryModel.getPrimaryCalculationDimension() : this.m_queryModel.getSecondaryCalculationDimension();
	if (!secondaryStructure.getAllStructureMembers().isEmpty())
	{
		return oFF.XOptional.of(secondaryStructure);
	}
	return oFF.XOptional.empty();
};
oFF.AuGdsQbCFQueryModelDataProvider.prototype.hasMeasures = function()
{
	return this.m_measureInputDataProvider.getMeasures().hasElements() || this.hasMeasuresOnSecondaryStructures();
};
oFF.AuGdsQbCFQueryModelDataProvider.prototype.hasMeasuresOnSecondaryStructures = function()
{
	if (oFF.isNull(this.m_primaryStructure) || !this.getMemberFilterDimension().isPresent())
	{
		return false;
	}
	return oFF.OuMeasureInputDataProviderFactory.createWithStructure(this.m_queryModel, this.getMemberFilterDimension().get()).getMeasures().hasElements();
};
oFF.AuGdsQbCFQueryModelDataProvider.prototype.shouldDimensionBeShown = function(dim)
{
	if (!dim.getConvenienceCommands().isDimensionSupportingRowsOrColumns(dim.getName()))
	{
		return false;
	}
	if (!oFF.FilterDialogValueUtils.supportsFilterOnDimension(dim))
	{
		return false;
	}
	if (dim.isMeasureStructure())
	{
		return false;
	}
	if (oFF.QDimensionUtil.isStructureLike(dim))
	{
		return false;
	}
	let supportsGroupingDimension = dim.isGroupingDimension();
	return oFF.QDimensionUtil.shouldDimensionBeShown(dim, supportsGroupingDimension);
};

oFF.AuGdsQbConditionalFormattingNumberRuleCreator = function() {};
oFF.AuGdsQbConditionalFormattingNumberRuleCreator.prototype = new oFF.AuGdsQbAbstractConditionalFormattingOperator();
oFF.AuGdsQbConditionalFormattingNumberRuleCreator.prototype._ff_c = "AuGdsQbConditionalFormattingNumberRuleCreator";

oFF.AuGdsQbConditionalFormattingNumberRuleCreator.createNumberRule = function(queryModel)
{
	oFF.XObjectExt.assertNotNullExt(queryModel, "queryModel is null");
	let ruleCreator = new oFF.AuGdsQbConditionalFormattingNumberRuleCreator();
	ruleCreator.m_queryModel = queryModel;
	return ruleCreator;
};
oFF.AuGdsQbConditionalFormattingNumberRuleCreator.prototype.createFormulaException = function(newRule)
{
	return this.createFormulaExceptionAt(newRule, -1);
};
oFF.AuGdsQbConditionalFormattingNumberRuleCreator.prototype.createFormulaExceptionAt = function(newRule, i)
{
	let exceptionId = newRule.getId();
	let ruleName = newRule.getName();
	let structureMember = newRule.getStructureMember();
	let formulaExceptionManager = this.m_queryModel.getFormulaExceptionManager();
	let formulaException = formulaExceptionManager.newFormulaException(exceptionId, ruleName);
	if (i !== -1)
	{
		formulaExceptionManager.insert(i, formulaException);
	}
	else
	{
		formulaExceptionManager.add(formulaException);
	}
	formulaException.setAutoSignFlip(this.m_queryModel.getAccountDimension() !== null);
	formulaException.setBaseMeasure(structureMember);
	formulaException.setIsPrimaryMeasure(structureMember.getDimension().isEqualTo(this.m_queryModel.getPrimaryCalculationDimension()));
	formulaException.setFormulaExceptionType(oFF.FormulaExceptionType.BASE_MEASURE_ONLY);
	oFF.XStream.of(newRule.getFilters()).forEach((filterItem) => {
		oFF.XStream.of(filterItem.getValues()).forEach((filterItemValue) => {
			let evaluate = formulaException.addNewEvaluate(filterItem.getDimension(), filterItemValue);
			if (oFF.isNull(filterItemValue))
			{
				evaluate.setOperator(oFF.ComparisonOperator.IS_NULL);
			}
		});
	});
	formulaException.setEvaluateDefault(newRule.getEvaluateType());
	return formulaException;
};
oFF.AuGdsQbConditionalFormattingNumberRuleCreator.prototype.createRange = function(formulaException, newRule, rangeIdx, ruleIdx)
{
	let tableDefinition = this.m_queryModel.getVisualizationManager().getDefaultTableDefinition();
	if (oFF.isNull(tableDefinition))
	{
		throw oFF.XException.createRuntimeException("Table definition cannot be null when creating range for conditional formatting");
	}
	let range = newRule.getThreshold().getThresholdRanges().get(rangeIdx);
	let lowerBoundOperator = range.getLowerBoundOperator();
	let upperBoundOperator = range.getUpperBoundOperator();
	let lowerBoundValue = range.getLowerBound();
	let upperBoundValue = range.getUpperBound();
	let baseThresholdId = this.createThresholdId(newRule.getId(), rangeIdx, oFF.AuGdsQbConditionalFormattingConstants.NO_RANGE_PART, ruleIdx);
	if (oFF.notNull(lowerBoundOperator) && oFF.notNull(upperBoundOperator))
	{
		if (lowerBoundOperator.isRangeInclusive() === upperBoundOperator.isRangeInclusive())
		{
			let operator = lowerBoundOperator.isRangeInclusive() ? oFF.ComparisonOperator.BETWEEN : oFF.ComparisonOperator.BETWEEN_EXCLUDING;
			this.createThreshold(formulaException, baseThresholdId, operator, lowerBoundValue, upperBoundValue);
			oFF.AuGdsQbConditionalFormattingStyleCreator.createDataPointStyle(tableDefinition, baseThresholdId, newRule.getName(), range, newRule.getStyle());
		}
		else
		{
			let inclusiveValue = lowerBoundOperator.isRangeInclusive() ? lowerBoundValue : upperBoundValue;
			let thresholdIdA = this.createThresholdId(newRule.getId(), rangeIdx, oFF.AuGdsQbConditionalFormattingConstants.FIRST_RANGE_PART, ruleIdx);
			this.createThreshold(formulaException, thresholdIdA, oFF.ComparisonOperator.BETWEEN, inclusiveValue, inclusiveValue);
			oFF.AuGdsQbConditionalFormattingStyleCreator.createDataPointStyle(tableDefinition, thresholdIdA, newRule.getName(), range, newRule.getStyle());
			let thresholdIdB = this.createThresholdId(newRule.getId(), rangeIdx, oFF.AuGdsQbConditionalFormattingConstants.SECOND_RANGE_PART, ruleIdx);
			this.createThreshold(formulaException, thresholdIdB, oFF.ComparisonOperator.BETWEEN_EXCLUDING, lowerBoundValue, upperBoundValue);
			oFF.AuGdsQbConditionalFormattingStyleCreator.createDataPointStyle(tableDefinition, thresholdIdB, newRule.getName(), range, newRule.getStyle());
		}
	}
	else
	{
		if (oFF.notNull(lowerBoundOperator))
		{
			this.createThreshold(formulaException, baseThresholdId, lowerBoundOperator, lowerBoundValue, null);
			oFF.AuGdsQbConditionalFormattingStyleCreator.createDataPointStyle(tableDefinition, baseThresholdId, newRule.getName(), range, newRule.getStyle());
		}
		else
		{
			this.createThreshold(formulaException, baseThresholdId, upperBoundOperator, upperBoundValue, null);
			oFF.AuGdsQbConditionalFormattingStyleCreator.createDataPointStyle(tableDefinition, baseThresholdId, newRule.getName(), range, newRule.getStyle());
		}
	}
};
oFF.AuGdsQbConditionalFormattingNumberRuleCreator.prototype.createRule = function(newRule)
{
	this.createRuleAt(newRule, -1);
};
oFF.AuGdsQbConditionalFormattingNumberRuleCreator.prototype.createRuleAt = function(newRule, i)
{
	oFF.XObjectExt.assertNotNullExt(newRule, "rule is null");
	let formulaException = this.createFormulaExceptionAt(newRule, i);
	let ranges = newRule.getThreshold().getThresholdRanges();
	for (let rangeIdx = 0; rangeIdx < ranges.size(); rangeIdx++)
	{
		this.createRange(formulaException, newRule, rangeIdx, -1);
	}
};
oFF.AuGdsQbConditionalFormattingNumberRuleCreator.prototype.createThreshold = function(formulaException, thresholdId, operator, low, high)
{
	let threshold = formulaException.newThresholdWithName(thresholdId, low.getDouble(), oFF.AlertLevel.GOOD_1);
	threshold.setOperator(operator);
	if (oFF.notNull(high))
	{
		threshold.setHighValue(high.getDouble());
	}
	formulaException.addThreshold(threshold);
	return threshold;
};
oFF.AuGdsQbConditionalFormattingNumberRuleCreator.prototype.createThresholdId = function(ruleId, rangeIdx, rangePart, ruleIdx)
{
	let rangeIdxStr = oFF.XInteger.convertToString(rangeIdx);
	let ruleIdxStr = ruleIdx !== -1 ? oFF.XInteger.convertToString(ruleIdx) : "";
	return oFF.XStringUtils.concatenate4(ruleId, rangeIdxStr, rangePart, ruleIdxStr);
};

oFF.AuGdsQbConditionalFormattingRuleCreatorBW = function() {};
oFF.AuGdsQbConditionalFormattingRuleCreatorBW.prototype = new oFF.AuGdsQbAbstractConditionalFormattingOperator();
oFF.AuGdsQbConditionalFormattingRuleCreatorBW.prototype._ff_c = "AuGdsQbConditionalFormattingRuleCreatorBW";

oFF.AuGdsQbConditionalFormattingRuleCreatorBW.prototype.createFormulaExceptionSegment = function(newRule, measure, structure, structIdx, i)
{
	let formulaException = this.createFormulaException(newRule, i);
	let ranges = newRule.getThreshold().getThresholdRanges();
	for (let rangeIdx = 0; rangeIdx < ranges.size(); rangeIdx++)
	{
		this.createRange(formulaException, newRule, rangeIdx, structIdx);
	}
	let exceptionId = oFF.XStringUtils.concatenate3(formulaException.getName(), "#", oFF.XInteger.convertToString(structIdx));
	formulaException.setName(exceptionId);
	if (oFF.notNull(measure))
	{
		formulaException.setMeasure(measure);
	}
	if (oFF.notNull(structure))
	{
		formulaException.setStructure(structure);
	}
};
oFF.AuGdsQbConditionalFormattingRuleCreatorBW.prototype.createRule = function(newRule)
{
	this.createRuleAt(newRule, -1);
};
oFF.AuGdsQbConditionalFormattingRuleCreatorBW.prototype.createRuleAt = function(newRule, i)
{
	oFF.XObjectExt.assertNotNullExt(newRule, "rule is null");
	let primaryStructureMembers = this.getPrimaryStructureMembersFromFilters(newRule);
	let secondaryStructureMembers = this.getSecondaryStructureMembersFromFilters(newRule);
	if (primaryStructureMembers.size() === 0 && secondaryStructureMembers.size() === 0)
	{
		this.createRuleBase(newRule, i);
		return;
	}
	if (primaryStructureMembers.size() === 0)
	{
		primaryStructureMembers.add(newRule.getStructureMember());
	}
	let structIdx = 1;
	let primaryStructMembersIterator = primaryStructureMembers.getIterator();
	while (primaryStructMembersIterator.hasNext())
	{
		let measure = primaryStructMembersIterator.next();
		let secondaryStructMembersIterator = secondaryStructureMembers.getIterator();
		if (!secondaryStructMembersIterator.hasNext())
		{
			this.createFormulaExceptionSegment(newRule, measure, null, structIdx, i);
			structIdx = structIdx + 1;
		}
		while (secondaryStructMembersIterator.hasNext())
		{
			let structure = secondaryStructMembersIterator.next();
			this.createFormulaExceptionSegment(newRule, measure, structure, structIdx, i);
			structIdx = structIdx + 1;
		}
	}
};
oFF.AuGdsQbConditionalFormattingRuleCreatorBW.prototype.getPrimaryStructureMembersFromFilters = function(newRule)
{
	let filterOnPrimaryStruct = oFF.XStream.of(newRule.getFilters()).find((filter1) => {
		return filter1.getDimension().isStructure() && filter1.getDimension().isEqualTo(newRule.getStructureMember().getDimension());
	});
	let primaryStructureMembers = oFF.XList.create();
	if (filterOnPrimaryStruct.isPresent())
	{
		let primaryDimension = filterOnPrimaryStruct.get().getDimension();
		primaryStructureMembers = oFF.XStream.of(filterOnPrimaryStruct.get().getValues()).map((value1) => {
			return primaryDimension.getStructureMember(value1.getStringRepresentation());
		}).collect(oFF.XStreamCollector.toList());
	}
	return primaryStructureMembers;
};
oFF.AuGdsQbConditionalFormattingRuleCreatorBW.prototype.getSecondaryStructureMembersFromFilters = function(newRule)
{
	let filtersOnSecondaryStruct = oFF.XStream.of(newRule.getFilters()).find((filter2) => {
		return filter2.getDimension().isStructure() && !filter2.getDimension().isEqualTo(newRule.getStructureMember().getDimension());
	});
	let secondaryStructureMembers = oFF.XList.create();
	if (filtersOnSecondaryStruct.isPresent())
	{
		let secondaryDimension = filtersOnSecondaryStruct.get().getDimension();
		secondaryStructureMembers = oFF.XStream.of(filtersOnSecondaryStruct.get().getValues()).map((value2) => {
			return secondaryDimension.getStructureMember(value2.getStringRepresentation());
		}).collect(oFF.XStreamCollector.toList());
	}
	return secondaryStructureMembers;
};

oFF.AuGdsQbConditionalFormattingRuleLister = function() {};
oFF.AuGdsQbConditionalFormattingRuleLister.prototype = new oFF.AuGdsQbAbstractConditionalFormattingOperator();
oFF.AuGdsQbConditionalFormattingRuleLister.prototype._ff_c = "AuGdsQbConditionalFormattingRuleLister";

oFF.AuGdsQbConditionalFormattingRuleLister.create = function(queryModel)
{
	let ruleLister = new oFF.AuGdsQbConditionalFormattingRuleLister();
	ruleLister.m_queryModel = queryModel;
	return ruleLister;
};
oFF.AuGdsQbConditionalFormattingRuleLister.prototype.findModelFormulaExceptions = function(structureMember)
{
	let formulaExceptionManager = this.m_queryModel.getFormulaExceptionManager();
	let validRules = oFF.XList.create();
	let ruleReader = oFF.AuGdsQbConditionalFormattingRuleReader.create(this.m_queryModel);
	let modelFormulaExceptions = formulaExceptionManager.getAllModelFormulaExceptions();
	let modelFormulaExceptionsIterator = modelFormulaExceptions.getIterator();
	while (modelFormulaExceptionsIterator.hasNext())
	{
		let modelException = modelFormulaExceptionsIterator.next();
		let modelBaseMeasure = modelException.getBaseMeasure();
		if (oFF.isNull(modelBaseMeasure))
		{
			modelBaseMeasure = this.m_queryModel.getStructureByName(modelException.getBaseMeasureName());
		}
		let isMeasureStructurePresent = oFF.notNull(modelBaseMeasure);
		if (this.isValidFormulaExceptionName(modelException.getName()) && isMeasureStructurePresent && (oFF.isNull(structureMember) || modelBaseMeasure.isEqualTo(structureMember)))
		{
			validRules.add(ruleReader.readRuleFromModelExceptionManager(this.getFormulaExceptionName(modelException.getName())));
		}
	}
	return validRules;
};
oFF.AuGdsQbConditionalFormattingRuleLister.prototype.getExceptionName = function(exceptionName)
{
	return oFF.XString.substring(exceptionName, 0, oFF.XString.indexOf(exceptionName, oFF.AuGdsQbConditionalFormattingConstants.EXCEPTION_RANGE_SEPARATOR));
};
oFF.AuGdsQbConditionalFormattingRuleLister.prototype.getFormulaExceptionName = function(formulaExceptionName)
{
	return oFF.XString.substring(formulaExceptionName, 0, oFF.XString.indexOf(formulaExceptionName, oFF.AuGdsQbConditionalFormattingConstants.FORMULA_EXCEPTION_SEPARATOR));
};
oFF.AuGdsQbConditionalFormattingRuleLister.prototype.isValidExceptionName = function(exceptionName)
{
	if (oFF.isNull(exceptionName))
	{
		return false;
	}
	if (!oFF.XString.containsString(exceptionName, oFF.AuGdsQbConditionalFormattingConstants.EXCEPTION_STRUCTURE_SEPARATOR))
	{
		return true;
	}
	return oFF.XString.endsWith(exceptionName, oFF.AuGdsQbConditionalFormattingConstants.EXCEPTION_FIRST_SEGMENT);
};
oFF.AuGdsQbConditionalFormattingRuleLister.prototype.isValidFormulaExceptionName = function(formulaExceptionName)
{
	if (oFF.isNull(formulaExceptionName))
	{
		return false;
	}
	if (!oFF.XString.containsString(formulaExceptionName, oFF.AuGdsQbConditionalFormattingConstants.FORMULA_EXCEPTION_SEPARATOR))
	{
		return true;
	}
	return oFF.XString.endsWith(formulaExceptionName, oFF.AuGdsQbConditionalFormattingConstants.FORMULA_EXCEPTION_FIRST_SEGMENT);
};
oFF.AuGdsQbConditionalFormattingRuleLister.prototype.listAllRules = function()
{
	return this.listAllRulesForMember(null);
};
oFF.AuGdsQbConditionalFormattingRuleLister.prototype.listAllRulesForMember = function(structureMember)
{
	let validRules = oFF.XList.create();
	validRules.addAll(this.readFormulaExceptionManager((structureMember)));
	validRules.addAll(this.readExceptionManager(structureMember));
	return validRules;
};
oFF.AuGdsQbConditionalFormattingRuleLister.prototype.readExceptionManager = function(structureMember)
{
	let exceptionManager = this.m_queryModel.getExceptionManager();
	let tableDefinitions = this.getTableDefinitions();
	if (tableDefinitions.isEmpty())
	{
		oFF.XLogger.println("Conditional Formatting: No table definition found");
		return oFF.XList.create();
	}
	let ruleReader = oFF.AuGdsQbConditionalFormattingRuleReader.create(this.m_queryModel);
	let validRules = oFF.XList.create();
	let exceptionList = exceptionManager.getValuesAsReadOnlyList();
	let exceptionIterator = exceptionList.getIterator();
	while (exceptionIterator.hasNext())
	{
		let exception = exceptionIterator.next();
		let measure = exception.getMeasure();
		if (this.isValidExceptionName(exception.getName()) && (oFF.isNull(structureMember) || measure.isEqualTo(structureMember)))
		{
			let rule = ruleReader.readRuleFromExceptionManager(this.getExceptionName(exception.getName()));
			let foundRule = oFF.XStream.of(validRules).find((validRule) => {
				return (oFF.XString.isEqual(validRule.getName(), rule.getName()) && validRule.getStructureMember().isEqualTo(rule.getStructureMember()));
			});
			if (!foundRule.isPresent())
			{
				validRules.add(rule);
			}
		}
	}
	return validRules;
};
oFF.AuGdsQbConditionalFormattingRuleLister.prototype.readFormulaExceptionManager = function(structureMember)
{
	let formulaExceptionManager = this.m_queryModel.getFormulaExceptionManager();
	let tableDefinitions = this.getTableDefinitions();
	if (tableDefinitions.isEmpty())
	{
		oFF.XLogger.println("Conditional Formatting: No table definition found");
		return oFF.XList.create();
	}
	let ruleReader = oFF.AuGdsQbConditionalFormattingRuleReader.create(this.m_queryModel);
	let validRules = oFF.XList.create();
	let formulaExceptionsList = formulaExceptionManager.getValuesAsReadOnlyList();
	let exceptionIterator = formulaExceptionsList.getIterator();
	while (exceptionIterator.hasNext())
	{
		let formulaException = exceptionIterator.next();
		let baseMeasure = formulaException.getBaseMeasure();
		if (oFF.isNull(baseMeasure))
		{
			baseMeasure = this.m_queryModel.getStructureByName(formulaException.getBaseMeasureName());
		}
		let isMeasureStructurePresent = oFF.notNull(baseMeasure);
		if (this.isValidFormulaExceptionName(formulaException.getName()) && isMeasureStructurePresent && (oFF.isNull(structureMember) || baseMeasure.isEqualTo(structureMember)))
		{
			let thresholdIterator = formulaException.getThresholds().getIterator();
			let areThresholdsValid = true;
			while (thresholdIterator.hasNext())
			{
				let threshold = thresholdIterator.next();
				let dataPointStyles = this.getDataPointStyleByExceptionName(tableDefinitions, threshold.getName());
				if (dataPointStyles.isEmpty() || dataPointStyles.get(0).getFormattingStyle() === null)
				{
					areThresholdsValid = false;
				}
			}
			if (areThresholdsValid)
			{
				validRules.add(ruleReader.readRuleFromFormulaExceptionManager(this.getFormulaExceptionName(formulaException.getName())));
			}
		}
	}
	validRules.addAll(this.findModelFormulaExceptions(structureMember));
	return validRules;
};

