oFF.AuGenAiServiceImpl.prototype.createTableMetadata = function(dataProvider, normalizeColumnsName)
{
	let tableMetadata = oFF.PrStructure.create();
	let dataList = oFF.PrList.create();
	let headerList = oFF.PrList.create();
	let queryManager = dataProvider.getQueryManager();
	let resultSet = queryManager.getClassicResultSet();
	let referenceGrid = oFF.ReferenceGridFactory.createReferenceGridSimple(resultSet);
	referenceGrid.setFormattingCellFn((dataCell) => {
		return dataCell.getValueType().isNumber() ? oFF.XNumberFormatter.formatDoubleToString(dataCell.getDouble(), "0.####") : dataCell.getFormattedValue();
	});
	let res = referenceGrid.exportForProtocol(oFF.ProtocolBindingType.SAC_TABLE_GRID);
	let colCount = res.getIntegerByKey("ColCount");
	let rowCount = res.getIntegerByKey("RowCount");
	let cells = res.getListByKey("Cells");
	let cellIndex = 0;
	for (; cellIndex < colCount; cellIndex++)
	{
		let cell = cells.getStructureAt(cellIndex);
		let headerName = cell.getStringByKey("Value");
		if (normalizeColumnsName)
		{
			let indexOfDot = oFF.XString.indexOf(headerName, ".");
			if (indexOfDot > -1)
			{
				headerName = oFF.XString.substring(headerName, 0, indexOfDot);
			}
		}
		headerList.addString(headerName);
	}
	for (let rowIndex = 0; rowIndex < rowCount; rowIndex++)
	{
		try
		{
			if (cellIndex >= cells.size())
			{
				cellIndex = cells.size() - 1;
			}
			let firsCellofRow = cells.getStructureAt(cellIndex);
			if (firsCellofRow.getBooleanByKey("Totals"))
			{
				break;
			}
			let row = oFF.PrStructure.create();
			for (let colIndex = 0; colIndex < colCount && cellIndex < cells.size(); colIndex++, cellIndex++)
			{
				let cell = cells.getStructureAt(cellIndex);
				let type = cell.getStringByKey("Type");
				if (oFF.XString.isEqual(type, "Number"))
				{
					row.putDouble(headerList.get(colIndex).asString().getString(), oFF.XDouble.convertFromString(cell.getStringByKey("Value")));
				}
				else
				{
					row.putString(headerList.get(colIndex).asString().getString(), cell.getStringByKey("Value"));
				}
			}
			if (row.size() === colCount)
			{
				dataList.add(row);
			}
		}
		catch (e)
		{
			continue;
		}
	}
	tableMetadata.put("header", headerList);
	tableMetadata.put("data", dataList);
	return tableMetadata;
};
