oFF.AuGdsQbConditionalFormattingRuleReaderException = function() {};
oFF.AuGdsQbConditionalFormattingRuleReaderException.prototype = new oFF.AuGdsQbConditionalFormattingRuleReaderBase();
oFF.AuGdsQbConditionalFormattingRuleReaderException.prototype._ff_c = "AuGdsQbConditionalFormattingRuleReaderException";

oFF.AuGdsQbConditionalFormattingRuleReaderException.create = function(queryModel)
{
	let ruleReader = new oFF.AuGdsQbConditionalFormattingRuleReaderException();
	ruleReader.setupCommon(queryModel);
	return ruleReader;
};
oFF.AuGdsQbConditionalFormattingRuleReaderException.prototype.getAllStructuresForException = function(exception)
{
	if (oFF.XString.indexOf(exception.getName(), oFF.AuGdsQbConditionalFormattingConstants.EXCEPTION_STRUCTURE_SEPARATOR) === -1)
	{
		return oFF.XList.create();
	}
	let exceptions = this.getQueryModel().getExceptionManager().getAllExceptionsOfMeasure(exception.getMeasure());
	let exceptionNameToMatch = oFF.XString.substring(exception.getName(), 0, oFF.XString.indexOf(exception.getName(), oFF.AuGdsQbConditionalFormattingConstants.EXCEPTION_STRUCTURE_SEPARATOR));
	return oFF.XStream.of(exceptions).filter((xcptn1) => {
		return oFF.XString.containsString(xcptn1.getName(), exceptionNameToMatch) && xcptn1.getStructure() !== null;
	}).map((xcptn2) => {
		return xcptn2.getStructure();
	}).collect(oFF.XStreamCollector.toList());
};
oFF.AuGdsQbConditionalFormattingRuleReaderException.prototype.getAllThresholdsForException = function(exception)
{
	let thresholds = oFF.XList.create();
	let exceptions = this.getQueryModel().getExceptionManager().getAllExceptionsOfMeasure(exception.getMeasure());
	let exceptionNameToMatch = oFF.XString.substring(exception.getName(), 0, oFF.XString.indexOf(exception.getName(), oFF.AuGdsQbConditionalFormattingConstants.EXCEPTION_RANGE_SEPARATOR));
	oFF.XStream.of(exceptions).forEach((xcptn) => {
		if (oFF.XString.containsString(xcptn.getName(), exceptionNameToMatch))
		{
			thresholds.addAll(xcptn.getThresholds());
		}
	});
	return thresholds;
};
oFF.AuGdsQbConditionalFormattingRuleReaderException.prototype.isEvaluateAllMembers = function(exception)
{
	let primaryDimension = this.getQueryModel().getPrimaryCalculationDimension();
	let isEvaluateAllMembersPrimaryStruct = exception.isEvaluateAllMembers(primaryDimension);
	let secondaryDimension = this.getQueryModel().getSecondaryCalculationDimension();
	let isEvaluateAllMembersSecondaryStruct = oFF.isNull(secondaryDimension) || exception.isEvaluateAllMembers(secondaryDimension);
	return isEvaluateAllMembersPrimaryStruct && isEvaluateAllMembersSecondaryStruct;
};
oFF.AuGdsQbConditionalFormattingRuleReaderException.prototype.processThreshold = function(threshold, tableDefinitions, rangeMap, rangeIdList, ruleBuilder, compareType, isRatioVarianceCalculated)
{
	let thresholdDataPointStyle = this.getDataPointStyleByExceptionName(tableDefinitions, threshold.getName());
	let dataPointStyle = null;
	if (threshold.getQueryModel().getExceptionManager().getByKey(threshold.getException().getName()).isChangeable())
	{
		if (thresholdDataPointStyle.isEmpty())
		{
			thresholdDataPointStyle = this.getDataPointStyleByExceptionName(tableDefinitions, threshold.getException().getName());
		}
		if (!thresholdDataPointStyle.isEmpty())
		{
			dataPointStyle = thresholdDataPointStyle.get(0);
		}
	}
	if (oFF.notNull(dataPointStyle))
	{
		let dataPointTableStyle = dataPointStyle.getFormattingStyle();
		let rangeId = dataPointTableStyle.getName();
		if (!rangeMap.containsKey(rangeId))
		{
			rangeIdList.add(oFF.XStringValue.create(rangeId));
		}
		rangeMap.put(rangeId, this.readRange(threshold, dataPointTableStyle, rangeMap, ruleBuilder, compareType, isRatioVarianceCalculated));
	}
};
oFF.AuGdsQbConditionalFormattingRuleReaderException.prototype.readException = function(ruleId)
{
	let exceptionManager = this.getQueryModel().getExceptionManager();
	let exception = exceptionManager.getByKey(ruleId);
	if (oFF.isNull(exception))
	{
		exception = exceptionManager.getByKey(oFF.XStringUtils.concatenate2(ruleId, oFF.AuGdsQbConditionalFormattingConstants.EXCEPTION_FIRST_SEGMENT));
		return oFF.XOptional.ofNullable(exception);
	}
	else
	{
		return oFF.XOptional.of(exception);
	}
};
oFF.AuGdsQbConditionalFormattingRuleReaderException.prototype.readRuleFromExceptionManager = function(ruleId)
{
	let exception = this.readException(ruleId).get();
	let ruleBuilder = oFF.AuGdsQbConditionalFormattingRuleBuilder.create();
	ruleBuilder.setId(ruleId);
	let ruleName = this.getRuleName(ruleId);
	if (ruleName.isPresent())
	{
		ruleBuilder.setName(ruleName.get().toString());
	}
	else
	{
		ruleBuilder.setName(exception.getText());
	}
	ruleBuilder.setEvaluateType(exception.getEvaluateDefault());
	ruleBuilder.setIsEditable(exception.isChangeable());
	let measureDimension = exception.getMeasure() !== null ? exception.getMeasure().getDimension() : null;
	let structureDimension = exception.getStructure() !== null ? exception.getStructure().getDimension() : null;
	let useStructureAsBaseMeasure = exception.isEvaluateAllMembers(measureDimension) && !exception.isEvaluateAllMembers(structureDimension) && exception.getStructure() !== null;
	let structures = this.getAllStructuresForException(exception);
	if (!structures.isEmpty())
	{
		ruleBuilder.addFilter(oFF.AuGdsQbConditionalFormattingFilterItem.createFromStructureMembers(structures.get(0).getDimension(), structures));
	}
	else
	{
		let structMember = useStructureAsBaseMeasure ? exception.getMeasure() : exception.getStructure();
		if (oFF.notNull(structMember))
		{
			ruleBuilder.addFilter(oFF.AuGdsQbConditionalFormattingFilterItem.createFromEvaluate(structMember.getDimension(), exception.getEvaluates()));
		}
	}
	ruleBuilder.setStructureMember(useStructureAsBaseMeasure ? exception.getStructure() : exception.getMeasure());
	ruleBuilder.setIsEvaluateAllMembers(this.isEvaluateAllMembers(exception));
	let compareType = oFF.AuGdsQbConditionalFormattingThresholdCompareType.NUMBER_RANGE;
	let refMeasure = null;
	let thresholds = this.getAllThresholdsForException(exception);
	ruleBuilder.setThreshold(oFF.AuGdsQbConditionalFormattingThreshold.create(compareType, this.readRanges(thresholds, ruleBuilder, compareType, true), refMeasure));
	let dimensions = oFF.XSetOfNameObject.create();
	oFF.XStream.of(exception.getEvaluates()).filter((evaluate) => {
		return !oFF.QDimensionUtil.isStructureLike(evaluate.getDimension());
	}).forEach((evaluate) => {
		dimensions.add(evaluate.getDimension());
	});
	oFF.XStream.of(dimensions).forEach((dimension) => {
		ruleBuilder.addFilter(oFF.AuGdsQbConditionalFormattingFilterItem.createFromEvaluate(dimension, exception.getEvaluates()));
	});
	return ruleBuilder.build();
};

