{
	let qbDoc = this.getParentDocument();
	return qbDoc.getQueryController();
};
oFF.AuGdsQbChartView.prototype._getVisualizationDefinition = function()
{
	let chartDefinition = this._getChartDefinition();
	if (oFF.isNull(chartDefinition))
	{
		chartDefinition = this._getQueryController().getVisualizationDefinitionForId(this.getUuid());
	}
	if (oFF.notNull(chartDefinition))
	{
		let chartSetting = chartDefinition.getChartSetting();
		if (chartSetting.getChartType() === null)
		{
			chartSetting.setChartType(oFF.ChartType.BAR);
		}
		if (chartSetting.getChartType2() === null)
		{
			chartSetting.setChartType2(oFF.ChartType.NONE);
		}
		if (chartSetting.getChartStackingType() === null)
		{
			chartSetting.setChartStackingType(oFF.ChartStackingType.NONE);
		}
		if (chartSetting.getChartOrientation() === null)
		{
			let barOrBarColumn = chartSetting.getChartType() === oFF.ChartType.BAR || chartSetting.getChartType() === oFF.ChartType.BAR_COLUMN;
			let chartOrientation = barOrBarColumn ? oFF.ChartOrientation.HORIZONTAL : oFF.ChartOrientation.VERTICAL;
			chartSetting.setChartOrientation(chartOrientation);
		}
	}
	return chartDefinition;
};
oFF.AuGdsQbChartView.prototype._setViewNameByChartDefIfPossible = function()
{
	if (this._getChartDefinition() !== null)
	{
		let chartType = this._getChartDefinition().getChartSetting().getChartType();
		this.setViewName(chartType.getName());
	}
};
oFF.AuGdsQbChartView.prototype._setVisualizationDefinitionId = function(chartDef)
{
	this.m_chartDef = chartDef;
};
