oFF.AuGdsQbChartView.prototype.buildViewUi = function(genesis)
{
	this.m_wrapper = genesis.newControl(oFF.UiType.FLEX_LAYOUT);
	this.m_wrapper.useMaxSpace();
	this.m_wrapper.setDirection(oFF.UiFlexDirection.ROW);
	this.m_chart = this.m_useVizInstanceRenderer ? oFF.AuHiChartView.createWithVizInstanceRenderer(genesis) : oFF.AuHiChartView.create(genesis);
	oFF.UiFramework.currentFramework().getAvailableThirdPartyLibraries().onThen((str) => {
		let highchartsVersion = str.getStringByKey("highcharts");
		this.m_chart.setIsNewHighchartsVersion(oFF.XString.isEqual("11.3.0", highchartsVersion));
	});
	this.m_chart.addContextFiller(this.getParentDocument());
	this.m_chart.setMenuActionConfigHandler(this.getParentDocument().getMenuManager());
	this.m_chart.setMenuPopulator(this.getParentDocument().getMenuManager());
	this.m_chart.setListBasedRendering(this.m_listBasedRendering);
	this.m_chart.setChartAccessibilityEnabled(this.m_chartAccessibilityEnabled);
	this.m_chart.setUnitInformationConsumer(this.m_unitInformationConsumer);
	this.m_wrapper.addItem(this.m_chart.getView());
	genesis.setRoot(this.m_wrapper);
};
