oFF.AuGdsQbInteractiveTableContextActionsHelper.getSortDirection = function(context, field, sortPath, measure)
{
	let caps = context.getModelCapabilities();
	let direction = oFF.XSortDirection.DEFAULT_VALUE;
	let supportsComplex = caps.supportsComplexSorting();
	let supportsDataCell = caps.supportsDataCellSorting();
	if (oFF.notNull(sortPath) && (supportsComplex || supportsDataCell))
	{
		let complexSorting = null;
		let sortingManager = context.getQueryModel().getSortingManager();
		if (supportsComplex)
		{
			complexSorting = sortingManager.getComplexSorting(sortPath, false);
		}
		if (oFF.isNull(complexSorting) && supportsDataCell)
		{
			complexSorting = sortingManager.getDataCellSorting(sortPath, false);
		}
		if (oFF.notNull(complexSorting))
		{
			direction = complexSorting.getDirection();
		}
	}
	else if (oFF.notNull(measure) && caps.supportsMeasureSorting())
	{
		let measureSorting = context.getQueryModel().getSortingManager().getMeasureSorting(measure, false);
		if (oFF.notNull(measureSorting))
		{
			direction = measureSorting.getDirection();
		}
	}
	else if (oFF.notNull(field))
	{
		let dimension = field.getDimension();
		let dimSortType = oFF.AuGdsQbInteractiveTableContextActionsHelper.resolveDimensionSortType(field);
		if (caps.supportsFieldSorting(field))
		{
			let fieldSorting = context.getQueryModel().getSortingManager().getFieldSorting(field, false);
			if (oFF.notNull(fieldSorting) && fieldSorting.getCustomSort() === null && !oFF.AuGdsQbInteractiveTableContextActionsHelper.isFallbackFieldSort(field))
			{
				direction = fieldSorting.getDirection();
			}
		}
		if (direction === oFF.XSortDirection.DEFAULT_VALUE && caps.supportsDimensionSorting(dimension, dimSortType))
		{
			let dimensionSorting = context.getQueryModel().getSortingManager().getDimensionSorting(dimension, false);
			if (oFF.notNull(dimensionSorting) && dimensionSorting.getSortingType() === dimSortType && dimensionSorting.getCustomSort() === null)
			{
				direction = dimensionSorting.getDirection();
			}
		}
	}
	return direction;
};
oFF.AuGdsQbInteractiveTableContextActionsHelper.isFallbackFieldSort = function(fieldSelField)
{
	let result = false;
	if (fieldSelField.getPresentationType().isTypeOf(oFF.PresentationType.ABSTRACT_KEY))
	{
		let dimension = fieldSelField.getDimension();
		result = oFF.XStream.of(fieldSelField.getQueryModel().getSortingManager().getSortingOperations()).filter((so) => {
			return so.getSortingType() === oFF.SortType.FIELD && so.getField().getDimension() === dimension;
		}).map((sor) => {
			return sor.getField().getPresentationType();
		}).anyMatch((pt) => {
			return !pt.isTypeOf(oFF.PresentationType.ABSTRACT_KEY);
		});
	}
	return result;
};
