oFF.AuGdsQbInteractiveTableContextActionsHelper.sortInDirection = function(context, direction, field, sortPath, measure, secondaryStructureMember, leadingAxisType)
{
	let cmd = context.getQueryManager().getConvenienceCommands();
	let caps = context.getModelCapabilities();
	let sortingManager = context.getQueryManager().getQueryModel().getSortingManager();
	let supportsComplex = caps.supportsComplexSorting();
	let supportsDataCell = caps.supportsDataCellSorting();
	if (oFF.XCollectionUtils.hasElements(sortPath) && (supportsComplex || supportsDataCell))
	{
		let sortAxis = sortPath.get(0).getDimension().getAxisType();
		cmd.clearSort(oFF.SortType.MEASURE, null);
		cmd.clearSort(oFF.SortType.DATA_CELL_VALUE, sortAxis.getName());
		cmd.clearSort(oFF.SortType.COMPLEX, null);
		if (supportsComplex)
		{
			sortingManager.getComplexSorting(sortPath, true).setDirection(direction);
		}
		else
		{
			sortingManager.getDataCellSorting(sortPath, true).setDirection(direction);
		}
	}
	else if (oFF.notNull(measure) && caps.supportsMeasureSorting())
	{
		cmd.clearSort(oFF.SortType.DATA_CELL_VALUE, null);
		cmd.clearSort(oFF.SortType.COMPLEX, null);
		cmd.sortByQueryDataCell(measure.getName(), oFF.isNull(secondaryStructureMember) ? null : secondaryStructureMember.getName(), direction, leadingAxisType);
	}
	else if (oFF.notNull(field))
	{
		let dimension = field.getDimension();
		sortingManager.removeDimensionSorting(dimension);
		cmd.clearSort(oFF.SortType.ABSTRACT_DIMENSION_SORT, dimension.getName());
		cmd.clearSort(oFF.SortType.COMPLEX, null);
		let axisType = dimension.getAxisType();
		let orthogonalAxisType = oFF.AxisType.getOrthogonalTypeForAxis(axisType);
		if (oFF.notNull(orthogonalAxisType))
		{
			cmd.clearSort(oFF.SortType.DATA_CELL_VALUE, orthogonalAxisType.getName());
			if (cmd.getQueryModel().getMeasureDimension() !== null && cmd.getQueryModel().getMeasureDimension().getAxisType() === orthogonalAxisType)
			{
				cmd.clearSort(oFF.SortType.MEASURE, null);
			}
		}
		let presentationType = field.getPresentationType();
		let dimSortType = oFF.AuGdsQbInteractiveTableContextActionsHelper.resolveDimensionSortType(field);
		if (caps.supportsFieldSorting(field))
		{
			if (direction !== oFF.XSortDirection.DEFAULT_VALUE)
			{
				cmd.sort(oFF.SortType.FIELD, dimension.getDimensionType(), dimension.getName(), presentationType, field.getName(), null, direction);
				let fieldPresentationType = field.getPresentationType();
				if (!fieldPresentationType.isTypeOf(oFF.PresentationType.ABSTRACT_KEY))
				{
					let fieldContainer = field.getAttribute();
					if (oFF.isNull(fieldContainer))
					{
						fieldContainer = field.getDimension();
					}
					let displayKeyField = fieldContainer.getDisplayKeyField();
					if (oFF.notNull(displayKeyField))
					{
						cmd.sort(oFF.SortType.FIELD, dimension.getDimensionType(), dimension.getName(), oFF.PresentationType.DISPLAY_KEY, displayKeyField.getName(), null, direction);
					}
				}
			}
		}
		else if (oFF.notNull(dimSortType) && caps.supportsDimensionSorting(dimension, dimSortType))
		{
			if (direction === oFF.XSortDirection.DEFAULT_VALUE)
			{
				if (dimension.getDimensionType().isTypeOf(oFF.DimensionType.MEASURE_STRUCTURE) && dimension.getQueryManager().getSystemType().isTypeOf(oFF.SystemType.BW))
				{
					let dimensionSorting = sortingManager.getDimensionSorting(dimension, true);
					dimensionSorting.setSortByKey();
					dimensionSorting.setDirection(direction);
					dimensionSorting.setCustomSort(oFF.XStream.of(dimension.getStructureLayout()).collect(oFF.XStreamCollector.toListOfString((input) => {
						return input.getName();
					})));
				}
			}
			else
			{
				cmd.sort(dimSortType, dimension.getDimensionType(), dimension.getName(), presentationType, null, null, direction);
			}
		}
	}
};

