oFF.AuGdsDimensionMemberFieldValueRetriever = function() {};
oFF.AuGdsDimensionMemberFieldValueRetriever.prototype = new oFF.XObjectExt();
oFF.AuGdsDimensionMemberFieldValueRetriever.prototype._ff_c = "AuGdsDimensionMemberFieldValueRetriever";

oFF.AuGdsDimensionMemberFieldValueRetriever.create = function(dimension)
{
	let instance = new oFF.AuGdsDimensionMemberFieldValueRetriever();
	instance.m_dimension = oFF.XObjectExt.assertNotNull(dimension);
	instance.m_dimensionMembers = oFF.XHashMapByString.create();
	return instance;
};
oFF.AuGdsDimensionMemberFieldValueRetriever.prototype.m_descriptionField = null;
oFF.AuGdsDimensionMemberFieldValueRetriever.prototype.m_dimension = null;
oFF.AuGdsDimensionMemberFieldValueRetriever.prototype.m_dimensionMembers = null;
oFF.AuGdsDimensionMemberFieldValueRetriever.prototype.m_displayIdField = null;
oFF.AuGdsDimensionMemberFieldValueRetriever.prototype.m_ignoreQueryDynamicFilter = false;
oFF.AuGdsDimensionMemberFieldValueRetriever.prototype.m_linkedReject = null;
oFF.AuGdsDimensionMemberFieldValueRetriever.prototype.m_linkedResolve = null;
oFF.AuGdsDimensionMemberFieldValueRetriever.prototype.m_mainPromise = null;
oFF.AuGdsDimensionMemberFieldValueRetriever.prototype.addSelectorField = function(selectorFieldToAdd)
{
	let selectorFields = this.m_dimension.getSelectorFields();
	if (!oFF.XCollectionUtils.contains(selectorFields, (selectorField) => {
		return selectorField.isEqualTo(selectorFieldToAdd);
	}))
	{
		selectorFields.add(selectorFieldToAdd);
	}
};
oFF.AuGdsDimensionMemberFieldValueRetriever.prototype.addSelectorFilter = function(dimensionMember)
{
	let field = dimensionMember.getFilteredField();
	let filterValue = dimensionMember.getKeyForSelector();
	this.m_dimensionMembers.put(filterValue, dimensionMember);
	if (oFF.isNull(field))
	{
		this.logWarning("Filter line - filtered field is empty. Fall back to key field for filtering.");
		this.addSelectorFilterForKeyField(filterValue);
	}
	else
	{
		let fields = oFF.XList.create();
		fields.add(field);
		let addFilterSucceeded = this.m_dimension.addSelectorFilterForFields(filterValue, fields, oFF.ComparisonOperator.EQUAL, false, false);
		if (!addFilterSucceeded)
		{
			this.addSelectorFilterForKeyField(filterValue);
		}
	}
};
oFF.AuGdsDimensionMemberFieldValueRetriever.prototype.addSelectorFilterForKeyField = function(filterValue)
{
	this.m_dimension.addSelectorFilterForKey(filterValue, oFF.ComparisonOperator.EQUAL);
};
oFF.AuGdsDimensionMemberFieldValueRetriever.prototype.getLogLayer = function()
{
	return oFF.OriginLayer.APPLICATION;
};
oFF.AuGdsDimensionMemberFieldValueRetriever.prototype.onValuehelpExecuted = function(extResult, resultSetContainer, customIdentifier)
{
	if (this.m_dimension.getQueryModel() !== null)
	{
		this.m_dimension.getQueryModel().setIgnoreQueryDynamicFilterInValueHelp(this.m_ignoreQueryDynamicFilter);
	}
	if (extResult.hasErrors())
	{
		this.logError3(this.getClassName(), "Error getting descriptions for dimension members for dimension named ", this.m_dimension.getName());
		this.m_linkedReject(null);
		return;
	}
	let nodes = extResult.getData();
	if (oFF.isNull(nodes))
	{
		this.logWarning3(this.getClassName(), "No descriptions for dimension members for dimension named '", this.m_dimension.getName());
		this.m_linkedReject(null);
		return;
	}
	let result = oFF.XHashMapByString.create();
	for (let j = 0; j < nodes.size(); j++)
	{
		let dimensionMember = nodes.get(j).getDimensionMember();
		let dimensionMemberValueExtractor = oFF.AuGdsDimensionMemberValueExtractor.create(dimensionMember);
		let key = dimensionMemberValueExtractor.getKey();
		let originalMemberDetails = this.m_dimensionMembers.getByKey(key);
		let memberDetails = oFF.AuGdsDimensionMemberDetails.create(key, dimensionMemberValueExtractor.getDisplayId(), dimensionMemberValueExtractor.getDescription());
		memberDetails.setDimension(this.m_dimension);
		memberDetails.setSourceFilterValueBag(oFF.notNull(originalMemberDetails) ? originalMemberDetails.getSourceFilterValueBag() : null);
		memberDetails.setHierarchyName(this.m_dimension.getSelectorHierarchyName());
		memberDetails.setFilteredField(oFF.notNull(originalMemberDetails) ? originalMemberDetails.getFilteredField() : null);
		memberDetails.setDisplayIdField(this.m_displayIdField);
		memberDetails.setDescriptionField(this.m_descriptionField);
		result.put(key, memberDetails);
	}
	this.m_linkedResolve(result);
};
oFF.AuGdsDimensionMemberFieldValueRetriever.prototype.releaseObject = function()
{
	this.m_mainPromise = null;
	this.m_linkedResolve = null;
	this.m_linkedReject = null;
	this.m_dimension = null;
	this.m_dimensionMembers = oFF.XObjectExt.release(this.m_dimensionMembers);
	this.m_displayIdField = null;
	this.m_descriptionField = null;
	oFF.XObjectExt.prototype.releaseObject.call( this );
};
oFF.AuGdsDimensionMemberFieldValueRetriever.prototype.retrieve = function(dimensionMembers)
{
	oFF.XObjectExt.assertNotNull(dimensionMembers);
	this.m_dimension.clearSelectorFilter();
	this.m_displayIdField = this.m_dimension.getSelectorDisplayKeyField();
	this.addSelectorField(this.m_displayIdField);
	let selectorFieldInRS = oFF.QDimensionUtil.getTextFieldUsedInResultSet(this.m_dimension, this.m_dimension.isSelectorHierarchyActive());
	this.m_descriptionField = oFF.notNull(selectorFieldInRS) ? selectorFieldInRS : this.m_dimension.getSelectorTextField();
	this.addSelectorField(this.m_descriptionField);
	for (let k = 0; k < dimensionMembers.size(); k++)
	{
		this.addSelectorFilter(dimensionMembers.get(k));
	}
	this.m_mainPromise = oFF.XPromise.create((resolve, reject) => {
		this.m_linkedResolve = resolve;
		this.m_linkedReject = reject;
	});
	this.m_ignoreQueryDynamicFilter = this.m_dimension.getQueryModel().isValueHelpIgnoreQueryDynamicFilter();
	this.m_dimension.getQueryModel().setIgnoreQueryDynamicFilterInValueHelp(true);
	this.m_dimension.setSelectorGettingInterval(false);
	this.m_dimension.processValueHelp(oFF.SyncType.NON_BLOCKING, this, null);
	return this.m_mainPromise;
};
oFF.AuGdsDimensionMemberFieldValueRetriever.prototype.setHierarchySelector = function(hierarchyName)
{
	let isHierarchyGiven = oFF.notNull(hierarchyName);
	if (isHierarchyGiven)
	{
		this.m_dimension.setSelectorHierarchyName(hierarchyName);
	}
	this.m_dimension.setSelectorHierarchyActive(isHierarchyGiven);
};

