{
	oFF.XCollectionUtils.forEach(oFF.AuGdsDocumentType.getAllTypes(), (docType) => {
		let displayName = docType.getDisplayName();
		let docTypeTile = tileContainer.addNewTile(displayName, displayName, docType.getIcon(), (controlEvent) => {
			this.newDocumentWithType(docType);
		});
		docTypeTile.setTooltip(docType.getDescription());
		if (!docType.isAvailable())
		{
			docTypeTile.setLoadState(oFF.UiLoadState.DISABLED);
			docTypeTile.setTooltip("Coming soon!");
		}
	});
};
