oFF.AuGdsHomeView.prototype.reloadRecentFilesList = function()
{
	if (oFF.notNull(this.m_recentFileTable))
	{
		let recentFiles = this.getSettingsManager().getRecentFilesList();
		this.m_recentFileTable.clearResponsiveTableRows();
		let recentFilesIterator = recentFiles.getIterator();
		while (recentFilesIterator.hasNext())
		{
			let filePathStr = recentFilesIterator.next();
			let fileName = oFF.XString.substring(filePathStr, oFF.XString.lastIndexOf(filePathStr, "/") + 1, -1);
			let tmpListItem = this.m_recentFileTable.addNewResponsiveTableRow();
			tmpListItem.setTag(oFF.AuGdsHomeView.GDS_HW_RECENT_FILES_ITEM_TAG);
			let fileNameCell = tmpListItem.addNewResponsiveTableCell();
			fileNameCell.setText(fileName);
			let pathCell = tmpListItem.addNewResponsiveTableCell();
			pathCell.setText(filePathStr);
		}
		this.updateRecentFilesCount(recentFiles.size());
	}
};
oFF.AuGdsHomeView.prototype.setupInternal = function(controller, listener)
{
	this.m_controller = controller;
	this.m_listener = listener;
	this.prepareUi();
};
oFF.AuGdsHomeView.prototype.updateRecentFilesCount = function(count)
{
	if (oFF.notNull(this.m_recentFileLabel))
	{
		let text = oFF.XStringUtils.concatenate3("Recent Files (", oFF.XInteger.convertToString(count), ")");
		this.m_recentFileLabel.setText(text);
	}
};

