	this.m_boilerplateFiles.put("ui5.yaml", "${ff_sdk}/production/resources/programs/proteus/templates/ui5.yaml");
	this.m_boilerplateFiles.put("package.json", "${ff_sdk}/production/resources/programs/proteus/templates/package.json");
