oFF.AuGdsDfDocument.prototype.canScheduleFile = function()
{
	let canSchedule = false;
	if (this.hasFile())
	{
		let fileAttributes = this.getFile().getAttributes();
		let fileSubType = fileAttributes.getStringByKey(oFF.XFileAttribute.NODE_SUB_TYPE);
		if (oFF.XString.isEqual(fileSubType, oFF.AuGdsQbSacContentlibConstants.INSIGHT))
		{
			let userProfile = this.getProcess().getUserProfile();
			if (this.getFeatureManager().isSacIntegration() && oFF.notNull(userProfile) && userProfile.arePrivilegesAvailable())
			{
				let hasScheduleCreatePrivilege = userProfile.hasPrivilegeOnType(oFF.AuGdsQbSacPrivilegeConstants.AUTH_GROUP_SCHEDULE, oFF.AuGdsQbSacPrivilegeConstants.PRIVILEGE_CREATE);
				let hasPublicFileCreatePrivilege = userProfile.hasPrivilegeOnType(oFF.AuGdsQbSacPrivilegeConstants.AUTH_GROUP_PUBLIC_FILE, oFF.AuGdsQbSacPrivilegeConstants.PRIVILEGE_CREATE);
				let hasPrivateFileCreatePrivilege = userProfile.hasPrivilegeOnType(oFF.AuGdsQbSacPrivilegeConstants.AUTH_GROUP_PRIVATE_FILE, oFF.AuGdsQbSacPrivilegeConstants.PRIVILEGE_CREATE);
				let canUpdateFile = fileAttributes.getBooleanByKeyExt(oFF.XFileAttribute.CAN_UPDATE, false);
				let canCopyFile = fileAttributes.getBooleanByKeyExt(oFF.XFileAttribute.CAN_COPY, false);
				canSchedule = hasScheduleCreatePrivilege && (canCopyFile || canUpdateFile) && (hasPrivateFileCreatePrivilege || hasPublicFileCreatePrivilege);
			}
		}
	}
	return canSchedule;
};
