	let hasSavePrivilege = true;
	let userProfile = this.getProcess().getUserProfile();
	if (this.getFeatureManager().isSacIntegration() && oFF.notNull(userProfile) && userProfile.arePrivilegesAvailable())
	{
		hasSavePrivilege = userProfile.hasPrivilegeOnType(oFF.AuGdsQbSacPrivilegeConstants.AUTH_GROUP_PUBLIC_FILE, oFF.AuGdsQbSacPrivilegeConstants.PRIVILEGE_CREATE) || userProfile.hasPrivilegeOnType(oFF.AuGdsQbSacPrivilegeConstants.AUTH_GROUP_PRIVATE_FILE, oFF.AuGdsQbSacPrivilegeConstants.PRIVILEGE_CREATE) || userProfile.hasPrivilegeOnType(oFF.AuGdsQbSacPrivilegeConstants.AUTH_GROUP_PRIVATE_INSIGHT, oFF.AuGdsQbSacPrivilegeConstants.PRIVILEGE_CREATE);
	}
	return hasSavePrivilege;
