oFF.AuGdsDfDocument.prototype.onFileSave = function(extResult, consumer)
{
	if (!extResult.hasErrors())
	{
		this.handleDocumentSaved(extResult.getData());
	}
	if (oFF.notNull(consumer))
	{
		consumer(extResult);
	}
};
oFF.AuGdsDfDocument.prototype.openFile = function(file)
{
	this.setBusy(true);
	return this.getFileManager().loadJsonFromFile(file).onThenExt((loadedJson) => {
		let success = this.initDocContentAndFile(loadedJson, file);
		if (!success)
		{
			throw oFF.XException.createRuntimeException("Unknown document");
		}
		return file;
	}).onCatch((errMsg) => {
		this.getLogger().logError(errMsg.getText());
		this.getMessageCenter().showErrorToast(this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.MSG_ERROR));
		throw oFF.XException.createException(errMsg.getText());
	}).onFinally(() => {
		this.setBusy(false);
	});
};
oFF.AuGdsDfDocument.prototype.performAction = function(contextAccess, actionId)
{
	let saveHandler = (extResult) => {
		this.getController().handleDocumentSave(extResult);
	};
	if (oFF.XString.isEqual(actionId, oFF.AuGdsConstants.ACTION_DOCUMENT_LOAD))
	{
		this.getController().openPressed();
	}
	else if (oFF.XString.isEqual(actionId, oFF.AuGdsConstants.ACTION_DOCUMENT_CLOSE))
	{
		this.getController().closeActiveDocumentSafe();
	}
	else if (oFF.XString.isEqual(actionId, oFF.AuGdsConstants.ACTION_DOCUMENT_SAVE))
	{
		if (this.hasFile())
		{
			this.executeSave(saveHandler);
		}
		else
		{
			this.executeSaveAs(saveHandler);
		}
	}
	else if (oFF.XString.isEqual(actionId, oFF.AuGdsConstants.ACTION_DOCUMENT_SAVE_AS))
	{
		if (this.hasSaveData())
		{
			this.executeSaveAs(saveHandler);
		}
	}
	else if (oFF.XString.isEqual(actionId, oFF.AuGdsConstants.ACTION_DOCUMENT_UNDO))
	{
		if (this.hasUndoSteps())
		{
			this.executeUndo();
		}
	}
	else if (oFF.XString.isEqual(actionId, oFF.AuGdsConstants.ACTION_DOCUMENT_REDO))
	{
		if (this.hasRedoSteps())
		{
			this.executeRedo();
		}
	}
	else if (oFF.XString.isEqual(actionId, oFF.AuGdsConstants.ACTION_CLIPBOARD_CUT))
	{
		if (this.canClipboardCut())
		{
			this.executeClipboardCut();
		}
	}
	else if (oFF.XString.isEqual(actionId, oFF.AuGdsConstants.ACTION_CLIPBOARD_COPY))
	{
		if (this.canClipboardCopy())
		{
			this.executeClipboardCopy();
		}
	}
	else if (oFF.XString.isEqual(actionId, oFF.AuGdsConstants.ACTION_CLIPBOARD_PASTE))
	{
		if (this.canClipboardPaste())
		{
			let data = this.getClipboardManager().getClipboardData();
			if (oFF.notNull(data))
			{
				this.executeClipboardPaste(data);
			}
		}
	}
};
