oFF.AuGdsDfDocument.prototype.releaseObject = function()
{
	this.m_supportedToolbarActions.clear();
	this.m_supportedToolbarActions = oFF.XObjectExt.release(this.m_supportedToolbarActions);
	this.m_documentSubApplication = null;
	this.m_controller = null;
	this.m_listener = null;
	this.m_documentTabItem = oFF.XObjectExt.release(this.m_documentTabItem);
	this.m_documentView = null;
	this.m_file = null;
	this.m_docContent = oFF.XObjectExt.release(this.m_docContent);
	this.m_statusMessageType = null;
	this.m_docTitle = null;
	this.m_docIcon = null;
	this.m_genesis = oFF.XObjectExt.release(this.m_genesis);
	this.m_menuButtons = oFF.XObjectExt.release(this.m_menuButtons);
	this.m_toolbarGroups = oFF.XObjectExt.release(this.m_toolbarGroups);
	this.m_toolbarFixedSection = oFF.XObjectExt.release(this.m_toolbarFixedSection);
	this.m_headerWidgets = oFF.XObjectExt.release(this.m_headerWidgets);
	this.m_panelController = oFF.XObjectExt.release(this.m_panelController);
	if (oFF.notNull(this.m_documentArguments))
	{
		this.removeDocumentArguments();
	}
	oFF.XObjectExt.prototype.releaseObject.call( this );
};
