oFF.AuGdsDfDocument.prototype.setStatusWarning = function(message)
{
	this.setStatus(message, oFF.UiMessageType.WARNING);
};
oFF.AuGdsDfDocument.prototype.setTabItemTooltip = function(tooltip)
{
	if (oFF.notNull(this.m_documentTabItem))
	{
		this.m_documentTabItem.setTooltip(tooltip);
	}
};
oFF.AuGdsDfDocument.prototype.setTitle = function(title)
{
	this.m_docTitle = title;
	if (oFF.notNull(this.m_documentTabItem))
	{
		this.m_documentTabItem.setText(title);
	}
	if (oFF.notNull(this.m_listener))
	{
		this.m_listener.onDocumentTitleChanged(this, title);
	}
};
oFF.AuGdsDfDocument.prototype.setupDocContentAndFile = function(extDoc, file)
{
	let isDocumentValid = false;
	if (oFF.notNull(extDoc))
	{
		let docContent = this.createDocumentContent(extDoc);
		isDocumentValid = this.isValidDocumentContent(docContent);
		if (isDocumentValid)
		{
			if (oFF.notNull(file))
			{
				this.markPristine();
			}
			else
			{
				this.markDirty();
			}
			this.setFile(file);
			let documentName = docContent.getDocumentName();
			if (oFF.XStringUtils.isNotNullAndNotEmpty(documentName))
			{
				this.setDocumentName(documentName);
			}
			this.m_docContent = docContent;
			this.m_isEmptyDocument = false;
		}
	}
	if (!isDocumentValid)
	{
		this.getMessageCenter().showErrorToast(oFF.AuGdsQbTextContants.INVALID_DOCUMENT);
	}
};
oFF.AuGdsDfDocument.prototype.setupDocument = function(controller, file, fileJson, documentArguments, listener)
{
	if (oFF.isNull(controller))
	{
		throw oFF.XException.createRuntimeException("Error while creating a gds document. Missing controller!");
	}
	this.m_uuid = oFF.XGuid.getGuid();
	this.m_controller = controller;
	this.m_listener = listener;
	this.m_isVisible = false;
	this.m_docTitle = "";
	this.m_docIcon = "";
	this.m_isDirty = false;
	this.m_isEmptyDocument = true;
	let mainApplication = controller.getProcess().getApplication();
	this.m_documentSubApplication = mainApplication.newSubApplication(controller.getProcess().newChildProcess(oFF.ProcessType.SERVICE));
	this.m_menuButtons = oFF.XList.create();
	this.m_toolbarGroups = oFF.XList.create();
	this.m_toolbarFixedSection = oFF.XList.create();
	this.m_headerWidgets = oFF.XList.create();
	this.m_documentFeatures = oFF.XProperties.create();
	this.initDocumentArguments(documentArguments);
	this.initPanelController();
	this.createDocumentView(this.m_controller.getGenesis());
	this.setBusy(true);
	let initialSetupPromise = this.doInitialSetup();
	if (oFF.isNull(initialSetupPromise))
	{
		this._finalizeSetup(file, fileJson);
		this.setBusy(false);
	}
	else
	{
		initialSetupPromise.onThen((success) => {
			this._finalizeSetup(file, fileJson);
		}).onCatch((errMsg) => {
			let errorText = errMsg.getText();
			let messageCenter = this.getMessageCenter();
			this.getLogger().logError(errorText);
			messageCenter.showErrorToast(this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.MSG_ERROR));
			throw oFF.XException.createException(errorText);
		}).onFinally(() => {
			this.setBusy(false);
		});
	}
};
oFF.AuGdsDfDocument.prototype.togglePanel = function(panelType)
{
	return this.getPanelController().togglePanel(panelType);
};
oFF.AuGdsDfDocument.prototype.updateArgs = function()
{
	this.getArgumentsManager().refreshAruments();
};
oFF.AuGdsDfDocument.prototype.updateCurrentDocumentFileAndJson = function(docJson, docFile)
{
	if (oFF.notNull(docJson))
	{
		this.setupDocContentAndFile(docJson, docFile);
		if (!this.isEmptyDocument())
		{
			this.handleNewDocContentLoaded();
		}
	}
};
oFF.AuGdsDfDocument.prototype.updateFileArgument = function(file)
{
	if (oFF.notNull(file))
	{
		this.getDocumentArgStruct().putString(oFF.DfProgram.PARAM_FILE, file.getUri().getPath());
	}
	else
	{
		this.getDocumentArgStruct().remove(oFF.DfProgram.PARAM_FILE);
	}
	this.onFileArgumentUpdated(file);
	this.updateArgs();
};
oFF.AuGdsDfDocument.prototype.updateTitle = function()
{
	let customTitle = this.getDocumentCustomTitle();
	let customToolName = this.getCustomToolName();
	if (oFF.XStringUtils.isNotNullAndNotEmpty(this.getDocumentName()))
	{
		this.setTitle(this.getDocumentName());
		this.setTabItemTooltip(this.getDocumentType().getDisplayName());
	}
	else if (this.hasFile())
	{
		this.setTitle(this.getFile().getUri().getPathContainer().getFileName());
		this.setTabItemTooltip(this.getFile().getUri().getPath());
	}
	else if (oFF.XStringUtils.isNotNullAndNotEmpty(customTitle))
	{
		this.setTitle(customTitle);
		this.setTabItemTooltip(customTitle);
	}
	else if (oFF.XStringUtils.isNotNullAndNotEmpty(customToolName))
	{
		this.setTitle(customToolName);
		this.setTabItemTooltip(customToolName);
	}
	else
	{
		this.setTitle(this.getDocumentType().getDisplayName());
		this.setTabItemTooltip(this.getDocumentType().getDescription());
	}
};

