oFF.AuGdsQbInfoPanelView = function() {};
oFF.AuGdsQbInfoPanelView.prototype = new oFF.DfUiView();
oFF.AuGdsQbInfoPanelView.prototype._ff_c = "AuGdsQbInfoPanelView";

oFF.AuGdsQbInfoPanelView.create = function()
{
	return new oFF.AuGdsQbInfoPanelView();
};
oFF.AuGdsQbInfoPanelView.prototype.m_generalInfoPanel = null;
oFF.AuGdsQbInfoPanelView.prototype.m_globalVariablesPanel = null;
oFF.AuGdsQbInfoPanelView.prototype.m_model = null;
oFF.AuGdsQbInfoPanelView.prototype.m_otherFiltersPanel = null;
oFF.AuGdsQbInfoPanelView.prototype.m_panelSectionList = null;
oFF.AuGdsQbInfoPanelView.prototype.m_technicalDetailsPanel = null;
oFF.AuGdsQbInfoPanelView.prototype.m_variablesPanel = null;
oFF.AuGdsQbInfoPanelView.prototype._addInfoTokenPanelViewSection = function(type, infoPanelModel)
{
	return this._addSection(oFF.AuGdsQbInfoTokensPanelView.create(type, infoPanelModel));
};
oFF.AuGdsQbInfoPanelView.prototype._addSection = function(section)
{
	section.renderView(this.getGenesis());
	this.getView().addItem(section.getView());
	this.m_panelSectionList.add(section);
	return section;
};
oFF.AuGdsQbInfoPanelView.prototype._buildUi = function()
{
	if (oFF.isNull(this.m_model))
	{
		return;
	}
	this._clearPanelSectionList();
	this.m_generalInfoPanel = this._addSection(oFF.AuGdsQbGeneralInfoPanelView.create(this.m_model));
	this.m_variablesPanel = this._addInfoTokenPanelViewSection(oFF.AuGdsQbInfoTokenType.VARIABLE, this.m_model);
	this.m_globalVariablesPanel = this._addInfoTokenPanelViewSection(oFF.AuGdsQbInfoTokenType.GLOBAL_FILTER, this.m_model);
	this.m_otherFiltersPanel = this._addInfoTokenPanelViewSection(oFF.AuGdsQbInfoTokenType.OTHER_FILTER, this.m_model);
	oFF.XCollectionUtils.forEach(this.m_panelSectionList, (section) => {
		section.setExpanded(true);
	});
	this.m_technicalDetailsPanel = this._addSection(oFF.AuGdsQbTechnicalDetailsPanelView.create(this.m_model));
	this.m_technicalDetailsPanel.setExpanded(false);
};
oFF.AuGdsQbInfoPanelView.prototype._clearPanelSectionList = function()
{
	oFF.XCollectionUtils.forEach(this.m_panelSectionList, (section) => {
		oFF.XObjectExt.release(section);
	});
	this.m_panelSectionList.clear();
};
oFF.AuGdsQbInfoPanelView.prototype._updateInfoPanelModel = function()
{
	if (oFF.notNull(this.m_generalInfoPanel))
	{
		this.m_generalInfoPanel.updateModel(this.m_model);
	}
	if (oFF.notNull(this.m_technicalDetailsPanel))
	{
		this.m_technicalDetailsPanel.updateModel(this.m_model);
	}
};
oFF.AuGdsQbInfoPanelView.prototype.destroyView = function()
{
	this.m_variablesPanel = oFF.XObjectExt.release(this.m_variablesPanel);
	this.m_generalInfoPanel = oFF.XObjectExt.release(this.m_generalInfoPanel);
	this.m_technicalDetailsPanel = oFF.XObjectExt.release(this.m_technicalDetailsPanel);
	this.m_otherFiltersPanel = oFF.XObjectExt.release(this.m_otherFiltersPanel);
	this.m_globalVariablesPanel = oFF.XObjectExt.release(this.m_globalVariablesPanel);
	this.m_panelSectionList.clear();
	this.m_panelSectionList = oFF.XObjectExt.release(this.m_panelSectionList);
	this.m_model = null;
};
oFF.AuGdsQbInfoPanelView.prototype.getViewControl = function(genesis)
{
	let rootLayout = genesis.newControl(oFF.UiType.FLEX_LAYOUT);
	rootLayout.setDirection(oFF.UiFlexDirection.COLUMN);
	rootLayout.useMaxSpace();
	return rootLayout;
};
oFF.AuGdsQbInfoPanelView.prototype.layoutView = function(viewControl)
{
	if (oFF.notNull(this.m_model))
	{
		this._buildUi();
	}
};
oFF.AuGdsQbInfoPanelView.prototype.refreshModel = function(model)
{
	this.m_variablesPanel.updateModel(model);
	this.m_globalVariablesPanel.updateModel(model);
	this.m_otherFiltersPanel.updateModel(model);
};
oFF.AuGdsQbInfoPanelView.prototype.setModel = function(model)
{
	this.m_model = model;
	this._buildUi();
};
oFF.AuGdsQbInfoPanelView.prototype.setupView = function()
{
	this.m_panelSectionList = oFF.XList.create();
};
oFF.AuGdsQbInfoPanelView.prototype.updatePanelsVisibility = function()
{
	oFF.XCollectionUtils.forEach(this.m_panelSectionList, (section) => {
		section.setVisible(section.isDisplayTypeSupported());
	});
};
oFF.AuGdsQbInfoPanelView.prototype.updateUi = function()
{
	this._updateInfoPanelModel();
	oFF.XCollectionUtils.forEach(this.m_panelSectionList, (section) => {
		section.updateUi();
	});
	this.updatePanelsVisibility();
};

