oFF.AuGdsQbPaginationDialogView.prototype.getPathElement = function(axisScope)
{
	let paths = axisScope.getAxisPaths();
	let curPath;
	if (paths.size() === 0)
	{
		curPath = axisScope.addNewAxisPath();
	}
	else
	{
		curPath = paths.get(0);
	}
	let curElement;
	if (curPath.size() === 0)
	{
		curElement = curPath.addNewElement();
	}
	else
	{
		curElement = curPath.get(0);
	}
	return curElement;
};
