oFF.AuGdsQbStylingDialogView.create = function(tableDefinition, rectStyleScopes, selectionStyle)
{
	let instance = new oFF.AuGdsQbStylingDialogView();
	let styleId = oFF.XGuid.getGuid();
	instance.m_formattingStyle = tableDefinition.addNewFormattingStyle(styleId, styleId);
	if (oFF.notNull(selectionStyle))
	{
		let name = instance.m_formattingStyle.getName();
		let text = instance.m_formattingStyle.getText();
		instance.m_formattingStyle.copyFrom(selectionStyle, null);
		instance.m_formattingStyle.setName(name);
		instance.m_formattingStyle.setText(text);
	}
	return instance;
};
oFF.AuGdsQbStylingDialogView.openDialog = function(application, tableDefinition, rectStyleScopes, selectionStyle, updateProcedure)
{
	let serializationView = oFF.AuGdsQbStylingDialogView.create(tableDefinition, rectStyleScopes, selectionStyle);
	let uiMgr = application.getUiManager();
	let displayFactory = oFF.OlapUiDisplayFactory.createFactoryForDialog(uiMgr);
	let context = oFF.OlapUiContext.createContext(uiMgr, displayFactory);
	let display = context.getDisplayFactory().getInstance();
	let okButton = display.addNewButton();
	okButton.setName("OK_BUTTON");
	okButton.setText("OK");
	okButton.setButtonType(oFF.UiButtonType.PRIMARY);
	okButton.registerOnPress(oFF.AuGdsLambdaListenerWithEvent.create((ev) => {
		let rectGuid = oFF.XGuid.getGuid();
		for (let i = 0; i < rectStyleScopes.size(); i++)
		{
			let guid = oFF.XStringUtils.concatenate3(rectGuid, "_", oFF.XInteger.convertToString(i));
			let pair = rectStyleScopes.get(i);
			let lrs = tableDefinition.addNewLayeredRectangularStyle(guid, guid);
			lrs.setStyle(serializationView.m_formattingStyle);
			lrs.getColumnsScope().copyFrom(pair.getFirstObject(), null);
			lrs.getRowsScope().copyFrom(pair.getSecondObject(), null);
		}
		serializationView.m_formattingStyle.setFontSize(oFF.XDouble.convertFromString(serializationView.m_fontSizeInput.getValue()));
		updateProcedure();
		display.close();
	}));
	let genesis = display.getGenesis();
	serializationView.initView(genesis);
	display.getGenesis().setRoot(serializationView.getView());
	display.open();
};
