oFF.DfAuGdsFilterLineTreeMenu.prototype.addExpandedItems = function(treeItem, visibleTreeItemIds)
{
	let children = treeItem.getItems();
	oFF.XCollectionUtils.forEach(children, (child) => {
		visibleTreeItemIds.add(child.getId());
	});
};
oFF.DfAuGdsFilterLineTreeMenu.prototype.addGroupDimensions = function(groupedDimensions, parentItem)
{
	parentItem.registerOnExpand(oFF.UiLambdaExpandListener.create((expandEvent) => {
		let expandedItem = expandEvent.getAffectedItem();
		this.addExpandedItems(expandedItem, this.m_visibleDetailPageTreeItemIds);
		this.rerenderPopupHeight();
	}));
	parentItem.registerOnCollapse(oFF.UiLambdaCollapseListener.create((collapseEvent) => {
		let collapsedItem = collapseEvent.getAffectedItem();
		this.removeCollapsedItems(collapsedItem, this.m_visibleDetailPageTreeItemIds);
		this.rerenderPopupHeight();
	}));
	for (let i = 0; i < groupedDimensions.size(); i++)
	{
		let dim = groupedDimensions.get(i);
		if (this.shouldDimensionBeShownInFilterSelector(dim))
		{
			let dimName = dim.getName();
			let dimDescription = this.getPresentationType().getDisplayValueByType(dim);
			let attrItem = this.createMenuTreeItem(dimName, dimDescription);
			attrItem.setCustomObject(dim);
			attrItem.registerOnPress(oFF.UiLambdaPressListener.create((attrItemEvent) => {
				let dimension = attrItemEvent.getControl().getCustomObject();
				this.m_openFilterDialogWithDimensionConsumer(dimension, oFF.FilterDialogViewType.LIST);
			}));
			parentItem.addItem(attrItem);
		}
	}
};
oFF.DfAuGdsFilterLineTreeMenu.prototype.addGroupedDimensionToDisplay = function(dimension)
{
	let groupedDimensions = dimension.getGroupedDimensions();
	let name = dimension.getName();
	let description = this.getPresentationType().getDisplayValueByType(dimension);
	let item = this.createMenuTreeItem(name, description);
	item.registerOnPress(oFF.UiLambdaPressListener.create((event) => {
		this.m_openFilterDialogWithDimensionConsumer(dimension, oFF.FilterDialogViewType.LIST);
	}));
	if (!groupedDimensions.isEmpty())
	{
		this.addGroupDimensions(groupedDimensions, item);
		item.setExpanded(true);
	}
	return item;
};
