oFF.DfAuGdsFilterLineTreeMenu.prototype.createMenuItems = function()
{
	this.m_dimensionListItems.clear();
	this.m_searchableListItems.clear();
	this.m_searchableItemToVisibleItem.clear();
	let filteredDimensions = this.getFilteredDimensions();
	for (let i = 0; i < filteredDimensions.size(); i++)
	{
		let dim = filteredDimensions.get(i);
		let searchableItem = this.createDimensionMenuItem(dim, false);
		this.m_searchableListItems.add(searchableItem);
		if (oFF.XCollectionUtils.hasElements(dim.getGroupingDimensions()) && !oFF.XCollectionUtils.contains(dim.getGroupingDimensions(), (d) => {
			return d.getDimensionType() === oFF.DimensionType.ACCOUNT;
		}))
		{
			continue;
		}
		let isGroupingEnabled = this.m_filterLineConfig.isDimensionGroupingEnabled();
		let dimensionItem = this.createDimensionMenuItem(dim, isGroupingEnabled);
		this.m_dimensionListItems.add(dimensionItem);
		this.m_searchableItemToVisibleItem.put(searchableItem, dimensionItem);
	}
	this.sortDimensionListItems();
	this.m_currentSubPageListItems = this.m_dimensionListItems;
	this.rerenderPopupHeight();
	this.createMenuItemsInternal();
};
