oFF.DfAuGdsFilterLineTreeMenu.prototype.getCommonPageHeight = function(listSize)
{
	let listSizeWithMinimum = listSize > 0 ? listSize : 1;
	let searchFieldPadding = this.isSearchFieldShown() ? oFF.DfAuGdsFilterLineTreeMenu.SEARCH_FIELD_PADDING : 0;
	let settingsItemPadding = this.isSettingsMenuShown() ? oFF.DfAuGdsFilterLineTreeMenu.SETTINGS_PADDING : 0;
	let listSizeCutOff = oFF.DfAuGdsFilterLineTreeMenu.MAX_LIST_SIZE_CUTOFF;
	if (this.isSettingsMenuShown())
	{
		listSizeCutOff--;
	}
	if (this.isSearchFieldShown())
	{
		listSizeCutOff--;
	}
	let maxScrollableListHeight = listSizeCutOff * oFF.DfAuGdsFilterLineTreeMenu.ITEM_HEIGHT;
	let maxHeightBeforeScroll = searchFieldPadding + maxScrollableListHeight + settingsItemPadding;
	let heightPaddingWithOrWithoutSearchFieldOrSettings = this.getHeaderHeight() + searchFieldPadding + settingsItemPadding;
	return oFF.XMath.minDouble(maxHeightBeforeScroll, heightPaddingWithOrWithoutSearchFieldOrSettings + listSizeWithMinimum * oFF.DfAuGdsFilterLineTreeMenu.ITEM_HEIGHT);
};
oFF.DfAuGdsFilterLineTreeMenu.prototype.getCurrentPageHeight = function()
{
	let pageHeight = 0;
	let offset = 0;
	if (this.isOnRootPage())
	{
		pageHeight = this.getRootPageHeight();
		offset = this.isSettingsMenuShown() ? 0.8 : 0;
	}
	else if (this.isOnSubPage())
	{
		pageHeight = this.getSubPageHeight();
	}
	else if (this.isOnDetailPage())
	{
		pageHeight = this.getDetailPageHeight();
	}
	return pageHeight + offset;
};
