oFF.DfAuGdsFilterLineTreeMenu.prototype.shouldDimensionBeShownInFilterSelector = function(dim)
{
	if (!dim.getConvenienceCommands().isDimensionSupportingRowsOrColumns(dim.getName()))
	{
		return false;
	}
	if (!oFF.FilterDialogValueUtils.supportsFilterOnDimension(dim))
	{
		return false;
	}
	if (dim.isMeasureStructure())
	{
		return false;
	}
	if (oFF.QDimensionUtil.isStructureLike(dim))
	{
		return false;
	}
	return oFF.QDimensionUtil.shouldDimensionBeShown(dim, true);
};
oFF.DfAuGdsFilterLineTreeMenu.prototype.shouldShowGrouping = function(dimension)
{
	let groupedDimensions = dimension.getGroupedDimensions();
	for (let i = 0; i < groupedDimensions.size(); i++)
	{
		let dim = groupedDimensions.get(i);
		if (this.shouldDimensionBeShownInFilterSelector(dim))
		{
			return true;
		}
	}
	return false;
};
