oFF.AuGdsFilterLineMenuSearchableView.prototype.m_listChangedConsumer = null;
oFF.AuGdsFilterLineMenuSearchableView.prototype.m_listItemSelectedConsumer = null;
oFF.AuGdsFilterLineMenuSearchableView.prototype.m_searchInput = null;
oFF.AuGdsFilterLineMenuSearchableView.prototype.m_searchableListItems = null;
oFF.AuGdsFilterLineMenuSearchableView.prototype.m_topLevelListItems = null;
oFF.AuGdsFilterLineMenuSearchableView.prototype.m_uiListElement = null;
oFF.AuGdsFilterLineMenuSearchableView.prototype.destroyView = function()
{
	this.m_uiListElement = oFF.XObjectExt.release(this.m_uiListElement);
	this.m_searchInput = oFF.XObjectExt.release(this.m_searchInput);
	this.m_topLevelListItems = oFF.XObjectExt.release(this.m_topLevelListItems);
	this.m_searchableListItems = oFF.XObjectExt.release(this.m_searchableListItems);
	this.m_listChangedConsumer = null;
	this.m_listItemSelectedConsumer = null;
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.fillLists = function(listItems, searchableListItems)
{
	this.m_uiListElement.clearItems();
	this.m_searchInput.setVisible(searchableListItems.size() >= oFF.AuGdsFilterLineMenuSearchableView.NUMBER_OF_ITEMS_FOR_SEARCH_FIELD);
	this.m_searchInput.setValue("");
	this.m_topLevelListItems.clear();
	oFF.XStream.of(listItems).forEach((listItem) => {
		this.m_uiListElement.addItem(listItem);
		this.m_topLevelListItems.add(listItem);
	});
	this.m_searchableListItems.addAll(searchableListItems);
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.filterList = function(searchText, clearButtonPressed)
{
	this.m_uiListElement.clearItems();
	if (!clearButtonPressed && oFF.XStringUtils.isNotNullAndNotEmpty(searchText))
	{
		oFF.XStream.of(this.m_searchableListItems).forEach((listItem) => {
			if (oFF.XString.containsString(oFF.XString.toLowerCase(listItem.getText()), oFF.XString.toLowerCase(searchText)))
			{
				this.m_uiListElement.addItem(listItem);
			}
		});
	}
	else
	{
		oFF.XStream.of(this.m_topLevelListItems).forEach((listItem) => {
			this.m_uiListElement.addItem(listItem);
		});
	}
	if (oFF.notNull(this.m_listChangedConsumer))
	{
		this.m_listChangedConsumer(this.m_topLevelListItems);
	}
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.getLocalization = function()
{
	return oFF.XLocalizationCenter.getCenter();
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.getViewControl = function(genesis)
{
	return genesis.newControl(oFF.UiType.FLEX_LAYOUT);
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.handleSearch = function(controlEvent)
{
	if (oFF.notNull(controlEvent))
	{
		let didPressClearButton = controlEvent.getParameters().getBooleanByKeyExt(oFF.UiEventParams.PARAM_CLEAR_BUTTON_PRESSED, false);
		let searchText = controlEvent.getParameters().getStringByKeyExt(oFF.UiEventParams.PARAM_SEARCH_TEXT, "");
		this.filterList(searchText, didPressClearButton);
	}
};
oFF.AuGdsFilterLineMenuSearchableView.prototype.handleSelect = function(event)
{
	if (oFF.notNull(event))
	{
		let selectedListItem = event.getSelectedItem();
		this.selectItem(selectedListItem);
		if (oFF.notNull(selectedListItem) && oFF.notNull(this.m_listItemSelectedConsumer))
		{
			this.m_listItemSelectedConsumer(selectedListItem);
		}
	}
};
