oFF.AuAnalyticalWidgetGenAIView.prototype.calculateColorByScore = function(score)
{
	if (score < 0.3)
	{
		return "#00000";
	}
	if (score >= 0.3 && score < 0.5)
	{
		return "#ffff00";
	}
	if (score >= 0.5 && score < 0.8)
	{
		return "#ff8800";
	}
	return "#ff0000";
};
oFF.AuAnalyticalWidgetGenAIView.prototype.clearDecoration = function()
{
	let tableDefinition = this.getTableDefinition();
	for (let i = 0; i < this.m_numOfCellDecorated; i++)
	{
		tableDefinition.removeFormattingStyleByName(this.generateFormattingStyleName(i));
		tableDefinition.removeLayeredRectangularStyleByName(this.generateLayeredRectangularStyleName(i));
	}
};
oFF.AuAnalyticalWidgetGenAIView.prototype.decorateCell = function(cellScore, cellIndex)
{
	if (!cellScore.isValid())
	{
		return;
	}
	let tableDefinition = this.getTableDefinition();
	let fsName = this.generateFormattingStyleName(cellIndex);
	let layerName = this.generateLayeredRectangularStyleName(cellIndex);
	let fs1 = tableDefinition.addNewFormattingStyle(fsName, fsName);
	fs1.setFillColor(this.calculateColorByScore(cellScore.getScore()));
	let lrs1 = tableDefinition.addNewLayeredRectangularStyle(layerName, layerName);
	lrs1.setStyleName(fsName);
	lrs1.getColumnsScope().setMatchFullHeaderSection(false);
	lrs1.getColumnsScope().setMatchFullDataSection(true);
	lrs1.getColumnsScope().setMatchModulo(-1);
	lrs1.getColumnsScope().setMatchOrdinal(cellScore.getColIndex() - 1);
	lrs1.getRowsScope().setMatchFullHeaderSection(false);
	lrs1.getRowsScope().setMatchFullDataSection(true);
	lrs1.getRowsScope().setMatchModulo(-1);
	lrs1.getRowsScope().setMatchOrdinal(cellScore.getRowIndex());
};
oFF.AuAnalyticalWidgetGenAIView.prototype.decorateTable = function(anomalyCellsScore)
{
	this.clearDecoration();
	this.m_numOfCellDecorated = 0;
	for (let i = 0; i < anomalyCellsScore.size(); i++)
	{
		let cellScore = anomalyCellsScore.get(i);
		if (cellScore.getScore() >= 0.3)
		{
			this.decorateCell(cellScore, i);
			this.m_numOfCellDecorated++;
		}
	}
	this.m_vizRendererView.getDataProvider().getEventing().getEmitterForModelChanges().newTypedEvent().queue();
};
