oFF.AuAnalyticalWidgetGenAIView.prototype.loadWidget = function(analyticalWidget)
{
	return oFF.OuAnalyticalWidgetUtils.createDataProviderFromWidget(this.m_process, analyticalWidget).onThenPromise((dp) => {
		this.m_dataProvider = dp;
		this.m_vizRendererView.setDataProvider(dp);
		return dp.getActions().getVisualizationActions().getActiveVisualizationDefinition().onThenExt((activeVizDef) => {
			this.m_activeVizDef = activeVizDef;
			this.layoutViewFromWidget(analyticalWidget);
			this._updateUi();
			return oFF.XBooleanValue.create(true);
		}).onCatch((err1) => {
			this._showErrorMessage("Could not get the Active Visualization Definition: ");
			oFF.XLogger.printError(oFF.XStringUtils.concatenate2("Could not get the Active Visualization Definition: ! Reason: ", err1.getText()));
		});
	});
};
oFF.AuAnalyticalWidgetGenAIView.prototype.loadWidgetByName = function(widgetName)
{
	return oFF.OuAnalyticalWidgetUtils.getWidgetByName(this.m_process, widgetName, this.m_widgetCatalogUrl).onThenPromise((loadedWidget) => {
		this._showVizRendererViewIfNeeded();
		return this.loadWidget(loadedWidget);
	}).onCatch((err) => {
		this._showErrorMessage(oFF.XStringUtils.concatenate2("Could not find the widget with name: ", widgetName));
		oFF.XLogger.printError(oFF.XStringUtils.concatenate2("Failed to render widget! Reason: ", err.getText()));
	});
};
oFF.AuAnalyticalWidgetGenAIView.prototype.loadWidgetFromDataProvider = function(dataProvider)
{
	return oFF.OuAnalyticalWidgetUtils.createAnalyticalWidgetFromDataProvider(this.m_process, dataProvider).onThenExt((widget) => {
		this.m_dataProvider = dataProvider;
		this.m_vizRendererView.setDataProvider(dataProvider);
		return oFF.XBooleanValue.create(true);
	});
};
