oFF.AuHiChartView.prototype._getResultSetStructure = function(visualizationData)
{
	let resultStructure = null;
	let hasValidCacheEntry = false;
	let isCachingActive = oFF.XStringUtils.isNotNullAndNotEmpty(this.m_cacheKey) && this.m_isFirstRender;
	let localStorage = this.getDataProvider().getApplication().getProcess().getLocalStorage();
	if (isCachingActive)
	{
		let cachedResult = localStorage.getStringByKey(this.m_cacheKey);
		if (oFF.XStringUtils.isNotNullAndNotEmpty(cachedResult))
		{
			let result = oFF.PrUtils.deserialize(cachedResult);
			if (oFF.notNull(result) && result.isStructure())
			{
				resultStructure = result.asStructure();
				hasValidCacheEntry = true;
			}
			else
			{
				oFF.XLogger.println(oFF.XStringUtils.concatenate2("Invalid cache data in local storage for chart with key : ", this.m_cacheKey));
			}
		}
		else
		{
			oFF.XLogger.println(oFF.XStringUtils.concatenate2("No cache entry in local storage for chart with key : ", this.m_cacheKey));
		}
	}
	if (!hasValidCacheEntry)
	{
		let chartRenderer = this._createRenderer(visualizationData);
		resultStructure = chartRenderer.render();
		if (isCachingActive)
		{
			localStorage.putString(this.m_cacheKey, resultStructure.getStringRepresentation());
		}
	}
	this.m_isFirstRender = false;
	return resultStructure;
};
