oFF.AuHiChartView.prototype.accumulateEventContext = function(container, contextStructure)
{
	let pointCategory = container.getDataPointCategory(contextStructure);
	let groupingCategory = container.getGroupCategory(contextStructure);
	let distributionCategory = container.getDistributionCategory(contextStructure);
	if (oFF.notNull(pointCategory) && oFF.notNull(groupingCategory) && oFF.notNull(distributionCategory))
	{
		this.m_dataPointSelection = this.m_dataPointSelection || true;
	}
	let axisCategoryElement = container.getCategoryElement(contextStructure);
	if (oFF.notNull(axisCategoryElement))
	{
		this.m_axisPointSelection = this.m_axisPointSelection || true;
		let parentCategory = axisCategoryElement.getParentCategory();
		let dimensionIndex = axisCategoryElement.getDimensionIndex();
		let elementsIterator = parentCategory.getCategoryElements().getIterator();
		let tupleMembers = oFF.XList.create();
		this.m_fieldNameLastSelected = axisCategoryElement.getFieldName();
		while (elementsIterator.hasNext())
		{
			let subElement = elementsIterator.next();
			if (subElement.getDimensionIndex() > dimensionIndex)
			{
				break;
			}
			tupleMembers.add(subElement.getDimensionMember());
			this.processCategoryElementContexts(subElement, tupleMembers);
			if (oFF.XString.isEqual(subElement.getFieldName(), this.m_fieldNameLastSelected))
			{
				break;
			}
		}
		this.m_categoryTuples.add(tupleMembers);
		this.processCategoryContextsCategory(parentCategory);
	}
	this.processCategoryContexts(pointCategory, this.m_categoryTuples);
	this.processCategoryContexts(groupingCategory, this.m_groupingTuples);
	this.processCategoryContexts(distributionCategory, this.m_distributionTuples);
};
