oFF.AuHiChartView.prototype.addScrollInformation = function(modelJson, scrollInformation)
{
	let xAxisStructure = modelJson.getStructureByKey("xAxis");
	if (oFF.notNull(xAxisStructure))
	{
		xAxisStructure.putDouble("max", scrollInformation.getDoubleByKey("max"));
		xAxisStructure.putDouble("min", scrollInformation.getDoubleByKey("min"));
	}
};
oFF.AuHiChartView.prototype.addSelectionInformationToRenderedChart = function(modelJson, scrollInformation)
{
	for (let i = 0; i < this.m_selectedContexts.size(); i++)
	{
		if (this.m_selectedContexts.get(i) === null)
		{
			continue;
		}
		let selectedStructure = oFF.JsonParserFactory.createFromString(this.m_selectedContexts.get(i)).asStructure();
		let modelStructure = this.getStructureEqualTo(selectedStructure, modelJson);
		if (oFF.notNull(modelStructure))
		{
			modelStructure.putBoolean("selected", true);
		}
	}
	if (oFF.notNull(scrollInformation))
	{
		this.addScrollInformation(modelJson, scrollInformation);
	}
	return modelJson;
};
