	oFF.AuGdsQbSubContextFillerUtil.decorateStructureMemberContext(queryModel.getNonMeasureDimension(), this.m_chartContext, this.m_secondaryStructureMembersAllSelected, this.m_secondaryStructureMembersAllSelected.size() > 1, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_SECONDARY_SINGLE, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_SECONDARY_MULTI_CONNECTED, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_SECONDARY_MULTI_GAPS, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_SECONDARY_FILTER);
	oFF.AuGdsQbSubContextFillerUtil.decorateStructureMemberContext(queryModel.getMeasureDimension(), this.m_chartContext, this.m_measureMembersAllSelected, this.m_measureMembersAllSelected.size() > 1, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_MEASURE_SINGLE, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_MEASURE_MULTI_CONNECTED, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_MEASURE_MULTI_GAPS, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_MEASURE_FILTER);
