oFF.AuHiChartView.prototype.collectEventContext = function(contextString)
{
	this.m_fieldNameLastSelected = null;
	let container = this.getChartDefinition().getActiveVisualizationContainer();
	let contextData = oFF.JsonParserFactory.createFromString(contextString);
	if (oFF.isNull(contextData))
	{
		oFF.XLogger.println("WARNING: Something wrong with the context");
	}
	else if (contextData.isList())
	{
		let contextList = contextData.asList();
		for (let i = 0; i < contextList.size(); i++)
		{
			let contextStructure = contextList.getStructureAt(i);
			if (oFF.isNull(contextStructure))
			{
				oFF.XLogger.println("WARNING: Something wrong with the context list");
			}
			else
			{
				this.accumulateEventContext(container, contextStructure);
			}
		}
	}
	else if (contextData.isStructure())
	{
		this.accumulateEventContext(container, contextData.asStructure());
	}
};
