oFF.AuHiChartView.prototype.getStructureEqualTo = function(selectedStructure, structureToSearch)
{
	let iterator = structureToSearch.getKeysAsIterator();
	while (iterator.hasNext())
	{
		let key = iterator.next();
		let element = structureToSearch.getByKey(key);
		if (oFF.notNull(element) && element.isStructure())
		{
			if (element.isEqualTo(selectedStructure))
			{
				return structureToSearch;
			}
			let result = this.getStructureEqualTo(selectedStructure, element.asStructure());
			if (oFF.notNull(result))
			{
				return result;
			}
		}
		else if (oFF.notNull(element) && element.isList())
		{
			let list = element.asList();
			for (let i = 0; i < list.size(); i++)
			{
				let listElement = list.get(i);
				if (oFF.notNull(listElement))
				{
					if (listElement.isStructure())
					{
						if (listElement.isEqualTo(selectedStructure))
						{
							return structureToSearch;
						}
						let result = this.getStructureEqualTo(selectedStructure, listElement.asStructure());
						if (oFF.notNull(result))
						{
							return result;
						}
					}
				}
			}
		}
	}
	return null;
};
oFF.AuHiChartView.prototype.getUnitText = function(unitDescriptions)
{
	let stringBuffer = oFF.XStringBuffer.create();
	for (let i = 0; i < unitDescriptions.size(); i++)
	{
		stringBuffer.append(unitDescriptions.get(i));
		if (i !== unitDescriptions.size() - 1)
		{
			stringBuffer.append("/");
		}
	}
	if (stringBuffer.length() === 0)
	{
		stringBuffer.append("-");
	}
	return stringBuffer.toString();
};
