oFF.AuHiChartView.prototype.showMessage = function(modelJson)
{
	if (modelJson.getStringByKey("ERROR_MESSAGE") !== null)
	{
		this._showNoDataIllustratedMessage(modelJson.getStringByKey("ERROR_MESSAGE"));
		return true;
	}
	else if (!modelJson.getListByKey(oFF.HighChartConstants.K_SERIES).hasElements())
	{
		this._showNoDataIllustratedMessage(this.m_localization.getText(oFF.AuChartViewI18n.I18N_CV_CHART_NO_CHART_FOR_CURRENT_SELECTION));
		return true;
	}
	return false;
};
oFF.AuHiChartView.prototype.showMessageNewRenderer = function(messages, modelJson)
{
	for (let i = 0; i < messages.size(); i++)
	{
		let message = messages.getStringAt(i);
		if (oFF.XString.isEqual(message, oFF.GenericHiChartRendererMessages.POSITIVE_NEGATIVE_ERROR))
		{
			this._showNoDataIllustratedMessage(this.m_localization.getText(oFF.AuChartViewI18n.I18N_CV_CHART_PIE_NEGATIVE_POSITIVE));
			return true;
		}
		if (oFF.XString.isEqual(message, oFF.GenericHiChartRendererMessages.NO_CHART_FOR_CURRENT_SELECTION))
		{
			this._showNoDataIllustratedMessage(this.m_localization.getText(oFF.AuChartViewI18n.I18N_CV_CHART_NO_CHART_FOR_CURRENT_SELECTION));
			return true;
		}
	}
	if (!modelJson.getListByKey(oFF.HighChartConstants.K_SERIES).hasElements())
	{
		this._showNoDataIllustratedMessage(this.m_localization.getText(oFF.AuChartViewI18n.I18N_CV_CHART_NO_CHART_FOR_CURRENT_SELECTION));
		return true;
	}
	return false;
};
oFF.AuHiChartView.prototype.updateChart = function()
{
	if (this.m_useDpAutoFetch)
	{
		this.refreshChart();
		return;
	}
	if (oFF.notNull(this.m_timer))
	{
		oFF.XTimeout.clear(this.m_timer);
	}
	this.m_timer = oFF.XTimeout.timeout(30, () => {
		if (oFF.notNull(this.m_chart))
		{
			let chartDefinition = this.getChartDefinition();
			let optionalQueryModel = this.getOptionalQueryModel();
			if (optionalQueryModel.isPresent() && oFF.XObjectExt.isValidObject(chartDefinition))
			{
				this.setBusy(true);
				if (this.isFetchNecessary(optionalQueryModel.get(), chartDefinition))
				{
					this.m_chartDefinition.getActiveVisualizationContainer().processExecution(oFF.SyncType.NON_BLOCKING, this, null);
				}
				else
				{
					this.updateFromExisting(optionalQueryModel.get(), chartDefinition);
					this.setBusy(false);
				}
			}
		}
	});
};
oFF.AuHiChartView.prototype.updateChartDefinition = function()
{
	let optionalQueryModel = this.getOptionalQueryModel();
	optionalQueryModel.ifPresent((queryModel) => {
		let visualizationManager = this.getQueryManager().getQueryModel().getVisualizationManager();
		let currentActiveVisualizationDefinition = visualizationManager.getCurrentActiveVisualizationDefinition();
		if (this.m_chartDefinition === currentActiveVisualizationDefinition)
		{
			this.m_chartDefinition.getChartSetting().synchronizeChartSetting();
		}
	});
};
oFF.AuHiChartView.prototype.updateFromExisting = function(queryModel, chartDefinition)
{
	let modelJson = this.m_chartDefinition.getAbstractRendering();
	if (oFF.notNull(modelJson) && !this.showMessage(modelJson))
	{
		let rsContainer = this.getQueryManager().getActiveResultSetContainer();
		if (oFF.notNull(this.m_unitInformationConsumer) && oFF.notNull(rsContainer) && queryModel.getVisualizationManager().getCurrentActiveVisualizationDefinition() === chartDefinition)
		{
			let rs = rsContainer.isCursorResultSetAvailable() ? rsContainer.getCursorResultSet() : null;
			this.applyUnitInfo(this.m_unitInformationConsumer, rs);
		}
		this.m_chart.setModelJson(modelJson);
		this._displayChart();
	}
};

