oFF.AuVizFrameView.prototype.onResultEvent = function(evt)
{
	if (oFF.isNull(this.m_chartDefinition))
	{
		return;
	}
	if (evt.getStep() === oFF.OlapDataProviderResultDataFetchStep.FETCH_STARTED)
	{
		this.setBusy(true);
	}
	else if (evt.getStep() === oFF.OlapDataProviderResultDataFetchStep.VISUALIZATION_FILLED && oFF.notNull(this.m_chartDefinition) && evt.getFilledVisualizationNames().contains(this.m_chartDefinition.getName()))
	{
		this.setBusy(false);
		this.onVisualizationObjectFilledInternal(this.m_chartDefinition.getActiveVisualizationContainer());
	}
	else if (evt.getStep() === oFF.OlapDataProviderResultDataFetchStep.ALL_DONE)
	{
		this.setBusy(false);
	}
};
