oFF.AuVizFrameView.prototype.onVisualizationObjectFilledInternal = function(visualisationContainer)
{
	if (oFF.notNull(visualisationContainer) && !visualisationContainer.isSyncCanceled())
	{
		let visualizationData = visualisationContainer.getVisualizationData();
		if (oFF.notNull(this.m_vizFrame) && oFF.notNull(visualizationData))
		{
			let chartRenderer = oFF.VizFrameRenderer.create(visualizationData);
			let modelJson = chartRenderer.render();
			this.m_vizFrame.setModelJson(modelJson);
			this.setBusy(false);
		}
	}
};
