		this.m_tableView.setTileRequester((vp, til) => {
			return this._scrollTo(vp.getFirstObject(), vp.getSecondObject(), til.getIntegerByKey(oFF.AuGdsQbConstants.QB_TABLE_ROW_START), til.getIntegerByKey(oFF.AuGdsQbConstants.QB_TABLE_ROW_END), til.getIntegerByKey(oFF.AuGdsQbConstants.QB_TABLE_COLUMN_START), til.getIntegerByKey(oFF.AuGdsQbConstants.QB_TABLE_COLUMN_END));
		});
		this.m_tableView.setEnableDragDropFromBuilderToTable(true);
		this.m_tableView.setEnableDragDropOptimizedExperience(true);
		this.m_tableView.addContextFiller(this.m_queryManagerContextFiller);
		this.m_tableView.addContextFiller(this.m_dataProviderContextFiller);
		this.m_tableView.addContextFiller(this.m_updateContextFiller);
		this.m_tableView.addContextFiller(this.m_executionContextFiller);
		this.m_tableView.addContextFiller(this.m_shellContextFiller);
		this.m_tableView.addContextFiller(this.m_viewContextFiller);
		this.m_tableView.setUpdateProcedure(this._notifyModelChange.bind(this));
		this.m_tableView.setMenuPopulator(this.m_menuCreator);
