oFF.AuVizRendererView.prototype._notifyModelChange = function()
{
	if (oFF.notNull(this.m_dataProvider))
	{
		this.m_dataProvider.getEventing().notifyExternalModelChange(null);
	}
};
oFF.AuVizRendererView.prototype._observeDataProviderEvents = function()
{
	if (oFF.notNull(this.m_dataProvider))
	{
		let dpEventing = this.m_dataProvider.getEventing();
		this.m_modelChangeListenerUuid = dpEventing.getListenerForEventType(oFF.OlapDataProviderEventType.MODEL_CHANGE).addConsumer((evt) => {
			this._updateView();
		});
		this.m_vizChangeListenerUuid = dpEventing.getListenerForEventType(oFF.OlapDataProviderEventType.VISUALIZATION_CHANGE).addConsumer((evt) => {
			this._updateView();
		});
		this.m_resultDataFetchListenerUuid = dpEventing.getListenerForResultDataFetch().addConsumer((evt) => {
			if (evt.getStep().isEqualTo(oFF.OlapDataProviderResultDataFetchStep.ALL_DONE))
			{
				this._updateView();
			}
		});
	}
};
oFF.AuVizRendererView.prototype._resetActiveView = function(errorMessage)
{
	if (oFF.notNull(this.m_activeView))
	{
		this.m_rootLayout.removeItem(this.m_activeView);
		this.m_activeView = null;
	}
	let title = oFF.XStringUtils.isNotNullAndNotEmpty(errorMessage) ? errorMessage : this.m_title;
	this.m_queryDetails.setTitle(title);
};
oFF.AuVizRendererView.prototype._scrollTo = function(tableDefinition, visualizationProvidedListener, rowFrom, rowTo, columnFrom, columnTo)
{
	let visualizationContainer = oFF.isNull(tableDefinition) ? null : tableDefinition.getActiveTableContainer();
	return oFF.notNull(visualizationContainer) && visualizationContainer.processTileVisualization(oFF.SyncType.NON_BLOCKING, visualizationProvidedListener, null, null, null, rowFrom, rowTo, columnFrom, columnTo);
};
oFF.AuVizRendererView.prototype._setActiveView = function(vizType, vizDefinition)
{
	if (oFF.XString.isEqual(vizType, oFF.SemanticBindingType.CHART.getName()))
	{
		this._setChartViewAsActive(vizDefinition);
	}
	else if (oFF.XString.isEqual(vizType, oFF.SemanticBindingType.TABLE.getName()))
	{
		this._setTableViewAsActive(vizDefinition);
	}
	else if (oFF.XString.isEqual(vizType, oFF.SemanticBindingType.KPI.getName()))
	{
		this._setKpiViewAsActive(vizDefinition);
	}
	else
	{
		throw oFF.XException.createException(oFF.XStringUtils.concatenate2("Unsupported visualization type: ", vizType));
	}
};
oFF.AuVizRendererView.prototype._setChartViewAsActive = function(vizDefinition)
{
	let chartView = this._getChartView();
	chartView.setDataProvider(this.m_dataProvider);
	chartView.setChartDefinition(vizDefinition);
	chartView.updateChartDefinition();
	chartView.updateChart();
	if (oFF.notNull(this.m_activeView))
	{
		this.m_rootLayout.removeItem(this.m_activeView);
	}
	this.m_activeView = chartView.getView();
	this.m_rootLayout.addItem(this.m_activeView);
};
oFF.AuVizRendererView.prototype._setKpiViewAsActive = function(vizDefinition)
{
	let kpiView = this._getKpiView();
	kpiView.setDataProvider(this.m_dataProvider);
	let kpiDefinition = vizDefinition;
	this.m_kpiView.setKpiDefinition(kpiDefinition);
	this.m_kpiView.updateKpi();
	if (oFF.notNull(this.m_activeView))
	{
		this.m_rootLayout.removeItem(this.m_activeView);
	}
	this.m_activeView = kpiView.getView();
	this.m_rootLayout.addItem(this.m_activeView);
};
oFF.AuVizRendererView.prototype._setTableSettings = function()
{
	if (oFF.notNull(this.m_tableSettings))
	{
		this.m_tableView.setEnableDragDropFromBuilderToTable(this.m_tableSettings.getBooleanByKeyExt(oFF.AuVizRendererView.CONFIG_DRAG_DROP_FROM_BUILDER_PANEL_TO_TABLE, true));
		this.m_tableView.setEnableDragDropOptimizedExperience(this.m_tableSettings.getBooleanByKeyExt(oFF.AuVizRendererView.CONFIG_DRAG_DROP_OPTIMIZED_EXPERIENCE, true));
		this.m_tableView.setFilterHighlightHintActive(this.m_tableSettings.getBooleanByKeyExt(oFF.AuVizRendererView.CONFIG_HIGHLIGHT_FOR_FILTER_ENABLED, true));
		this.m_tableView.setFilterHighlightIncludeColor(this.m_tableSettings.getStringByKeyExt(oFF.AuVizRendererView.CONFIG_HIGHLIGHT_FOR_FILTER_COLOR_INCLUDE, "rgba(0,127,255,0.15)"));
		this.m_tableView.setFilterHighlightExcludeColor(this.m_tableSettings.getStringByKeyExt(oFF.AuVizRendererView.CONFIG_HIGHLIGHT_FOR_FILTER_COLOR_EXCLUDE, "rgba(0,127,255,0.15)"));
		let windowingConfig = this.m_tableSettings.getStructureByKey(oFF.AuVizRendererView.CONFIG_WINDOWING);
		if (oFF.XCollectionUtils.hasElements(windowingConfig))
		{
			this.m_tableView.setHorizontalLazyLoad(windowingConfig.getBooleanByKeyExt(oFF.AuVizRendererView.CONFIG_WINDOWING_HORIZONTAL_LAZY_LOAD, false));
			this.m_tableView.setRowsWindowSize(windowingConfig.getIntegerByKeyExt(oFF.AuVizRendererView.CONFIG_WINDOWING_ROWS_WINDOW_SIZE, 50));
			this.m_tableView.setRowsWindowFactor(windowingConfig.getIntegerByKeyExt(oFF.AuVizRendererView.CONFIG_WINDOWING_ROWS_WINDOW_FACTOR, 3));
			this.m_tableView.setMaxRowsWindowSize(windowingConfig.getIntegerByKeyExt(oFF.AuVizRendererView.CONFIG_WINDOWING_MAX_ROWS_WINDOW_SIZE, 300));
			this.m_tableView.setMaxRowsLoad(windowingConfig.getIntegerByKeyExt(oFF.AuVizRendererView.CONFIG_WINDOWING_MAX_ROWS_LOAD, -1));
			this.m_tableView.setMaxRowsRecommendation(windowingConfig.getIntegerByKeyExt(oFF.AuVizRendererView.CONFIG_WINDOWING_MAX_ROWS_RECOMMENDATION, 100000));
			this.m_tableView.setColumnsWindowSize(windowingConfig.getIntegerByKeyExt(oFF.AuVizRendererView.CONFIG_WINDOWING_COLUMNS_WINDOW_SIZE, 15));
			this.m_tableView.setColumnsWindowFactor(windowingConfig.getIntegerByKeyExt(oFF.AuVizRendererView.CONFIG_WINDOWING_COLUMNS_WINDOW_FACTOR, 3));
			this.m_tableView.setMaxColumnsWindowSize(windowingConfig.getIntegerByKeyExt(oFF.AuVizRendererView.CONFIG_WINDOWING_MAX_COLUMNS_WINDOW_SIZE, 50));
			let maxTableCols = windowingConfig.getIntegerByKeyExt(oFF.AuVizRendererView.CONFIG_WINDOWING_MAX_COLUMNS_LOAD, 150);
			this.m_tableView.setMaxColumnsLoad(maxTableCols);
			this.m_queryDetails.setMaxTableCols(maxTableCols);
			let columnsRecommendation = windowingConfig.getIntegerByKeyExt(oFF.AuVizRendererView.CONFIG_WINDOWING_MAX_COLUMNS_RECOMMENDATION, 100);
			this.m_tableView.setMaxColumnsRecommendation(columnsRecommendation);
			this.m_queryDetails.setMaxTableColRecommendation(columnsRecommendation);
		}
	}
};
oFF.AuVizRendererView.prototype._setTableViewAsActive = function(vizDefinition)
{
	let tableView = this._getTableView();
	tableView.setDataProvider(this.m_dataProvider);
	tableView.setTableDefinition(vizDefinition);
	let appSettings = vizDefinition.getApplicationSettings();
	if (oFF.notNull(this.m_tableSettings))
	{
		appSettings.setShowCommentIcons(this.m_tableSettings.getBooleanByKeyExt(oFF.AuVizRendererView.CONFIG_TABLE_RENDER_SHOW_COMMENT_ICONS, false));
		appSettings.setShowImages(this.m_tableSettings.getBooleanByKeyExt(oFF.AuVizRendererView.CONFIG_TABLE_RENDER_SHOW_IMAGES, false));
		appSettings.setShowHyperlinks(this.m_tableSettings.getBooleanByKeyExt(oFF.AuVizRendererView.CONFIG_TABLE_RENDER_SHOW_HYPERLINKS, false));
		appSettings.setAllowTextEdit(this.m_tableSettings.getBooleanByKeyExt(oFF.AuVizRendererView.CONFIG_TABLE_RENDER_ALLOW_TEXT_EDIT, false));
	}
	this._adjustGridWindowingConfigs();
	tableView.refreshView();
	if (oFF.notNull(this.m_activeView))
	{
		this.m_rootLayout.removeItem(this.m_activeView);
	}
	this.m_activeView = tableView.getView();
	this.m_rootLayout.addItem(this.m_activeView);
};
oFF.AuVizRendererView.prototype._unobserveDataProviderEvents = function()
{
	if (oFF.XObjectExt.isValidObject(this.m_dataProvider))
	{
		let dpEventing = this.m_dataProvider.getEventing();
		dpEventing.getListenerForEventType(oFF.OlapDataProviderEventType.MODEL_CHANGE).removeConsumerByUuid(this.m_modelChangeListenerUuid);
		this.m_modelChangeListenerUuid = null;
		dpEventing.getListenerForEventType(oFF.OlapDataProviderEventType.VISUALIZATION_CHANGE).removeConsumerByUuid(this.m_vizChangeListenerUuid);
		this.m_vizChangeListenerUuid = null;
		dpEventing.getListenerForResultDataFetch().removeConsumerByUuid(this.m_resultDataFetchListenerUuid);
		this.m_resultDataFetchListenerUuid = null;
	}
};
oFF.AuVizRendererView.prototype._updateView = function()
{
	this.m_queryDetails.resetModelDetails();
	if (oFF.XObjectExt.isValidObject(this.m_dataProvider))
	{
		if (!this.m_dataProvider.getResulting().isAutoFetchActive())
		{
			return;
		}
		this.m_rootLayout.setBusy(true);
		this.m_dataProvider.getActions().getVisualizationActions().getActiveVisualizationDefinition().onThen((activeVizDef) => {
			let bindingType = activeVizDef.getSemanticBindingType();
			this._setActiveView(bindingType.getName(), activeVizDef);
			this.m_queryDetails.onResultReady();
		}).onCatch((error) => {
			this._resetActiveView(error.getText());
		}).onFinally(() => {
			this.m_rootLayout.setBusy(false);
		});
	}
	else
	{
		this._resetActiveView(null);
	}
};
