	this.m_tableSettings = null;
	this.m_tableView = oFF.XObjectExt.release(this.m_tableView);
	this.m_chartSettings = null;
	this.m_chartView = oFF.XObjectExt.release(this.m_chartView);
	this.m_kpiView = oFF.XObjectExt.release(this.m_kpiView);
	this.m_queryDetails = oFF.XObjectExt.release(this.m_queryDetails);
	this.m_rootLayout = oFF.XObjectExt.release(this.m_rootLayout);
	this._unobserveDataProviderEvents();
