oFF.AuGdsQuasarDocument.prototype.saveExport = function(proteusEngine)
{
	let config = oFF.SuResourceExplorerConfigWrapper.create();
	config.setTitle("Select target directory");
	oFF.SuResourceExplorerPromise.selectDirectory(this.getProcess(), config).onThen((directory) => {
		if (oFF.notNull(directory))
		{
			let projectName = this.getTitle();
			let projectFolderName = oFF.XString.substring(projectName, 0, oFF.XString.indexOf(projectName, ".gdf"));
			let outputPath = oFF.XStringUtils.concatenate5(directory.getUri().getPath(), oFF.XFile.SLASH, projectFolderName, oFF.XFile.SLASH, "index.html");
			let file = oFF.XFile.createWithVars(this.getProcess(), outputPath);
			if (file.hasErrors())
			{
				this.setStatusError(file.getFirstError().getText());
			}
			else
			{
				let contentToSave = oFF.XContent.createStringContent(oFF.ContentType.TEXT, proteusEngine.getCombinedHtmlFileContent());
				oFF.XFilePromise.saveContentRecursive(file, contentToSave).onThen((file1) => {
					this.setStatusSuccess("Quasar document successfully exported as UI5 app.");
				}).onCatch((errorMsg1) => {
					this.setStatusError(errorMsg1.getText());
				});
			}
		}
	}).onCatch((errorMsg) => {
		this.setStatusError(errorMsg.getText());
	});
};
oFF.AuGdsQuasarDocument.prototype.setDocument = function(docString)
{
	if (oFF.XStringUtils.isNotNullAndNotEmpty(docString))
	{
		let parser = oFF.JsonParserFactory.newInstance();
		if (oFF.notNull(parser))
		{
			let jsonContent = parser.parse(docString);
			if (oFF.notNull(jsonContent))
			{
				if (parser.hasErrors())
				{
					this.getGenesis().showErrorToast("Document is not a quasar document!");
				}
				else
				{
					oFF.XObjectExt.release(parser);
					if (jsonContent.isStructure())
					{
						this.m_quasarEngine.setDocument(jsonContent);
					}
				}
			}
			else
			{
				this.getGenesis().showErrorToast("Document is not a json!");
			}
		}
	}
	else
	{
		this.getGenesis().showErrorToast("Document is empty!");
	}
};
