oFF.AuGdsQueryBuilderDocument.prototype._getInsightStoryLink = function()
{
	let buildLink = (metadata) => {
		let link = null;
		if (oFF.notNull(metadata) && oFF.XStringUtils.isNotNullAndNotEmpty(metadata.getStringByKey(oFF.XFileAttribute.SAC_LINKED_STORY_ID)))
		{
			let baseAppUrl = oFF.XStringTokenizer.splitString(this.getProcess().getNetworkLocation().getUrl(), "#").get(0);
			link = oFF.PrFactory.createStructure();
			link.putString(oFF.OuQueryInformationDialog.MODEL_LINK_NAME, metadata.getStringByKey(oFF.XFileAttribute.SAC_LINKED_STORY_NAME));
			link.putString(oFF.OuQueryInformationDialog.MODEL_LINK_SRC, oFF.XStringUtils.concatenate4(baseAppUrl, "#/story2&/s2/", metadata.getStringByKey(oFF.XFileAttribute.SAC_LINKED_STORY_ID), "/?mode=view"));
			link.putString(oFF.OuQueryInformationDialog.MODEL_LINK_ICON, "sap-icon://fpa/stories");
		}
		return link;
	};
	return oFF.XPromise.create((resolve, reject) => {
		let attributes = this.getFile().getAttributes();
		if (attributes.containsKey(oFF.XFileAttribute.SAC_EPM_OBJECT_ID) && !attributes.containsKey(oFF.XFileAttribute.SAC_LINKED_STORY_ID))
		{
			this._getPinnedStoryMetadata().onThen((metadata) => {
				resolve(buildLink(metadata));
			}).onFinally(() => {
				resolve(null);
			});
		}
		else
		{
			resolve(buildLink(this.getFile().getAttributes()));
		}
	});
};
oFF.AuGdsQueryBuilderDocument.prototype._getInteropMetadata = function(interopSettings, resExpConfig)
{
	return oFF.XPromise.create((resolve, reject) => {
		let resConfigInteropMetadata = resExpConfig.getStructureByKey("ext") !== null ? resExpConfig.getStructureByKey("ext").getStructureByKey(oFF.XStringUtils.concatenate2("sap.sac.insight.", oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_STORY_INTEROP_METADATA)) : null;
		let storedInteropMetadata = oFF.notNull(interopSettings) ? interopSettings.getStructureByKey(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_STORY_INTEROP_METADATA) : null;
		let interopMetadata = oFF.notNull(resConfigInteropMetadata) ? resConfigInteropMetadata : storedInteropMetadata;
		if (this.hasFile() && oFF.notNull(interopMetadata))
		{
			let attributes = this.getFile().getAttributes();
			if (interopMetadata.getBooleanByKeyExt("hyperLinkInterop", false) || attributes.containsKey(oFF.XFileAttribute.SAC_LINKED_STORY_ID))
			{
				resolve(interopMetadata);
			}
			else
			{
				this._getPinnedStoryMetadata().onThen((metadata) => {
					if (oFF.isNull(metadata) || !metadata.containsKey(oFF.XFileAttribute.SAC_LINKED_STORY_ID))
					{
						resolve(null);
					}
					else
					{
						resolve(interopMetadata);
					}
				}).onFinally(() => {
					resolve(null);
				});
			}
		}
		else
		{
			resolve(interopMetadata);
		}
	});
};
oFF.AuGdsQueryBuilderDocument.prototype._getPinnedStoryMetadata = function()
{
	return oFF.XPromise.create((resolve, reject) => {
		this.getFile().getAttributesForChanges().putBoolean(oFF.XFileAttribute.SAC_FETCH_LINKED_STORY, true);
		this.getFile().processFetchMetadata(oFF.SyncType.NON_BLOCKING, oFF.XLambdaFileFetchMetadataListener.create((extResult, metadata) => {
			let resultTmp = extResult;
			if (resultTmp.hasErrors() || oFF.isNull(metadata))
			{
				resolve(null);
			}
			else
			{
				resolve(metadata);
			}
		}), null, oFF.XFileCachingType.ENFORCE_UPDATE);
	});
};
