oFF.AuGdsQueryBuilderDocument.prototype._presentInsightSaveDialog = function()
{
	let docContent = this.getDocContent();
	let interopSettings = oFF.notNull(docContent) ? docContent.getCustomStructure(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_INTEROP_SETTTINGS_KEY) : null;
	let resExpConfig = this.getController().getGdsConfiguration().getConfigJson().getStructureByKey(oFF.AuGdsConstants.CONFIG_RESOURCE_EXPLORER);
	let previousOkLabel = this._setInsightSaveDialogBtnLabelReturnOriginal(resExpConfig);
	this._getInteropMetadata(interopSettings, resExpConfig).onThen((interopMetadata) => {
		let title;
		let i18nProvider = this.getController().getGlobalLocalization();
		title = i18nProvider.getText(oFF.AuGdsQueryBuilderI18n.RESOURCE_EXPLORER_TITLE_INSIGHT_SAVE);
		let initialPath = null;
		let resourceName = null;
		let supplButtons = this._buildInsightSaveAndPinButton(interopMetadata);
		if (this.hasFile())
		{
			title = i18nProvider.getText(oFF.AuGdsQueryBuilderI18n.RESOURCE_EXPLORER_TITLE_INSIGHT_SAVE_AS);
			let resourceWrapper = oFF.SuResourceWrapper.create(this.getFile());
			let resource = resourceWrapper.getRealResource();
			if (oFF.notNull(resource))
			{
				resourceName = resourceWrapper.getTranslatedDisplayName();
				if (resource.getParent() !== null)
				{
					initialPath = oFF.SuResourceWrapper.getUrlWithoutFinalSlash(resource.getParent().getUri());
				}
			}
			if (oFF.isNull(initialPath))
			{
				let defaultInsightSavePath = resExpConfig.getStructureByKey("config").getStringByKey("root");
				initialPath = this.getProcess().getKernel().getKernelProcess().getEnvironment().resolvePath(defaultInsightSavePath);
			}
		}
		let variables = this.getQueryManager().getQueryModel().getInputEnabledAndNonTechnicalVariables();
		let okAndFilter = oFF.SuResourceExplorerListener.createOKAndFilterAndButtons((resourceInfo, dialog) => {
			this.handleInsightFileForSaveSelected(resourceInfo, dialog);
		}, () => {
			if (resExpConfig.containsKey(oFF.SuResourceExplorer.PARAM_CONFIG_LEGACY))
			{
				let config = resExpConfig.getStructureByKey(oFF.SuResourceExplorer.PARAM_CONFIG_LEGACY);
				if (config.containsKey(oFF.SuResourceExplorerConfig.DIALOG_MODE))
				{
					let dialogMode = config.getStructureByKey(oFF.SuResourceExplorerConfig.DIALOG_MODE);
					if (oFF.XStringUtils.isNotNullAndNotEmpty(previousOkLabel))
					{
						dialogMode.putString(oFF.SuResourceExplorerDialogModeConfig.PARAM_OK_BUTTON_LABEL, previousOkLabel);
					}
					else
					{
						dialogMode.remove(oFF.SuResourceExplorerDialogModeConfig.PARAM_OK_BUTTON_LABEL);
					}
				}
			}
		}, oFF.AuGdsQbExternalConfiguration.getInstance().getResourceExplorerFilterCallback(), supplButtons);
		let resExplorerSaveRunner = oFF.AuGdsResourceExplorerProgramFactory.createResourceExplorerSaveWithVariables(this.getProcess(), title, this.getController().getGdsConfiguration(), resourceName, oFF.AuGdsResourceExplorerProgramFactory.CONFIG_EXT_TYPE_INSIGHT, okAndFilter, initialPath, i18nProvider, variables, this.getQueryBuilderDocContent().getForcePrompt(), this.getQueryBuilderDocContent().getSuppressExitVariables());
		resExplorerSaveRunner.runProgram();
	});
};
