oFF.AuGdsQueryBuilderDocument.prototype.closeActiveView = function()
{
	if (oFF.notNull(this.m_activeView))
	{
		let viewIndex = this.m_views.getValuesAsReadOnlyList().getIndex(this.m_activeView);
		if (viewIndex >= 0)
		{
			let tmpTabItem = this.m_viewIconTabBar.getSelectedItem();
			this.m_viewIconTabBar.removeItem(tmpTabItem);
			let removingUUId = this.m_activeView.getUuid();
			this.m_views.remove(removingUUId);
			let viewToRemove = this.m_activeView;
			let newViewIndex = viewIndex < this.m_views.size() ? viewIndex : this.m_views.size() - 1;
			if (newViewIndex >= 0)
			{
				this.m_activeView = this.m_views.getValuesAsReadOnlyList().get(newViewIndex);
				this.selectViewTab(this.m_activeView);
			}
			let definitionToRemove = this.getVisDefForView(viewToRemove);
			let visualizationManager = this.getQueryManager().getQueryModel().getVisualizationManager();
			visualizationManager.removeVisualizationDefinition(definitionToRemove);
			visualizationManager.setCurrentActiveVisualizationDefinition(this.getVisDefForView(this.m_activeView));
			let valuesAsReadOnlyListOfString = this.m_viewsByVisualizations.getKeysAsReadOnlyList();
			oFF.XStream.ofString(valuesAsReadOnlyListOfString).find((val) => {
				return oFF.XString.isEqual(this.m_viewsByVisualizations.getByKey(val.toString()), removingUUId);
			}).ifPresent((key) => {
				this.m_viewsByVisualizations.remove(key.toString());
			});
			this.m_queryController.deRegisterResultReadyListener(viewToRemove);
			oFF.XObjectExt.release(tmpTabItem);
			viewToRemove.notifyBeforeClose();
			viewToRemove = oFF.XObjectExt.release(viewToRemove);
			this.notifyReRenderUpdate();
		}
	}
};
oFF.AuGdsQueryBuilderDocument.prototype.createAndRenderNewTableView = function(vizDef)
{
	let newTableView = oFF.AuGdsQbInteractiveTableView.createWithVisualization(this.getGenesis(), vizDef);
	newTableView.setMessageConsumer((messageType, messageText) => {
		let messageCenter = this.getMessageCenter();
		if (messageType === oFF.UiMessageType.INFORMATION)
		{
			messageCenter.showInfoToast(messageText);
		}
		else if (messageType === oFF.UiMessageType.WARNING)
		{
			messageCenter.showWarningToast(messageText);
		}
		else if (messageType === oFF.UiMessageType.ERROR)
		{
			messageCenter.showErrorToast(messageText);
		}
		else if (messageType === oFF.UiMessageType.SUCCESS)
		{
			messageCenter.showSuccessToast(messageText);
		}
	});
	newTableView.registerOnSelectionChange(this);
	newTableView.addContextFiller(this);
	newTableView.setMenuPopulator(this.getMenuManager());
	newTableView.registerOnTableDataUpdated(this.onTableDataUpdated.bind(this));
	newTableView.registerOnBackendRequestStarted(this.onBackendRequestStarted.bind(this));
	newTableView.registerOnBackendRequestFinished(this.onBackendRequestFinished.bind(this));
	newTableView.setDefaultSettings(this.getDefaultQmSettings());
	let documentConfigJson = this.getDocumentConfigJson();
	newTableView.setEnableDragDropFromBuilderToTable(documentConfigJson.getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_DRAG_DROP_FROM_BUILDER_PANEL_TO_TABLE));
	newTableView.setEnableDragDropOptimizedExperience(documentConfigJson.getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_DRAG_DROP_OPTIMIZED_EXPERIENCE));
	newTableView.setFilterHighlightHintConfig(documentConfigJson.getStructureByKey(oFF.AuGdsQbConstants.CONFIG_TABLE_HIGHLIGHT_HINT_FOR_FILTER));
	newTableView.setWindowingConfig(documentConfigJson.getStructureByKey(oFF.AuGdsQbConstants.CONFIG_WINDOWING));
	newTableView.setUseDataProviderForDataFetch(this.isUsingDataProviderAutoFetch());
	newTableView.setUpdateProcedure(this.notifyEditAction.bind(this));
	newTableView.setTileRequester((vp, trs) => {
		return this.m_queryController.requestTableTileIfNeeded(vp.getFirstObject(), vp.getSecondObject(), trs.getIntegerByKey(oFF.AuGdsQbConstants.QB_TABLE_ROW_START), trs.getIntegerByKey(oFF.AuGdsQbConstants.QB_TABLE_ROW_END), trs.getIntegerByKey(oFF.AuGdsQbConstants.QB_TABLE_COLUMN_START), trs.getIntegerByKey(oFF.AuGdsQbConstants.QB_TABLE_COLUMN_END));
	});
	newTableView.setViewName("Query table");
	if (newTableView.canUseDataProvider())
	{
		newTableView.setDataProvider(this.getDataProvider());
	}
	else
	{
		newTableView.queryManagerUpdated(this.getQueryManager());
	}
	let documentTitle = this.getDocumentTitle();
	this.applyTitleInfoToVisualizationDefinitions(documentTitle);
	this.m_queryController.registerResultEmptyListener(newTableView);
	this.m_queryController.registerRenderingPauseEndListener(newTableView);
	this.m_tableView = newTableView;
	this.renderTableView(newTableView);
	return newTableView;
};
