oFF.AuGdsQueryBuilderDocument.prototype.createQueryDetailsIfNeeded = function()
{
	if (oFF.isNull(this.m_queryDetails) && oFF.notNull(this.m_queryController))
	{
		this.m_queryDetails = oFF.AuGdsQueryDetails.create(this.getGenesis());
		this.m_queryDetails.setQueryManager(this.getQueryManager());
		this.m_queryDetails.setMenuPopulator(this.getMenuManager());
		this.m_queryDetails.addContextFiller(this);
		this.m_queryDetails.setUpdateProcedure(() => {
			this.forceUpdateQueryResultSet();
		});
		this.m_queryDetails.setActiveView(this.m_activeView);
		let docConfig = this.getDocumentConfigJson();
		let windowingConfig = oFF.isNull(docConfig) ? null : docConfig.getStructureByKey(oFF.AuGdsQbConstants.CONFIG_WINDOWING);
		let horizontalLazyLoad = oFF.notNull(windowingConfig) && windowingConfig.getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_WINDOWING_HORIZONTAL_LAZY_LOAD);
		let maxTableCols = oFF.isNull(windowingConfig) ? 150 : windowingConfig.getIntegerByKeyExt(oFF.AuGdsQbConstants.CONFIG_WINDOWING_MAX_COLUMNS_LOAD, 150);
		let maxColumnsWindowSize = oFF.isNull(windowingConfig) ? 50 : windowingConfig.getIntegerByKeyExt(oFF.AuGdsQbConstants.CONFIG_WINDOWING_MAX_COLUMNS_WINDOW_SIZE, 50);
		let columnsWindowFactor = oFF.isNull(windowingConfig) ? 3 : windowingConfig.getIntegerByKeyExt(oFF.AuGdsQbConstants.CONFIG_WINDOWING_COLUMNS_WINDOW_FACTOR, 3);
		let columnsWindowSize = oFF.isNull(windowingConfig) ? 20 : windowingConfig.getIntegerByKeyExt(oFF.AuGdsQbConstants.CONFIG_WINDOWING_COLUMNS_WINDOW_SIZE, 20);
		this.m_queryDetails.setMaxTableCols(horizontalLazyLoad ? maxTableCols : oFF.XMath.min(maxColumnsWindowSize, columnsWindowSize * columnsWindowFactor));
		this.m_queryDetails.setMaxTableColRecommendation(oFF.isNull(windowingConfig) ? 100 : windowingConfig.getIntegerByKeyExt(oFF.AuGdsQbConstants.CONFIG_WINDOWING_MAX_COLUMNS_RECOMMENDATION, 100));
		let defaultQueryDetailsDisplay = this.getDefaultQmSettings().isShowQueryDetails();
		this.m_queryDetails.setTableTitleVisible(defaultQueryDetailsDisplay);
		this.m_queryDetails.setModelDetailsVisible(defaultQueryDetailsDisplay);
		this.setQueryDetailsConfig(this.m_initialQueryDetailsConfig);
		this.m_queryController.registerResultReadyListener(this.m_queryDetails);
		this.m_queryController.registerResultEmptyListener(this.m_queryDetails);
	}
	else if (oFF.notNull(this.m_queryDetails))
	{
		this.m_queryDetails.setTransientDefaultTitle(this.getDocumentTitle());
	}
};
