oFF.AuGdsQueryBuilderDocument.prototype.executeSave = function(consumer)
{
	if (this.getFeatureManager().isSacIntegration())
	{
		if (this.hasFile())
		{
			let insightMigrationSettings = this.getQueryBuilderDocContent().getCustomStructure(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_INTEROP_SETTTINGS_KEY);
			if (oFF.notNull(insightMigrationSettings) && insightMigrationSettings.getBooleanByKey(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_SHOW_MIGRATED_SAVE_WARNING))
			{
				this.presentMigrateSaveWarningDialog();
			}
			else
			{
				this.saveInsightToFile(this.getFile(), (extResult) => {
					if (!extResult.hasErrors())
					{
						oFF.AuUsageTracking.recordInsightSavedSuccess(this.getProcess(), true);
					}
					consumer(extResult);
				}, true);
			}
		}
		else
		{
			this._presentInsightSaveDialog();
		}
	}
	else
	{
		oFF.AuGdsDfDocument.prototype.executeSave.call( this , consumer);
	}
};
