oFF.AuGdsQueryBuilderDocument.prototype.exportData = function(config)
{
	return oFF.XPromise.create((resolve, reject) => {
		let onError = (msg) => {
			this._setContentBusy(null);
			reject(oFF.XError.create(msg));
		};
		let onComplete = (result) => {
			this._setContentBusy(null);
			if (result.success() || result.hasWarnings())
			{
				resolve(result);
			}
			else
			{
				reject(oFF.XError.create("export failed"));
			}
		};
		let dataExportHelper = oFF.DataExportHelper.create(this.getQueryController().getQueryManager(), this.m_tableView.getTableDefinition(), onError, onComplete);
		dataExportHelper.exportData(config);
	});
};
