oFF.AuGdsQueryBuilderDocument.prototype.fillContext = function(context)
{
	let programContext = context.addSubContext();
	programContext.setType(oFF.AuGdsContextConstants.PROGRAM_GALAXY_DATA_STUDIO);
	programContext.setCustomObject(this.getController());
	let actionEnabled = oFF.XBiFunctionHolder.create((contextAccess1, actionKey1) => {
		return oFF.XBooleanValue.create(this.isActionEnabled(contextAccess1, actionKey1));
	});
	let actionToggledOn = oFF.XBiFunctionHolder.create((contextAccess2, actionKey2) => {
		return oFF.XBooleanValue.create(this.isActionToggledOn(contextAccess2, actionKey2));
	});
	let actionExecutor = oFF.XBiConsumerHolder.create((contextAccess3, actionKey3) => {
		this.performAction(contextAccess3, actionKey3);
	});
	let documentActionEnabled = context.addSubContext();
	documentActionEnabled.setType(oFF.AuGdsContextConstants.GLOBAL_ACTION_ENABLED);
	documentActionEnabled.setCustomObject(actionEnabled);
	let documentActionToggledOn = context.addSubContext();
	documentActionToggledOn.setType(oFF.AuGdsContextConstants.GLOBAL_ACTION_TOGGLED_ON);
	documentActionToggledOn.setCustomObject(actionToggledOn);
	let documentActionExecutor = context.addSubContext();
	documentActionExecutor.setType(oFF.AuGdsContextConstants.GLOBAL_ACTION_EXECUTE);
	documentActionExecutor.setCustomObject(actionExecutor);
	let documentContext = context.addSubContext();
	documentContext.setType(oFF.AuGdsContextConstants.DOCUMENT_QUERY_BUILDER);
	documentContext.setCustomObject(this);
	let commandContext = context.addSubContext();
	commandContext.setType(oFF.AuGdsContextConstants.DATA_PROVIDER_COMMAND_EXECUTOR);
	commandContext.setCustomObject(this.getDpCommandExecutor());
	commandContext.setType(oFF.AuGdsContextConstants.SHELL_COMMAND_EXECUTOR);
	commandContext.setCustomObject(this.getShellCommandExecutor());
	let queryManager = this.getQueryManager();
	if (oFF.notNull(queryManager))
	{
		let queryModel = queryManager.getQueryModel();
		let queryModelContext = context.addSubContext();
		queryModelContext.setType(oFF.AuGdsContextConstants.OLAP_QUERY_MODEL);
		queryModelContext.setCustomObject(queryModel);
		oFF.AuGdsQbSubContextFillerUtil.expandQueryModelContext(queryModelContext, queryModel);
	}
	let updateContext = context.addSubContext();
	updateContext.setType(oFF.AuGdsContextConstants.OLAP_QUERY_UPDATE_PROCEDURE);
	updateContext.setCustomObject(oFF.XProcedureHolder.create(this.notifyEditAction.bind(this)));
	let messagingContext = context.addSubContext();
	messagingContext.setType(oFF.AuGdsContextConstants.UI_MESSAGE_CONSUMER);
	let messagingConsumerHolder = oFF.XBiConsumerHolder.create((messageType, messageText) => {
		let messageCenter = this.getMessageCenter();
		if (messageType === oFF.UiMessageType.INFORMATION)
		{
			messageCenter.showInfoToast(messageText);
		}
		else if (messageType === oFF.UiMessageType.WARNING)
		{
			messageCenter.showWarningToast(messageText);
		}
		else if (messageType === oFF.UiMessageType.ERROR)
		{
			messageCenter.showErrorToast(messageText);
		}
		else if (messageType === oFF.UiMessageType.SUCCESS)
		{
			messageCenter.showSuccessToast(messageText);
		}
	});
	messagingContext.setCustomObject(messagingConsumerHolder);
};
