oFF.AuGdsQueryBuilderDocument.prototype.getRriJumpTarget = function(targetDataSource)
{
	let targetUrl = null;
	if (oFF.notNull(targetDataSource))
	{
		let location = oFF.NetworkEnv.getLocation();
		let rriConfig = this.getDocumentConfigJson().getStructureByKey(oFF.AuGdsQbConstants.REPORT_REPORT_INTERFACE);
		let fragmentPattern = oFF.isNull(rriConfig) ? null : rriConfig.getStringByKey(oFF.AuGdsQbConstants.RRI_TARGET_FRAGMENT_TEMPLATE);
		if (oFF.XStringUtils.isNotNullAndNotEmpty(fragmentPattern) && oFF.XString.startsWith(fragmentPattern, "#"))
		{
			fragmentPattern = oFF.XString.substring(fragmentPattern, 1, -1);
		}
		let queryPatternTemplate = oFF.isNull(rriConfig) ? null : rriConfig.getStringByKey(oFF.AuGdsQbConstants.RRI_TARGET_QUERY_TEMPLATE);
		let urlPathTemplate = oFF.isNull(rriConfig) ? null : rriConfig.getStringByKey(oFF.AuGdsQbConstants.RRI_TARGET_PATH_TEMPLATE);
		let systemDescription = this.getQueryManager().getSystemDescription();
		let urlPath = this.replaceRriParameters(urlPathTemplate, targetDataSource, systemDescription);
		let urlQuery = this.replaceRriParameters(queryPatternTemplate, targetDataSource, systemDescription);
		let urlFragment = this.replaceRriParameters(fragmentPattern, targetDataSource, systemDescription);
		let baseUrl = oFF.isNull(rriConfig) ? null : rriConfig.getStringByKey(oFF.AuGdsQbConstants.RRI_TARGET_BASE_URL);
		if (oFF.notNull(location))
		{
			if (oFF.XStringUtils.isNullOrEmpty(baseUrl))
			{
				baseUrl = location.getUrlExt(true, false, false, false, true, true, false, false, false);
			}
			if (oFF.XStringUtils.isNullOrEmpty(urlPath))
			{
				urlPath = location.getUrlExt(false, false, false, false, false, false, true, false, false);
			}
		}
		if (oFF.XStringUtils.isNotNullAndNotEmpty(baseUrl) && oFF.XStringUtils.isNotNullAndNotEmpty(urlPath))
		{
			let urlObject = oFF.XUri.create();
			urlObject.setUrl(baseUrl);
			if (oFF.XStringUtils.isNotNullAndNotEmpty(urlPath))
			{
				urlObject.setPath(urlPath);
			}
			if (oFF.XStringUtils.isNotNullAndNotEmpty(urlQuery))
			{
				urlObject.setQuery(urlQuery);
			}
			if (oFF.XStringUtils.isNotNullAndNotEmpty(urlFragment))
			{
				urlObject.setFragment(urlFragment);
			}
			targetUrl = urlObject.getUrl();
		}
	}
	return targetUrl;
};
