oFF.AuGdsQueryBuilderDocument.prototype.handleEnvironmentParams = function()
{
	let objectName = null;
	let objectType = null;
	let systemName = null;
	let environment = this.getProcess().getEnvironment();
	if (environment.containsKey(oFF.AuGdsConstants.URL_PARAM_DATA_SOURCE_NAME))
	{
		objectName = environment.getStringByKey(oFF.AuGdsConstants.URL_PARAM_DATA_SOURCE_NAME);
		objectType = environment.getStringByKey(oFF.AuGdsConstants.URL_PARAM_SYSTEM_TYPE);
		systemName = environment.getStringByKey(oFF.AuGdsConstants.URL_PARAM_CONNECTION);
	}
	else if (oFF.NetworkEnv.getLocation() !== null)
	{
		let location = oFF.NetworkEnv.getLocation();
		if (oFF.XStringUtils.isNotNullAndNotEmpty(location.getFragment()))
		{
			let fragmentUri = oFF.XUri.createFromUrl(location.getFragment());
			objectName = fragmentUri.getQueryElementValue(oFF.AuGdsConstants.URL_PARAM_DATA_SOURCE_NAME);
			objectType = fragmentUri.getQueryElementValue(oFF.AuGdsConstants.URL_PARAM_SYSTEM_TYPE);
			systemName = fragmentUri.getQueryElementValue(oFF.AuGdsConstants.URL_PARAM_CONNECTION);
		}
	}
	if (oFF.XStringUtils.isNullOrEmpty(objectName))
	{
		return;
	}
	if (oFF.XString.isEqual(objectType, "MODEL"))
	{
		this.m_model = objectName;
		return;
	}
	let dataSource = oFF.QFactory.createDataSource();
	if (oFF.XStringUtils.isNotNullAndNotEmpty(systemName))
	{
		dataSource.setSystemName(systemName);
	}
	if (oFF.XStringUtils.isNotNullAndNotEmpty(objectType))
	{
		switch (objectType)
		{
			case "BW":
				dataSource.setType(oFF.MetaObjectType.QUERY);
				dataSource.setObjectName(objectName);
				break;

			case "HANA":
				dataSource.setFullQualifiedName(objectName);
				break;

			case "DATASPHERE":
				dataSource.setType(oFF.MetaObjectType.INA_MODEL);
				dataSource.setObjectName(objectName);
				break;
		}
	}
	else
	{
		dataSource.setFullQualifiedName(objectName);
	}
	this.m_dataSource = dataSource;
};
oFF.AuGdsQueryBuilderDocument.prototype.handleExistingDocContent = function(docContent)
{
	let qbDocContent = docContent;
	let system = qbDocContent.getSystemName();
	let inaRepoJson = qbDocContent.getInaRepoStructure();
	this.m_viewsFromFile = qbDocContent.getViews();
	let filterLineConfig = qbDocContent.getFilterLineConfig();
	this.setFilterLineConfig(filterLineConfig);
	let queryDetailsConfig = qbDocContent.getQueryDetailsConfig();
	this.setQueryDetailsConfig(queryDetailsConfig);
	let dataSource = oFF.QFactory.createDataSource();
	dataSource.deserializeFromElementExt(oFF.QModelFormat.INA_REPOSITORY, inaRepoJson);
	dataSource.setSystemName(system);
	this.m_dataSource = dataSource;
	if (this.getFeatureManager().isSacIntegration())
	{
		this.getQueryController().enableClientInfo();
	}
	this.getQueryController().setInaRepoJson(inaRepoJson);
	if (this.getFeatureManager().isSacIntegration() && oFF.XString.containsString(this.getProcess().getParentProcess().getNetworkLocation().getUrl(), "isSch=true"))
	{
		this.getQueryController().setForceInitialVariableDialog(false);
	}
	else
	{
		this.getQueryController().setForceInitialVariableDialog(qbDocContent.getForcePrompt());
	}
	this.getQueryController().setSuppressExitVariables(qbDocContent.getSuppressExitVariables());
	let model = this.getDocContent().getModel();
	if (oFF.XStringUtils.isNotNullAndNotEmpty(model))
	{
		let fileManager = this.getFileManager();
		let modelFile = this.getModelFile(model);
		this.setBusy(true);
		fileManager.loadDocument(modelFile, (docType, file, jsonObj) => {
			this.getQueryController().getClientInfo().setSacModelId(modelFile.getName());
			this.openModelForInsight(jsonObj, file);
			this.setBusy(false);
		});
	}
	else
	{
		if (qbDocContent.getCustomStructure(oFF.AuGdsQbOrcaInteropConstants.GDF_QD_ORCA_INTEROP_SETTTINGS_KEY) !== null)
		{
			oFF.AuGdsQbOrcaInteropHandler.addModelInformationToDocContenIfExists(docContent);
		}
		this.getQueryController().initQueryManagerFromDataSource(this.getApplication(), this.m_dataSource);
	}
	let documentTitle = this.getDocumentTitle();
	this.applyTitleInfoToVisualizationDefinitions(documentTitle);
};
oFF.AuGdsQueryBuilderDocument.prototype.handleExternalFileType = function(fileType, fileJson, file)
{
	this.initClientInfo();
	if (fileType === oFF.AuGdsFileType.INSIGHT)
	{
		this.openInsight(file, fileJson);
	}
	else if (fileType === oFF.AuGdsFileType.MODEL)
	{
		if (this.openModel(fileJson, file))
		{
			oFF.AuGdsQbExternalConfiguration.getInstance().fireFileLoadedCallback(this, fileType, file);
		}
		else
		{
			this.handleCriticalStartupError(null);
		}
	}
	else if (fileType === oFF.AuGdsFileType.SAC_SHORTCUT)
	{
		this.openSacShortcut(file, fileJson);
	}
};
oFF.AuGdsQueryBuilderDocument.prototype.handleInsightFileForSaveSelected = function(resourceInfo, dialog)
{
	if (oFF.notNull(resourceInfo) && !resourceInfo.isDirectory())
	{
		this.getQueryBuilderDocContent().removeOrcaInteropSpecificSettingsStructure();
		let isSaveAsInsightAction = this.hasFile();
		let file = oFF.XFile.createByUrl(this.getProcess(), resourceInfo.getUrl());
		let isOutputFileExisting = file.isExisting();
		oFF.AuGdsQbSacInsightHandler.addFileAttributes(file, resourceInfo);
		let isOpenPromptAutomatically = false;
		if (resourceInfo.get(oFF.AuGdsQbSacContentlibConstants.AUTOMATICALLY_OPEN_PROMPT) !== null)
		{
			isOpenPromptAutomatically = resourceInfo.get(oFF.AuGdsQbSacContentlibConstants.AUTOMATICALLY_OPEN_PROMPT).getBoolean();
		}
		this.getQueryBuilderDocContent().setForcePrompt(isOpenPromptAutomatically);
		let suppressExitVariables = false;
		if (resourceInfo.get(oFF.AuGdsQbSacContentlibConstants.SAVE_DYNAMIC_VARIABLES) !== null)
		{
			suppressExitVariables = resourceInfo.get(oFF.AuGdsQbSacContentlibConstants.SAVE_DYNAMIC_VARIABLES).getBoolean();
		}
		this.getQueryBuilderDocContent().setSuppressExitVariables(suppressExitVariables);
		let insightPinned = resourceInfo.getString(oFF.XFileAttribute.SAC_INTEROP_STORY_ID) !== null;
		this.saveInsightToFile(file, (extResult) => {
			if (!extResult.hasErrors())
			{
				if (isSaveAsInsightAction)
				{
					oFF.AuUsageTracking.recordInsightSavedAsSuccess(this.getProcess(), isOutputFileExisting);
				}
				else
				{
					oFF.AuUsageTracking.recordInsightSavedSuccess(this.getProcess(), isOutputFileExisting);
				}
				if (insightPinned)
				{
					oFF.AuUsageTracking.recordInsightSaveAndPinSuccess(this.getProcess());
					let msg = this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.SAVE_AND_PIN_INSIGHT_SUCCESS);
					this.getMessageCenter().showSuccessToast(msg);
				}
				this.handleDocumentSaved(extResult.getData());
				dialog.close();
			}
			else
			{
				let errors = extResult.getErrors();
				let iterator = errors.getIterator();
				let error = iterator.next();
				let errorText = error.getText();
				let errorKey = oFF.AuGdsQbSacContentlibErrorMessageUtil.getLocalisedMessageKey(errorText);
				errorText = insightPinned ? this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.SAVE_AND_PIN_INSIGHT_ERROR) : this.getLocalizationProvider().getText(errorKey);
				if (oFF.isNull(errorText) || oFF.XString.isEqual(errorText, errorKey))
				{
					errorText = this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.SAVE_INSIGHT_ERROR);
				}
				dialog.showErrorMessage(errorText);
			}
		}, !insightPinned);
	}
	else
	{
		dialog.showErrorMessage(this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.SAVE_INSIGHT_ERROR));
	}
};
