oFF.AuGdsQueryBuilderDocument.prototype.onSelect = function(event)
{
	let control = event.getControl();
	if (control === this.m_viewIconTabBar)
	{
		let selectedTab = event.getSelectedItem();
		let tmpView = selectedTab.getCustomObject();
		this.changeActiveView(tmpView);
		if (oFF.notNull(tmpView) && tmpView.getViewType() !== oFF.AuGdsViewType.SPREADSHEET)
		{
			let currentActiveVisualizationDefinition = this.getVisDefForView(tmpView);
			let queryModel = this.getQueryManager().getQueryModel();
			let visualizationManager = queryModel.getVisualizationManager();
			if (oFF.isNull(currentActiveVisualizationDefinition))
			{
				currentActiveVisualizationDefinition = oFF.XCollectionUtils.findFirst(visualizationManager.getVisualizationDefinitions(), (visDef2) => {
					return visDef2.getProtocolBindingType() === oFF.ProtocolBindingType.SAC_TABLE_GRID;
				});
			}
			visualizationManager.setCurrentActiveVisualizationDefinition(currentActiveVisualizationDefinition);
			this.getPanelController().executeOnOpenPanels((qbPanel) => {
				qbPanel.updatePanelUi();
			});
			this.updateQueryResultSet();
		}
	}
};
