oFF.AuGdsQueryBuilderDocument.prototype.openModel = function(modelJson, file)
{
	this.resetRepoContent();
	let sfxJson = oFF.AuGdsQbSacModelHandler.getSfxJsonFromModelJson(this.getApplication(), modelJson);
	let modelDataSource = oFF.AuGdsQbSacModelHandler.getDataSourceFromSfxJson(sfxJson, file);
	let documentStateFlag = oFF.PrStructure.create();
	documentStateFlag.putBoolean(oFF.AuGdsQbSacContentlibConstants.IS_LOADED_FROM_INSIGHT, false);
	let systemLandscape = this.getApplication().getSystemLandscape();
	if (oFF.notNull(modelDataSource))
	{
		if (oFF.AuGdsQbSacModelHandler.isFlexibleTimeDimensionModel(modelJson) || oFF.AuGdsQbSacModelHandler.isBPCModel(systemLandscape, modelDataSource) || oFF.AuGdsQbSacModelHandler.isUniverseModel(systemLandscape, modelDataSource))
		{
			let warningPopup = oFF.AuGdsPopupHelper.createInvalidModelsListPopup(this.getGenesis(), this.getLocalizationProvider());
			warningPopup.open();
			return false;
		}
		else
		{
			this.initClientInfo();
			this.getDocContent().setCustomStructure(oFF.AuGdsQbSacContentlibConstants.MODEL_DEPENDENCY, modelJson);
			let modelInfo = oFF.PrStructure.create();
			modelInfo.putString(oFF.OuQueryInformationDialogConstants.MODEL_DISPLAY_NAME_KEY, file.getAttributes().getStringByKey(oFF.XFileAttribute.DISPLAY_NAME));
			modelInfo.putString(oFF.OuQueryInformationDialogConstants.MODEL_SUBTYPE_KEY, file.getAttributes().getStringByKey(oFF.XFileAttribute.NODE_SUB_TYPE));
			this.getDocContent().setCustomStructure(oFF.AuGdsQbSacContentlibConstants.MODEL_INFO, modelInfo);
			this.getDocContent().setCustomStructure(oFF.AuGdsQbSacContentlibConstants.DOCUMENT_STATE_FLAG, documentStateFlag);
			this.getQueryController().getClientInfo().setSacModelId(file.getName());
			this.getQueryController().setForceInitialVariableDialog(!this.m_resettingInProgress);
			this.handleNewDataSourceSet(modelDataSource, sfxJson);
			this.markDirty();
			return true;
		}
	}
	else
	{
		this.getMessageCenter().showErrorToast(this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.CANNOT_OPEN_MODEL_MSG));
	}
	return false;
};
oFF.AuGdsQueryBuilderDocument.prototype.openModelForInsight = function(modelJson, file)
{
	let sfxJson = oFF.AuGdsQbSacModelHandler.getSfxJsonFromModelJson(this.getApplication(), modelJson);
	let modelDataSource = oFF.AuGdsQbSacModelHandler.getDataSourceFromSfxJson(sfxJson, file);
	if (oFF.notNull(modelDataSource) && oFF.notNull(modelJson))
	{
		if (oFF.AuGdsQbSacModelHandler.isFlexibleTimeDimensionModel(modelJson))
		{
			let warningPopup = oFF.AuGdsPopupHelper.createInvalidModelsListPopup(this.getGenesis(), this.getLocalizationProvider());
			warningPopup.open();
			this.showLandingPage(true);
		}
		else
		{
			this.handleNewDataSourceSet(modelDataSource, sfxJson);
			this.markPristine();
		}
	}
	else
	{
		this.getMessageCenter().showWarningToast(this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.CANNOT_OPEN_MODEL_MSG));
	}
};
