oFF.AuGdsQueryBuilderDocument.prototype.presentExportDialog = function(exportType)
{
	let okHandler = (config) => {
		this._setContentBusy(this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.MSG_EXPORTING_DATA));
		if (this.getQueryManager().getSystemType().isTypeOf(oFF.SystemType.ORCA))
		{
			config.setDefaultDatasourceName(this.getDocumentTitle());
		}
		let onError = (msg) => {
			this._setContentBusy(null);
			this.getMessageCenter().showErrorToast(msg);
		};
		let onComplete = (result) => {
			this._setContentBusy(null);
			if (result.success())
			{
				if (result.hasWarnings())
				{
					let warning = oFF.DataExportHelper.getDisplayMessageFromResult(result);
					this.getMessageCenter().showWarningToast(warning);
				}
				else
				{
					let successMsg = this.getLocalizationProvider().getTextWithPlaceholder(oFF.AuGdsQueryBuilderI18n.MSG_EXPORT_DATA_SUCCESS, config.getFileName());
					this.getMessageCenter().showSuccessToast(successMsg);
					oFF.AuUsageTracking.trackExportUsage(this.getProcess(), exportType, this.getQueryManager().getSystemType(), config);
				}
				oFF.AuGdsQbExternalConfiguration.getInstance().fireDocumentExportedCallback(this, config);
			}
		};
		this.persistExportConfig(config);
		if (config.getSupportsShortcutLinkforAppendix() && config.getCreateShortcutLinkforAppendix())
		{
			this.saveAndCreateShortcutlink().onThen((shortcutFileLocation) => {
				config.setShortcutUrl(shortcutFileLocation);
				let dataExportHelper = oFF.DataExportHelper.create(this.getQueryController().getQueryManager(), this.m_tableView.getTableDefinition(), onError, onComplete);
				dataExportHelper.exportData(config);
			});
		}
		else
		{
			let dataExportHelper = oFF.DataExportHelper.create(this.getQueryController().getQueryManager(), this.m_tableView.getTableDefinition(), onError, onComplete);
			dataExportHelper.exportData(config);
		}
	};
	let showRepMembers = this.m_tableView.getTableDefinition() !== null ? this.m_tableView.getTableDefinition().isRepetitiveMemberNames() : false;
	let exportDialogRunner = oFF.ProgramRunner.createRunner(this.getProcess(), oFF.SuExportDialog.DEFAULT_PROGRAM_NAME);
	exportDialogRunner.setStringArgument(oFF.SuExportDialog.PARAM_EXPORT_TYPE, exportType);
	exportDialogRunner.setStringArgument(oFF.SuExportDialog.PARAM_FILE_NAME, this.getDocumentTitle());
	exportDialogRunner.setBooleanArgument(oFF.SuExportDialog.PARAM_SHOW_REP_MEMBERS, showRepMembers);
	this.loadExportConfig(exportDialogRunner, exportType);
	exportDialogRunner.runProgram().onThenExt((dialog) => {
		let expDialog = dialog;
		expDialog.setOkHandler(okHandler);
		return expDialog;
	}).onCatch((error) => {
		this.getGenesis().showErrorToast(error.getText());
	});
};
