oFF.AuGdsQueryBuilderDocument.prototype.presentNewDataSourcePicker = function()
{
	let queryManager = this.getQueryManager();
	if (oFF.notNull(queryManager))
	{
		let isDWC;
		try
		{
			isDWC = queryManager.getSystemDescription().getProperties().getBooleanByKey("FPA_IS_DWC");
		}
		catch (t)
		{
			isDWC = false;
		}
		if (isDWC)
		{
			this.presentModelPicker();
			return;
		}
	}
	if (!oFF.AuGdsQbExternalConfiguration.getInstance().fireDataSourcePickerPresenter())
	{
		let title = this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.DATASOURCE_PICKER_TITLE);
		let auGdsInstance = oFF.AuGdsQbExternalConfiguration.getInstance();
		let onOk = (resourceInfo, dialog) => {
			this.resetSacInsightIfNeeded();
			this.handleDataSourcePickerOk(resourceInfo);
			let dataSource = oFF.AuGdsQueryBuilderDocument.createDatasource(resourceInfo);
			let dataSourceInfo = oFF.AuGdsQueryBuilderDocument.createDatasourceInfo(dataSource, resourceInfo);
			dialog.addToRecentlyUsed(dataSourceInfo);
			dialog.close();
		};
		let onFilter = auGdsInstance.getResourceExplorerFilterCallback();
		let onQuickAccessChange = auGdsInstance.getResourceExplorerQuickAccessCallback();
		let resourceExplorerListener = oFF.SuResourceExplorerListener.create(onOk, null, null, onQuickAccessChange, onFilter, null);
		let configJson = this.getController().getGdsConfiguration().getConfigJson().getByKey("ResourceExplorer");
		let dataSourceJson = configJson.getStructureByKey("config").getStructureByKey("datasource");
		if (oFF.notNull(queryManager))
		{
			dataSourceJson.putString("system", queryManager.getQueryManager().getSystemType().getName());
			let dataSource = queryManager.getQueryModel().getDataSource();
			dataSourceJson.putString("connection", dataSource.getSystemName());
		}
		oFF.AuGdsResourceExplorerProgramFactory.createDatasourcePicker(this.getProcess(), title, this.getGdsConfiguration(), resourceExplorerListener).runProgram();
	}
};
