oFF.AuGdsQueryBuilderDocument.prototype.renderViewByVisualization = function(vizDef)
{
	let currentProtocolBindingType = vizDef.getProtocolBindingType();
	let vizDefId = vizDef.getName();
	let addedView = null;
	if (currentProtocolBindingType.isTypeOf(oFF.ProtocolBindingType.SAC_TABLE_GRID))
	{
		this.setupTableViewIfNeeded(vizDef);
		this.showTableViewIfNeeded();
		addedView = this.m_tableView;
		this.m_viewsByVisualizations.put(vizDefId, this.m_tableView.getUuid());
	}
	else if (currentProtocolBindingType.isTypeOf(oFF.ProtocolBindingType.ABSTRACT_CHART_PROTOCOL))
	{
		let viewId = this.m_viewsByVisualizations.getByKey(vizDefId);
		addedView = this.m_views.getByKey(viewId);
		if (oFF.isNull(addedView))
		{
			addedView = this.addChartView(vizDef);
			if (oFF.notNull(addedView))
			{
				this.m_views.put(addedView.getUuid(), addedView);
			}
		}
		if (oFF.notNull(addedView))
		{
			this.m_viewsByVisualizations.put(vizDefId, addedView.getUuid());
		}
	}
	return addedView;
};
oFF.AuGdsQueryBuilderDocument.prototype.replaceRriParameters = function(sourceString, targetDataSource, systemDescription)
{
	let result = sourceString;
	if (oFF.notNull(result))
	{
		result = oFF.XString.replace(result, "{DATASOURCE_FQN}", oFF.XHttpUtils.encodeURIComponent(targetDataSource.getFullQualifiedName()));
		result = oFF.XString.replace(result, "{DATASOURCE_NAME}", oFF.XHttpUtils.encodeURIComponent(targetDataSource.getObjectName()));
		result = oFF.XString.replace(result, "{SYSTEM_CONNECTION}", oFF.XHttpUtils.encodeURIComponent(systemDescription.getSystemName()));
		result = oFF.XString.replace(result, "{SYSTEM_TYPE}", oFF.XHttpUtils.encodeURIComponent(systemDescription.getSystemType().getName()));
		result = oFF.XString.replace(result, "{RRINAME}", oFF.XHttpUtils.encodeURIComponent(targetDataSource.getRriName()));
		result = oFF.XString.replace(result, "{RRIVALUE}", oFF.XHttpUtils.encodeURIComponent(targetDataSource.getRriValue()));
	}
	return result;
};
