oFF.AuGdsQueryBuilderDocument.prototype.rerenderViews = function()
{
	if (this.getDocumentConfigJson().getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_ENABLE_CHARTING))
	{
		let visualizationManager = this.getQueryManager().getQueryModel().getVisualizationManager();
		let definitions = visualizationManager.getVisualizationDefinitions();
		let currentActiveVisualizationDefinition = visualizationManager.getCurrentActiveVisualizationDefinition();
		if (this.areMultiViewsEnabled())
		{
			for (let i = 0; i < definitions.size(); i++)
			{
				let definition = definitions.get(i);
				let viewId = this.m_viewsByVisualizations.getByKey(definition.getName());
				let viewForDefinition = this.m_views.getByKey(viewId);
				if (oFF.isNull(viewForDefinition))
				{
					this.renderViewByVisualization(definition);
				}
			}
			if (oFF.notNull(currentActiveVisualizationDefinition) && this.m_viewsByVisualizations.containsKey(currentActiveVisualizationDefinition.getName()))
			{
				let viewId2 = this.m_viewsByVisualizations.getByKey(currentActiveVisualizationDefinition.getName());
				this.selectView(this.m_views.getByKey(viewId2));
			}
		}
		else
		{
			this.renderViewByVisualization(currentActiveVisualizationDefinition);
		}
	}
};
