oFF.AuGdsQueryBuilderDocument.prototype.saveAndCreateShortcutlink = function()
{
	return oFF.XPromise.create((resolve, reject) => {
		let shortcutDirectoryFilePath = this.getProcess().getKernel().getKernelProcess().getEnvironment().resolvePath(oFF.SuQuickAccessShareDialogConstants.SHORTCUT_DIRECTORY_DEFAULT_PATH);
		let root = this.getProcess().getRootDirectoryUri().getUrl();
		let filePath = oFF.XStringUtils.concatenate3(root, shortcutDirectoryFilePath, oFF.SuQuickAccessShareDialogConstants.NEW_SHORTCUT);
		this.getSaveContent().onThen((contentToSave) => {
			let shortcutFile = oFF.XFile.createWithVars(this.getProcess(), filePath);
			oFF.XFilePromise.saveContent(shortcutFile, contentToSave).onThen((savedShortcutFile) => {
				if (oFF.notNull(savedShortcutFile) && savedShortcutFile.getCachedMetadata() !== null && savedShortcutFile.getCachedMetadata().containsKey(oFF.XFileAttribute.UNIQUE_ID))
				{
					let location = oFF.NetworkEnv.getLocation();
					let shortcutFileLocation = oFF.XUri.createFromOther(location);
					let shortcutId = savedShortcutFile.getCachedMetadata().getStringByKey(oFF.XFileAttribute.UNIQUE_ID);
					let newFragment = oFF.XStringUtils.concatenate2(oFF.SuQuickAccessShareDialogConstants.DA_BASE_FRAGMENT, shortcutId);
					shortcutFileLocation.setFragment(newFragment);
					resolve(shortcutFileLocation);
				}
			});
		}).onCatch((errorMsg) => {
			this.getMessageCenter().showErrorToast(this.getLocalizationProvider().getText(oFF.AuGdsQueryBuilderI18n.SHORTCUT_LINK_FAILURE_MESSAGE));
			resolve(null);
		}).onFinally(() => {
			oFF.XLogger.println("saveAndCreateShortcutlink: shortcut Created...");
		});
	});
};
oFF.AuGdsQueryBuilderDocument.prototype.saveInsightToFile = function(fileToSave, consumer, showSuccessToast)
{
	if (!this.hasSaveData())
	{
		this.getMessageCenter().showErrorToast("No save data! Cannot save");
		return;
	}
	this.removeMigrateInsightWarningIfPresent();
	let contentPromise = this.getSaveContent().onThen((contentToSave) => {
		let queryBuilderJson = contentToSave.getJsonContent();
		let formattedContent = oFF.AuGdsFileType.INSIGHT.format(queryBuilderJson, fileToSave);
		formattedContent = oFF.AuGdsQbSacInsightHandler.appendModelDataset(formattedContent, this.getDocContent(), this.getQueryManager(), this.m_dataSource);
		let formattedContentToSave = oFF.XContent.createJsonObjectContent(oFF.ContentType.JSON, formattedContent);
		this.getFileManager().saveDocumentContentAs(formattedContentToSave, fileToSave, (extResult) => {
			if (!extResult.hasErrors())
			{
				this.handleDocumentSaved(extResult.getData());
			}
			if (oFF.notNull(consumer))
			{
				consumer(extResult);
			}
		}, showSuccessToast);
	});
	if (oFF.notNull(consumer))
	{
		contentPromise.onCatch((error) => {
			let errorResult = oFF.ExtResult.createWithErrorMessage(error.getText());
			consumer(errorResult);
		});
	}
};
