oFF.AuGdsQueryBuilderDocument.prototype.showLandingPage = function(suppressDataSourcePicker)
{
	this.m_dataSource = null;
	this.m_viewsFromFile = null;
	let onlyRefreshUrl = this.getQueryBuilderDocContent().getCustomStructure(oFF.AuGdsQbSacContentlibConstants.DOCUMENT_STATE_FLAG) !== null ? false : true;
	this.clearDatasourceArguments();
	this.getQueryController().reset();
	this.resetDocContent();
	this.setFile(null);
	this.markPristine();
	this.getStatusBarManager().hideNetworkActivityIndicator();
	if (this.isFeatureEnabled(oFF.AuGdsConstants.PARAM_SUPPRESS_LANDING_PAGE))
	{
		return;
	}
	this.cleanMainView();
	let shouldShowWelcomeDialog = this.isFeatureEnabled(oFF.AuGdsConstants.PARAM_SHOW_WELCOME_DIALOG) && !this.m_didShowWelcomeDialog;
	this.m_didShowWelcomeDialog = shouldShowWelcomeDialog;
	let featureManager = this.getFeatureManager();
	let isSacIntegration = featureManager.isSacIntegration();
	this.m_landingPage = oFF.AuGdsQbLandingPageView.create(this.getProcess());
	this.m_landingPage.setIsDebugMode(featureManager.isDebug());
	this.m_landingPage.setIsSacIntegration(isSacIntegration);
	this.m_landingPage.shouldShowWelcomeDialog(shouldShowWelcomeDialog);
	this.m_landingPage.setFromDataSourceLegacyPressedProcedure(this.presentLegacyDataSourcePicker.bind(this));
	this.m_landingPage.setFromDataSourcePressedProcedure(this.presentNewDataSourcePicker.bind(this));
	this.m_landingPage.setOpenInsightPressedProcedure(this.presentInsightPicker.bind(this));
	this.m_landingPage.setFromModelPressedProcedure(this.presentModelPicker.bind(this));
	this.m_landingPage.setFromClipboardPressedProcedure(this._openInsightFromClipboard.bind(this));
	this.m_landingPage.setRecentFileSelectedConsumer((recentFile) => {
		this.openFile(recentFile);
	});
	this.m_landingPage.setLearnMoreLinkClickedProcedure(() => {
		oFF.AuGdsQbExternalConfiguration.getInstance().fireLearnMoreLinkClickedCallback();
	});
	this.m_landingPage.setWelcomeDialogClosedConsumer((doNotShowAgain) => {
		oFF.AuGdsQbExternalConfiguration.getInstance().fireWelcomeDialogClosedCallback(doNotShowAgain);
	});
	if (isSacIntegration)
	{
		oFF.AuGdsResourceExplorerProgramFactory.setupResourceExplorerWrapperByGdsConfig(this.getGdsConfiguration());
	}
	let landingPageView = this.m_landingPage.renderView(this.getGenesis());
	this.m_contentLayout.addItem(landingPageView);
	this.getToolbarManager().setToolbarVisible(false);
	this.setStatusInfo("Create a new dragonfly document...");
	this.setTitle(this.getDocumentType().getDisplayName());
	this._updateQuickActionToolbar();
	if (this.isAutoOpenDataSourcePicker() && !suppressDataSourcePicker)
	{
		this.presentDataSourcePicker();
	}
	if (oFF.XString.isEqual(this.getArgumentsManager().getArguments().getListByKey(oFF.AuGdsConstants.PARAM_DOCUMENTS).getStructureAt(0).getStringByKey(oFF.AuGdsConstants.PARAM_LAUNCH_QUICK_ACTION), oFF.AuGdsConstants.PARAM_MODEL))
	{
		this.presentModelPicker();
	}
	oFF.AuGdsQbExternalConfiguration.getInstance().fireLandingPageShownCallback(onlyRefreshUrl);
};
