oFF.AuGdsQueryBuilderDocument.prototype.showShareDialog = function(application, queryManager, showWarning)
{
	if (this.isDirty() && showWarning)
	{
		this.showUnsavedWarningDialog(true);
	}
	else
	{
		let prgStartData = oFF.ProgramStartData.create();
		prgStartData.putXObject(oFF.DfOuDialogProgram.PRG_DATA_QUERY_MANAGER, queryManager);
		let resource = this.getFile().getAttributes().getStringByKey(oFF.XFileAttribute.UNIQUE_ID);
		let link = this.getProcess().getNetworkLocation().getUrl();
		link = oFF.XStringTokenizer.splitString(link, oFF.AuGdsQbConstants.QB_SHARE_INSIGHT_APP_HTML_URL).get(0);
		link = oFF.XStringUtils.concatenate3(link, oFF.AuGdsQbConstants.QB_SHARE_INSIGHT_URL, resource);
		let shareDlg = oFF.ProgramRunner.createRunner(application.getProcess(), oFF.OuShareDialog.DEFAULT_PROGRAM_NAME);
		shareDlg.setStringArgument(oFF.OuShareDialogConstants.ARG_FILE, this.getFile().getUri().getUrl());
		shareDlg.setStringArgument(oFF.OuShareDialogConstants.ARG_LINK, link);
		if (this.getFile().getAttributes().getBooleanByKey(oFF.XFileAttribute.IS_WORKSPACE_FILE))
		{
			let workspace = this.getFile().getAttributes().getStringByKey(oFF.XFileAttribute.SPACE_ID);
			shareDlg.setStringArgument(oFF.OuShareDialogConstants.ARG_WORKSPACE, workspace);
		}
		let owner = this.getFile().getAttributes().getStringByKey(oFF.XFileAttribute.CREATED_BY);
		shareDlg.setStringArgument(oFF.OuShareDialogConstants.ARG_OWNER, owner);
		shareDlg.setProgramStartData(prgStartData);
		shareDlg.runProgram();
	}
};
