oFF.AuGdsQueryBuilderDocument.prototype.updateDocContentForSave = function()
{
	let queryManager = this.getQueryManager();
	if (oFF.isNull(queryManager))
	{
		return oFF.XPromise.resolve(null);
	}
	let hasVariablesInFilter = oFF.XCollectionUtils.contains(queryManager.getDimensionMemberVariables(), (variable) => {
		return variable.isInputEnabled() && variable.isUsedInDynamicFilter();
	});
	if (hasVariablesInFilter)
	{
		return oFF.XPromise.create((resolve, reject) => {
			let syncType = this.getApplication().getDefaultSyncType();
			queryManager.reInitVariablesAfterSubmit(syncType, oFF.VariableProcessorCallbackLambda.createSingleUse((result) => {
				if (result.hasErrors())
				{
					reject(oFF.MessageUtil.condenseMessagesToSingleError(result));
					return;
				}
				let variables = queryManager.getQueryModel().getVariableContainer().serializeToContent(oFF.QModelFormat.INA_REPOSITORY);
				queryManager.cancelReInitVariables(syncType, oFF.VariableProcessorCallbackLambda.createSingleUse((cancelResult) => {
					if (cancelResult.hasErrors())
					{
						reject(oFF.MessageUtil.condenseMessagesToSingleError(cancelResult));
						return;
					}
					queryManager.getQueryModel().getVariableContainer().deserializeFromContent(variables);
					this.updateDocContentForSaveInternal();
					resolve(null);
				}), null);
			}), null);
		});
	}
	this.updateDocContentForSaveInternal();
	return oFF.XPromise.resolve(null);
};
oFF.AuGdsQueryBuilderDocument.prototype.updateDocContentForSaveInternal = function()
{
	let queryManager = this.getQueryManager();
	let queryModel = queryManager.getQueryModel();
	let chartsEnabled = this.getDocumentConfigJson().getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_ENABLE_CHARTING);
	if (queryModel.getFilter().isValueHelpFilterInitialized())
	{
		queryModel.stopEventing();
		queryModel.getFilter().getValuehelpFilter().setCartesianProduct(null);
		queryModel.resumeEventing();
	}
	let docContent = this.getQueryBuilderDocContent();
	docContent.setSystemName(queryModel.getDataSource().getSystemName());
	docContent.setDataSource(queryModel.getDataSource().getFullQualifiedName());
	docContent.setInaRepoStructure(queryModel.serializeToElement(oFF.QModelFormat.INA_REPOSITORY_DELTA));
	docContent.clearViews();
	if (!chartsEnabled)
	{
		let allViews = oFF.PrFactory.createList();
		oFF.XCollectionUtils.forEach(this.m_views, (qbView) => {
			let viewData = qbView.getViewSaveData();
			let viewSaveStruct = oFF.PrFactory.createStructure();
			viewSaveStruct.put(oFF.AuGdsQbConstants.GDF_QD_FILE_VIEWS_VIEW_DATA_KEY, viewData);
			viewSaveStruct.putInteger(oFF.AuGdsQbConstants.GDF_QD_FILE_VIEWS_VIEW_INDEX_KEY, this.getViewIndex(qbView));
			allViews.add(viewSaveStruct);
		});
		docContent.setViews(allViews);
	}
	docContent.setSelectedViewIndex(this.getSelectedViewIndex());
	if (oFF.notNull(this.m_filterLine))
	{
		docContent.setFilterLineConfig(this.m_filterLine.getConfig());
	}
	if (oFF.notNull(this.m_queryDetails))
	{
		docContent.setQueryDetailsConfig(this.m_queryDetails.getConfig());
	}
	let modelName = this.getModelName();
	if (oFF.XStringUtils.isNotNullAndNotEmpty(modelName))
	{
		docContent.setModel(modelName);
	}
};
