oFF.AuGdsQbChartLabelView.prototype.setupView = function() {};
oFF.AuGdsQbChartLabelView.prototype.updateUi = function()
{
	let chartDefinition = this.m_manager.getActiveChartDefinition();
	if (chartDefinition.getChartSetting().getChartType() !== null)
	{
		if (this.m_chartType !== chartDefinition.getChartSetting().getChartType())
		{
			this.m_runOnceFirstAndOnChartChange = true;
			this.resetCheckboxes();
		}
		this.m_chartType = chartDefinition.getChartSetting().getChartType();
		let additionalOptions = oFF.XLinkedHashMapByString.create();
		additionalOptions.put(oFF.OlapVisualizationConstants.CHART_STYLE_PLACEMENT_INLINE, this.m_i18n.getText(oFF.AuGdsQbChartPropertiesI18n.STYLE_CHART_PLACEMENT_INLINE));
		let diagonalOptions = oFF.XLinkedHashMapByString.create();
		diagonalOptions.put(oFF.OlapVisualizationConstants.CHART_STYLE_LABEL_DIRECTION_DIAGONAL, this.m_i18n.getText(oFF.AuGdsQbChartPropertiesI18n.STYLE_CHART_LABEL_AXIS_DIRECTION_DIAGONAL));
		let inlineOption = oFF.XLinkedHashMapByString.create();
		inlineOption.put(oFF.OlapVisualizationConstants.CHART_STYLE_LABEL_DIRECTION_INLINE, this.m_i18n.getText(oFF.AuGdsQbChartPropertiesI18n.STYLE_CHART_LABEL_AXIS_DIRECTION_INLINE));
		if (this.m_chartType.isTypeOf(oFF.ChartType.PIE) || this.m_chartType.isTypeOf(oFF.ChartType.DOUGHNUT))
		{
			this.resetPanel();
			this.m_labelTypeDropdown.setVisible(false);
			this.m_showDataLabelCheckbox.setVisible(true);
			this.m_showAbsoluteValuesCheckbox.setVisible(true);
		}
		else
		{
			this.m_labelTypeDropdown.setVisible(true);
		}
		this.m_labelTypeDropdown.setValueChangedConsumer((key, value) => {
			this._updateUI(value.toString(), this.m_chartType);
		});
		this.m_showDataLabelCheckbox.setValueChangedConsumer((value, newValue) => {
			let isChecked = oFF.XBoolean.convertFromString(newValue.getStringRepresentation());
			this.m_manager.setDataLabelShow(isChecked);
		});
		this.m_xAxisTitleCheckbox.setValueChangedConsumer((value, newValue) => {
			let isChecked = oFF.XBoolean.convertFromString(newValue.getStringRepresentation());
			this.m_manager.setXAxisTitleShow(isChecked);
		});
		this.m_yAxisTitleCheckbox.setValueChangedConsumer((value, newValue) => {
			let isChecked = oFF.XBoolean.convertFromString(newValue.getStringRepresentation());
			this.m_manager.setYAxisTitleShow(isChecked);
		});
		this.m_xAxisLabelCheckbox.setValueChangedConsumer((value, newValue) => {
			let isChecked = oFF.XBoolean.convertFromString(newValue.getStringRepresentation());
			this.m_manager.setXAxisLabelShow(isChecked);
		});
		this.m_yAxisLabelCheckbox.setValueChangedConsumer((value, newValue) => {
			let isChecked = oFF.XBoolean.convertFromString(newValue.getStringRepresentation());
			this.m_manager.setYAxisLabelShow(isChecked);
		});
		this.m_showAbsoluteValuesCheckbox.setValueChangedConsumer((value, newValue) => {
			let isChecked = oFF.XBoolean.convertFromString(newValue.getStringRepresentation());
			this.m_manager.setAbsoluteValues(isChecked);
		});
		if (oFF.notNull(this.m_optionsDropdown))
		{
			this.m_optionsDropdown.setValueChangedConsumer((value, newValue) => {
				this.m_manager.setDirectionOptions(newValue.getStringRepresentation());
			});
		}
		this.m_showFirstCheckbox.setValueChangedConsumer((value, newValue) => {
			let string = newValue.getStringRepresentation();
			let isChecked = oFF.XBoolean.convertFromString(string);
			this.m_manager.setShowFirst(isChecked);
		});
		if (this.m_chartType.isTypeOf(oFF.ChartType.BAR) || this.m_chartType.isTypeOf(oFF.ChartType.STACKED_BAR))
		{
			this.m_optionsDropdown = this.m_labelDirectionInlineDropdown;
			this.m_showAbsoluteValuesCheckbox.setVisible(false);
		}
		else
		{
			this.m_optionsDropdown = this.m_labelDirectionDiagonalDropdown;
		}
		if (this.m_runOnceFirstAndOnChartChange)
		{
			if (!this.m_chartType.isTypeOf(oFF.ChartType.PIE) && !this.m_chartType.isTypeOf(oFF.ChartType.DOUGHNUT))
			{
				this.m_labelTypeDropdown.setValue(oFF.XStringValue.create(oFF.OlapVisualizationConstants.CHART_STYLE_LABEL_AXISLABEL));
				this._updateUI(oFF.OlapVisualizationConstants.CHART_STYLE_LABEL_AXISLABEL, this.m_chartType);
			}
			this.m_runOnceFirstAndOnChartChange = false;
		}
	}
};

