oFF.AuGdsQbConditionalFormattingContentView.prototype.loadCards = function()
{
	this.m_rulesContainer.clearItems();
	this.m_cardWidgetsManager.clear();
	let rules = this.m_CRUDLAPI.listAllRules();
	for (let i = 0; i < rules.size(); i++)
	{
		let cardWidget = this.createRuleCard(rules.get(i));
		this.m_cardWidgetsManager.add(cardWidget);
		this.m_rulesContainer.addItem(cardWidget.getView());
		cardWidget.validate();
		this.focusCardIfNecessary(cardWidget);
	}
	this.m_noRulesMsgContainer.setVisible(rules.isEmpty());
	this.updateOverlapWarning();
};
