oFF.AuGdsConditionalFormattingThresholdIcon.prototype.checkContrast = function()
{
	let l1 = this.m_backgroundLuminance + .05;
	let l2 = this.getLuminance(this.m_color) + .05;
	let ratio = l1 / l2;
	if (l2 > l1)
	{
		ratio = 1 / ratio;
	}
	return ratio >= 3;
};
