{
	this.fireOnChange(this.m_activeCheckbox.isChecked());
};
oFF.AuGdsQbConditionalFormattingRuleCard.prototype.toggleEditLockPopover = function(control)
{
	if (this.m_editLockPopoverElement !== control && oFF.notNull(this.m_editLockPopover))
	{
		this.m_editLockPopover.close();
	}
	this.togglePopover(this.m_editLockPopover, control);
	this.m_editLockPopoverElement = control;
};
oFF.AuGdsQbConditionalFormattingRuleCard.prototype.togglePopover = function(popover, control)
{
	if (oFF.isNull(popover))
	{
		return;
	}
	if (popover.isOpen())
	{
		popover.close();
	}
	else
	{
		popover.openAt(control);
	}
};
oFF.AuGdsQbConditionalFormattingRuleCard.prototype.updateInfoIconUi = function()
{
	this.setErrorIcon();
	this.setWarningIcon();
	let infoIconVisible = this.isError() || this.isWarning();
	this.m_infoIcon.setVisible(infoIconVisible);
	if (!infoIconVisible)
	{
		this.m_infoIcon.registerOnHover(null);
		this.m_infoIcon.registerOnHoverEnd(null);
		this.m_infoIcon.registerOnPress(null);
	}
};
oFF.AuGdsQbConditionalFormattingRuleCard.prototype.updateUi = function()
{
	this.m_activeCheckbox.setChecked(this.isActiveRule());
	this.m_activeCheckbox.setEnabled(this.m_isEnabled);
	this.updateInfoIconUi();
};
oFF.AuGdsQbConditionalFormattingRuleCard.prototype.validate = function()
{
	let ruleValidationMessenger = this.m_ruleValidator.validate(this.m_rule);
	if (ruleValidationMessenger.hasErrors())
	{
		this.setErrors(ruleValidationMessenger.getErrors());
	}
	else
	{
		this.m_ruleValidator.validateFilters(this.m_rule).then((filtersValidationMessenger) => {
			if (filtersValidationMessenger.hasErrors())
			{
				this.setErrors(filtersValidationMessenger.getErrors());
			}
			return filtersValidationMessenger;
		}, null);
	}
};

