oFF.AuTablePropertiesView.prototype.resetValues = function()
{
	let needsReFetch = false;
	if (oFF.notNull(this.m_templateManager) && (!oFF.XString.isEqual(this.m_templateManager.getActiveTemplateName(), this.m_templateManager.getDefaultTableTemplate()) || this.m_templateManager.isAlternatingRowsActive() || this.m_templateManager.isWrapText() || this.m_templateManager.isMayOverwriteExceptions() && !oFF.XString.isEqual(this.m_templateManager.getActiveExceptionFormattingName(), this.m_templateManager.getDefaultExceptionFormattingName()) || this.m_templateManager.supportsChartTemplates() && oFF.XCollectionUtils.hasElements(this.m_templateManager.getChartTemplateCollection(oFF.OlapVisualizationConstants.CHART_TEMPLATE_LINK)) && (!oFF.XString.isEqual(this.m_templateManager.getActiveChartTemplateName(), this.m_templateManager.getDefaultChartTemplate()))))
	{
		this.m_templateManager.activateTemplate(this.m_templateManager.getDefaultTableTemplate());
		this.m_templateManager.setAlternatingRowsActive(false);
		this.m_templateManager.setWrapText(false);
		this.m_templateManager.setReportReadingLines(1);
		if (this.m_templateManager.supportsChartTemplates() && oFF.XCollectionUtils.hasElements(this.m_templateManager.getChartTemplateCollection(oFF.OlapVisualizationConstants.CHART_TEMPLATE_LINK)))
		{
			this.m_templateManager.activateChartTemplate(oFF.OlapVisualizationConstants.CHART_COLOR_NAME);
		}
		if (this.m_templateManager.isMayOverwriteExceptions())
		{
			this.m_templateManager.activateExceptionFormatting(oFF.OlapVisualizationConstants.EXCEPTION_SYMBOL);
		}
		needsReFetch = true;
	}
	if (oFF.notNull(this.m_queryManager) && !oFF.XString.isEqual(this.getPosition(), oFF.AuTablePropertiesView.DEFAULT_KEY))
	{
		let cmd = this.m_queryManager.getConvenienceCommands();
		cmd.clearAllUniqueAxisProperties();
		cmd.toggleUniqueAxisProperties(null, oFF.UniqueAxisPropertyType.NUMERIC_SHIFT, true);
		cmd.toggleUniqueAxisProperties(null, oFF.UniqueAxisPropertyType.UNIT_INDEX, true);
		cmd.toggleUniqueAxisProperties(null, oFF.UniqueAxisPropertyType.CELL_VALUE_TYPES, true);
		needsReFetch = true;
	}
	this.updateUi();
	if (needsReFetch)
	{
		this.notifyChangeListeners();
	}
};
