oFF.AuTablePropertiesView.prototype.updateUi = function()
{
	let templateDropdown = this.m_form.getFormItemByKey(oFF.AuTablePropertiesView.TEMPLATE);
	let unitPosDropdown = this.m_form.getFormItemByKey(oFF.AuTablePropertiesView.UNIT_POSITION);
	let alternatingSwitch = this.m_form.getFormItemByKey(oFF.AuTablePropertiesView.ALTERNATING);
	let wrapSwitch = this.m_form.getFormItemByKey(oFF.AuTablePropertiesView.WRAP);
	let exceptionDropdown = this.m_form.getFormItemByKey(oFF.AuTablePropertiesView.EXCEPTIONS);
	let chartTemplateDropdown = this.m_form.getFormItemByKey(oFF.AuTablePropertiesView.CHART_TEMPLATES);
	let readingLinesDropdown = this.m_form.getFormItemByKey(oFF.AuTablePropertiesView.READING_LINES);
	templateDropdown.setValueChangedConsumer(null);
	unitPosDropdown.setValueChangedConsumer(null);
	alternatingSwitch.setValueChangedConsumer(null);
	if (oFF.notNull(this.m_templateManager) && oFF.XObjectExt.isValidObject(this.getQueryManager()) && oFF.XObjectExt.isValidObject(this.getQueryManager().getQueryModel()))
	{
		let tableDefinition = this.getActiveTableDefinition();
		let tableShowing = oFF.notNull(tableDefinition);
		if (tableShowing)
		{
			this.m_templateManager.setTableDefinition(tableDefinition);
		}
		oFF.XCollectionUtils.forEach(this.m_form.getAllFormItems(), (item) => {
			item.setEnabled(tableShowing);
		});
		if (oFF.notNull(chartTemplateDropdown) && this.m_templateManager.supportsChartTemplates())
		{
			chartTemplateDropdown.setEnabled(!tableShowing);
		}
	}
	let templateOptions = oFF.XLinkedHashMapByString.create();
	if (oFF.notNull(this.m_templateManager))
	{
		let templateCollection = this.m_templateManager.getTemplateCollection(oFF.OlapVisualizationConstants.TABLE_TEMPLATE_LINK);
		oFF.XCollectionUtils.forEach(templateCollection, (template) => {
			templateOptions.put(template.getName(), this.getTableTemplateText(template.getName()));
		});
	}
	templateDropdown.setDropdownItems(templateOptions);
	if (oFF.notNull(this.m_templateManager))
	{
		templateDropdown.setValue(oFF.XStringValue.create(this.m_templateManager.getActiveTemplateName()));
	}
	if (oFF.notNull(exceptionDropdown))
	{
		exceptionDropdown.setValueChangedConsumer(null);
	}
	if (oFF.notNull(readingLinesDropdown))
	{
		readingLinesDropdown.setValueChangedConsumer(null);
	}
	if (!oFF.XObjectExt.isValidObject(this.m_queryManager) || !oFF.XObjectExt.isValidObject(this.m_queryManager.getQueryModel()))
	{
		return;
	}
	let optionalTemplateManager = oFF.XOptional.getOptionalEnsureNotReleased(this.m_templateManager);
	optionalTemplateManager.ifPresent((templateManager) => {
		templateDropdown.setValue(oFF.XStringValue.create(templateManager.getActiveTemplateName()));
		templateDropdown.setValueChangedConsumer((formItemKey, optionKey) => {
			templateManager.activateTemplate(optionKey.getStringRepresentation());
			this.updateReadingLineDropdownVisibility(readingLinesDropdown);
			this.notifyChangeListeners();
		});
		if (oFF.notNull(readingLinesDropdown))
		{
			this.updateReadingLineDropdownVisibility(readingLinesDropdown);
			readingLinesDropdown.setValue(oFF.XStringValue.create(oFF.XInteger.convertToString(templateManager.getReportReadingLines())));
			readingLinesDropdown.setValueChangedConsumer((readingKey, readingOption) => {
				templateManager.setReportReadingLines(oFF.XInteger.convertFromString(readingOption.getStringRepresentation()));
				this.notifyChangeListeners();
			});
		}
		if (oFF.notNull(exceptionDropdown))
		{
			let showExceptions = templateManager.isMayOverwriteExceptions();
			exceptionDropdown.setVisible(showExceptions);
			if (showExceptions)
			{
				exceptionDropdown.setValue(oFF.XStringValue.create(templateManager.getActiveExceptionFormattingName()));
				exceptionDropdown.setValueChangedConsumer((formItemKey1, optionKey1) => {
					templateManager.activateExceptionFormatting(optionKey1.getStringRepresentation());
					this.notifyChangeListeners();
				});
			}
		}
		unitPosDropdown.setVisible(this.getQueryManager().getModelCapabilities().supportsUniqueAxisProperties());
		unitPosDropdown.setValue(oFF.XStringValue.create(this.getPosition()));
		unitPosDropdown.setValueChangedConsumer((formItemKey2, positionKey) => {
			this.setPosition(positionKey.getStringRepresentation());
			this.notifyChangeListeners();
		});
		alternatingSwitch.setValue(oFF.XBooleanValue.create(templateManager.isAlternatingRowsActive()));
		alternatingSwitch.setValueChangedConsumer((formItemKey3, newValue) => {
			let booleanValue = newValue;
			templateManager.setAlternatingRowsActive(booleanValue.getBoolean());
			this.notifyChangeListeners();
		});
		wrapSwitch.setVisible(true);
		wrapSwitch.setValue(oFF.XBooleanValue.create(templateManager.isWrapText()));
		wrapSwitch.setValueChangedConsumer((formItemKey4, newValue4) => {
			let booleanValue4 = newValue4;
			templateManager.setWrapText(booleanValue4.getBoolean());
			this.notifyChangeListeners();
		});
		if (oFF.notNull(chartTemplateDropdown))
		{
			let chartDropdownVisible = templateManager.supportsChartTemplates() && oFF.XCollectionUtils.hasElements(templateManager.getChartTemplateCollection(oFF.OlapVisualizationConstants.CHART_TEMPLATE_LINK));
			chartTemplateDropdown.setVisible(chartDropdownVisible);
			if (chartDropdownVisible)
			{
				chartTemplateDropdown.setValue(oFF.XStringValue.create(this.m_templateManager.getActiveChartTemplateName()));
				chartTemplateDropdown.setValueChangedConsumer((formItemKey4, optionKey4) => {
					this.m_templateManager.activateChartTemplate(optionKey4.getStringRepresentation());
					this.notifyChangeListeners();
				});
			}
		}
	});
};

