oFF.AuGdsQbLandingPageView.prototype._createNameCell = function(recentFile)
{
	let nameCellWrapper = this.getGenesis().newControl(oFF.UiType.FLEX_LAYOUT);
	nameCellWrapper.setDirection(oFF.UiFlexDirection.ROW);
	nameCellWrapper.setAlignItems(oFF.UiFlexAlignItems.START);
	nameCellWrapper.useMaxWidth();
	let iconName = this.getRecentFileIcon(recentFile);
	if (oFF.XStringUtils.isNotNullAndNotEmpty(iconName))
	{
		let fileIcon = nameCellWrapper.addNewItemOfType(oFF.UiType.ICON);
		fileIcon.setIcon(iconName);
		fileIcon.setEnabled(false);
		fileIcon.setMargin(oFF.UiCssBoxEdges.create("0.1rem 0.5rem 0 0"));
	}
	let nameBreadcrumbWrapper = nameCellWrapper.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
	nameBreadcrumbWrapper.setDirection(oFF.UiFlexDirection.COLUMN);
	if (oFF.XStringUtils.isNotNullAndNotEmpty(iconName))
	{
		nameBreadcrumbWrapper.setWidth(oFF.UiCssLength.create("calc(100% - 1.5rem)"));
	}
	let nameText = nameBreadcrumbWrapper.addNewItemOfType(oFF.UiType.TEXT);
	nameText.setText(this.getRecentFileName(recentFile));
	nameText.setWrapping(false);
	nameCellWrapper.setCustomObject(nameText);
	if (this.m_isSacIntegration)
	{
		this.generateAncestorPathsIfNecessary(nameBreadcrumbWrapper, recentFile, nameText);
	}
	return nameCellWrapper;
};
oFF.AuGdsQbLandingPageView.prototype._getAncestorTranslatedDisplayName = function(ancestorStruct)
{
	let displayName = null;
	if (oFF.notNull(ancestorStruct))
	{
		let ancestorUniqueId = ancestorStruct.getStringByKey(oFF.XFileAttribute.UNIQUE_ID);
		if (oFF.XStringUtils.isNotNullAndNotEmpty(ancestorUniqueId))
		{
			displayName = oFF.SuResourceWrapper.getTranslatedDisplayNameForResourceUid(ancestorUniqueId);
			if (oFF.XStringUtils.isNullOrEmpty(displayName))
			{
				displayName = ancestorStruct.getStringByKey(oFF.XFileAttribute.DISPLAY_NAME);
			}
			if (oFF.XStringUtils.isNullOrEmpty(displayName))
			{
				displayName = ancestorUniqueId;
			}
		}
		else
		{
			displayName = ancestorStruct.getStringByKey(oFF.XFileAttribute.DISPLAY_NAME);
		}
	}
	return displayName;
};
oFF.AuGdsQbLandingPageView.prototype._getConnectionIconName = function()
{
	if (this.getGenesis().getUiManager().getDriverInfo().getAllIconNames().contains("fpa/data"))
	{
		return "fpa/data";
	}
	return "connected";
};
oFF.AuGdsQbLandingPageView.prototype._getRecentFiles = function()
{
	let recentFilesDir = null;
	if (this.m_process.getFileSystemManager().getActiveFileSystem().getProtocolType() === oFF.ProtocolType.VFS)
	{
		recentFilesDir = oFF.XFile.createFromEnvVar(this.m_process, oFF.XEnvironmentConstants.FIREFLY_RECENT_FILES, null);
	}
	else if (this.m_process.getFileSystemManager().getActiveFileSystem().getProtocolType() === oFF.ProtocolType.FS_DUMMY)
	{
		recentFilesDir = oFF.XFile.create(this.m_process, "/sys/EHS/clib/RecentFiles/");
	}
	else if (this.m_process.getFileSystemManager().getActiveFileSystem().getProtocolType() === oFF.ProtocolType.FS_CONTENTLIB)
	{
		recentFilesDir = oFF.XFile.create(this.m_process, "/RecentFiles/");
	}
	if (oFF.notNull(recentFilesDir) && recentFilesDir.isValid())
	{
		this.m_recentFileTable.setBusy(true);
		recentFilesDir.processFetchChildren(oFF.SyncType.NON_BLOCKING, this, null, null);
	}
};
oFF.AuGdsQbLandingPageView.prototype._handleRecentFilesLoaded = function(recentFiles)
{
	if (oFF.notNull(recentFiles))
	{
		this.m_recentFileTable.clearResponsiveTableRows();
		this.m_allRecentFileEntries.clear();
		this.updateRecentFilesLabel(recentFiles.size());
		oFF.XCollectionUtils.forEach(recentFiles, (recentFile) => {
			let tmpRow = this.m_recentFileTable.addNewResponsiveTableRow();
			tmpRow.setCustomObject(recentFile);
			tmpRow.addResponsiveTableCell(this._createNameCell(recentFile));
			let descCell = tmpRow.addNewResponsiveTableCellOfType(oFF.UiType.TEXT);
			descCell.setText(this.getRecentFileDescription(recentFile));
			let createdByCell = tmpRow.addNewResponsiveTableCellOfType(oFF.UiType.TEXT);
			createdByCell.setText(this.getRecentFileCreatedBy(recentFile));
			let createdAtCell = tmpRow.addNewResponsiveTableCellOfType(oFF.UiType.TEXT);
			createdAtCell.setText(this.getRecentFileCreatedAt(recentFile));
			let changedByCell = tmpRow.addNewResponsiveTableCellOfType(oFF.UiType.TEXT);
			changedByCell.setText(this.getRecentFileChangedBy(recentFile));
			let changedAtCell = tmpRow.addNewResponsiveTableCellOfType(oFF.UiType.TEXT);
			changedAtCell.setText(this.getRecentFileChangedAt(recentFile));
			this.m_allRecentFileEntries.add(tmpRow);
		});
	}
};
