oFF.AuGdsQbLandingPageView.prototype.filterRecentFiles = function(searchText, clearButtonPressed)
{
	this.m_recentFileTable.clearResponsiveTableRows();
	if (!clearButtonPressed)
	{
		for (let a = 0; a < this.m_allRecentFileEntries.size(); a++)
		{
			let responsiveTableRow = this.m_allRecentFileEntries.get(a);
			if (this.isTextInRow(responsiveTableRow, searchText))
			{
				this.m_recentFileTable.addResponsiveTableRow(responsiveTableRow);
			}
		}
	}
	else
	{
		oFF.XCollectionUtils.forEach(this.m_allRecentFileEntries, (tmpRow) => {
			this.m_recentFileTable.addResponsiveTableRow(tmpRow);
		});
	}
	this.updateRecentFilesLabel(this.m_recentFileTable.getNumberOfResponsiveTableRows());
};
oFF.AuGdsQbLandingPageView.prototype.generateAncestorPathsIfNecessary = function(nameCellWrapper, recentFile, nameText)
{
	let metadata = recentFile.getCachedMetadata();
	let ancestorList = metadata.getListReadOnlyByKey(oFF.XFileAttribute.ANCESTOR_RESOURCE);
	let isWorkspace = metadata.getBooleanByKey(oFF.XFileAttribute.IS_WORKSPACE_FILE);
	if (oFF.notNull(ancestorList) && ancestorList.hasElements())
	{
		let ancestorsBreadcrumbs = nameCellWrapper.addNewItemOfType(oFF.UiType.BREADCRUMBS);
		ancestorsBreadcrumbs.addCssClass("ffGdsQbLandingPageRecentFileBreadcrumbs");
		ancestorsBreadcrumbs.useMaxWidth();
		ancestorsBreadcrumbs.setMargin(oFF.UiCssBoxEdges.create("0.325rem 0"));
		ancestorsBreadcrumbs.addLabelledBy(nameText);
		let readOnlyBag = ancestorList.getReadOnlyList();
		oFF.XCollectionUtils.forEach(readOnlyBag, (ancestor) => {
			if (ancestor.isStructure())
			{
				let ancestorStruct = ancestor.asStructureReadOnly();
				if (ancestorStruct.hasElements())
				{
					let resUid = ancestorStruct.getStringByKey(oFF.XFileAttribute.UNIQUE_ID);
					if (!oFF.XString.isEqual(resUid, oFF.AuGdsQbLandingPageView.WORKSPACES_UID))
					{
						let linkUrl = "/sap/fpa/ui/app.html#/files&/f/";
						if (isWorkspace)
						{
							let fullResPath = "";
							for (let i = 0; i < ancestorsBreadcrumbs.getLinks().size(); i++)
							{
								let srcLink = ancestorsBreadcrumbs.getLinks().get(i).getSrc();
								let index = oFF.XString.lastIndexOf(srcLink, "/");
								fullResPath = oFF.XStringUtils.concatenate3(fullResPath, oFF.XString.substring(srcLink, index + 1, -1), "/");
							}
							resUid = oFF.XString.replace(resUid, "_ROOT", "");
							linkUrl = oFF.XStringUtils.concatenate3(linkUrl, fullResPath, resUid);
						}
						else
						{
							linkUrl = oFF.XStringUtils.concatenate2(linkUrl, "myfiles");
							if (oFF.XStringUtils.isNotNullAndNotEmpty(resUid) && !oFF.XString.isEqual(oFF.XString.toLowerCase(resUid), "myfiles"))
							{
								linkUrl = oFF.XStringUtils.concatenate3(linkUrl, "/", resUid);
							}
						}
						let newAncestorLink = ancestorsBreadcrumbs.addNewLink();
						newAncestorLink.setText(this._getAncestorTranslatedDisplayName(ancestorStruct));
						newAncestorLink.setTarget("_self");
						newAncestorLink.setSrc(linkUrl);
					}
				}
			}
		});
	}
};
