oFF.AuGdsQbLandingPageView.prototype.getSingleAttribute = function(file, name, alternativeName, defaultValue)
{
	let value = null;
	if (oFF.notNull(file))
	{
		let metadata = file.getCachedMetadata();
		if (oFF.notNull(metadata))
		{
			value = metadata.getStringByKey(name.getName());
			if (oFF.isNull(value) && oFF.notNull(alternativeName))
			{
				value = metadata.getStringByKey(alternativeName.getName());
			}
		}
	}
	if (oFF.XStringUtils.isNullOrEmpty(value))
	{
		value = defaultValue;
	}
	return value;
};
