oFF.AuGdsQbLandingPageView.prototype.isTextInRow = function(row, searchText)
{
	if (oFF.isNull(row))
	{
		return false;
	}
	if (oFF.XStringUtils.isNullOrEmpty(searchText))
	{
		return true;
	}
	let nameLbl = row.getResponsiveTableCell(0).getCustomObject();
	let descriptionLbl = row.getResponsiveTableCell(1);
	let createdByLbl = row.getResponsiveTableCell(2);
	let createdOnLbl = row.getResponsiveTableCell(3);
	let changedByLbl = row.getResponsiveTableCell(4);
	let changedOnLbl = row.getResponsiveTableCell(5);
	let nameLower = oFF.XString.toLowerCase(nameLbl.getText());
	let descLower = oFF.XString.toLowerCase(descriptionLbl.getText());
	let createdByLower = oFF.XString.toLowerCase(createdByLbl.getText());
	let createdOnLower = oFF.XString.toLowerCase(createdOnLbl.getText());
	let changedByLower = oFF.XString.toLowerCase(changedByLbl.getText());
	let changedOnLower = oFF.XString.toLowerCase(changedOnLbl.getText());
	let searchTextLower = oFF.XString.toLowerCase(searchText);
	if (oFF.XString.containsString(nameLower, searchTextLower))
	{
		return true;
	}
	if (oFF.XString.containsString(descLower, searchTextLower))
	{
		return true;
	}
	if (oFF.XString.containsString(createdByLower, searchTextLower))
	{
		return true;
	}
	if (oFF.XString.containsString(createdOnLower, searchTextLower))
	{
		return true;
	}
	if (oFF.XString.containsString(changedByLower, searchTextLower))
	{
		return true;
	}
	return oFF.XString.containsString(changedOnLower, searchTextLower);
};
