oFF.AuGdsQbInteractiveTableView.prototype.addAreaBoundaries = function(dropAreas, boundaries, headerFromKey, headerToKey, boundaryFromKey, boundaryToKey, headerIndex)
{
	let oldBoundary = 0;
	for (let i = 0; i < boundaries.size(); i++)
	{
		let boundary = boundaries.get(i).getInteger();
		if (boundary !== oldBoundary)
		{
			let structure = dropAreas.addNewStructure();
			structure.putInteger(headerFromKey, headerIndex);
			structure.putInteger(headerToKey, headerIndex);
			structure.putInteger(boundaryFromKey, oldBoundary);
			structure.putInteger(boundaryToKey, boundary - 1);
		}
		oldBoundary = boundary;
	}
};
