oFF.AuGdsQbInteractiveTableView.prototype.executeScrollLoad = function(vizContainer, enforce, correct)
{
	let totalHeightRaw = this.m_renderer.getTableJson().getIntegerByKey(oFF.SacTableConstants.TD_N_TOTAL_HEIGHT);
	let widgetHeightRaw = this.m_renderer.getTableJson().getIntegerByKey(oFF.SacTableConstants.TD_N_WIDGET_HEIGHT);
	let rowsTotalCount = this.getDataRowTuplesCountTotal();
	let totalWidthRaw = this.m_renderer.getTableJson().getIntegerByKey(oFF.SacTableConstants.TD_N_TOTAL_WIDTH);
	let widgetWidthRaw = this.m_renderer.getTableJson().getIntegerByKey(oFF.SacTableConstants.TD_N_WIDGET_WIDTH);
	let columnsTotalCount = this.getDataColumnTuplesCountTotal();
	if (this.m_scrollTopRaw > -1 || this.isHorizontalLazyLoad() && this.m_scrollLeftRaw > -1)
	{
		let rowScrollReferencePoint = this.m_rowScrollReferencePoint;
		let rowScrollEndReferencePoint = this.m_rowScrollEndReferencePoint;
		if (this.m_scrollTopRaw > -1)
		{
			let totalHeight = oFF.XMath.div(totalHeightRaw, 1000) + 1;
			let scrollTop = oFF.XMath.div(this.m_scrollTopRaw, 1000);
			let scrollTopEnd = oFF.XMath.div(this.m_scrollTopRaw + widgetHeightRaw, 1000) + 2;
			rowScrollReferencePoint = oFF.XMath.div(rowsTotalCount * scrollTop, totalHeight);
			rowScrollEndReferencePoint = oFF.XMath.div(rowsTotalCount * scrollTopEnd, totalHeight) + 1;
		}
		let colScrollReferencePoint = this.m_colScrollReferencePoint;
		let colScrollEndReferencePoint = this.m_colScrollEndReferencePoint;
		if (this.isHorizontalLazyLoad() && this.m_scrollLeftRaw > -1)
		{
			let totalWidth = oFF.XMath.div(totalWidthRaw, 1000) + 1;
			let scrollLeft = oFF.XMath.div(this.m_scrollLeftRaw, 1000);
			let scrollLeftEnd = oFF.XMath.div(this.m_scrollLeftRaw + widgetWidthRaw, 1000) + 2;
			colScrollReferencePoint = oFF.XMath.div(columnsTotalCount * scrollLeft, totalWidth);
			colScrollEndReferencePoint = oFF.XMath.div(columnsTotalCount * scrollLeftEnd, totalWidth) + 1;
		}
		let rowScrollDifference = rowScrollReferencePoint - this.m_rowScrollReferencePoint;
		let colScrollDifference = colScrollReferencePoint - this.m_colScrollReferencePoint;
		let rowScrollTolerance = oFF.XMath.div(this.getRowsWindowSize(), 2);
		let colScrollTolerance = oFF.XMath.div(this.getColumnsWindowSize(), 2);
		if (enforce || rowScrollDifference > 0 && this.isRowTotalCountInaccurate() || colScrollDifference > 0 && this.isColumnTotalCountInaccurate() || rowScrollDifference > rowScrollTolerance || rowScrollDifference < -rowScrollTolerance || colScrollDifference > colScrollTolerance || colScrollDifference < -colScrollTolerance)
		{
			this.m_rowScrollReferencePoint = rowScrollReferencePoint;
			this.m_rowScrollEndReferencePoint = rowScrollEndReferencePoint;
			this.m_colScrollReferencePoint = colScrollReferencePoint;
			this.m_colScrollEndReferencePoint = colScrollEndReferencePoint;
			if (oFF.XStringUtils.isNotNullAndNotEmpty(this.m_scrollTimeout))
			{
				oFF.XTimeout.clear(this.m_scrollTimeout);
			}
			if (correct && oFF.notNull(vizContainer))
			{
				this.correctScrollingPoints(vizContainer);
			}
			this.m_scrollTimeout = oFF.XTimeout.timeout(100, () => {
				this.reschedulePendingScroll();
				this.setTableModelJson(this.m_renderer.reFormat(this.getAvailableTableContainer()));
			});
		}
	}
};
