oFF.AuGdsQbInteractiveTableView.prototype.extractMembersFromTupleElements = function(tupleElementsLastSelected)
{
	for (let i = 0; i < tupleElementsLastSelected.size(); i++)
	{
		let tupleElement = tupleElementsLastSelected.get(i);
		let member = tupleElement.getDimensionMember();
		if (member.getMemberType().isTypeOf(oFF.MemberType.RESULT))
		{
			continue;
		}
		let dimension = this.getQueryManager().getQueryModel().getDimensionByName(tupleElement.getDimension().getName());
		this.extractStructureMember(dimension, member);
		oFF.XCollectionUtils.addIfNotPresent(this.m_membersLastSelected, member);
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.extractStructureMember = function(dimension, member)
{
	let structureMember;
	if (dimension.getDimensionType() === oFF.DimensionType.MEASURE_STRUCTURE)
	{
		structureMember = dimension.getStructureMember(member.getName());
		oFF.XCollectionUtils.addIfNotNull(this.m_measureMembersLastSelected, structureMember);
	}
	else if (dimension.getDimensionType() === oFF.DimensionType.SECONDARY_STRUCTURE)
	{
		structureMember = dimension.getStructureMember(member.getName());
		oFF.XCollectionUtils.addIfNotNull(this.m_secondaryStructureMembersLastSelected, structureMember);
	}
	else if (dimension.getDimensionType() === oFF.DimensionType.ACCOUNT)
	{
		structureMember = dimension.getStructureMember(member.getName());
		if (oFF.notNull(structureMember))
		{
			this.m_accountMembersLastSelected.add(structureMember);
		}
		else
		{
			this.m_accountMembersLastSelected.add(member);
		}
	}
	else if (dimension.getDimensionType().isTypeOf(oFF.DimensionType.GENERAL_VERSION))
	{
		structureMember = dimension.getStructureMember(member.getName());
		if (oFF.notNull(structureMember))
		{
			this.m_versionMembersLastSelected.add(structureMember);
		}
		else
		{
			this.m_versionMembersLastSelected.add(member);
		}
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.extractStructureMembersFromTuples = function(tuplesLastSelected)
{
	for (let i = 0; i < tuplesLastSelected.size(); i++)
	{
		let tuple = tuplesLastSelected.get(i);
		for (let j = 0; j < tuple.size(); j++)
		{
			let tupleElement = tuple.getTupleElementAt(j);
			let member = tupleElement.getDimensionMember();
			let dimension = this.getQueryManager().getQueryModel().getDimensionByName(tupleElement.getDimension().getName());
			this.extractStructureMember(dimension, member);
		}
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.fetchResultSet = function()
{
	if (this.m_useDpForDataFetch)
	{
		this.refreshTable();
		return;
	}
	let control = this.getTableControl();
	if (oFF.notNull(control) && oFF.XObjectExt.isValidObject(this.m_tableDefinition))
	{
		this.m_tableDefinition.getApplicationSettings().setWidgetHeight(control.getOffsetHeight());
		this.m_tableDefinition.getApplicationSettings().setWidgetWidth(control.getOffsetWidth());
		this.setBusy(true);
		let tableContainer = this.getActiveTableContainer();
		if (oFF.XObjectExt.isValidObject(tableContainer) && tableContainer.getSyncState() !== oFF.SyncState.PROCESSING && !this.hasPendingTableUpdates())
		{
			if (oFF.notNull(this.m_backendRequestStartedProcedure))
			{
				this.m_backendRequestStartedProcedure();
			}
			this.m_activeSynchronizer = tableContainer;
			tableContainer.processExecution(oFF.SyncType.NON_BLOCKING, this, null);
			tableContainer.attachListener(oFF.OuLambdaSyncListener.create((messages, data) => {
				this.checkPendingReRendering();
				let perfTool = oFF.UiPerformanceCenter.getCenter();
				perfTool.endMeasure("[Dragonfly][Select Dimension]");
				perfTool.endMeasure("[Dragonfly][Select Measure]");
				perfTool.endMeasure("[Dragonfly][Select All Measures]");
				perfTool.endMeasure("[Dragonfly][Filter Dimension]");
				perfTool.endMeasure("[Dragonfly][Load][Open from saved insight]");
				perfTool.endMeasure("[Dragonfly][Load][Open from datasource]");
				perfTool.endMeasure("[Dragonfly][Load][Open Url]");
				return oFF.XBooleanValue.create(true);
			}), oFF.ListenerType.SYNC_LISTENER, null);
		}
		else if (oFF.XObjectExt.isValidObject(tableContainer))
		{
			let singleUseListener = oFF.AbstractVisualizationProvidedListenerLambda.createSingleUse((cb) => {
				this.refreshTable();
			});
			tableContainer.attachListener(singleUseListener, oFF.ListenerType.SPECIFIC, null);
			this.m_renderingIsOutdated = true;
		}
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.filterAndDrill = function(sourceDimension, targetTupleElement)
{
	let member = targetTupleElement.getDimensionMember();
	if (oFF.notNull(member) && !oFF.XConstantWithParent.isObjectTypeOf(member.getMemberType(), oFF.MemberType.RESULT))
	{
		let dimension = targetTupleElement.getDimension();
		let dimensionName = null;
		let memberName = null;
		if (dimension.isUniversalDisplayHierarchyDimension())
		{
			let udhKey = member.getUdhKey();
			if (oFF.notNull(udhKey))
			{
				dimensionName = udhKey.getDrillGroupDimensionName();
				memberName = udhKey.getHierarchyKey();
			}
		}
		else
		{
			dimensionName = dimension.getName();
			memberName = member.getName();
		}
		this.filterAndDrillEffective(sourceDimension, dimensionName, memberName);
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.filterAndDrillEffective = function(sourceDimension, dimensionName, memberName)
{
	let cmd = this.getQueryManager().getConvenienceCommands();
	let dimension = this.getQueryManager().getQueryModel().getDimensionByName(dimensionName);
	cmd.clearFiltersByDimension(dimension);
	cmd.addSingleMemberFilterByDimension(dimension, memberName, oFF.ComparisonOperator.EQUAL);
	cmd.moveDimensionToFree(sourceDimension.getName());
	let targetAxisType = dimension.getAxisType();
	let targetAxisIndex = dimension.getIndexOnAxis();
	cmd.moveDimensionToFree(dimension.getName());
	cmd.moveDimensionOnAxisTo(sourceDimension.getName(), targetAxisType, targetAxisIndex);
	this.m_updateProcedure();
};
