oFF.AuGdsQbInteractiveTableView.prototype.getMinMediumMaxOfSelectedCells = function()
{
	let sortedList = oFF.XStream.of(this.m_selectedCells).filterNullValues().map((c) => {
		return c.getPlain();
	}).filterNullValues().filter((v) => {
		return v.getValueType().isNumber();
	}).map((n) => {
		return oFF.XDoubleValue.create(oFF.XValueUtil.getDouble(n, false, true));
	}).sorted(oFF.XComparatorDouble.create()).collect(oFF.XStreamCollector.toList());
	let cellCount = oFF.XCollectionUtils.size(sortedList);
	let middleIndex = oFF.XMath.div(cellCount, 2);
	let remainder = oFF.XMath.mod(cellCount, 2);
	let result = oFF.XList.create();
	if (cellCount > 0)
	{
		result.add(sortedList.get(0));
		let median;
		if (remainder === 0)
		{
			median = (sortedList.get(middleIndex).getDouble() + sortedList.get(middleIndex - 1).getDouble()) / 2;
		}
		else
		{
			median = sortedList.get(middleIndex).getDouble();
		}
		result.add(oFF.XDoubleValue.create(median));
		result.add(sortedList.get(cellCount - 1));
	}
	return result;
};
