oFF.AuGdsQbInteractiveTableView.prototype.handleMeasureActivation = function(node, sourceDimension, targetAxisType, targetField, targetTupleElement, targetTupleElementBefore, swapElement, beforeCell, membersGetter, visibleMembersGetter)
{
	let thenFunction = (allMembers) => {
		this.handleMeasureVisibility(node, sourceDimension, targetAxisType, targetField, targetTupleElement, targetTupleElementBefore, swapElement, beforeCell, allMembers, visibleMembersGetter);
		return null;
	};
	membersGetter.then(thenFunction, null);
};
oFF.AuGdsQbInteractiveTableView.prototype.handleMeasureActivationByTupleElement = function(tupleElement, sourceDimension, targetAxisType, targetField, targetTupleElement, targetTupleElementBefore, swapElement, beforeCell, membersGetter, visibleMembersGetter)
{
	let thenFunction = (allMembers) => {
		let nodeOptional = oFF.XStream.of(allMembers).find((n) => {
			return oFF.DfNameObject.areNamesEqual(n.getDimensionMember(), tupleElement.getDimensionMember());
		});
		if (nodeOptional.isPresent())
		{
			this.handleMeasureVisibility(nodeOptional.get(), sourceDimension, targetAxisType, targetField, targetTupleElement, targetTupleElementBefore, swapElement, beforeCell, allMembers, visibleMembersGetter);
		}
		return null;
	};
	membersGetter.then(thenFunction, null);
};
oFF.AuGdsQbInteractiveTableView.prototype.handleMeasureVisibility = function(node, sourceDimension, targetAxisType, targetField, targetTupleElement, targetTupleElementBefore, swapElement, beforeCell, allMembers, visibleMembersGetter)
{
	let thenFunction = (visibleMembers) => {
		let needsUpdate = false;
		let finalMembers = oFF.XListOfNameObject.create();
		finalMembers.addAll(visibleMembers);
		let finalMembersStable = oFF.XListOfNameObject.create();
		let containsDraggedMember = visibleMembers.containsKey(node.getDimensionMember().getName());
		if (!swapElement && oFF.notNull(targetTupleElementBefore) && oFF.DfNameObject.areNamesEqual(targetTupleElementBefore.getDimension(), sourceDimension) && oFF.XCollectionUtils.getIndexByMatchingPredicate(finalMembers, (am) => {
			return oFF.DfNameObject.areNamesEqual(am, targetTupleElementBefore.getDimensionMember());
		}) === oFF.XCollectionUtils.size(finalMembers) - 1)
		{
			oFF.XCollectionUtils.removeIf(finalMembers, (fm) => {
				return oFF.DfNameObject.areNamesEqual(fm, node.getDimensionMember());
			});
			finalMembers.add(node);
			finalMembersStable.addAll(finalMembers);
			oFF.QueryDesignerUtils.setFilterForDimension(sourceDimension, allMembers, finalMembers);
			oFF.QueryDesignerUtils.setMemberOrder(sourceDimension, finalMembersStable);
			needsUpdate = true;
		}
		else if (!oFF.XStream.of(visibleMembers).anyMatch((n) => {
			return n.hasChildren();
		}) && !node.hasChildren() && oFF.notNull(targetTupleElement) && oFF.DfNameObject.areNamesEqual(targetTupleElement.getDimension(), sourceDimension))
		{
			let targetMember = finalMembers.getByKey(targetTupleElement.getDimensionMember().getName());
			let sourceIndex = oFF.XCollectionUtils.getIndexByMatchingPredicate(finalMembers, (fm) => {
				return oFF.DfNameObject.areNamesEqual(fm.getDimensionMember(), node.getDimensionMember());
			});
			let targetIndex;
			if (swapElement)
			{
				oFF.XCollectionUtils.removeIf(finalMembers, (fm) => {
					return oFF.DfNameObject.areNamesEqual(fm, node.getDimensionMember());
				});
				targetIndex = oFF.XCollectionUtils.getIndexByMatchingPredicate(finalMembers, (fm) => {
					return oFF.DfNameObject.areNamesEqual(fm.getDimensionMember(), targetTupleElement.getDimensionMember());
				});
				finalMembers.insert(targetIndex, node);
				finalMembers.removeElement(targetMember);
				if (sourceIndex > -1)
				{
					finalMembers.insert(sourceIndex, targetMember);
				}
			}
			else
			{
				oFF.XCollectionUtils.removeIf(finalMembers, (fm) => {
					return oFF.DfNameObject.areNamesEqual(fm, node.getDimensionMember());
				});
				targetIndex = oFF.XCollectionUtils.getIndexByMatchingPredicate(finalMembers, (fm) => {
					return oFF.DfNameObject.areNamesEqual(fm.getDimensionMember(), targetTupleElement.getDimensionMember());
				});
				finalMembers.insert(targetIndex + (beforeCell ? 0 : 1), node);
			}
			finalMembersStable.addAll(finalMembers);
			oFF.QueryDesignerUtils.setFilterForDimension(sourceDimension, allMembers, finalMembers);
			oFF.QueryDesignerUtils.setMemberOrder(sourceDimension, finalMembersStable);
			needsUpdate = true;
		}
		else if (!containsDraggedMember)
		{
			finalMembers.add(node);
			this.addAllChildrenRecursive(node, finalMembers);
			oFF.QueryDesignerUtils.setFilterForDimension(sourceDimension, allMembers, finalMembers);
			needsUpdate = true;
		}
		if (oFF.notNull(targetField) && targetField.getDimension() !== sourceDimension)
		{
			if (swapElement)
			{
				this.swapDimensions(sourceDimension, targetField.getDimension());
			}
			else
			{
				this.moveDimensions(beforeCell, sourceDimension, targetField.getDimension());
			}
			needsUpdate = false;
		}
		else if (sourceDimension.getAxisType() !== targetAxisType)
		{
			sourceDimension.getConvenienceCommands().moveDimensionToAxis(sourceDimension.getName(), targetAxisType);
			sourceDimension.getConvenienceCommands().moveSortToPosition(oFF.SortType.ABSTRACT_DIMENSION_SORT, sourceDimension.getName(), 0);
			needsUpdate = true;
		}
		if (needsUpdate)
		{
			this.m_updateProcedure();
		}
		return null;
	};
	visibleMembersGetter.then(thenFunction, null);
};
