oFF.AuGdsQbInteractiveTableView.prototype.highlightTableDropZones = function(member, field, attribute, dimension)
{
	let optionalTableControl = oFF.XOptional.getOptionalEnsureNotReleased(this.getTableControl());
	optionalTableControl.ifPresent((tableControl) => {
		let columnIndices = oFF.XList.create();
		let rowIndices = oFF.XList.create();
		let resolver = tableControl.getCustomObject();
		let columnPadding = this.getTileColumnsPadding();
		let minCol = oFF.XMath.max(0, this.m_colScrollReferencePoint - columnPadding);
		let maxCol = oFF.XMath.max(this.m_colScrollEndReferencePoint, this.m_colScrollReferencePoint + this.getColumnsWindowSize()) + columnPadding;
		let rowPadding = this.getTileRowsPadding();
		let minRow = oFF.XMath.max(0, this.m_rowScrollReferencePoint - rowPadding);
		let maxRow = oFF.XMath.max(this.m_rowScrollEndReferencePoint, this.m_rowScrollReferencePoint + this.getRowsWindowSize()) + rowPadding;
		let lastMemberHeaderColumn = resolver.getLastColumnIndexWithRowHeader();
		let lastMemberHeaderRow = resolver.getLastRowIndexWithColumnHeader();
		let headerColumnsIndex = oFF.XMath.max(0, resolver.getHeaderColumnCount() - 1);
		let headerRowIndex = oFF.XMath.max(0, resolver.getHeaderRowCount() - 1);
		let columnIndicesMember = oFF.XList.create();
		let rowIndicesMember = oFF.XList.create();
		let dropStructure = oFF.PrFactory.createStructure();
		let columnPrList = dropStructure.putNewList(oFF.SacTableConstants.DROP_COLUMN_INDICES);
		let rowPrList = dropStructure.putNewList(oFF.SacTableConstants.DROP_ROW_INDICES);
		let lastHeaderRow = oFF.XMath.max(0, resolver.getHeaderRowCount() - 1);
		if (oFF.isNull(member))
		{
			oFF.XCollectionUtils.addAllIfNotPresent(columnIndices, resolver.getColumnFieldBoundaries(field));
			oFF.XCollectionUtils.addAllIfNotPresent(rowIndices, resolver.getRowFieldBoundaries(field));
			oFF.XCollectionUtils.addAllIfNotPresent(columnIndices, resolver.getColumnAttributeBoundaries(attribute));
			oFF.XCollectionUtils.addAllIfNotPresent(rowIndices, resolver.getRowAttributeBoundaries(attribute));
			oFF.XCollectionUtils.addAllIfNotPresent(columnIndices, resolver.getRowsDimensionBoundaries(dimension));
			oFF.XCollectionUtils.addAllIfNotPresent(rowIndices, resolver.getColumnsDimensionBoundaries(dimension));
			oFF.XCollectionUtils.forEach(columnIndices, (ci) => {
				if (!columnIndicesMember.contains(ci))
				{
					let colDropper = columnPrList.addNewStructure();
					colDropper.putInteger(oFF.SacTableConstants.DROP_INDICES_INDEX, ci.getInteger());
					colDropper.putInteger(oFF.SacTableConstants.DROP_INDICES_DRAW_START, lastHeaderRow);
				}
			});
			oFF.XCollectionUtils.forEach(rowIndices, (ri) => {
				if (!rowIndicesMember.contains(ri))
				{
					let rowDropper = rowPrList.addNewStructure();
					rowDropper.putInteger(oFF.SacTableConstants.DROP_INDICES_INDEX, ri.getInteger());
					rowDropper.putInteger(oFF.SacTableConstants.DROP_INDICES_DRAW_START, 0);
				}
			});
			if (lastMemberHeaderColumn > -1 || lastMemberHeaderRow > -1)
			{
				let dropAreas = dropStructure.putNewList(oFF.SacTableConstants.DROP_AREAS);
				let supportsUdhKey = this.getQueryManager().getModelCapabilities().supportsUdhKey();
				let udh = resolver.isUdhOnRows();
				if (lastMemberHeaderColumn > -1 && (!udh || supportsUdhKey))
				{
					if (!udh)
					{
						this.addAreaBoundaries(dropAreas, resolver.getRowsDimensionBoundaries(null), oFF.SacTableConstants.DROP_AREA_ROW_FROM, oFF.SacTableConstants.DROP_AREA_ROW_TO, oFF.SacTableConstants.DROP_AREA_COLUMN_FROM, oFF.SacTableConstants.DROP_AREA_COLUMN_TO, headerRowIndex);
					}
					this.addSubAreaBoundaries(dropAreas, resolver.getFilterableRowDimensionMemberBoundaries(minRow, maxRow), oFF.SacTableConstants.DROP_AREA_COLUMN_FROM, oFF.SacTableConstants.DROP_AREA_COLUMN_TO, oFF.SacTableConstants.DROP_AREA_ROW_FROM, oFF.SacTableConstants.DROP_AREA_ROW_TO);
				}
				udh = resolver.isUdhOnColumns();
				if (lastMemberHeaderRow > -1 && (!udh || supportsUdhKey))
				{
					if (!udh)
					{
						this.addAreaBoundaries(dropAreas, resolver.getColumnsDimensionBoundaries(null), oFF.SacTableConstants.DROP_AREA_COLUMN_FROM, oFF.SacTableConstants.DROP_AREA_COLUMN_TO, oFF.SacTableConstants.DROP_AREA_ROW_FROM, oFF.SacTableConstants.DROP_AREA_ROW_TO, headerColumnsIndex + (udh ? 1 : 0));
					}
					this.addSubAreaBoundaries(dropAreas, resolver.getFilterableColumnDimensionMemberBoundaries(minCol, maxCol), oFF.SacTableConstants.DROP_AREA_ROW_FROM, oFF.SacTableConstants.DROP_AREA_ROW_TO, oFF.SacTableConstants.DROP_AREA_COLUMN_FROM, oFF.SacTableConstants.DROP_AREA_COLUMN_TO);
				}
			}
		}
		else
		{
			oFF.XCollectionUtils.addAllIfNotPresent(columnIndicesMember, resolver.getColumnMemberBoundaries(member, minCol, maxCol));
			oFF.XCollectionUtils.addAllIfNotPresent(rowIndicesMember, resolver.getRowMemberBoundaries(member, minRow, maxRow));
			let rowInterval = resolver.getColumnDimensionInterval(dimension);
			let columnInterval = resolver.getRowDimensionInterval(dimension);
			oFF.XCollectionUtils.forEach(columnIndicesMember, (cim) => {
				let colmDropper = columnPrList.addNewStructure();
				colmDropper.putInteger(oFF.SacTableConstants.DROP_INDICES_INDEX, cim.getInteger());
				colmDropper.putInteger(oFF.SacTableConstants.DROP_INDICES_DRAW_START, rowInterval.getFirstObject().getInteger());
			});
			oFF.XCollectionUtils.forEach(rowIndicesMember, (rim) => {
				let rowmDropper = rowPrList.addNewStructure();
				rowmDropper.putInteger(oFF.SacTableConstants.DROP_INDICES_INDEX, rim.getInteger());
				rowmDropper.putInteger(oFF.SacTableConstants.DROP_INDICES_DRAW_START, columnInterval.getFirstObject().getInteger());
			});
			let dropAreas2 = dropStructure.putNewList(oFF.SacTableConstants.DROP_AREAS);
			let axisType = dimension.getAxisType();
			if (axisType === oFF.AxisType.ROWS)
			{
				this.addAreaBoundary(dropAreas2, columnInterval.getFirstObject().getInteger(), columnInterval.getSecondObject().getInteger(), oFF.SacTableConstants.DROP_AREA_ROW_FROM, oFF.SacTableConstants.DROP_AREA_COLUMN_FROM, oFF.SacTableConstants.DROP_AREA_COLUMN_TO, headerRowIndex + 1);
			}
			else if (axisType === oFF.AxisType.COLUMNS)
			{
				this.addAreaBoundary(dropAreas2, rowInterval.getFirstObject().getInteger(), rowInterval.getSecondObject().getInteger(), oFF.SacTableConstants.DROP_AREA_COLUMN_FROM, oFF.SacTableConstants.DROP_AREA_ROW_FROM, oFF.SacTableConstants.DROP_AREA_ROW_TO, headerColumnsIndex + 1);
			}
		}
		this.m_pendingDropZones = dropStructure;
		tableControl.enableDropZones(dropStructure);
	});
};
oFF.AuGdsQbInteractiveTableView.prototype.incrementCurrentCellHeight = function(increment)
{
	let tableContainer = this.getAvailableTableContainer();
	if (oFF.XObjectExt.isValidObject(tableContainer) && tableContainer.isValidContainer() && this.m_rowMax > -1)
	{
		let table = tableContainer.getResultTable();
		let origHeight;
		if (this.m_rowMax < table.getPreRowsAmount())
		{
			origHeight = table.getHeaderRowList().get(this.m_rowMax).getHeight();
		}
		else
		{
			origHeight = table.getRowList().get(this.m_rowMax - table.getPreRowsAmount()).getHeight();
		}
		this.m_tableDefinition.setFixedPixelHeightForRow(this.m_rowMax, origHeight + increment);
		this.scheduleResizeTimeout();
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.incrementCurrentCellWidth = function(increment)
{
	let tableContainer = this.getAvailableTableContainer();
	if (oFF.XObjectExt.isValidObject(tableContainer) && tableContainer.isValidContainer() && this.m_columnMax > -1)
	{
		let table = tableContainer.getResultTable();
		let origWidth = table.getColumnWidth(this.m_columnMax);
		this.m_tableDefinition.setFixedPixelWidthForColumn(this.m_columnMax, origWidth + increment);
		this.scheduleResizeTimeout();
	}
};
