oFF.AuGdsQbInteractiveTableView.prototype.onButtonPress = function(event)
{
	this.ensureCloseContextMenu();
	let parameters = event.getParameters();
	let pressedButtonType = oFF.UiPressedButtonType.lookup(parameters.getStringByKey(oFF.UiEventParams.PARAM_PRESSED_BUTTON_TYPE));
	let column = parameters.getIntegerByKey(oFF.UiEventParams.PARAM_COLUMN);
	let row = parameters.getIntegerByKey(oFF.UiEventParams.PARAM_ROW);
	let resolver = event.getControl().getCustomObject();
	let tupleElement;
	let fieldName;
	if (pressedButtonType === oFF.UiPressedButtonType.DRILL)
	{
		tupleElement = resolver.getColumnTupleElement(column, row);
		if (oFF.isNull(tupleElement))
		{
			tupleElement = resolver.getRowTupleElement(column, row);
		}
		if (oFF.notNull(tupleElement))
		{
			if (oFF.AuGdsQbInteractiveTableView.supportsTupleElementCollapse(tupleElement))
			{
				tupleElement.setNextDrillState(oFF.DrillState.COLLAPSED);
			}
			else if (oFF.AuGdsQbInteractiveTableView.supportsTupleElementExpand(tupleElement))
			{
				tupleElement.setNextDrillState(oFF.DrillState.EXPANDED);
			}
			else if (oFF.AuGdsQbInteractiveTableView.supportsTupleElementDrill(tupleElement))
			{
				tupleElement.setNextDrillState(oFF.DrillState.DRILLED);
			}
		}
		this.m_updateProcedure();
	}
	else if (pressedButtonType === oFF.UiPressedButtonType.ICON)
	{
		let tuple = resolver.getRowTuple(row);
		tupleElement = resolver.getRowTupleElement(column, row);
		if (oFF.isNull(tuple))
		{
			tuple = resolver.getColumnTuple(column);
			tupleElement = resolver.getColumnTupleElement(column, row);
		}
		let leadingAxisType = oFF.isNull(tuple) ? null : tuple.getAxis().getType();
		fieldName = resolver.getColumnTupleFieldName(row);
		if (oFF.isNull(fieldName))
		{
			fieldName = resolver.getRowTupleFieldName(column);
		}
		let finalSelectedMeasure = null;
		let finalSelectedSecStructEl = null;
		let selectedSortPath = null;
		let caps = this.getQueryManager().getModelCapabilities();
		if (oFF.notNull(tuple))
		{
			if ((caps.supportsDataCellSorting() || caps.supportsComplexSorting()) && tuple.getTupleElementAt(tuple.getElements().size() - 1) === tupleElement)
			{
				selectedSortPath = oFF.XStream.of(tuple.getTupleElementAt(tuple.getElements().size() - 1).getDrillPathExt(false)).map((pathElement) => {
					return pathElement;
				}).collect(oFF.XStreamCollector.toList());
			}
			else if (caps.supportsMeasureSorting())
			{
				finalSelectedMeasure = this.getStructureMember(tuple, oFF.DimensionType.MEASURE_STRUCTURE);
				finalSelectedSecStructEl = this.getStructureMember(tuple, oFF.DimensionType.SECONDARY_STRUCTURE);
			}
		}
		let field = this.getQueryManager().getQueryModel().getFieldByName(fieldName);
		let sortDirection = oFF.AuGdsQbInteractiveTableContextActionsHelper.getSortDirection(this.getQueryManager(), field, selectedSortPath, finalSelectedMeasure);
		let targetSortDirection = oFF.XSortDirection.ASCENDING;
		if (sortDirection === oFF.XSortDirection.ASCENDING)
		{
			targetSortDirection = oFF.XSortDirection.DESCENDING;
		}
		else if (sortDirection === oFF.XSortDirection.DESCENDING)
		{
			targetSortDirection = oFF.XSortDirection.DEFAULT_VALUE;
		}
		oFF.AuGdsQbInteractiveTableContextActionsHelper.sortInDirection(this.getQueryManager(), targetSortDirection, field, selectedSortPath, finalSelectedMeasure, finalSelectedSecStructEl, leadingAxisType);
		this.m_updateProcedure();
	}
	else if (pressedButtonType === oFF.UiPressedButtonType.LINK)
	{
		let quickActionManager = this.getQueryManager().getQueryModel().getQuickActionManager();
		let columnDimension = resolver.getColumnDimension(row);
		let columnTupleReference = resolver.getColumnTupleReference(column);
		let columnDimensionLevel = oFF.isNull(columnDimension) ? -1 : columnDimension.getIndexOnAxis();
		let rowDimension = resolver.getRowDimension(column);
		let rowTupleReference = resolver.getRowTupleReference(row);
		let rowDimensionLevel = oFF.isNull(rowDimension) ? -1 : rowDimension.getIndexOnAxis();
		fieldName = resolver.getHeaderFieldName(column, row);
		let linkField = null;
		if (oFF.XStringUtils.isNotNullAndNotEmpty(fieldName))
		{
			linkField = this.getQueryManager().getQueryModel().getFieldByName(fieldName);
		}
		if (oFF.notNull(linkField) && linkField.getPresentationType() === oFF.PresentationType.URL)
		{
			let urlString = oFF.XValueUtil.getString(resolver.getPlainCellContent(column, row));
			if (oFF.XStringUtils.isNotNullAndNotEmpty(urlString))
			{
				oFF.UiFramework.currentFramework().openUrl(oFF.XHttpUtils.decodeURIComponent(urlString), "_blank");
			}
		}
		else
		{
			for (let i = 0; i < quickActionManager.size(); i++)
			{
				let action = quickActionManager.get(i);
				if (resolver.canResolveAction(action, rowDimensionLevel, columnDimensionLevel))
				{
					let actionType = action.getOlapComponentType();
					if (actionType === oFF.OlapComponentType.QUICK_ACTION_URL)
					{
						let uri = resolver.getUriFromAction(action, rowTupleReference, rowDimensionLevel, columnTupleReference, columnDimensionLevel);
						if (oFF.notNull(uri))
						{
							let url = uri.getUrl();
							if (oFF.XStringUtils.isNotNullAndNotEmpty(url))
							{
								oFF.UiFramework.currentFramework().openUrl(url, "_blank");
							}
						}
					}
					else if (actionType === oFF.OlapComponentType.QUICK_ACTION_DATAPROVIDER)
					{
						let commandPairs = resolver.getDpActionCommandPairsFromSimpleContext(action, rowTupleReference, rowDimensionLevel, columnTupleReference, columnDimensionLevel);
						if (oFF.XCollectionUtils.hasElements(commandPairs))
						{
							let dpActions = this.getDataProvider().getActions();
							oFF.XCollectionUtils.forEach(commandPairs, (pair) => {
								dpActions.executeActionByName(pair.getFirstObject().getString(), pair.getSecondObject());
							});
						}
					}
				}
			}
		}
	}
};
