oFF.AuGdsQbInteractiveTableView.prototype.onConfirmTextEdit = function(event)
{
	let queryManager = this.getQueryManager();
	let resultSetContainer = oFF.isNull(queryManager) ? null : queryManager.getActiveResultSetContainer();
	if (oFF.notNull(resultSetContainer) && resultSetContainer.isCursorResultSetAvailable() && queryManager.isDataEntryEnabled())
	{
		let targetColumn = event.getParameters().getIntegerByKeyExt(oFF.UiEventParams.PARAM_TARGET_COLUMN, -1);
		let targetRow = event.getParameters().getIntegerByKeyExt(oFF.UiEventParams.PARAM_TARGET_ROW, -1);
		let optionalTableControl = oFF.XOptional.getOptionalEnsureNotReleased(this.getTableControl());
		optionalTableControl.ifPresent((tableControl) => {
			let resolver = tableControl.getCustomObject();
			if (resolver.isDataEntryEnabled(targetColumn, targetRow))
			{
				let valueModifier = event.getParameters().getStringByKey(oFF.UiEventParams.PARAM_VALUE);
				let oldValue = resolver.getValueAt(targetColumn, targetRow);
				let value = oFF.XSimpleNumberModifier.calculate(oldValue, valueModifier);
				resolver.editValueAt(targetColumn, targetRow, oFF.XValueUtil.getString(value));
				let members = resolver.getMembers(targetColumn, targetRow);
				if (oFF.XCollectionUtils.hasElements(members))
				{
					let dataEntry = resultSetContainer.getCursorResultSet().getNewDataEntryViaMember();
					oFF.XCollectionUtils.forEach(members, (mem) => {
						dataEntry.addMemberContext(mem.getDimension().getName(), mem.getName());
					});
					try
					{
						dataEntry.setDouble(value.getDouble());
					}
					catch (t)
					{
						dataEntry.setString(oFF.XValueUtil.getString(value));
					}
					dataEntry.setPriority(1);
					dataEntry.setProcessingType(oFF.DataEntryProcessingType.FULL);
					dataEntry.setDataCellEntryDescription("MyDataEntryViaMember");
					this.setTableModelJson(this.m_renderer.reFormat(this.getAvailableTableContainer()));
				}
			}
		});
	}
};
