oFF.AuGdsQbInteractiveTableView.prototype.onTableDragAndDrop = function(event)
{
	this.ensureCloseContextMenu();
	let parameters = event.getParameters();
	let eventType = oFF.UiSacTableDragAndDropEventType.lookup(parameters.getStringByKey(oFF.UiEventParams.PARAM_EVENT_TYPE));
	let sourceColumn = parameters.getIntegerByKeyExt(oFF.UiEventParams.PARAM_SOURCE_COLUMN, -1);
	let sourceRow = parameters.getIntegerByKeyExt(oFF.UiEventParams.PARAM_SOURCE_ROW, -1);
	let resolver = event.getControl().getCustomObject();
	let queryModel = this.getQueryManager().getQueryModel();
	let sourceFieldName = resolver.getHeaderFieldName(sourceColumn, sourceRow);
	let sourceField = queryModel.getFieldByName(sourceFieldName);
	let sourceAttribute = oFF.isNull(sourceField) ? null : sourceField.getAttribute();
	let sourceDimension = oFF.isNull(sourceField) ? null : sourceField.getDimension();
	let sourceAxis = oFF.isNull(sourceDimension) ? null : sourceDimension.getAxis();
	let sourceTupleElement = resolver.getTupleElement(sourceColumn, sourceRow);
	let sourceMember = oFF.isNull(sourceTupleElement) ? null : sourceTupleElement.getDimensionMember();
	if (eventType === oFF.UiSacTableDragAndDropEventType.CELL_DRAG_START)
	{
		if (this.m_optimizedDragDropExperience && (oFF.isNull(sourceMember) || sourceMember.getDimension().isStructure()))
		{
			this.highlightTableDropZones(sourceMember, sourceField, sourceAttribute, sourceDimension);
		}
	}
	else if (this.getApplication().getSession().hasFeatureByName(oFF.OlapUiFeatureToggle.DATA_ANALYZER_HIGHLIGHT_MEMBER_CELLS) && eventType === oFF.UiSacTableDragAndDropEventType.CELL_DRAG_ENTER)
	{
		let targetFilterColumn = parameters.getIntegerByKeyExt(oFF.UiEventParams.PARAM_TARGET_COLUMN, -1);
		let targetFilterRow = parameters.getIntegerByKeyExt(oFF.UiEventParams.PARAM_TARGET_ROW, -1);
		let targetTupleElement = resolver.getTupleElement(targetFilterColumn, targetFilterRow);
		if (resolver.isCellOnHeader(targetFilterColumn, targetFilterRow))
		{
			this.processHeaderCellHighlight(targetFilterColumn, targetFilterRow, resolver, true);
		}
		else
		{
			this.processDataCellHighlight(targetTupleElement, resolver, true);
		}
	}
	else if (this.getApplication().getSession().hasFeatureByName(oFF.OlapUiFeatureToggle.DATA_ANALYZER_HIGHLIGHT_MEMBER_CELLS) && eventType === oFF.UiSacTableDragAndDropEventType.CELL_DRAG_LEAVE)
	{
		let targetFilterColumn = parameters.getIntegerByKeyExt(oFF.UiEventParams.PARAM_TARGET_COLUMN, -1);
		let targetFilterRow = parameters.getIntegerByKeyExt(oFF.UiEventParams.PARAM_TARGET_ROW, -1);
		let targetTupleElement = resolver.getTupleElement(targetFilterColumn, targetFilterRow);
		if (resolver.isCellOnHeader(targetFilterColumn, targetFilterRow))
		{
			this.processHeaderCellHighlight(targetFilterColumn, targetFilterRow, resolver, false);
		}
		else
		{
			this.processDataCellHighlight(targetTupleElement, resolver, false);
		}
	}
	else if (eventType === oFF.UiSacTableDragAndDropEventType.CELL_DRAG_END)
	{
		this.disableDropZones();
	}
	else if (oFF.isNull(sourceMember) || sourceMember.getDimension().isStructure())
	{
		let targetColumn = parameters.getIntegerByKeyExt(oFF.UiEventParams.PARAM_TARGET_COLUMN, -1);
		let targetRow = parameters.getIntegerByKeyExt(oFF.UiEventParams.PARAM_TARGET_ROW, -1);
		let beforeCell = parameters.getBooleanByKeyExt(oFF.UiEventParams.PARAM_PLACED_BEFORE_CELL, false);
		let swapElement = !beforeCell && this.m_optimizedDragDropExperience;
		let targetFieldName = resolver.getHeaderFieldName(targetColumn, targetRow);
		let targetField = queryModel.getFieldByName(targetFieldName);
		let targetAxisType = resolver.getTargetDropAxisType(targetColumn, targetRow);
		let targetTupleElementOrig = resolver.getTupleElement(targetColumn, targetRow);
		if (oFF.notNull(sourceTupleElement))
		{
			sourceDimension = sourceTupleElement.getDimension();
			let targetTupleElement = null;
			let targetTupleElementBefore = null;
			if (this.m_optimizedDragDropExperience)
			{
				if (beforeCell)
				{
					targetTupleElement = resolver.getTupleElementForDimension(targetColumn, targetRow, sourceDimension);
					targetTupleElementBefore = resolver.getTupleElementForDimension(targetColumn - 1, targetRow - 1, sourceDimension);
					if (oFF.notNull(targetTupleElement) || oFF.notNull(targetTupleElementBefore))
					{
						targetAxisType = sourceDimension.getAxisType();
					}
				}
				else if (swapElement && oFF.notNull(targetTupleElementOrig) && oFF.DfNameObject.areNamesEqual(targetTupleElementOrig.getDimension(), sourceDimension))
				{
					targetTupleElement = targetTupleElementOrig;
				}
			}
			let membersGetter = sourceDimension.getMemberManager().getMembers();
			let visibleMembersGetter = sourceDimension.getConvenienceCommands().getVisibleMembersInResultSetOrder(sourceDimension);
			this.handleMeasureActivationByTupleElement(sourceTupleElement, sourceDimension, targetAxisType, targetField, targetTupleElement, targetTupleElementBefore, swapElement, beforeCell, membersGetter, visibleMembersGetter);
			return;
		}
		if (oFF.notNull(sourceField) && oFF.notNull(sourceDimension) && oFF.notNull(sourceAxis) && oFF.notNull(targetField))
		{
			let targetDimension = targetField.getDimension();
			let targetAxis = targetDimension.getAxis();
			if (swapElement)
			{
				if (sourceDimension === targetDimension)
				{
					this.swapFields(sourceField, targetField, sourceDimension);
				}
				else if (oFF.notNull(targetTupleElementOrig) && targetTupleElementOrig.getDimension() === targetDimension)
				{
					this.filterAndDrill(sourceDimension, targetTupleElementOrig);
				}
				else
				{
					this.swapDimensions(sourceDimension, targetDimension);
				}
			}
			else
			{
				if (sourceDimension === targetDimension)
				{
					this.moveFields(beforeCell, sourceField, targetField, sourceDimension);
				}
				else if (sourceAxis === targetAxis && beforeCell && sourceAxis.getIndex(targetDimension) === sourceAxis.getIndex(sourceDimension) + 1)
				{
					this.moveFieldToEnd(sourceField, sourceDimension);
				}
				else if (sourceAxis === targetAxis && !beforeCell && sourceAxis.getIndex(targetDimension) === sourceAxis.getIndex(sourceDimension) - 1)
				{
					this.moveFieldToStart(sourceField, sourceDimension);
				}
				else
				{
					this.moveDimensions(beforeCell, sourceDimension, targetDimension);
				}
			}
		}
		else if (oFF.notNull(sourceDimension) && oFF.notNull(targetTupleElementOrig) && sourceDimension.getModelCapabilities().supportsUdhKey())
		{
			this.filterAndDrill(sourceDimension, targetTupleElementOrig);
		}
		else if (oFF.notNull(sourceAxis) && oFF.notNull(targetAxisType))
		{
			if (sourceAxis.getType() === targetAxisType && sourceAxis.size() - 1 === sourceDimension.getIndexOnAxis())
			{
				this.moveFieldToEnd(sourceField, sourceDimension);
			}
			this.ensureFieldOnDimension(sourceField);
			if (oFF.XStringUtils.isNotNullAndNotEmpty(targetFieldName) && sourceAxis.getType() !== targetAxisType)
			{
				this.getQueryManager().getConvenienceCommands().moveDimensionOnAxisTo(sourceDimension.getName(), targetAxisType, 0);
			}
			else
			{
				this.getQueryManager().getConvenienceCommands().moveDimensionToAxis(sourceDimension.getName(), targetAxisType);
			}
			sourceDimension.getConvenienceCommands().moveSortToPosition(oFF.SortType.ABSTRACT_DIMENSION_SORT, sourceDimension.getName(), 0);
			this.m_updateProcedure();
		}
	}
};
