oFF.AuGdsQbInteractiveTableView.prototype.preloadWindow = function(rowMin, rowMax, colMin, colMax)
{
	if (this.m_useDpForDataFetch && oFF.notNull(this.m_dataProvider))
	{
		this.setBusy(true);
		this.m_dataProvider.getActions().getResultSetActions().fetchNewTile(rowMin, rowMax, colMin, colMax, this.m_tableDefinition.getName());
		return;
	}
	let scrollRequestStructure = oFF.PrFactory.createStructure();
	scrollRequestStructure.putInteger(oFF.AuGdsQbConstants.QB_TABLE_ROW_START, rowMin);
	scrollRequestStructure.putInteger(oFF.AuGdsQbConstants.QB_TABLE_ROW_END, rowMax);
	scrollRequestStructure.putInteger(oFF.AuGdsQbConstants.QB_TABLE_COLUMN_START, colMin);
	scrollRequestStructure.putInteger(oFF.AuGdsQbConstants.QB_TABLE_COLUMN_END, colMax);
	if (oFF.notNull(this.m_tileRequester) && this.m_tileRequester(oFF.XPair.create(this.getTableDefinition(), this), scrollRequestStructure))
	{
		this.setBusy(true);
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.processDataCellHighlight = function(targetTupleElement, resolver, shouldHighlight)
{
	if (this.m_optimizedDragDropExperience && oFF.notNull(targetTupleElement))
	{
		let dropZoneAreas = this.m_pendingDropZones.getListByKey(oFF.SacTableConstants.DROP_AREAS);
		for (let i = 0; i < dropZoneAreas.size(); i++)
		{
			let dropZone = dropZoneAreas.get(i).asStructure();
			let columnFrom = dropZone.getIntegerByKey(oFF.SacTableConstants.DROP_AREA_COLUMN_FROM);
			let rowFrom = dropZone.getIntegerByKey(oFF.SacTableConstants.DROP_AREA_ROW_FROM);
			let tupleElement = resolver.getTupleElement(columnFrom, rowFrom);
			if (oFF.isNull(tupleElement))
			{
				continue;
			}
			let isSameDimension = oFF.XString.isEqual(targetTupleElement.getDimension().getName(), tupleElement.getDimension().getName());
			let isSameMember = oFF.XString.isEqual(targetTupleElement.getDimensionMember().getName(), tupleElement.getDimensionMember().getName());
			if (isSameDimension && isSameMember)
			{
				if (this.hasDropZoneRange(dropZone))
				{
					let columnTo = dropZone.getIntegerByKey(oFF.SacTableConstants.DROP_AREA_COLUMN_TO);
					let rowTo = dropZone.getIntegerByKey(oFF.SacTableConstants.DROP_AREA_ROW_TO);
					for (let j = rowFrom; j < rowTo + 1; j++)
					{
						for (let k = columnFrom; k < columnTo + 1; k++)
						{
							if (shouldHighlight)
							{
								this.getTableControl().addCssClassToCell(k, j, "cellDropZoneFocus");
							}
							else
							{
								this.getTableControl().removeCssClassFromCell(k, j, "cellDropZoneFocus");
							}
						}
					}
				}
				else
				{
					if (shouldHighlight)
					{
						this.getTableControl().addCssClassToCell(columnFrom, rowFrom, "cellDropZoneFocus");
					}
					else
					{
						this.getTableControl().removeCssClassFromCell(columnFrom, rowFrom, "cellDropZoneFocus");
					}
				}
			}
		}
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.processDragEnterEvent = function(event)
{
	let control = event.getDraggedControl();
	let dragEndListener = control.getListenerOnDragEnd();
	if (dragEndListener !== this)
	{
		this.m_dragEndForwarder = dragEndListener;
		control.registerOnDragEnd(this);
	}
	let payload = control.getCustomObject();
	if (oFF.notNull(payload))
	{
		let component = payload.getModelComponent();
		let componentType = component.getOlapComponentType();
		let member = null;
		let attribute = null;
		let field = null;
		let dimension = null;
		if (oFF.OlapUiDimensionUtil.isMemberNode(component))
		{
			let node = oFF.OlapUiDimensionUtil.getMemberNode(component);
			dimension = node.getDimension();
			member = node.getDimensionMember();
		}
		else if (componentType === oFF.OlapComponentType.FIELD)
		{
			field = component;
			attribute = field.getAttribute();
			dimension = field.getDimension();
		}
		else if (componentType === oFF.OlapComponentType.ATTRIBUTE)
		{
			attribute = component;
			dimension = attribute.getDimension();
		}
		else if (componentType.isTypeOf(oFF.OlapComponentType.ABSTRACT_DIMENSION))
		{
			dimension = component;
		}
		this.highlightTableDropZones(member, field, attribute, dimension);
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.processDropEvent = function(dropEvent)
{
	let parameters = dropEvent.getParameters();
	let targetColumn = parameters.getIntegerByKeyExt(oFF.UiEventParams.PARAM_TARGET_COLUMN, -1);
	let targetRow = parameters.getIntegerByKeyExt(oFF.UiEventParams.PARAM_TARGET_ROW, -1);
	let beforeCell = dropEvent.getRelativeDropPosition() === oFF.UiRelativeDropPosition.BEFORE;
	let swapElement = !beforeCell && this.m_optimizedDragDropExperience;
	let resolver = this.getTableControl().getCustomObject();
	let payload = dropEvent.getDraggedControl().getCustomObject();
	let cmd = this.getQueryManager().getConvenienceCommands();
	if (oFF.notNull(payload))
	{
		let component = payload.getModelComponent();
		let componentType = component.getOlapComponentType();
		let queryModel = this.getQueryManager().getQueryModel();
		let targetAxisType = resolver.getTargetDropAxisType(targetColumn, targetRow);
		let targetFieldName = resolver.getHeaderFieldName(targetColumn, targetRow);
		let targetTupleElementOrig = this.m_optimizedDragDropExperience ? resolver.getTupleElement(targetColumn, targetRow) : null;
		let targetField = queryModel.getFieldByName(targetFieldName);
		let sourceField = null;
		let sourceAttribute = null;
		let sourceDimension = null;
		if (oFF.OlapUiDimensionUtil.isMemberNode(component))
		{
			let node = oFF.OlapUiDimensionUtil.getMemberNode(component);
			sourceDimension = node.getDimension();
			let targetTupleElement = null;
			let targetTupleElementBefore = null;
			if (this.m_optimizedDragDropExperience)
			{
				if (beforeCell)
				{
					targetTupleElement = resolver.getTupleElementForDimension(targetColumn, targetRow, sourceDimension);
					targetTupleElementBefore = resolver.getTupleElementForDimension(targetColumn - 1, targetRow - 1, sourceDimension);
					if (oFF.notNull(targetTupleElement) || oFF.notNull(targetTupleElementBefore) || targetColumn === -1 && resolver.getHeaderRowCount() === targetRow && sourceDimension.getAxisType() === oFF.AxisType.ROWS || targetRow === -1 && resolver.getHeaderColumnCount() === targetColumn && sourceDimension.getAxisType() === oFF.AxisType.COLUMNS)
					{
						targetAxisType = sourceDimension.getAxisType();
					}
				}
				else if (swapElement && oFF.notNull(targetTupleElementOrig) && oFF.DfNameObject.areNamesEqual(targetTupleElementOrig.getDimension(), sourceDimension))
				{
					targetTupleElement = targetTupleElementOrig;
				}
			}
			let membersGetter = sourceDimension.getMemberManager().getMembers();
			let visibleMembersGetter = sourceDimension.getConvenienceCommands().getVisibleMembersInResultSetOrder(sourceDimension);
			this.handleMeasureActivation(node, sourceDimension, targetAxisType, targetField, targetTupleElement, targetTupleElementBefore, swapElement, beforeCell, membersGetter, visibleMembersGetter);
			return;
		}
		else if (componentType === oFF.OlapComponentType.FIELD)
		{
			sourceField = component;
			sourceAttribute = sourceField.getAttribute();
			sourceDimension = sourceField.getDimension();
		}
		else if (componentType === oFF.OlapComponentType.ATTRIBUTE)
		{
			sourceAttribute = component;
			sourceDimension = sourceAttribute.getDimension();
		}
		else if (componentType.isTypeOf(oFF.OlapComponentType.ABSTRACT_DIMENSION))
		{
			sourceDimension = component;
		}
		if (swapElement && oFF.notNull(sourceDimension))
		{
			if (oFF.notNull(sourceField) && oFF.notNull(targetField) && sourceDimension === targetField.getDimension())
			{
				this.swapFields(sourceField, targetField, sourceDimension);
			}
			else
			{
				if (oFF.notNull(sourceField) && sourceDimension.getFieldLayoutType() === oFF.FieldLayoutType.FIELD_BASED)
				{
					cmd.addFieldToResultSet(sourceDimension.getName(), sourceField.getName());
				}
				else if (oFF.notNull(sourceField) && oFF.notNull(sourceAttribute))
				{
					cmd.addAttributeField(null, sourceDimension.getName(), sourceAttribute.getName(), null, sourceField.getName(), oFF.QContextType.RESULT_SET);
				}
				if (oFF.isNull(targetField))
				{
					if (oFF.notNull(targetTupleElementOrig) && cmd.getModelCapabilities().supportsUdhKey())
					{
						this.filterAndDrill(sourceDimension, targetTupleElementOrig);
					}
					if (oFF.notNull(targetAxisType))
					{
						cmd.moveDimensionToAxis(sourceDimension.getName(), targetAxisType);
						sourceDimension.getConvenienceCommands().moveSortToPosition(oFF.SortType.ABSTRACT_DIMENSION_SORT, sourceDimension.getName(), 0);
						if (oFF.notNull(sourceAttribute) && sourceDimension.getFieldLayoutType() !== oFF.FieldLayoutType.FIELD_BASED)
						{
							cmd.addAttributeToResultSet(sourceDimension.getName(), sourceAttribute.getName());
						}
						this.m_updateProcedure();
					}
				}
				else if (oFF.notNull(sourceAttribute) && sourceDimension === targetField.getDimension())
				{
					if (targetField.getAttribute() === sourceAttribute.getDimension().getMainAttribute())
					{
						if (sourceDimension.getMainAttribute() === null)
						{
							cmd.addAttributeToResultSet(sourceDimension.getName(), sourceAttribute.getName());
						}
						else
						{
							let targetFields = sourceDimension.getMainAttribute().getResultSetFields();
							if (oFF.XCollectionUtils.hasElements(targetFields))
							{
								this.moveAttributes(false, sourceAttribute, targetFields.getFieldAt(targetFields.size() - 1), sourceDimension);
							}
							else
							{
								cmd.addAttributeToResultSet(sourceDimension.getName(), sourceAttribute.getName());
							}
						}
					}
					else
					{
						this.swapAttributes(sourceAttribute, targetField.getAttribute(), sourceDimension);
					}
				}
				else
				{
					if (oFF.notNull(sourceAttribute) && sourceDimension.getFieldLayoutType() !== oFF.FieldLayoutType.FIELD_BASED)
					{
						cmd.addAttributeToResultSet(sourceDimension.getName(), sourceAttribute.getName());
					}
					if (oFF.notNull(targetTupleElementOrig) && targetField.getDimension() === targetTupleElementOrig.getDimension())
					{
						this.filterAndDrill(sourceDimension, targetTupleElementOrig);
					}
					else
					{
						this.swapDimensions(sourceDimension, targetField.getDimension());
					}
				}
			}
		}
		else if (oFF.notNull(sourceDimension))
		{
			if (oFF.notNull(sourceAttribute))
			{
				cmd.addAttributeToResultSet(sourceDimension.getName(), sourceAttribute.getName());
			}
			if (oFF.notNull(sourceAttribute) && oFF.notNull(targetField) && sourceDimension === targetField.getDimension())
			{
				this.moveAttributes(beforeCell, sourceAttribute, targetField, sourceDimension);
			}
			else if (oFF.notNull(targetField))
			{
				this.moveDimensions(beforeCell, sourceDimension, targetField.getDimension());
			}
			else if (oFF.notNull(targetAxisType))
			{
				if (oFF.XStringUtils.isNotNullAndNotEmpty(targetFieldName))
				{
					cmd.moveDimensionOnAxisTo(sourceDimension.getName(), targetAxisType, 0);
				}
				else
				{
					cmd.moveDimensionToAxis(sourceDimension.getName(), targetAxisType);
				}
				sourceDimension.getConvenienceCommands().moveSortToPosition(oFF.SortType.ABSTRACT_DIMENSION_SORT, sourceDimension.getName(), 0);
				this.m_updateProcedure();
			}
		}
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.processFieldsAndAttributes = function(fieldNamesLastSelected, queryModel, axisType, dimensionsList)
{
	for (let i = 0; i < fieldNamesLastSelected.size(); i++)
	{
		let fieldName = fieldNamesLastSelected.get(i);
		if (oFF.XStringUtils.isNullOrEmpty(fieldName))
		{
			continue;
		}
		this.m_axisHeaderLastSelected = axisType;
		let field = queryModel.getFieldByName(fieldName);
		if (oFF.notNull(field))
		{
			this.m_fieldsLastSelected.add(field);
			let attribute = field.getAttribute();
			if (field.getDimension().getFieldLayoutType() !== oFF.FieldLayoutType.FIELD_BASED && oFF.notNull(attribute))
			{
				this.m_attributesLastSelected.add(attribute);
			}
		}
		else if (oFF.XStringUtils.isNotNullAndNotEmpty(fieldName) && oFF.XCollectionUtils.hasElements(dimensionsList) && dimensionsList.size() === 1 && dimensionsList.get(0).isUniversalDisplayHierarchyDimension())
		{
			this.m_unresolvedFieldNameLastSelected = fieldName;
			this.m_udhDimensionSelected = dimensionsList.get(0);
		}
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.processHeaderCellHighlight = function(col, row, resolver, shouldHighlight)
{
	if (this.m_optimizedDragDropExperience && resolver.getColumnDimension(row) !== null)
	{
		let colDimension = resolver.getColumnDimension(row);
		for (let i = 0; i < resolver.getHeaderRowCount(); i++)
		{
			let curDimension = resolver.getColumnDimension(i);
			if (oFF.notNull(curDimension) && oFF.XString.isEqual(curDimension.getName(), colDimension.getName()))
			{
				if (shouldHighlight)
				{
					this.getTableControl().addCssClassToCell(col, i, "cellDropZoneFocus");
				}
				else
				{
					this.getTableControl().removeCssClassFromCell(col, i, "cellDropZoneFocus");
				}
			}
		}
	}
	else if (this.m_optimizedDragDropExperience && resolver.getRowDimension(col) !== null)
	{
		let rowDimension = resolver.getRowDimension(col);
		for (let i = 0; i < resolver.getHeaderColumnCount(); i++)
		{
			let curDimension = resolver.getRowDimension(i);
			if (oFF.notNull(curDimension) && oFF.XString.isEqual(curDimension.getName(), rowDimension.getName()))
			{
				if (shouldHighlight)
				{
					this.getTableControl().addCssClassToCell(i, row, "cellDropZoneFocus");
				}
				else
				{
					this.getTableControl().removeCssClassFromCell(i, row, "cellDropZoneFocus");
				}
			}
		}
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.processKeyEvent = function(keyboardEvent)
{
	if (keyboardEvent.isAltPressed())
	{
		switch (keyboardEvent.getCode())
		{
			case oFF.AuGdsQbInteractiveTableView.KEY_ARROW_DOWN:
				this.incrementCurrentCellHeight(1);
				break;

			case oFF.AuGdsQbInteractiveTableView.KEY_ARROW_DOWN_N:
				this.incrementCurrentCellHeight(1);
				break;

			case oFF.AuGdsQbInteractiveTableView.KEY_ARROW_UP:
				this.incrementCurrentCellHeight(-1);
				break;

			case oFF.AuGdsQbInteractiveTableView.KEY_ARROW_UP_N:
				this.incrementCurrentCellHeight(-1);
				break;

			case oFF.AuGdsQbInteractiveTableView.KEY_ARROW_LEFT:
				this.incrementCurrentCellWidth(-1);
				break;

			case oFF.AuGdsQbInteractiveTableView.KEY_ARROW_LEFT_N:
				this.incrementCurrentCellWidth(-1);
				break;

			case oFF.AuGdsQbInteractiveTableView.KEY_ARROW_RIGHT:
				this.incrementCurrentCellWidth(1);
				break;

			case oFF.AuGdsQbInteractiveTableView.KEY_ARROW_RIGHT_N:
				this.incrementCurrentCellWidth(1);
				break;
		}
	}
	else if (keyboardEvent.isCtrlPressed() || keyboardEvent.isMetaPressed())
	{
		switch (keyboardEvent.getCode())
		{
			case oFF.AuGdsQbInteractiveTableView.KEY_C:
				this.executeClipboardCopy();
				break;
		}
	}
};
