oFF.AuGdsQbInteractiveTableView.prototype.reRenderTableStyling = function()
{
	if (this.isSyncActionProcessing() || this.hasPendingTableUpdates())
	{
		this.m_pendingTableReRendering = true;
	}
	else
	{
		if (oFF.XObjectExt.isValidObject(this.m_tableDefinition))
		{
			let tableContainer = this.getAvailableTableContainer();
			if (oFF.XObjectExt.isValidObject(tableContainer) && tableContainer.isValidContainer() && tableContainer.needsRecreateRows())
			{
				this.setBusy(true);
				let nullListener = null;
				let renderAction = oFF.OuLambdaSyncAction.create(this.getApplication().getSession(), nullListener, () => {
					let modelJson = null;
					if (!this.hasPendingGeneralUpdates())
					{
						modelJson = this.m_renderer.reFormat(tableContainer);
						if (!this.hasPendingGeneralUpdates())
						{
							this.m_activeSynchronizer = null;
							this.setTableModelJson(modelJson);
						}
					}
					return modelJson;
				}, 30);
				this.m_activeSynchronizer = renderAction;
				renderAction.attachListener(oFF.OuLambdaSyncListener.create((messages, data) => {
					this.checkPendingReRendering();
					return oFF.XBooleanValue.create(true);
				}), oFF.ListenerType.SYNC_LISTENER, null);
				renderAction.processSyncAction(oFF.SyncType.NON_BLOCKING, null, null);
			}
			else
			{
				let modelJsonL = this.m_renderer.reFormat(tableContainer);
				if (oFF.XCollectionUtils.hasElements(modelJsonL))
				{
					this.setTableModelJson(modelJsonL);
				}
				else
				{
					this.setBusy(false);
				}
			}
		}
	}
};
oFF.AuGdsQbInteractiveTableView.prototype.refreshTable = function()
{
	let visualisationContainer = this.getVisualizationContainer();
	let tableData = !oFF.XObjectExt.isValidObject(visualisationContainer) ? null : visualisationContainer.getVisualizationData();
	let tileCarrier = !oFF.XObjectExt.isValidObject(tableData) ? null : tableData.getRecentTileCarrier();
	let isInitialTile = oFF.notNull(tileCarrier) && tileCarrier.getRowMin() === 0 && tileCarrier.getColumnMin() === 0;
	if (this.m_renderingIsOutdated && !oFF.XObjectExt.isValidObject(tableData) && isInitialTile)
	{
		this.m_renderingIsOutdated = false;
		this.fetchResultSet();
	}
	else if (oFF.notNull(visualisationContainer) && !visualisationContainer.isSyncCanceled())
	{
		if (oFF.notNull(this.m_preloadFinishedProcedure))
		{
			this.m_preloadFinishedProcedure(visualisationContainer.getVisualizationData());
			this.m_preloadFinishedProcedure = null;
		}
		let modelJson;
		let control = this.getTableControl();
		if (oFF.notNull(control))
		{
			let activeTableContainer = this.getAvailableTableContainer();
			modelJson = oFF.XObjectExt.isValidObject(activeTableContainer) && activeTableContainer.isValidContainer() ? this.m_renderer.render(activeTableContainer) : null;
			if (oFF.notNull(modelJson))
			{
				control.setCustomObject(activeTableContainer);
				this.m_activeSynchronizer = null;
				this.setTableModelJson(modelJson);
				this.correctScrollingPoints(visualisationContainer);
				if (isInitialTile && (this.m_rowScrollReferencePoint > 0 && this.m_rowScrollEndReferencePoint > tileCarrier.getRowMax() || this.m_colScrollReferencePoint > 0 && this.m_colScrollEndReferencePoint > tileCarrier.getColumnMax()))
				{
					if (oFF.XStringUtils.isNotNullAndNotEmpty(this.m_scrollTimeout))
					{
						oFF.XTimeout.clear(this.m_scrollTimeout);
					}
					this.m_scrollTimeout = oFF.XTimeout.timeout(100, () => {
						this.executeScrollLoad(visualisationContainer, true, true);
					});
				}
				else
				{
					this.processSelection();
				}
			}
			else
			{
				oFF.XLogger.println("Do not render, as table updates are pending (INNER)");
			}
		}
		else
		{
			oFF.XLogger.println("Do not render, as table updates are pending (OUTER)");
		}
		if (oFF.notNull(this.m_backendRequestFinishedProcedure))
		{
			this.m_backendRequestFinishedProcedure();
		}
		if (!this.m_useDpForDataFetch)
		{
			let visualizationName = visualisationContainer.getVisualizationDefinition().getName();
			let dataFetch = this.m_dataProvider.getEventing().getEmitterForResultDataFetch().newTypedEvent();
			dataFetch.setStep(oFF.OlapDataProviderResultDataFetchStep.VISUALIZATION_FILLED);
			dataFetch.addAffectedVisualizationName(visualizationName);
			dataFetch.queue();
		}
	}
};
