oFF.AuGdsQbInteractiveTableView.prototype.setupTableRendererWithDefinition = function()
{
	if (this.getQueryManager() !== null)
	{
		let visualizationManager = this.getQueryManager().getQueryModel().getVisualizationManager();
		if (!oFF.XObjectExt.isValidObject(this.m_tableDefinition))
		{
			let interopTableDefinition = visualizationManager.getVisualizationDefinitionByName(oFF.AuGdsConstants.INTEROP_TABLE_DEFINITION);
			if (oFF.notNull(interopTableDefinition))
			{
				this.setTableDefinition(interopTableDefinition);
			}
			else if (this.m_autoCreateTableDefinition)
			{
				let currentActiveVis = visualizationManager.getCurrentActiveVisualizationDefinition();
				let tableDefinitionToPickup = null;
				if (oFF.notNull(currentActiveVis) && currentActiveVis.getOlapComponentType() === oFF.OlapComponentType.VISUALIZATION_TABLE_DEFINITION)
				{
					tableDefinitionToPickup = currentActiveVis;
				}
				if (oFF.isNull(tableDefinitionToPickup))
				{
					tableDefinitionToPickup = visualizationManager.getOrCreateDefaultTableDefinition();
				}
				this.setTableDefinition(tableDefinitionToPickup);
			}
		}
		if (oFF.XObjectExt.isValidObject(this.m_stashedTableCfgJson) && oFF.XObjectExt.isValidObject(this.m_tableDefinition))
		{
			this.setTableDefinitionFromStructure(this.m_stashedTableCfgJson);
			this.setBusy(true);
			this.m_dataProvider.getResulting().fetchNewResultSet(oFF.AuGdsQbInteractiveTableView.INITIAL_RESULT_SET_FETCH_CORRELATION_ID).onFinally(() => {
				this.m_stashedTableCfgJson = null;
				this.setBusy(false);
			});
		}
	}
};
