oFF.AuGdsQbInteractiveTableView.prototype.trySetupSelection = function(selectionElement)
{
	this.m_currentSelectionElement = selectionElement;
	let selectedCells = oFF.XList.create();
	let selectedScopes = oFF.XList.create();
	let cells = oFF.XList.create();
	this.getSelectedCells(selectionElement, selectedCells, selectedScopes, cells);
	let commonStyle = this.getAvailableTableContainer().analyzeSelectionStyle(selectedCells);
	this.m_selectedCells = cells;
	let success = false;
	this.resetSelectionStructure();
	if (oFF.notNull(selectionElement))
	{
		if (selectionElement.isStructure())
		{
			this.analyseSelectionStructure(selectionElement.asStructure());
			success = true;
		}
		else if (selectionElement.isList())
		{
			let selectionList = selectionElement.asList();
			if (oFF.XCollectionUtils.hasElements(selectionList))
			{
				this.m_isMultiSelectWithGaps = selectionList.size() > 1;
				for (let i = 0; i < selectionList.size(); i++)
				{
					this.analyseSelectionStructure(selectionList.getStructureAt(i));
				}
				if (this.m_isMultiSelectWithGaps)
				{
					this.m_selectedMeasure = null;
					this.m_selectedSecondaryStructureMember = null;
					this.m_selectedDocumentId = null;
					this.m_selectedRowTupleIndex = -1;
					this.m_selectedColumnTupleIndex = -1;
				}
				success = true;
			}
		}
		this.setupBaseContext();
		let columnContext = this.m_tableSelectionContext.addSubContext();
		if (this.m_onHeaderColumns)
		{
			columnContext.setType(oFF.AuGdsContextConstants.SELECTION_COLUMNS_HEADER);
		}
		else if (this.m_onDataColumns)
		{
			columnContext.setType(oFF.AuGdsContextConstants.SELECTION_COLUMNS_DATA);
		}
		else
		{
			columnContext.setType(oFF.AuGdsContextConstants.SELECTION_COLUMNS_OTHER);
		}
		columnContext.setCustomObject(oFF.XIntegerValue.create(this.m_columnMax));
		let rowContext = this.m_tableSelectionContext.addSubContext();
		if (this.m_onHeaderRows)
		{
			rowContext.setType(oFF.AuGdsContextConstants.SELECTION_ROWS_HEADER);
		}
		else if (this.m_onDataRows)
		{
			rowContext.setType(oFF.AuGdsContextConstants.SELECTION_ROWS_DATA);
		}
		else
		{
			rowContext.setType(oFF.AuGdsContextConstants.SELECTION_ROWS_OTHER);
		}
		rowContext.setCustomObject(oFF.XIntegerValue.create(this.m_rowMax));
		if (this.m_onDataRows && this.m_onDataColumns)
		{
			this.m_tableSelectionContext.addSubContext().setType(oFF.AuGdsContextConstants.SELECTION_DATA_CELLS);
		}
		else if (this.m_onHeaderRows && this.m_onDataColumns)
		{
			this.m_tableSelectionContext.addSubContext().setType(oFF.AuGdsContextConstants.SELECTION_COLUMNS_MEMBER_HEADERS);
		}
		else if (this.m_onDataRows && this.m_onHeaderColumns)
		{
			this.m_tableSelectionContext.addSubContext().setType(oFF.AuGdsContextConstants.SELECTION_ROWS_MEMBER_HEADERS);
		}
		else if (oFF.XCollectionUtils.hasElements(this.m_columnDimensionsAllSelected))
		{
			this.m_tableSelectionContext.addSubContext().setType(oFF.AuGdsContextConstants.SELECTION_COLUMNS_DIMENSION_HEADERS);
		}
		else if (oFF.XCollectionUtils.hasElements(this.m_rowDimensionsAllSelected))
		{
			this.m_tableSelectionContext.addSubContext().setType(oFF.AuGdsContextConstants.SELECTION_ROWS_DIMENSION_HEADERS);
		}
		if (this.m_onEmptyHeaderSection)
		{
			this.m_tableSelectionContext.addSubContext().setType(oFF.AuGdsContextConstants.SELECTION_EMPTY_HEADERS);
		}
		if (oFF.XCollectionUtils.hasElements(selectedCells))
		{
			let cellSelectionContext = this.m_tableSelectionContext.addSubContext();
			cellSelectionContext.setType(oFF.AuGdsContextConstants.SELECTION_CELLS);
			this.extendPairContext(cellSelectionContext, selectedCells, oFF.AuGdsContextConstants.SELECTION_CELL);
		}
		if (oFF.XCollectionUtils.hasElements(selectedScopes))
		{
			let cellSelectionContext = this.m_tableSelectionContext.addSubContext();
			cellSelectionContext.setType(oFF.AuGdsContextConstants.SELECTION_SCOPES);
			this.extendPairContext(cellSelectionContext, selectedScopes, oFF.AuGdsContextConstants.SELECTION_SCOPE);
		}
		if (oFF.notNull(commonStyle))
		{
			let styleContext = this.m_tableSelectionContext.addSubContext();
			styleContext.setType(oFF.AuGdsContextConstants.SELECTION_STYLE);
			styleContext.setCustomObject(commonStyle);
		}
		let queryModel = this.getQueryManager().getQueryModel();
		if (oFF.XCollectionUtils.hasElements(this.m_columnDimensionsAllSelected) && oFF.XCollectionUtils.hasElements(this.m_rowDimensionsAllSelected))
		{
			oFF.AuGdsQbSubContextFillerUtil.extendDimensionContext(this.m_tableSelectionContext, queryModel, this.m_columnDimensionsAllSelected, true);
			oFF.AuGdsQbSubContextFillerUtil.extendDimensionContext(this.m_tableSelectionContext, queryModel, this.m_rowDimensionsAllSelected, true);
		}
		else if (oFF.XCollectionUtils.hasElements(this.m_columnDimensionsAllSelected))
		{
			oFF.AuGdsQbSubContextFillerUtil.extendDimensionContext(this.m_tableSelectionContext, queryModel, this.m_columnDimensionsAllSelected, this.m_columnDimensionsAllSelected.size() > this.m_columnDimensionsLastSelected.size());
		}
		else if (oFF.XCollectionUtils.hasElements(this.m_rowDimensionsAllSelected))
		{
			oFF.AuGdsQbSubContextFillerUtil.extendDimensionContext(this.m_tableSelectionContext, queryModel, this.m_rowDimensionsAllSelected, this.m_rowDimensionsAllSelected.size() > this.m_rowDimensionsLastSelected.size());
		}
		if (oFF.XCollectionUtils.hasElements(this.m_rowTuplesAllSelected))
		{
			oFF.AuGdsQbSubContextFillerUtil.extendTupleContext(this.m_tableSelectionContext, queryModel, this.m_rowTuplesAllSelected, this.m_rowTuplesAllSelected.size() > this.m_rowTuplesLastSelected.size(), true);
		}
		if (oFF.XCollectionUtils.hasElements(this.m_columnTuplesAllSelected))
		{
			oFF.AuGdsQbSubContextFillerUtil.extendTupleContext(this.m_tableSelectionContext, queryModel, this.m_columnTuplesAllSelected, this.m_columnTuplesAllSelected.size() > this.m_columnTuplesLastSelected.size(), false);
		}
		oFF.AuGdsQbSubContextFillerUtil.extendMemberContext(this.m_tableSelectionContext, queryModel, this.m_membersAllSelected, this.m_membersAllSelected.size() > this.m_membersLastSelected.size());
		oFF.AuGdsQbSubContextFillerUtil.extendTupleElementContext(this.m_tableSelectionContext, this.m_rowTupleElementsAllSelected, this.m_columnTupleElementsAllSelected);
		oFF.AuGdsQbSubContextFillerUtil.decorateStructureMemberContext(queryModel.getVersionDimension(), this.m_tableSelectionContext, this.m_versionMembersAllSelected, this.m_versionMembersAllSelected.size() > this.m_versionMembersLastSelected.size(), oFF.AuGdsContextConstants.OLAP_MEMBER_VERSION_SINGLE, oFF.AuGdsContextConstants.OLAP_MEMBER_VERSION_MULTI_CONNECTED, oFF.AuGdsContextConstants.OLAP_MEMBER_VERSION_MULTI_GAPS, oFF.AuGdsContextConstants.OLAP_MEMBER_VERSION_FILTER);
		oFF.AuGdsQbSubContextFillerUtil.decorateStructureMemberContext(queryModel.getAccountDimension(), this.m_tableSelectionContext, this.m_accountMembersAllSelected, this.m_accountMembersAllSelected.size() > this.m_accountMembersLastSelected.size(), oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_ACCOUNT_SINGLE, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_ACCOUNT_MULTI_CONNECTED, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_ACCOUNT_MULTI_GAPS, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_ACCOUNT_FILTER);
		oFF.AuGdsQbSubContextFillerUtil.decorateStructureMemberContext(queryModel.getNonMeasureDimension(), this.m_tableSelectionContext, this.m_secondaryStructureMembersAllSelected, this.m_secondaryStructureMembersAllSelected.size() > this.m_secondaryStructureMembersLastSelected.size(), oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_SECONDARY_SINGLE, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_SECONDARY_MULTI_CONNECTED, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_SECONDARY_MULTI_GAPS, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_SECONDARY_FILTER);
		oFF.AuGdsQbSubContextFillerUtil.decorateStructureMemberContext(queryModel.getMeasureDimension(), this.m_tableSelectionContext, this.m_measureMembersAllSelected, this.m_measureMembersAllSelected.size() > this.m_measureMembersLastSelected.size(), oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_MEASURE_SINGLE, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_MEASURE_MULTI_CONNECTED, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_MEASURE_MULTI_GAPS, oFF.AuGdsContextConstants.OLAP_STRUCTURE_MEMBER_MEASURE_FILTER);
		if (oFF.notNull(this.m_rowTuplesAllSelected) && this.m_rowTuplesAllSelected.size() === 1 && oFF.notNull(this.m_columnTuplesAllSelected) && this.m_columnTuplesAllSelected.size() === 1 && oFF.notNull(this.m_selectedDocumentId))
		{
			let subContext = this.m_tableSelectionContext.addSubContext();
			subContext.setType(oFF.AuGdsContextConstants.OLAP_DATA_CELL_DOCUMENT_ID);
			subContext.setCustomObject(oFF.XStringValue.create(this.m_selectedDocumentId));
		}
		oFF.AuGdsQbSubContextFillerUtil.extendAttributeAndFieldContext(this.m_tableSelectionContext, queryModel, this.m_attributesAllSelected, this.m_attributesLastSelected, this.m_fieldsAllSelected, this.m_fieldsAllSelected.size() > this.m_fieldsLastSelected.size());
		oFF.AuGdsQbSubContextFillerUtil.extendAxisAndFieldContext(this.m_tableSelectionContext, queryModel, this.m_unresolvedFieldNameLastSelected, this.m_axisHeaderLastSelected, this.m_udhDimensionSelected);
	}
	return success;
};
