oFF.AuGdsFilterLineTreeMenuMeasures.createMenuWithMeasures = function(genesis, featureManager, queryManager, openFilterDialogWithDimensionConsumer, openFilterDialogWithMeasureConsumer, setCascadeBehaviourForFilters, filterLineConfig)
{
	let newView = new oFF.AuGdsFilterLineTreeMenuMeasures();
	newView.setupInternal(genesis, featureManager, queryManager, openFilterDialogWithDimensionConsumer, setCascadeBehaviourForFilters, filterLineConfig);
	newView.m_openFilterDialogWithMeasureConsumer = openFilterDialogWithMeasureConsumer;
	newView.m_isDimensionMenuActive = false;
	return newView;
};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.m_isDimensionMenuActive = false;
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.m_openFilterDialogWithMeasureConsumer = null;
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.m_uiListItems = null;
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.addOrChangeItem = function(isListChanged, member)
{
	let isMeasureNameEqual = (listItem) => {
		return oFF.XString.isEqual(listItem.getCustomObject().getName(), member.getName());
	};
	let isItemChanged = (listItem2) => {
		return !oFF.XObject.areObjectsEqual(listItem2.getCustomObject(), member);
	};
	let existingItem = oFF.XCollectionUtils.findFirst(this.m_uiListItems, isMeasureNameEqual);
	let addNewItem = false;
	if (oFF.isNull(existingItem) && this.isDimensionMemberVisible(member))
	{
		addNewItem = true;
	}
	else if (oFF.notNull(existingItem) && isItemChanged(existingItem))
	{
		this.m_uiListItems.removeElement(existingItem);
		addNewItem = true;
	}
	if (addNewItem)
	{
		this.m_uiListItems.add(this.createMeasureMenuItem(member));
		isListChanged.setBoolean(true);
	}
	return isListChanged;
};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.castStructureMemberTypeToDimMember = function(structureMember)
{
	return structureMember;
};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.createMeasureMenuItem = function(measure)
{
	let name = this.getNameFromDimensionMember(measure);
	let item = this.createMenuItem(name, name);
	item.setCustomObject(measure);
	item.registerOnPress(oFF.UiLambdaPressListener.create((event) => {
		this.m_openFilterDialogWithMeasureConsumer(measure);
	}));
	return item;
};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.createMenuItemsInternal = function()
{
	this.m_uiListItems = oFF.XStream.of(this.getStructureDimension().getAllStructureMembers()).filter(this.isDimensionMemberVisible.bind(this)).map(this.createMeasureMenuItem.bind(this)).collect(oFF.XStreamCollector.toList());
	this.sortMemberListItems();
};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.createNavMenuItem = function(sourceList, text)
{
	let item = this.createMenuItem(text, text);
	item.setListItemType(oFF.UiListItemType.NAVIGATION);
	sourceList.addItem(item);
	return item;
};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.destroyView = function()
{
	this.m_uiListItems = oFF.XObjectExt.release(this.m_uiListItems);
	this.m_openFilterDialogWithMeasureConsumer = null;
	oFF.DfAuGdsFilterLineTreeMenu.prototype.destroyView.call( this );
};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.getDimensionMenu = function(sourceList)
{
	let dimensionMenu = this.createNavMenuItem(sourceList, this.getLocalization().getText(oFF.AuGdsFilterLineI18n.DIMENSIONS));
	dimensionMenu.registerOnPress(oFF.UiLambdaPressListener.create((controlEvent) => {
		let extraSections = oFF.XList.create();
		extraSections.add(this.createDimensionSettingsSection());
		this.rootListItemOnPress(this.getLocalization().getText(oFF.AuGdsFilterLineI18n.DIMENSIONS), this.getLocalization().getText(oFF.AuGdsFilterLineI18n.SEARCH_DIMENSION), this.m_dimensionListItems, this.m_searchableListItems, extraSections);
		this.m_currentSubPageListItems = this.m_dimensionListItems;
		this.m_isDimensionMenuActive = true;
		this.rerenderPopupHeight();
	}));
	return dimensionMenu;
};
