oFF.AuGdsFilterLineTreeMenuMeasures.prototype.isDimensionMemberVisible = function(dimensionMember)
{
	if (dimensionMember.getResultVisibility() === oFF.ResultVisibility.HIDDEN)
	{
		return false;
	}
	let qmDimension = this.getStructureDimension().getStructureMember(dimensionMember.getName());
	return oFF.FilterDialogViewType.MEASURE_BASED_FILTER.isSupportedByMember(qmDimension);
};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.isSearchFieldShownForSubPage = function()
{
	return this.m_isDimensionMenuActive ? this.m_searchableListItems.size() >= oFF.AuGdsFilterLineMenuSearchableView.NUMBER_OF_ITEMS_FOR_SEARCH_FIELD : this.m_currentSubPageListItems.size() >= oFF.AuGdsFilterLineMenuSearchableView.NUMBER_OF_ITEMS_FOR_SEARCH_FIELD;
};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.isSettingsMenuShown = function()
{
	return this.m_isDimensionMenuActive && !this.isOnDetailPage();
};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.onBack = function(event)
{
	if (this.isOnRootPage())
	{
		this.m_isDimensionMenuActive = false;
	}
	oFF.DfAuGdsFilterLineTreeMenu.prototype.onBack.call( this , event);
};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.removeItemById = function(id) {};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.removeItemIfNeeded = function(item)
{
	let storedStructureMember = item.getCustomObject();
	let qmStructureMember = this.getStructureDimension().getStructureMember(storedStructureMember.getName());
	let isStructureMemberHidden = oFF.notNull(qmStructureMember) && !this.isDimensionMemberVisible(qmStructureMember);
	let isStructureMemberRemoved = oFF.isNull(qmStructureMember) || isStructureMemberHidden;
	if (isStructureMemberRemoved)
	{
		this.removeItemById(item.getId());
	}
	return isStructureMemberRemoved;
};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.removeNonExistentOrHiddenMembers = function()
{
	let itemCount = this.m_uiListItems.size();
	this.m_uiListItems = oFF.XStream.of(this.m_uiListItems).filter((item) => {
		return !this.removeItemIfNeeded(item);
	}).collect(oFF.XStreamCollector.toList());
	return oFF.XPromise.resolve(oFF.XBooleanValue.create(itemCount - this.m_uiListItems.size() !== 0));
};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.resetPage = function() {};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.rootListItemOnPress = function(title, searchInputPlaceholder, list, searchableList, extraSections)
{
	let searchableListView = oFF.AuGdsFilterLineMenuSearchableView.createWithSettings(this.getGenesis(), list, searchableList, searchInputPlaceholder);
	searchableListView.setupExtraListSections(extraSections);
	searchableListView.setListSelectionMode(oFF.UiSelectionMode.NONE);
	let searchableListControl = searchableListView.getView();
	searchableListControl.setWidth(oFF.UiCssLength.create("16rem"));
	this.setSubPageContent(searchableListControl);
	this.setSubPageTitle(title);
	this.goToSubPage();
};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.setupInternal = function(genesis, featureManager, queryManager, openFilterDialogWithDimensionConsumer, setCascadeBehaviourForFilters, filterLineConfig)
{
	oFF.DfAuGdsFilterLineTreeMenu.prototype.setupInternal.call( this , genesis, featureManager, queryManager, openFilterDialogWithDimensionConsumer, setCascadeBehaviourForFilters, filterLineConfig);
	oFF.XObjectExt.assertNotNullExt(this.getStructureDimension(), "Structure dimension must be present to create a filter line menu with measures/accounts.");
};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.sortMemberListItems = function()
{
	this.m_uiListItems.sortByComparator(oFF.XComparatorLambda.create((item1, item2) => {
		return oFF.XIntegerValue.create(oFF.XString.compare(oFF.XString.toLowerCase(item1.getText()), oFF.XString.toLowerCase(item2.getText())));
	}));
};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.updateContent = function()
{
	let rootList = this.getGenesis().newControl(oFF.UiType.LIST);
	rootList.addItem(this.getDimensionMenu(rootList));
	rootList.addItem(this.getStructureMenu(rootList));
	this.setRootPageContent(rootList);
};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.updateMemberListFromQueryModel = function()
{
	let isListChanged = oFF.XStream.of(this.getStructureDimension().getAllStructureMembers()).filter(this.isDimensionMemberVisible.bind(this)).map(this.castStructureMemberTypeToDimMember.bind(this)).reduce(oFF.XBooleanValue.create(false), (isListChangedInitial, member) => {
		return this.addOrChangeItem(isListChangedInitial, member);
	});
	return oFF.XPromise.resolve(isListChanged);
};
oFF.AuGdsFilterLineTreeMenuMeasures.prototype.updateMenuItemsInternal = function()
{
	this.updateMemberListFromQueryModel().onThen((isListChanged) => {
		this.removeNonExistentOrHiddenMembers().onThen((isMemberRemoved) => {
			if (isListChanged.getBoolean() || isMemberRemoved.getBoolean())
			{
				this.resetPage();
				this.sortMemberListItems();
			}
		});
	});
};

