oFF.AuProteusShell.prototype.saveBoilerplateFiles = function()
{
	return oFF.XPromise.create((resolve, reject) => {
		if (oFF.isNull(this.m_outputDir))
		{
			reject(oFF.XError.create("Output directory cannot be found!"));
		}
		else
		{
			if (!this.m_outputDir.isExisting())
			{
				this.m_outputDir.mkdirs();
			}
			let contents = this.m_proteusEngine.getBoilerplateFiles();
			if (oFF.notNull(contents))
			{
				let filenames = contents.getKeysAsIterator();
				let promiseList = oFF.XPromiseList.create();
				while (filenames.hasNext())
				{
					let filename = filenames.next();
					let filePath = this.getProcess().resolvePath(contents.getByKey(filename));
					let file = oFF.XFile.createWithVars(this.getProcess(), filePath);
					promiseList.add(oFF.XFilePromise.copyFile(file, this.m_outputDir, false).onThenExt((newFile) => {
						let status = oFF.isNull(newFile) || newFile.hasErrors();
						if (status)
						{
							this.println(oFF.XStringUtils.concatenate2("Cannot save ", filename));
						}
						else
						{
							this.println(oFF.XStringUtils.concatenate2(filename, " saved!"));
						}
						return oFF.XBooleanValue.create(!status);
					}).onCatch(reject));
				}
				let testPromise = oFF.XPromise.all(promiseList);
				testPromise.onThenExt((states) => {
					let isSuccess = true;
					let iterator = states.getIterator();
					while (iterator.hasNext())
					{
						let next = iterator.next();
						isSuccess = isSuccess && next.getBoolean();
					}
					resolve(oFF.XBooleanValue.create(isSuccess));
					return oFF.XBooleanValue.create(isSuccess);
				}).onCatch(reject);
			}
		}
	});
};
oFF.AuProteusShell.prototype.saveOutput = function()
{
	if (oFF.notNull(this.m_proteusEngine))
	{
		if (this.m_proteusEngine.hasErrors())
		{
			let errorsIterator = this.m_proteusEngine.getParsingErrors().getIterator();
			while (errorsIterator.hasNext())
			{
				this.println(errorsIterator.next());
			}
		}
		else
		{
			this.println("Quasar document successfully converted!");
		}
		this.println(oFF.XStringUtils.concatenate2("Saving output to: ", this.m_outputDir.getNativePath()));
		this.saveBoilerplateFiles().onThen((state) => {
			if (state.getBoolean())
			{
				this.saveViewFile(this.m_proteusEngine.getXmlViewContent());
				this.println("Successfully saved!");
			}
			else
			{
				this.println("Error saving template files!");
			}
		}).onCatch((error) => {
			this.println(error.getText());
		});
	}
};
oFF.AuProteusShell.prototype.saveViewFile = function(viewStr)
{
	if (oFF.isNull(this.m_outputDir))
	{
		this.println("Output directory cannot be found!");
	}
	else
	{
		let viewDir = this.m_outputDir.newChild("view/");
		if (!viewDir.isExisting())
		{
			viewDir.mkdirs();
		}
		let viewfile = viewDir.newChild("Main.view.xml");
		if (oFF.isNull(viewfile) || viewfile.hasErrors())
		{
			this.println("Cannot save!");
		}
		else
		{
			let fileContentToSave = oFF.XByteArray.convertFromString(viewStr);
			viewfile.saveByteArray(fileContentToSave);
			this.println("View file saved!");
		}
	}
};
