oFF.AuComboBoxView.prototype.createDropdownItems = function(comboBoxValues)
{
	let itemList = oFF.XList.create();
	let size = comboBoxValues.size();
	for (let i = 0; i < size; i++)
	{
		let presentation = comboBoxValues.get(i);
		let text = presentation.getFirstString();
		let name = presentation.getSecondString();
		let DropdownItem = this.m_root.newItem();
		DropdownItem.setName(name);
		DropdownItem.setText(text);
		itemList.add(DropdownItem);
	}
	if (oFF.notNull(itemList))
	{
		let itemListSize = itemList.size();
		for (let i = 0; i < itemListSize; i++)
		{
			this.m_root.addItem(itemList.get(i));
		}
	}
};
