oFF.AuComboBoxView.prototype.setDropdownItemList = function()
{
	let comboBoxValues = oFF.XList.create();
	let axis = this.m_config.getAxis();
	let memberSelected = this.m_config.getMember();
	let m_dp = this.getDataProviders().get(0);
	let queryManager = m_dp.getQueryManager();
	if (oFF.XString.isEqual(oFF.AuComboBoxView.AXIS_ROW, axis))
	{
		let rowAxis = queryManager.getQueryModel().getDimensionNames();
		for (let i = 0; i < rowAxis.size(); i++)
		{
			let dimension = rowAxis.get(i);
			let rowStringBuffer = oFF.XStringBuffer.create();
			rowStringBuffer.append(oFF.AuComboBoxView.ROW_PREFIX).append(dimension);
			comboBoxValues.add(oFF.XPairOfString.create(dimension, rowStringBuffer.toString()));
		}
		this.createDropdownItems(comboBoxValues);
	}
	else if (oFF.XString.isEqual(oFF.AuComboBoxView.AXIS_COLUMN, axis))
	{
		let colAxis = queryManager.getQueryModel().getColumnsAxis().getDimensionNames();
		for (let i = 0; i < colAxis.size(); i++)
		{
			let dimension = colAxis.get(i);
			let colStringBuffer = oFF.XStringBuffer.create();
			colStringBuffer.append(oFF.AuComboBoxView.COLUMN_PREFIX).append(dimension);
			comboBoxValues.add(oFF.XPairOfString.create(dimension, colStringBuffer.toString()));
		}
		this.createDropdownItems(comboBoxValues);
	}
	if (oFF.XString.isString(memberSelected))
	{
		let result = queryManager.processQueryExecution(oFF.SyncType.BLOCKING, null, null);
		if (result.hasErrors())
		{
			throw oFF.XException.createRuntimeException(result.getSummary());
		}
		let resultSetContainer = result.getData();
		let classicResultSet = resultSetContainer.getClassicResultSet();
		let tuplesIterator = classicResultSet.getRowsAxis().getTuplesIterator();
		while (tuplesIterator.hasNext())
		{
			let oTuple = tuplesIterator.next();
			let oElement = oTuple.get(0);
			let oMember = oElement.getDimensionMember();
			let sMemberName = oMember.getName();
			let rowStringBuffer = oFF.XStringBuffer.create();
			rowStringBuffer.append(oFF.AuComboBoxView.MEMBER_PREFIX).append(sMemberName);
			comboBoxValues.add(oFF.XPairOfString.create(sMemberName, rowStringBuffer.toString()));
		}
		this.createDropdownItems(comboBoxValues);
	}
};
