oFF.AuAnalyticalButtonComponentPlugin.prototype._ff_c = "AuAnalyticalButtonComponentPlugin";

oFF.AuAnalyticalButtonComponentPlugin.CONFIG_ACTIONS = "actions";
oFF.AuAnalyticalButtonComponentPlugin.CONFIG_DATA_PROVIDER_NAMES = "dataProviderNames";
oFF.AuAnalyticalButtonComponentPlugin.CONFIG_TEXT = "text";
oFF.AuAnalyticalButtonComponentPlugin.PLUGIN_NAME = "AnalyticalButton";
oFF.AuAnalyticalButtonComponentPlugin.prototype.m_buttonView = null;
oFF.AuAnalyticalButtonComponentPlugin.prototype.m_commandSequence = null;
oFF.AuAnalyticalButtonComponentPlugin.prototype.m_dataProviderNames = null;
oFF.AuAnalyticalButtonComponentPlugin.prototype.m_dataProviders = null;
oFF.AuAnalyticalButtonComponentPlugin.prototype.m_poolChangeConsumerId = null;
oFF.AuAnalyticalButtonComponentPlugin.prototype.m_text = null;
oFF.AuAnalyticalButtonComponentPlugin.prototype._onDataProviderPoolChange = function(dpName)
{
	if (!this.m_dataProviderNames.contains(dpName))
	{
		this._setDataProviderFromPool();
	}
};
oFF.AuAnalyticalButtonComponentPlugin.prototype._setDataProviderFromPool = function()
{
	this.m_dataProviders.clear();
	let dpPool = this.getProcess().getDataProviderPool();
	oFF.XCollectionUtils.forEach(this.m_dataProviderNames, (tmpDpName) => {
		if (dpPool.hasDataProviderByName(tmpDpName))
		{
			this.m_dataProviders.add(dpPool.getDataProviderByName(tmpDpName));
		}
	});
	this.m_buttonView.setDataProviders(oFF.OlapDataProviderOlapAccess.getOlapInterfaces(this.m_dataProviders));
};
oFF.AuAnalyticalButtonComponentPlugin.prototype._subscribePoolEvents = function()
{
	let dpPool = this.getProcess().getDataProviderPool();
	this.m_poolChangeConsumerId = dpPool.addChangeConsumer(this._onDataProviderPoolChange.bind(this));
};
oFF.AuAnalyticalButtonComponentPlugin.prototype._unsubscribePoolEvents = function()
{
	let dpPool = this.getProcess().getDataProviderPool();
	if (oFF.notNull(this.m_poolChangeConsumerId))
	{
		dpPool.removeChangeConsumerByUuid(this.m_poolChangeConsumerId);
		this.m_poolChangeConsumerId = null;
	}
};
oFF.AuAnalyticalButtonComponentPlugin.prototype.buildPluginUi = function(genesis)
{
	let config = oFF.AuButtonViewConfiguration.createButtonViewConfig(this.getApplication());
	config.setText(this.m_text);
	this.m_buttonView = oFF.AuButtonView.createView(genesis, config);
	this.m_buttonView.setCommandSequence(this.m_commandSequence);
	if (oFF.notNull(this.m_dataProviderNames))
	{
		this._setDataProviderFromPool();
		this._subscribePoolEvents();
	}
	genesis.setRoot(this.m_buttonView.getView());
};
oFF.AuAnalyticalButtonComponentPlugin.prototype.destroyPlugin = function()
{
	this._unsubscribePoolEvents();
	this.m_dataProviderNames = oFF.XCollectionUtils.clearAndReleaseCollection(this.m_dataProviderNames);
	this.m_text = null;
	this.m_poolChangeConsumerId = null;
	this.m_commandSequence = oFF.XCollectionUtils.clearAndReleaseCollection(this.m_commandSequence);
	this.m_buttonView = oFF.XObjectExt.release(this.m_buttonView);
	oFF.HuDfComponentPlugin.prototype.destroyPlugin.call( this );
};
oFF.AuAnalyticalButtonComponentPlugin.prototype.getPluginCategory = function()
{
	return oFF.HuPluginCategory.OLAP;
};
oFF.AuAnalyticalButtonComponentPlugin.prototype.getPluginName = function()
{
	return oFF.AuAnalyticalButtonComponentPlugin.PLUGIN_NAME;
};
oFF.AuAnalyticalButtonComponentPlugin.prototype.processConfiguration = function(configuration)
{
	this.m_dataProviderNames = oFF.XList.createWithList(oFF.XStringTokenizer.splitString(configuration.getStringByKey(oFF.AuAnalyticalButtonComponentPlugin.CONFIG_DATA_PROVIDER_NAMES), ","));
	this.m_text = configuration.getStringByKeyExt(oFF.AuAnalyticalButtonComponentPlugin.CONFIG_TEXT, "Button");
	this.m_commandSequence = oFF.XList.create();
	let actionsString = configuration.getStringByKey(oFF.AuAnalyticalButtonComponentPlugin.CONFIG_ACTIONS);
	let actionsList = oFF.XStringTokenizer.splitString(actionsString, ";");
	for (let i = 0; i < actionsList.size(); i++)
	{
		let fullAction = actionsList.get(i);
		if (oFF.XString.endsWith(fullAction, ")"))
		{
			fullAction = oFF.XStringUtils.stripRight(fullAction, 1);
		}
		let actionList = oFF.XStringTokenizer.splitString(fullAction, "(");
		let action = actionList.get(0);
		let parametersList = oFF.XStringTokenizer.splitString(actionList.size() > 1 ? actionList.get(1) : "", ",");
		let actionPair = new oFF.AuButtonActionPair();
		actionPair.setActionName(action);
		actionPair.setActionArguments(parametersList);
		this.m_commandSequence.add(actionPair);
	}
};
oFF.AuAnalyticalButtonComponentPlugin.prototype.setupPlugin = function(controller)
{
	this.m_dataProviders = oFF.XList.create();
	return oFF.HuDfComponentPlugin.prototype.setupPlugin.call( this , controller);
};

