oFF.AuComboBoxComponentPlugin.prototype.m_poolChangeConsumerId = null;
oFF.AuComboBoxComponentPlugin.prototype._onDataProviderPoolChange = function(dpName)
{
	if (!this.m_dataProviderNames.contains(dpName))
	{
		this._setDataProviderFromPool();
	}
};
oFF.AuComboBoxComponentPlugin.prototype._setDataProviderFromPool = function()
{
	this.m_dataProviders.clear();
	let dpPool = this.getProcess().getDataProviderPool();
	oFF.XCollectionUtils.forEach(this.m_dataProviderNames, (tmpDpName) => {
		if (dpPool.hasDataProviderByName(tmpDpName))
		{
			this.m_dataProviders.add(dpPool.getDataProviderByName(tmpDpName));
		}
	});
	this.m_comboBoxView.setDataProviders(oFF.OlapDataProviderOlapAccess.getOlapInterfaces(this.m_dataProviders));
};
oFF.AuComboBoxComponentPlugin.prototype._subscribePoolEvents = function()
{
	let dpPool = this.getProcess().getDataProviderPool();
	this.m_poolChangeConsumerId = dpPool.addChangeConsumer(this._onDataProviderPoolChange.bind(this));
};
oFF.AuComboBoxComponentPlugin.prototype._unsubscribePoolEvents = function()
{
	let dpPool = this.getProcess().getDataProviderPool();
	if (oFF.notNull(this.m_poolChangeConsumerId))
	{
		dpPool.removeChangeConsumerByUuid(this.m_poolChangeConsumerId);
		this.m_poolChangeConsumerId = null;
	}
};
oFF.AuComboBoxComponentPlugin.prototype.buildPluginUi = function(genesis)
{
	let config = oFF.AuComboBoxViewConfiguration.createComboBoxViewConfig(this.getApplication());
	config.setPlaceholder(this.m_placeholder);
	config.setAxis(this.m_axis);
	config.setMember(this.m_member);
	this.m_comboBoxView = oFF.AuComboBoxView.createView(genesis, config);
	if (oFF.notNull(this.m_dataProviderNames))
	{
		this._setDataProviderFromPool();
		this._subscribePoolEvents();
	}
	genesis.setRoot(this.m_comboBoxView.getView());
};
oFF.AuComboBoxComponentPlugin.prototype.destroyPlugin = function()
{
	this._unsubscribePoolEvents();
	this.m_dataProviderNames = oFF.XCollectionUtils.clearAndReleaseCollection(this.m_dataProviderNames);
	this.m_placeholder = null;
	this.m_axis = null;
	this.m_member = null;
	this.m_comboBoxView = oFF.XObjectExt.release(this.m_comboBoxView);
	oFF.HuDfComponentPlugin.prototype.destroyPlugin.call( this );
};
oFF.AuComboBoxComponentPlugin.prototype.getPluginCategory = function()
{
	return oFF.HuPluginCategory.OLAP;
};
oFF.AuComboBoxComponentPlugin.prototype.getPluginName = function()
{
	return oFF.AuComboBoxComponentPlugin.PLUGIN_NAME;
};
oFF.AuComboBoxComponentPlugin.prototype.processConfiguration = function(configuration)
{
	this.m_dataProviderNames = oFF.XList.createWithList(oFF.XStringTokenizer.splitString(configuration.getStringByKey(oFF.AuComboBoxComponentPlugin.CONFIG_DATA_PROVIDER_NAMES), ","));
	this.m_placeholder = configuration.getStringByKeyExt(oFF.AuComboBoxComponentPlugin.CONFIG_PLACEHOLDER, "Select a value");
	this.m_axis = configuration.getStringByKey(oFF.AuComboBoxComponentPlugin.CONFIG_AXIS);
	this.m_member = configuration.getStringByKey(oFF.AuComboBoxComponentPlugin.CONFIG_MEMBER);
};
