oFF.AuInsightRendererViewPlugin.prototype.setupPlugin = function(controller)
{
	oFF.HuDfComponentPlugin.prototype.setupPlugin.call( this , controller);
	let createDpPromise = null;
	let configuration = this.getConfiguration();
	let insightFile = configuration.getStringByKey(oFF.AuInsightRendererViewPlugin.CONFIG_INSIGHT_FILE);
	let process = this.getProcess();
	let dpName;
	if (oFF.XStringUtils.isNotNullAndNotEmpty(insightFile))
	{
		let file = oFF.XFile.createByNativePath(process, insightFile);
		dpName = oFF.XStringUtils.concatenate3(file.getName(), ":", oFF.XGuid.getGuid());
		createDpPromise = oFF.OlapDataProviderFactory.createDataProviderFromFile(process, dpName, insightFile, null);
	}
	else
	{
		let insightContent = configuration.getStructureByKey(oFF.AuInsightRendererViewPlugin.CONFIG_INSIGHT_CONTENT);
		if (oFF.notNull(insightContent) && insightContent.hasElements())
		{
			dpName = oFF.XGuid.getGuid();
			createDpPromise = oFF.OlapDataProviderFactory.createDataProviderFromFileContent(process, dpName, insightContent);
		}
	}
	if (oFF.notNull(createDpPromise))
	{
		return createDpPromise.onThenExt((dataProvider) => {
			this.m_dataProvider = dataProvider;
			return oFF.XBooleanValue.create(true);
		});
	}
	return null;
};

