oFF.AuStylingPanelDocumentPlugin.prototype._ff_c = "AuStylingPanelDocumentPlugin";

oFF.AuStylingPanelDocumentPlugin.CONFIG_CONFIG_KEY = "config";
oFF.AuStylingPanelDocumentPlugin.CONFIG_ITEM_CONFIGS_KEY = "itemConfigs";
oFF.AuStylingPanelDocumentPlugin.CONFIG_PLUGIN_KEY = "plugin";
oFF.AuStylingPanelDocumentPlugin.CONFIG_STYLING_ITEMS = "stylingItems";
oFF.AuStylingPanelDocumentPlugin.ITEMS_CONFIG_PATH = "/stylingpaneldocument/templates/";
oFF.AuStylingPanelDocumentPlugin.PLUGIN_NAME = "StylingPanelDocument";
oFF.AuStylingPanelDocumentPlugin.prototype.m_pluginViewWrapper = null;
oFF.AuStylingPanelDocumentPlugin.prototype._createPluginInstance = function(config)
{
	return this.getController().addNewComponentPlugin(oFF.HpExpandableListDocumentPlugin.PLUGIN_NAME, config, null).onThenExt((pluginInstanceId) => {
		this.m_pluginViewWrapper = this.getController().getPluginView(pluginInstanceId);
		return oFF.XBooleanValue.create(true);
	});
};
oFF.AuStylingPanelDocumentPlugin.prototype._injectDpName = function(stylePluginConfig)
{
	let configuration = this.getConfiguration();
	let dpName = configuration.getStringByKey(oFF.OuDataProviderCPConstants.CONFIG_DATA_PROVIDER_NAME);
	if (oFF.XStringUtils.isNotNullAndNotEmpty(dpName))
	{
		let subPanels = stylePluginConfig.getListByKey(oFF.HpExpandableListDocumentPlugin.ITEMS_AGGREGATION);
		oFF.XCollectionUtils.forEach(subPanels, (subPanel) => {
			if (subPanel.isStructure())
			{
				let subPanelStructure = subPanel.asStructure();
				let subPanelConfig = subPanelStructure.getStructureByKey(oFF.HuHorizonApi.PARAM_CONFIG);
				if (oFF.isNull(subPanelConfig))
				{
					subPanelConfig = subPanelStructure.putNewStructure(oFF.HuHorizonApi.PARAM_CONFIG);
				}
				subPanelConfig.putString(oFF.OuDataProviderCPConstants.CONFIG_DATA_PROVIDER_NAME, dpName);
			}
		});
	}
};
oFF.AuStylingPanelDocumentPlugin.prototype._passthroughPluginConfigToItemsIfNeeded = function(pluginStartConfig)
{
	if (oFF.XCollectionUtils.hasElements(pluginStartConfig))
	{
		let pluginName = pluginStartConfig.getStringByKey(oFF.AuStylingPanelDocumentPlugin.CONFIG_PLUGIN_KEY);
		if (oFF.XStringUtils.isNotNullAndNotEmpty(pluginName))
		{
			let itemConfigs = this.getConfiguration().getStructureByKey(oFF.AuStylingPanelDocumentPlugin.CONFIG_ITEM_CONFIGS_KEY);
			if (oFF.XCollectionUtils.hasElements(itemConfigs))
			{
				let passthroughPluginConfig = itemConfigs.getStructureByKey(pluginName);
				if (oFF.XCollectionUtils.hasElements(passthroughPluginConfig))
				{
					let pluginConfig = pluginStartConfig.getStructureByKey(oFF.AuStylingPanelDocumentPlugin.CONFIG_CONFIG_KEY);
					if (oFF.isNull(pluginConfig))
					{
						pluginConfig = pluginStartConfig.putNewStructure(oFF.AuStylingPanelDocumentPlugin.CONFIG_CONFIG_KEY);
					}
					oFF.PrUtils.mergeStructuresExt(pluginConfig, passthroughPluginConfig, true);
				}
			}
		}
	}
};
oFF.AuStylingPanelDocumentPlugin.prototype.destroyPlugin = function()
{
	this.m_pluginViewWrapper = oFF.XObjectExt.release(this.m_pluginViewWrapper);
	oFF.HuDfDocumentPlugin.prototype.destroyPlugin.call( this );
};
oFF.AuStylingPanelDocumentPlugin.prototype.getAutoLayoutConfiguration = function()
{
	let autoLayoutConfig = oFF.PrFactory.createStructure();
	autoLayoutConfig.putString("type", oFF.HuLayoutType.SINGLE_PLUGIN.getName());
	return autoLayoutConfig;
};
oFF.AuStylingPanelDocumentPlugin.prototype.getPluginCategory = function()
{
	return oFF.HuPluginCategory.OLAP;
};
oFF.AuStylingPanelDocumentPlugin.prototype.getPluginName = function()
{
	return oFF.AuStylingPanelDocumentPlugin.PLUGIN_NAME;
};
oFF.AuStylingPanelDocumentPlugin.prototype.layoutDocument = function(documentController)
{
	let genesis = documentController.getGenesis();
	let title = oFF.XLocalizationCenter.getCenter().getText(oFF.AuGdsQueryBuilderI18n.STYLE_TITLE);
	let panelWidget = oFF.UtPanelWidget.create(genesis, "fpa/designer", title, null);
	panelWidget.addCssClass("ffStylingPanelWidget");
	let panel = panelWidget.getView();
	panel.setContent(this.m_pluginViewWrapper);
	documentController.setRoot(panel);
};
oFF.AuStylingPanelDocumentPlugin.prototype.setupPlugin = function(controller)
{
	oFF.HuDfDocumentPlugin.prototype.setupPlugin.call( this , controller);
	let stylePluginConfig = oFF.PrFactory.createStructure();
	let stylingItemsConfig = oFF.PrFactory.createList();
	let stylingItems = this.getConfiguration().getListByKey(oFF.AuStylingPanelDocumentPlugin.CONFIG_STYLING_ITEMS);
	if (oFF.notNull(stylingItems))
	{
		stylePluginConfig.put(oFF.HpExpandableListDocumentPlugin.ITEMS_AGGREGATION, stylingItemsConfig);
		oFF.XCollectionUtils.forEach(stylingItems, (item) => {
			if (item.isString())
			{
				let itemPluginName = item.asString().getString();
				let configPath = oFF.XStringUtils.concatenate3(oFF.AuStylingPanelDocumentPlugin.ITEMS_CONFIG_PATH, itemPluginName, ".cfg");
				let config = oFF.XResources.loadString(configPath);
				if (oFF.notNull(config))
				{
					let configStruct = oFF.PrUtils.deserialize(config).asStructure();
					this._passthroughPluginConfigToItemsIfNeeded(configStruct);
					stylingItemsConfig.add(configStruct);
				}
			}
		});
		if (stylingItemsConfig.hasElements())
		{
			this._injectDpName(stylePluginConfig);
			return this._createPluginInstance(stylePluginConfig);
		}
	}
	return oFF.XPromise.reject(oFF.XError.create("No styling items found in configuration"));
};

