oFF.AuDataAnalyzerNotificationObserverViewPlugin.prototype._addEntry = function(notificationName, dataKey, value)
{
	let listItem = this.m_genesis.newControl(oFF.UiType.CUSTOM_LIST_ITEM);
	listItem.addCssClass("ffDaNotificationObserverListItem");
	listItem.setHighlight(oFF.UiMessageType.INFORMATION);
	let innerList = listItem.setNewContent(oFF.UiType.FLEX_LAYOUT).setDirection(oFF.UiFlexDirection.COLUMN);
	innerList.addNewItemOfType(oFF.UiType.TEXT).setText("Notification name").setFontWeight(oFF.UiFontWeight.BOLD);
	innerList.addNewItemOfType(oFF.UiType.LABEL).setText(notificationName).addCssClass("ffDaNotificationObserverNotificationName").setWrapping(true);
	innerList.addNewItemOfType(oFF.UiType.TEXT).setText("Data key").setFontWeight(oFF.UiFontWeight.BOLD);
	innerList.addNewItemOfType(oFF.UiType.LABEL).setText(dataKey).addCssClass("ffDaNotificationObserverDataKey").setWrapping(true);
	innerList.addNewItemOfType(oFF.UiType.TEXT).setText("Data value").setFontWeight(oFF.UiFontWeight.BOLD);
	innerList.addNewItemOfType(oFF.UiType.LABEL).setText(value).addCssClass("ffDaNotificationObserverDataValue").setWrapping(true);
	this.m_notificationUiEntries.addItem(listItem);
};
oFF.AuDataAnalyzerNotificationObserverViewPlugin.prototype._addInfoButton = function(titleFlex)
{
	let infoButton = titleFlex.addNewItemOfType(oFF.UiType.BUTTON);
	infoButton.setIcon("information");
	infoButton.setWidth(oFF.UiCssLength.create("2rem"));
	infoButton.setEnabled(oFF.notNull(this.m_notificationConfigList) && this.m_notificationConfigList.hasElements());
	infoButton.registerOnPress(oFF.UiLambdaPressListener.create((evt) => {
		let notificationKeysList = this.m_genesis.newControl(oFF.UiType.LIST);
		oFF.XCollectionUtils.forEach(this.m_notificationConfigList, (config) => {
			let configStruct = config.asStructure();
			if (oFF.notNull(configStruct))
			{
				let configKey = configStruct.getStringByKey(oFF.AuDataAnalyzerNotificationObserverViewPlugin.CONFIG_NOTIFICATION_NAME);
				notificationKeysList.addItem(this.m_genesis.newControl(oFF.UiType.LIST_ITEM).setText(configKey));
			}
		});
		let dialog = this.m_genesis.newControl(oFF.UiType.DIALOG).setTitle("Observed notification keys").setContent(notificationKeysList);
		let dialogOkButton = this.m_genesis.newControl(oFF.UiType.DIALOG_BUTTON).setText("Ok").setButtonType(oFF.UiButtonType.PRIMARY).registerOnPress(oFF.UiLambdaPressListener.create((evt2) => {
			dialog.close();
		}));
		dialog.addDialogButton(dialogOkButton).open();
	}));
};
oFF.AuDataAnalyzerNotificationObserverViewPlugin.prototype._getNotificationDataValue = function(data, dataKey, dataType)
{
	let value = null;
	if (oFF.XString.isEqual(dataType, oFF.XValueType.STRING.getName()))
	{
		value = data.getStringByKey(dataKey);
	}
	else if (oFF.XString.isEqual(dataType, oFF.XValueType.INTEGER.getName()))
	{
		value = oFF.XInteger.convertToString(data.getIntegerByKey(dataKey));
	}
	else if (oFF.XString.isEqual(dataType, oFF.XValueType.BOOLEAN.getName()))
	{
		value = oFF.XBoolean.convertToString(data.getBooleanByKey(dataKey));
	}
	else if (oFF.XString.isEqual(dataType, oFF.XValueType.OBJECT.getName()))
	{
		value = data.getXObjectByKey(dataKey).toString();
	}
	return value;
};
oFF.AuDataAnalyzerNotificationObserverViewPlugin.prototype._observeNotifications = function()
{
	let notificationCenter = this.getController().getLocalNotificationCenter();
	oFF.XCollectionUtils.forEach(this.m_notificationConfigList, (config) => {
		if (oFF.notNull(config))
		{
			let configStruct = config.asStructure();
			let notificationName = configStruct.getStringByKey(oFF.AuDataAnalyzerNotificationObserverViewPlugin.CONFIG_NOTIFICATION_NAME);
			let dataConfig = configStruct.getStructureByKey(oFF.AuDataAnalyzerNotificationObserverViewPlugin.CONFIG_NOTIFICATION_DATA);
			let key = dataConfig.getStringByKey(oFF.AuDataAnalyzerNotificationObserverViewPlugin.CONFIG_NOTIFICATION_DATA_KEY);
			let dataType = dataConfig.getStringByKey(oFF.AuDataAnalyzerNotificationObserverViewPlugin.CONFIG_NOTIFICATION_DATA_TYPE);
			let notificationId = notificationCenter.addObserverForName(notificationName, (data) => {
				let value = this._getNotificationDataValue(data, key, dataType);
				this._addEntry(notificationName, key, value);
			});
			this.m_notificationObserverIds.add(notificationId);
		}
	});
};
oFF.AuDataAnalyzerNotificationObserverViewPlugin.prototype._unobserveNotifications = function()
{
	let notificationCenter = this.getController().getLocalNotificationCenter();
	oFF.XCollectionUtils.forEach(this.m_notificationObserverIds, notificationCenter.removeObserverByUuid.bind(notificationCenter));
	this.m_notificationObserverIds.clear();
};
