oFF.AuGdsDfQbPanel.prototype.addStyleClass = function(className)
{
	this.getView().addCssClass(className);
};
oFF.AuGdsDfQbPanel.prototype.buildPanelUi = function(genesis)
{
	this.addStyleClass("ffGdsQbPanel");
	this.buildQbPanelUi(genesis);
	this.getView().addAttribute(oFF.UtUi5AttributeConstants.FAST_NAV_GROUP, "true");
};
oFF.AuGdsDfQbPanel.prototype.canUseDataProvider = function()
{
	return this.getDataProviderContext() !== null;
};
oFF.AuGdsDfQbPanel.prototype.getDataProviderContext = function()
{
	return null;
};
oFF.AuGdsDfQbPanel.prototype.removeStyleClass = function(className)
{
	this.getView().removeCssClass(className);
};
oFF.AuGdsDfQbPanel.prototype.updatePanelUiInternal = function()
{
	this.updateQueryManager();
	this.updateQbPanelUi();
};
oFF.AuGdsDfQbPanel.prototype.updateQueryManager = function()
{
	let qbContext = this.getParentDocument();
	if (oFF.isNull(qbContext))
	{
		return;
	}
	let dataProvider = qbContext.getDataProvider();
	if (oFF.notNull(dataProvider) && this.canUseDataProvider())
	{
		if (this.getDataProviderContext().getDataProvider() !== dataProvider)
		{
			this.getDataProviderContext().setDataProvider(dataProvider);
		}
	}
	else
	{
		let documentQueryManager = qbContext.getQueryManager();
		if (this.getQueryManager() !== documentQueryManager)
		{
			this.setQueryManager(documentQueryManager);
		}
	}
};

