oFF.AuGdsQbGeneralInfoPanelView.prototype._addNewStoryLink = function(layout)
{
	let storyLinkLayout = layout.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
	storyLinkLayout.setDirection(oFF.UiFlexDirection.ROW);
	storyLinkLayout.addCssClass("ffGdsQbGIStoryLinkLayout");
	let info = this.m_generalInfoPanelModel.getStoryInfo().get();
	if (info.isEmpty())
	{
		return;
	}
	if (info.getIconUri().isPresent())
	{
		let storyIcon = storyLinkLayout.addNewItemOfType(oFF.UiType.ICON);
		storyIcon.setIcon(info.getIconUri().get());
		storyIcon.addCssClass("sapMLnk");
		storyIcon.registerOnPress(oFF.UiLambdaPressListener.create((_ce) => {
			oFF.UiFramework.currentFramework().openUrl(info.getLinkSrc().get(), "_blank");
		}));
	}
	storyLinkLayout.addItem(this._buildStoryLink());
};
