oFF.AuGdsFilterLineTreeMenuAccounts = function() {};
oFF.AuGdsFilterLineTreeMenuAccounts.prototype = new oFF.AuGdsFilterLineTreeMenuMeasures();
oFF.AuGdsFilterLineTreeMenuAccounts.prototype._ff_c = "AuGdsFilterLineTreeMenuAccounts";

oFF.AuGdsFilterLineTreeMenuAccounts.createMenuWithAccounts = function(genesis, featureManager, queryManager, openFilterDialogWithDimensionConsumer, openFilterDialogWithAccountDimensionConsumer, setCascadeBehaviourForFilters, filterLineConfig)
{
	let newView = new oFF.AuGdsFilterLineTreeMenuAccounts();
	newView.setupInternal(genesis, featureManager, queryManager, openFilterDialogWithDimensionConsumer, setCascadeBehaviourForFilters, filterLineConfig);
	newView.m_openFilterDialogWithAccountDimensionConsumer = openFilterDialogWithAccountDimensionConsumer;
	newView.m_isDimensionMenuActive = false;
	return newView;
};
oFF.AuGdsFilterLineTreeMenuAccounts.prototype.m_initialVisibleSubPageTreeItemIds = null;
oFF.AuGdsFilterLineTreeMenuAccounts.prototype.m_openFilterDialogWithAccountDimensionConsumer = null;
oFF.AuGdsFilterLineTreeMenuAccounts.prototype.m_showSearchForAccounts = false;
oFF.AuGdsFilterLineTreeMenuAccounts.prototype.m_uiTreeListItems = null;
oFF.AuGdsFilterLineTreeMenuAccounts.prototype.m_visibleSubPageTreeItemIds = null;
oFF.AuGdsFilterLineTreeMenuAccounts.prototype.addNewTreeItem = function(memberNode)
{
	let treeItem = this.createAccountMemberMenuItem(memberNode);
	this.m_uiTreeListItems.add(treeItem);
	this.m_initialVisibleSubPageTreeItemIds.add(treeItem.getId());
};
oFF.AuGdsFilterLineTreeMenuAccounts.prototype.addOrChangeTreeItem = function(isListChanged, node)
{
	let member = node.getDimensionMember();
	let isAccountNameEqual = (treeItem) => {
		return oFF.XString.isEqual(treeItem.getCustomObject().getName(), member.getName());
	};
	let isItemChanged = (treeItem2) => {
		return !oFF.XObject.areObjectsEqual(treeItem2.getCustomObject(), member);
	};
	let existingTreeItem = oFF.XCollectionUtils.findFirst(this.m_uiTreeListItems, isAccountNameEqual);
	let addNewItem = false;
	if (oFF.isNull(existingTreeItem))
	{
		addNewItem = true;
	}
	else if (isItemChanged(existingTreeItem))
	{
		this.removeItemById(existingTreeItem.getId());
		this.m_uiTreeListItems.removeElement(existingTreeItem);
		addNewItem = true;
	}
	if (addNewItem && this.isDimensionMemberVisible(node.getDimensionMember()))
	{
		this.addNewTreeItem(node);
		isListChanged.setBoolean(true);
	}
	return isListChanged;
};
oFF.AuGdsFilterLineTreeMenuAccounts.prototype.createAccountMemberMenuItem = function(memberNode)
{
	let member = memberNode.getDimensionMember();
	let accountName = member.getName();
	let accountText = this.getPresentationType().getDisplayValueByType(member);
	let item = this.createMenuTreeItem(accountText, accountText);
	item.setCustomObject(member);
	oFF.XStream.of(memberNode.getChildren()).filter((node) => {
		return this.isDimensionMemberVisible(node.getDimensionMember());
	}).forEach((child) => {
		item.addItem(this.createAccountMemberMenuItem(child));
	});
	item.registerOnPress(oFF.UiLambdaPressListener.create((event) => {
		this.m_openFilterDialogWithAccountDimensionConsumer(accountName, accountText);
	}));
	item.registerOnExpand(oFF.UiLambdaExpandListener.create((expandEvent) => {
		let expandedItem = expandEvent.getAffectedItem();
		this.addExpandedItems(expandedItem, this.m_visibleSubPageTreeItemIds);
		this.rerenderPopupHeight();
	}));
	item.registerOnCollapse(oFF.UiLambdaCollapseListener.create((collapseEvent) => {
		let collapsedItem = collapseEvent.getAffectedItem();
		this.removeCollapsedItems(collapsedItem, this.m_visibleSubPageTreeItemIds);
		this.rerenderPopupHeight();
	}));
	return item;
};
oFF.AuGdsFilterLineTreeMenuAccounts.prototype.createMenuItemsInternal = function()
{
	this.m_uiTreeListItems.clear();
	this.m_visibleSubPageTreeItemIds.clear();
	this.m_initialVisibleSubPageTreeItemIds.clear();
	this.loadMembers().onThen((nodes) => {
		oFF.XStream.of(nodes).filter((node) => {
			return node.getParentNode() === null && this.isDimensionMemberVisible(node.getDimensionMember());
		}).forEach(this.addNewTreeItem.bind(this));
		this.resetVisibleSubPageTreeItemsIdsToInitial();
		this.sortMemberListItems();
	});
};
oFF.AuGdsFilterLineTreeMenuAccounts.prototype.destroyView = function()
{
	this.m_uiTreeListItems = oFF.XObjectExt.release(this.m_uiTreeListItems);
	this.m_visibleSubPageTreeItemIds = oFF.XObjectExt.release(this.m_visibleSubPageTreeItemIds);
	this.m_initialVisibleSubPageTreeItemIds = oFF.XObjectExt.release(this.m_initialVisibleSubPageTreeItemIds);
	this.m_openFilterDialogWithAccountDimensionConsumer = null;
	oFF.AuGdsFilterLineTreeMenuMeasures.prototype.destroyView.call( this );
};
