oFF.AuAnalyticalChartViewPlugin.prototype._getStartViz = function()
{
	let dataProvider = this.getDataProvider();
	if (oFF.isNull(dataProvider))
	{
		return oFF.XPromise.resolve(null);
	}
	if (oFF.XStringUtils.isNotNullAndNotEmpty(this.m_visualizationName))
	{
		return dataProvider.getOrCreateQueryManager().onThenExt((queryManager) => {
			return queryManager.getQueryModel().getVisualizationManager().getVisualizationDefinitionByName(this.m_visualizationName);
		});
	}
	return dataProvider.getActions().getVisualizationActions().getActiveVisualizationDefinition();
};
oFF.AuAnalyticalChartViewPlugin.prototype._isChartVisualization = function(vizDef)
{
	return oFF.notNull(vizDef) && vizDef.getSemanticBindingType() === oFF.SemanticBindingType.CHART;
};
oFF.AuAnalyticalChartViewPlugin.prototype._observeNotifications = function()
{
	let notificationCenter = this.getController().getLocalNotificationCenter();
	this.m_vizNameSetObserverId = notificationCenter.addObserverForName(oFF.AuAnalyticalChartViewPlugin.NOTIFICATION_VISUALIZATION_NAME_SET, (data) => {
		this.m_visualizationName = data.getStringByKey(oFF.AuAnalyticalChartViewPlugin.NOTIFY_DATA_VISUALIZATION_NAME);
		this._setChartViewVisualizationByName(this.m_visualizationName);
	});
	this.m_setTitleObserverId = notificationCenter.addObserverForName(oFF.AuAnalyticalChartViewPlugin.NOTIFICATION_SET_TITLE, (data) => {
		let title = data.getStringByKey(oFF.AuAnalyticalChartViewPlugin.NOTIFICATION_DATA_KEY_TITLE);
		this.m_chartView.setChartTitle(title);
	});
};
oFF.AuAnalyticalChartViewPlugin.prototype._setChartViewVisualization = function(definition)
{
	if (this._isChartVisualization(definition))
	{
		this.m_chartView.hideIllustratedMessage();
		let chartDefinition = definition;
		this.m_chartView.setChartDefinition(chartDefinition);
		this.m_chartView.updateChart();
	}
	else
	{
		this._showNoChartDataMessage();
	}
};
oFF.AuAnalyticalChartViewPlugin.prototype._setChartViewVisualizationByName = function(vizName)
{
	if (this.m_chartView.getQueryManager() !== null)
	{
		let visualizationManager = this.m_chartView.getQueryManager().getQueryModel().getVisualizationManager();
		let definition = oFF.XCollectionUtils.findFirst(visualizationManager.getVisualizationDefinitions(), (vis) => {
			return oFF.XString.isEqual(vis.getName(), vizName) && this._isChartVisualization(vis);
		});
		this._setChartViewVisualization(definition);
	}
};
oFF.AuAnalyticalChartViewPlugin.prototype._setInitialChartViewVisualization = function()
{
	this._getStartViz().onThen((definition) => {
		let syncPromise = oFF.XPromise.resolve(null);
		if (oFF.notNull(definition) && this.m_activateVizOnStart)
		{
			syncPromise = this.getDataProvider().getActions().getVisualizationActions().setActiveVisualizationDefinition(definition.getName());
		}
		syncPromise.onThen((empty) => {
			this._setChartViewVisualization(definition);
		});
	});
};
oFF.AuAnalyticalChartViewPlugin.prototype._showNoChartDataMessage = function()
{
	let localization = oFF.XLocalizationCenter.getCenter().getLocalizationProviderByName("AuChartView");
	this.m_chartView.showIllustratedMessage(localization.getText(oFF.AuChartViewI18n.I18N_CV_CHART_NO_CHART_TITLE), localization.getText(oFF.AuChartViewI18n.I18N_CV_CHART_NO_CHART_FOR_CURRENT_SELECTION));
};
oFF.AuAnalyticalChartViewPlugin.prototype._unobserveNotifications = function()
{
	let notificationCenter = this.getController().getLocalNotificationCenter();
	notificationCenter.removeObserverByUuid(this.m_vizNameSetObserverId);
	this.m_vizNameSetObserverId = null;
	notificationCenter.removeObserverByUuid(this.m_setTitleObserverId);
	this.m_setTitleObserverId = null;
};
