oFF.AuAnalyticalChartViewPlugin.prototype.onDataProviderVizChange = function(activeVizName, evt)
{
	let currentVizName = this.getActiveVizName();
	if (oFF.XStringUtils.isNullOrEmpty(this.m_visualizationName))
	{
		if (!oFF.XString.isEqual(currentVizName, activeVizName))
		{
			this._setChartViewVisualizationByName(activeVizName);
		}
	}
	else if (oFF.XStringUtils.isNullOrEmpty(currentVizName) && evt.getChangedVisualizationNames().contains(this.m_visualizationName))
	{
		this._setInitialChartViewVisualization();
	}
};
