oFF.AuOlapFilterLineViewPlugin.prototype._applyFilterLineConfigIfNecessary = function()
{
	if (oFF.notNull(this.m_filterLineView) && this.getConfiguration() !== null)
	{
		let filterLineConfig = this.getConfiguration().getStructureByKey(oFF.AuOlapFilterLineViewPlugin.CONFIG_FILTER_LINE_CONFIG);
		if (oFF.XCollectionUtils.hasElements(filterLineConfig))
		{
			this.m_filterLineView.setConfig(filterLineConfig);
		}
	}
};
oFF.AuOlapFilterLineViewPlugin.prototype._applyGlobalConfiguration = function()
{
	let configManager = oFF.AsConfigManagerSafeAccess.from(this.getDataApplication());
	if (oFF.notNull(configManager))
	{
		let oConfig = this.m_filterLineView.getConfig();
		let configuration = configManager.getFeatureConfig();
		oConfig.putBoolean(oFF.AuOlapFilterLineViewPlugin.GROUP_DIMENSIONS, configuration.getBooleanByKey(oFF.CoGlobalConfigurationUtils.GROUP_DIMENSIONS));
		this.m_filterLineView.setConfig(oConfig);
	}
};
oFF.AuOlapFilterLineViewPlugin.prototype._cleanDataSpace = function()
{
	this.getController().getDataSpace().remove(oFF.AuOlapFilterLineViewPlugin.DATA_SPACE_FILTER_LINE_API);
};
oFF.AuOlapFilterLineViewPlugin.prototype._fillDataSpace = function()
{
	this.getController().getDataSpace().putXObject(oFF.AuOlapFilterLineViewPlugin.DATA_SPACE_FILTER_LINE_API, this.m_filterLineView);
};
oFF.AuOlapFilterLineViewPlugin.prototype._observeNotifications = function()
{
	let notificationCenter = this.getController().getLocalNotificationCenter();
	this.m_setVisibilityObserverId = notificationCenter.addObserverForName(oFF.AuOlapFilterLineViewPlugin.NOTIFICATION_SET_VISIBILITY, (data) => {
		let isVisible = data.getBooleanByKey(oFF.AuOlapFilterLineViewPlugin.NOTIFICATION_DATA_IS_VISIBLE);
		this._setVisibility(isVisible);
	});
	this.m_getReadModeForDimObserverId = notificationCenter.addObserverForName(oFF.AuOlapFilterLineViewPlugin.NOTIFICATION_GET_READ_MODE_FOR_DIMENSION_CALLBACK, (data) => {
		try
		{
			let getReadModeCallback = oFF.XObject.castToAny(data.getXObjectByKey(oFF.AuOlapFilterLineViewPlugin.NOTIFICATION_DATA_READ_MODE_CALLBACK));
			let dimension = oFF.XObject.castToAny(data.getXObjectByKey(oFF.AuOlapFilterLineViewPlugin.NOTIFICATION_DATA_DIMENSION));
			if (oFF.notNull(dimension) && oFF.notNull(getReadModeCallback))
			{
				let readModeForDimension = this.m_filterLineView.getReadModeForDimension(dimension);
				let olapUiReadMode = readModeForDimension.get();
				getReadModeCallback.getConsumer()(olapUiReadMode);
			}
			else
			{
				throw oFF.XException.createException("Invalid dimension or callback supplied to determine read mode.");
			}
		}
		catch (e)
		{
			oFF.XLogger.printError(oFF.XException.getMessage(e));
		}
	});
};
