oFF.AuDocumentGeneralInfoViewPlugin.DATA_SPACE_FILE_KEY = "DataAnalyzerFile";
oFF.AuDocumentGeneralInfoViewPlugin.PLUGIN_NAME = "DocumentGeneralInfo";
oFF.AuDocumentGeneralInfoViewPlugin.prototype.m_dataspaceListenerUuid = null;
oFF.AuDocumentGeneralInfoViewPlugin.prototype.m_genesis = null;
oFF.AuDocumentGeneralInfoViewPlugin.prototype.m_infoPanelConfigManager = null;
oFF.AuDocumentGeneralInfoViewPlugin.prototype.m_infoPanelView = null;
oFF.AuDocumentGeneralInfoViewPlugin.prototype.m_panel = null;
oFF.AuDocumentGeneralInfoViewPlugin.prototype.m_pinnedToStoryLink = null;
oFF.AuDocumentGeneralInfoViewPlugin.prototype.m_pinnedToStoryUtils = null;
oFF.AuDocumentGeneralInfoViewPlugin.prototype.m_updateWaitingForVariablesSubmit = false;
oFF.AuDocumentGeneralInfoViewPlugin.prototype._buildModel = function()
{
	let config = this.getConfiguration().getConfigurationStructure();
	if (oFF.notNull(this.m_pinnedToStoryLink))
	{
		config.put(oFF.AuGdsQbInfoPanelConfigManager.STORY_LINK_KEY, this.m_pinnedToStoryLink);
	}
	return oFF.AuGdsQbInfoPanelModelBuilder.create(this._getCurrentFile(), this.getDataProvider(), config).build();
};
oFF.AuDocumentGeneralInfoViewPlugin.prototype._getCurrentFile = function()
{
	return this.getDataSpace().getXObjectByKey(oFF.AuDocumentGeneralInfoViewPlugin.DATA_SPACE_FILE_KEY);
};
oFF.AuDocumentGeneralInfoViewPlugin.prototype._releaseObservers = function()
{
	if (this.getDataProvider() !== null)
	{
		this.getDataProvider().getQueryManager().unregisterVariableProcessorStateChangedListener(this);
	}
};
oFF.AuDocumentGeneralInfoViewPlugin.prototype._setDataProvider = function(dataProvider)
{
	this._releaseObservers();
	if (oFF.notNull(dataProvider))
	{
		oFF.AuGdsQbMemberDecoratorHelper.decorateFilterExpressionMembers(dataProvider.getQueryManager().getQueryModel().getFilter().getFixedFilter()).onThen((result) => {
			dataProvider.getQueryManager().registerVariableProcessorStateChangedListener(this, oFF.XStringValue.create("onVariableStateChangeObserverId"));
			this._updateUi();
		});
	}
	else
	{
		this._updateUi();
	}
};
oFF.AuDocumentGeneralInfoViewPlugin.prototype._setupCommunication = function()
{
	this.m_dataspaceListenerUuid = this.getDataSpaceBase().addChangeConsumer((key) => {
		switch (key)
		{
			case oFF.AuDocumentGeneralInfoViewPlugin.DATA_SPACE_FILE_KEY:
				this.updatePinnedToStoryLink().onThen((link) => {
					this._updateUi();
				});
				break;
		}
	});
};
oFF.AuDocumentGeneralInfoViewPlugin.prototype._updateUi = function()
{
	let infoPanelModel = this._buildModel();
	if (infoPanelModel.isEmpty())
	{
		let message = this.m_genesis.newRoot(oFF.UiType.ILLUSTRATED_MESSAGE);
		message.setIllustrationType(oFF.UiIllustratedMessageType.CONNECTION);
		message.setIllustrationSize(oFF.UiIllustratedMessageSize.AUTO);
		return;
	}
	this.m_infoPanelView.setModel(infoPanelModel);
	this.m_infoPanelView.updateUi();
};
oFF.AuDocumentGeneralInfoViewPlugin.prototype._updateVariablesAffectedPanels = function()
{
	let model = this._buildModel();
	this.m_infoPanelView.refreshModel(model);
};
oFF.AuDocumentGeneralInfoViewPlugin.prototype.buildDataProviderPluginUi = function(genesis)
{
	this.m_genesis = genesis;
	let title = oFF.XLocalizationCenter.getCenter().getText(oFF.AuGdsQueryBuilderI18n.INFO_TITLE);
	let panelWidget = oFF.UtPanelWidget.create(genesis, "message-information", title, null);
	panelWidget.addCssClass("ffGeneralInfoPanelWidget");
	this.m_panel = panelWidget.getView();
	genesis.setRoot(this.m_panel);
	this.m_infoPanelView.renderView(this.m_genesis);
	this.m_panel.setContent(this.m_infoPanelView.getView());
	this.m_infoPanelView.updateUi();
};
oFF.AuDocumentGeneralInfoViewPlugin.prototype.destroyPlugin = function()
{
	this._releaseObservers();
	this.m_genesis = null;
	this.m_panel = null;
	this.m_infoPanelView = oFF.XObjectExt.release(this.m_infoPanelView);
	this.getDataSpaceBase().removeChangeConsumerByUuid(this.m_dataspaceListenerUuid);
	this.m_pinnedToStoryUtils = oFF.XObjectExt.release(this.m_pinnedToStoryUtils);
	this.m_pinnedToStoryLink = oFF.XObjectExt.release(this.m_pinnedToStoryLink);
	oFF.DfOuDataProviderComponentPlugin.prototype.destroyPlugin.call( this );
};
oFF.AuDocumentGeneralInfoViewPlugin.prototype.getDataSpaceBase = function()
{
	return this.getController().getDataSpace();
};
oFF.AuDocumentGeneralInfoViewPlugin.prototype.getPluginCategory = function()
{
	return oFF.HuPluginCategory.OLAP;
};
oFF.AuDocumentGeneralInfoViewPlugin.prototype.getPluginName = function()
{
	return oFF.AuDocumentGeneralInfoViewPlugin.PLUGIN_NAME;
};
oFF.AuDocumentGeneralInfoViewPlugin.prototype.onDataProviderModelChange = function(dataProvider, evt)
{
	this._updateVariablesAffectedPanels();
};
oFF.AuDocumentGeneralInfoViewPlugin.prototype.onDataProviderReady = function(dataProvider)
{
	this._setDataProvider(dataProvider);
};
oFF.AuDocumentGeneralInfoViewPlugin.prototype.onDataProviderReleased = function(dataProviderName)
{
	this._setDataProvider(null);
};
oFF.AuDocumentGeneralInfoViewPlugin.prototype.onDataProviderResultDataFetch = function(dataProvider, evt) {};
oFF.AuDocumentGeneralInfoViewPlugin.prototype.onDataProviderVizChange = function(activeVizName, evt) {};
oFF.AuDocumentGeneralInfoViewPlugin.prototype.onVariableProcessorStateChanged = function(variableProcessor, customIdentifier)
{
	if (variableProcessor.getVariableProcessorState() === oFF.VariableProcessorState.PROCESSING_UPDATE_VALUES && !this.m_updateWaitingForVariablesSubmit)
	{
		this.m_updateWaitingForVariablesSubmit = true;
	}
	else if (variableProcessor.getVariableProcessorState() === oFF.VariableProcessorState.SUBMITTED && this.m_updateWaitingForVariablesSubmit)
	{
		this.m_updateWaitingForVariablesSubmit = false;
		oFF.AuGdsQbMemberDecoratorHelper.decorateFilterExpressionMembers(this.getDataProvider().getQueryManager().getQueryModel().getFilter().getFixedFilter()).onThen((res) => {
			this._updateVariablesAffectedPanels();
		});
	}
};
oFF.AuDocumentGeneralInfoViewPlugin.prototype.processConfiguration = function(configuration) {};
oFF.AuDocumentGeneralInfoViewPlugin.prototype.setupPlugin = function(controller)
{
	this.m_infoPanelConfigManager = oFF.AuGdsQbInfoPanelConfigManager.create(controller.getConfiguration().getConfigurationStructure());
	if (this.m_infoPanelConfigManager.isInfoPanelEnabled())
	{
		oFF.DfOuDataProviderComponentPlugin.prototype.setupPlugin.call( this , controller);
		this.m_infoPanelView = oFF.AuGdsQbInfoPanelView.create();
		this._setupCommunication();
	}
	return this.updatePinnedToStoryLink();
};
oFF.AuDocumentGeneralInfoViewPlugin.prototype.updatePinnedToStoryLink = function()
{
	let pinnedToStoryUtils = oFF.AuGdsPinnedToStoryUtils.create(this.getProcess(), this._getCurrentFile());
	return pinnedToStoryUtils.getPinnedInsightLink().onThenExt((link) => {
		if (oFF.notNull(link))
		{
			this.m_pinnedToStoryLink = oFF.PrStructure.create();
			this.m_pinnedToStoryLink.putString(oFF.AuGdsQbInfoPanelConfigManager.STORY_LINK_TEXT_KEY, link.getStringByKey(oFF.OuQueryInformationDialog.MODEL_LINK_NAME));
			this.m_pinnedToStoryLink.putString(oFF.AuGdsQbInfoPanelConfigManager.STORY_LINK_SRC_KEY, link.getStringByKey(oFF.OuQueryInformationDialog.MODEL_LINK_SRC));
			this.m_pinnedToStoryLink.putString(oFF.AuGdsQbInfoPanelConfigManager.STORY_LINK_ICON_KEY, link.getStringByKey(oFF.OuQueryInformationDialog.MODEL_LINK_ICON));
		}
		return oFF.XBooleanValue.create(true);
	});
};

