oFF.AuDataProviderRemoteControlViewPlugin.prototype.m_genesis = null;
oFF.AuDataProviderRemoteControlViewPlugin.prototype.m_lifecycleButton = null;
oFF.AuDataProviderRemoteControlViewPlugin.prototype.m_main = null;
