		this.m_table.setRowsWindowSize(windowingConfig.getIntegerByKeyExt(oFF.AuAnalyticalTableViewPlugin.CONFIG_WINDOWING_ROWS_WINDOW_SIZE, 50));
		this.m_table.setRowsWindowFactor(windowingConfig.getIntegerByKeyExt(oFF.AuAnalyticalTableViewPlugin.CONFIG_WINDOWING_ROWS_WINDOW_FACTOR, 3));
		this.m_table.setMaxRowsWindowSize(windowingConfig.getIntegerByKeyExt(oFF.AuAnalyticalTableViewPlugin.CONFIG_WINDOWING_MAX_ROWS_WINDOW_SIZE, 300));
		this.m_table.setMaxRowsLoad(windowingConfig.getIntegerByKeyExt(oFF.AuAnalyticalTableViewPlugin.CONFIG_WINDOWING_MAX_ROWS_LOAD, -1));
		this.m_table.setMaxRowsRecommendation(windowingConfig.getIntegerByKeyExt(oFF.AuAnalyticalTableViewPlugin.CONFIG_WINDOWING_MAX_ROWS_RECOMMENDATION, 100000));
		this.m_table.setColumnsWindowSize(windowingConfig.getIntegerByKeyExt(oFF.AuAnalyticalTableViewPlugin.CONFIG_WINDOWING_COLUMNS_WINDOW_SIZE, 15));
		this.m_table.setColumnsWindowFactor(windowingConfig.getIntegerByKeyExt(oFF.AuAnalyticalTableViewPlugin.CONFIG_WINDOWING_COLUMNS_WINDOW_FACTOR, 3));
		this.m_table.setMaxColumnsWindowSize(windowingConfig.getIntegerByKeyExt(oFF.AuAnalyticalTableViewPlugin.CONFIG_WINDOWING_MAX_COLUMNS_WINDOW_SIZE, 50));
		let maxTableCols = windowingConfig.getIntegerByKeyExt(oFF.AuAnalyticalTableViewPlugin.CONFIG_WINDOWING_MAX_COLUMNS_LOAD, 150);
		this.m_table.setMaxColumnsLoad(maxTableCols);
		this.m_queryDetails.setMaxTableCols(maxTableCols);
