oFF.AuAnalyticalTableViewPlugin.prototype.onDataProviderVizChange = function(activeVizName, evt)
{
	let currentTableDefinition = this.m_table.getTableDefinition();
	let currentTableDefinitionId = oFF.notNull(currentTableDefinition) ? currentTableDefinition.getName() : null;
	let queryManager = evt.getDataProvider().getQueryManager();
	if (this.getConfiguration().getBooleanByKeyExt(oFF.AuAnalyticalTableViewPlugin.CONFIG_KEEP_TABLE_DEFINITION_ACTIVE, false) && oFF.XStringUtils.isNotNullAndNotEmpty(currentTableDefinitionId) && oFF.XStringUtils.isNullOrEmpty(this.m_tableDefinitionId))
	{
		this.m_tableDefinitionId = currentTableDefinitionId;
	}
	if (oFF.XStringUtils.isNullOrEmpty(this.m_tableDefinitionId))
	{
		if (!oFF.XString.isEqual(currentTableDefinitionId, activeVizName))
		{
			this._applyTableDefinition(queryManager);
		}
	}
	else if (oFF.XStringUtils.isNullOrEmpty(currentTableDefinitionId) && evt.getChangedVisualizationNames().contains(this.m_tableDefinitionId))
	{
		this._applyTableDefinition(queryManager);
	}
};
