oFF.LoadSystemsProgram.prototype.constructOutput = function(systemLandscape)
{
	let output = oFF.PrFactory.createStructure();
	let systems = output.putNewStructure("Systems");
	let systemNames = systemLandscape.getSystemNames();
	let systemNamesIterator = systemNames.getIterator();
	while (systemNamesIterator.hasNext())
	{
		let systemName = systemNamesIterator.next();
		let systemDescription = systemLandscape.getSystemDescription(systemName);
		let system = systems.putNewStructure(systemName);
		let properties = systemDescription.getProperties();
		let keys = properties.getKeysAsIterator();
		while (keys.hasNext())
		{
			let key = keys.next();
			system.putString(key, properties.getByKey(key));
		}
	}
	return output;
};
