oFF.AuButtonProgram.prototype.processArguments = function(args)
{
	this.m_dataProviderNames = oFF.XList.createWithList(oFF.XStringTokenizer.splitString(this.getArgumentStructure().getStringByKey(oFF.AuButtonProgram.PARAM_DATA_PROVIDER_NAMES), ","));
	this.m_text = this.getArgumentStructure().getStringByKeyExt(oFF.AuButtonProgram.PARAM_TEXT, "Button");
	this.m_type = oFF.UiButtonType.lookup(this.getArgumentStructure().getStringByKeyExt(oFF.AuButtonProgram.PARAM_TYPE, "Primary"));
	let actionsString = oFF.XBase64.getInstance().decodeToString(this.getArgumentStructure().getStringByKey(oFF.AuButtonProgram.PARAM_ACTIONS));
	this.m_commandStruct = oFF.JsonParserFactory.createFromString(actionsString);
	this.m_commandSequence = oFF.XList.create();
	oFF.XCollectionUtils.forEach(this.m_commandStruct, (struct) => {
		if (struct.isStructure())
		{
			let castStruct = struct.asStructure();
			let newCommand = new oFF.AuButtonActionPair();
			newCommand.setActionName(castStruct.getStringByKey("Command"));
			let newArgs = oFF.XList.create();
			let argsList = castStruct.getListByKey("Arguments");
			oFF.XCollectionUtils.forEach(argsList, (arg) => {
				if (arg.isString())
				{
					if (oFF.XString.isEqual(arg.getStringRepresentation(), "\"\""))
					{
						newArgs.add("null");
					}
					else
					{
						newArgs.add(oFF.XString.replace(arg.getStringRepresentation(), "\"", ""));
					}
				}
				else
				{
					newArgs.add(oFF.PrUtils.serialize(arg, false, false, 0));
				}
			});
			newCommand.setActionArguments(newArgs);
			this.m_commandSequence.add(newCommand);
		}
	});
};
