oFF.AuGalaxyDataStudio.prototype.handleDocumentLoad = function(docType, file, gdfJson, argJson)
{
	this.setContentBusy(false);
	if (oFF.isNull(docType))
	{
		this.getMessageCenter().showErrorToast("Unknown document type!");
	}
	else if (oFF.notNull(file) && oFF.isNull(gdfJson))
	{
		this.getMessageCenter().showErrorToast(oFF.XStringUtils.concatenate3("Error while processing the file ", file.getUri().getPathContainer().getFileName(), "!"));
	}
	else if (oFF.isNull(file) && oFF.isNull(gdfJson))
	{
		this.getMessageCenter().showErrorToast("Error while fetching the specified file!");
	}
	else
	{
		this.openDocument(docType, file, gdfJson, argJson);
		this.getSettingsManager().addRecentFileEntry(file);
	}
};
oFF.AuGalaxyDataStudio.prototype.handleDocumentLoadByFileContent = function(fileContent)
{
	if (oFF.XStringUtils.isNotNullAndNotEmpty(fileContent))
	{
		this.setContentBusy(true);
		let parser = oFF.JsonParserFactory.newInstance();
		let tmpElement = parser.parse(fileContent);
		let jsonObj = oFF.notNull(tmpElement) && tmpElement.isStructure() ? tmpElement : null;
		parser = oFF.XObjectExt.release(parser);
		let docType = this.getFileManager().determineDocumentType(jsonObj, null);
		this.getArgumentsManager().processDocumentsArgument((docArgs, docFile, documentType) => {
			let tmpArgs = docArgs;
			this.handleDocumentLoad(docType, null, jsonObj, tmpArgs);
		});
	}
};
oFF.AuGalaxyDataStudio.prototype.handleDocumentSave = function(extResult)
{
	if (extResult.hasErrors())
	{
		let errMsg = this.getLocalization().getText(oFF.AuGalaxyDataStudioI18n.SAVE_INSIGHT_AUTH_ERROR);
		this.getMessageCenter().showErrorToast(errMsg);
	}
	else
	{
		this.handleAfterDocumentSaved(extResult.getData());
	}
};
oFF.AuGalaxyDataStudio.prototype.handleFileDrop = function(event)
{
	let fileContent = event.getFileContentString();
	this.handleDocumentLoadByFileContent(fileContent);
};
oFF.AuGalaxyDataStudio.prototype.handleResourceExplorerFileSelected = function(resourceInfo)
{
	if (oFF.notNull(resourceInfo) && !resourceInfo.isDirectory())
	{
		this.loadDocumentFileByPath(resourceInfo.getUrl());
	}
	else
	{
		let msg = this.getLocalization().getText(oFF.AuGalaxyDataStudioI18n.SAVE_RESOURCE_ERROR);
		this.getMessageCenter().showErrorToast(msg);
	}
};
oFF.AuGalaxyDataStudio.prototype.handleStartup = function()
{
	if (this.getArgumentsManager().hasFileContentArgument())
	{
		this.handleDocumentLoadByFileContent(this.getArgumentsManager().getFileContentArgument());
	}
	else if (this.getArgumentsManager().hasBookmarkArgument())
	{
		this.loadDocumentByBookmarkId(this.getArgumentsManager().getBookmarkArgument());
	}
	else if (this.getArgumentsManager().hasValidDocumentArguments())
	{
		this.processProgramArguments();
	}
	else
	{
		this.showHomeView();
	}
};
oFF.AuGalaxyDataStudio.prototype.hasUnsavedChanges = function()
{
	if (oFF.notNull(this.m_openDocuments))
	{
		let openDocumentsKeys = this.m_openDocuments.getKeysAsIterator();
		while (openDocumentsKeys.hasNext())
		{
			let tmpDocKey = openDocumentsKeys.next();
			let tmpDocument = this.m_openDocuments.getByKey(tmpDocKey);
			if (tmpDocument.isDirty())
			{
				return true;
			}
		}
	}
	return false;
};
