oFF.AuGalaxyDataStudio.prototype.loadDocumentByBookmarkId = function(bookmarkId)
{
	if (oFF.XStringUtils.isNotNullAndNotEmpty(bookmarkId))
	{
		let bookmarkFilePath = oFF.XStringUtils.concatenate4(oFF.AuGdsConstants.DEFAULT_BOOKMARK_DIR, bookmarkId, ".", oFF.AuGdsConstants.GDF_FILE_EXTENSION);
		let bookmarkFile = oFF.XFile.create(this.getProcess(), bookmarkFilePath);
		this.getFileManager().loadDocument(bookmarkFile, (docType, file, jsonObj) => {
			this.handleDocumentLoad(docType, null, jsonObj, null);
		});
	}
	else
	{
		this.getMessageCenter().showErrorToast("Missing bookmark id!");
	}
};
oFF.AuGalaxyDataStudio.prototype.loadDocumentFileByPath = function(path)
{
	try
	{
		this.setContentBusy(true);
		this.getFileManager().loadDocumentByPath(path, (docType, file, jsonObj) => {
			this.handleDocumentLoad(docType, file, jsonObj, null);
		});
	}
	catch (e)
	{
		this.setContentBusy(false);
		let errorMsg = oFF.XException.getMessage(e);
		errorMsg = oFF.XStringUtils.concatenate4("Could not load file with path: ", path, ". Reason: ", errorMsg);
		this.getMessageCenter().showErrorToast(errorMsg);
	}
};
