oFF.AuGalaxyDataStudio.prototype.prepareRecentFilesSubMenu = function(recentFilesMenuItem)
{
	if (!recentFilesMenuItem.isEnabled())
	{
		return;
	}
	let recentFiles = this.getSettingsManager().getRecentFilesList();
	oFF.XStream.ofString(recentFiles).forEach((pathStr) => {
		let filePathStr = pathStr.getString();
		let fileName = oFF.XString.substring(filePathStr, oFF.XString.lastIndexOf(filePathStr, "/") + 1, -1);
		let pathDisplay = oFF.XStringUtils.isNotNullAndNotEmpty(fileName) ? oFF.XStringUtils.concatenate4(fileName, " [", filePathStr, "]") : filePathStr;
		recentFilesMenuItem.addNewItem().setText(pathDisplay).setIcon("timesheet").registerOnPress(oFF.UiLambdaPressListener.create((controlEvent) => {
			this.recentFileMenuItemPressed(filePathStr);
		}));
	});
	recentFilesMenuItem.addNewItem().setText("Clear History").setIcon("delete").setSectionStart(true).registerOnPress(oFF.UiLambdaPressListener.create((controlEvent2) => {
		this.clearRecentFilesPressed();
	}));
};
