{
	return this.saveActiveDocumentInternal();
};
oFF.AuGalaxyDataStudio.prototype.saveActiveDocumentInternal = function()
{
	let saveActiveDocPromise = oFF.XPromise.create((resolve, reject) => {
		if (oFF.notNull(this.m_activeDocument))
		{
			this.m_activeDocument.executeSave((extResult) => {
				this.handleDocumentSave(extResult);
				if (oFF.notNull(extResult) && extResult.isValid())
				{
					resolve(this.m_activeDocument);
				}
				else if (oFF.notNull(extResult) && extResult.hasErrors())
				{
					reject(oFF.XError.createWithMessage(extResult.getFirstError()));
				}
				else
				{
					reject(oFF.XError.create("Failed to save active document. Unknown error!"));
				}
			});
		}
		else
		{
			reject(oFF.XError.create("No active document!"));
		}
	});
	return saveActiveDocPromise;
};
