oFF.AuGalaxyDataStudio.prototype.saveAsPressed = function()
{
	if (oFF.notNull(this.m_activeDocument))
	{
		let externalConfig = oFF.AuGdsExternalConfiguration.getInstance();
		if (externalConfig.hasSaveHandler())
		{
			this.m_activeDocument.getSaveContent().onThen((content) => {
				externalConfig.fireSaveHandler(content);
			});
		}
		else
		{
			this.m_activeDocument.executeSaveAs((extResult) => {
				this.handleDocumentSave(extResult);
			});
		}
	}
};
