oFF.AuGdsQbFilterPanel.prototype.createFilterEntry = function(grandParent, parent, element)
{
	let dimension = parent.getDimension();
	let filterEntry = this.getGenesis().newControl(oFF.UiType.CUSTOM_LIST_ITEM);
	let content = filterEntry.setNewContent(oFF.UiType.FLEX_LAYOUT);
	content.setJustifyContent(oFF.UiFlexJustifyContent.SPACE_BETWEEN);
	content.setAlignItems(oFF.UiFlexAlignItems.CENTER);
	content.setHeight(oFF.UiCssLength.create("32px"));
	content.setPadding(oFF.UiCssBoxEdges.create("5px"));
	let startSpacer = content.addNewItemOfType(oFF.UiType.SPACER);
	startSpacer.setFlex("0 0 20px");
	let comparisonOperator = element.getComparisonOperator();
	if (oFF.isNull(comparisonOperator))
	{
		return null;
	}
	let setSign = element.getSetSign();
	if (setSign === oFF.SetSign.EXCLUDING)
	{
		if (comparisonOperator === oFF.ComparisonOperator.EQUAL)
		{
			comparisonOperator = oFF.ComparisonOperator.NOT_EQUAL;
		}
		if (comparisonOperator === oFF.ComparisonOperator.BETWEEN)
		{
			comparisonOperator = oFF.ComparisonOperator.NOT_BETWEEN;
		}
	}
	let operatorLbl = content.addNewItemOfType(oFF.UiType.LABEL);
	operatorLbl.setText(comparisonOperator.getName());
	operatorLbl.setTooltip(comparisonOperator.getName());
	operatorLbl.setFlex("1 0 40%");
	let lowLbl = content.addNewItemOfType(oFF.UiType.LABEL);
	lowLbl.setFlex("1 1 30%");
	let low = element.getLow();
	let lowText = oFF.AuGdsQbFilterPanel.getDisplayText(dimension, low);
	if (oFF.notNull(lowText))
	{
		lowLbl.setText(lowText);
		lowLbl.setTooltip(lowText);
	}
	let highLbl = content.addNewItemOfType(oFF.UiType.LABEL);
	highLbl.setFlex("1 1 30%");
	let high = element.getHigh();
	let highText = oFF.AuGdsQbFilterPanel.getDisplayText(dimension, high);
	if (oFF.notNull(highText))
	{
		highLbl.setText(highText);
		highLbl.setTooltip(highText);
	}
	let deleteIco = content.addNewItemOfType(oFF.UiType.ICON);
	deleteIco.setIcon("sys-cancel");
	deleteIco.setTooltip("Remove filter");
	deleteIco.setColor(oFF.UiColor.ORANGE.newDarkerColor(0.2));
	deleteIco.setHeight(oFF.UiCssLength.create("16px"));
	deleteIco.setFlex("0 0 16px");
	deleteIco.registerOnPress(oFF.AuGdsLambdaListener.create(() => {
		parent.removeElement(element);
		if (parent.size() === 0)
		{
			grandParent.removeElement(parent);
		}
		this.notifyEditActionListeners();
	}));
	return filterEntry;
};
