oFF.AuGdsQbFilterPanel.prototype.setQueryManager = oFF.noSupport;
oFF.AuGdsQbFilterPanel.prototype.setupPanel = function() {};
oFF.AuGdsQbFilterPanel.prototype.unobserveDataProviderEvents = function()
{
	if (oFF.XObjectExt.isValidObject(this.m_dataProvider))
	{
		this.m_dataProvider.getEventing().getListenerForLifecycle().removeConsumerByUuid(this.m_lifecycleId);
		this.m_dataProvider.getEventing().getListenerForModelChanges().removeConsumerByUuid(this.m_modelId);
		this.m_lifecycleId = null;
		this.m_modelId = null;
	}
};
oFF.AuGdsQbFilterPanel.prototype.updateQbPanelUi = function()
{
	this.m_filterList.clearItems();
	if (this.getQueryManager() === null)
	{
		return;
	}
	let filter = this.getQueryManager().getQueryModel().getFilter();
	let dynamicFilter = filter.getDynamicFilter();
	if (dynamicFilter.isCartesianProduct() && dynamicFilter.getCartesianProduct() !== null)
	{
		let cartesianProduct = dynamicFilter.getCartesianProduct();
		for (let i = 0; i < cartesianProduct.size(); i++)
		{
			let cartesianChild = cartesianProduct.getCartesianChild(i);
			let dimensionEntry = this.createDimensionEntry(cartesianProduct, cartesianChild);
			this.m_filterList.addItem(dimensionEntry);
			for (let j = 0; j < cartesianChild.size(); j++)
			{
				let cartesianElement = cartesianChild.getOp(j);
				let filterEntry = this.createFilterEntry(cartesianProduct, cartesianChild, cartesianElement);
				if (oFF.isNull(filterEntry))
				{
					continue;
				}
				this.m_filterList.addItem(filterEntry);
			}
		}
	}
};

