	this.m_accountDimensionFilterManager = oFF.AuGdsFilterLineAccountDimensionFilterManager.createAccountFilterManager(this.m_queryManager, this.getGenesis(), this.m_grid, updateCommandConsumerForAccounts, focusOnPreviousConsumer);
