oFF.AuGdsFilterLine.prototype.onModelComponentChanged = function(modelComponent, customIdentifier)
{
	this.updateFilterLineMenu();
	if (this.isWaitingForVariableSubmit())
	{
		this.m_updateWaitingForSubmit = true;
	}
	else
	{
		this.updateFilterLine(false);
	}
};
oFF.AuGdsFilterLine.prototype.onVariableProcessorStateChanged = function(variableProcessor, customIdentifier)
{
	if (variableProcessor.getVariableProcessorState() === oFF.VariableProcessorState.PROCESSING_UPDATE_VALUES && !this.m_updateWaitingForSubmit)
	{
		this.m_updateWaitingForSubmit = true;
	}
	else if (variableProcessor.getVariableProcessorState() === oFF.VariableProcessorState.SUBMITTED && this.m_updateWaitingForSubmit)
	{
		this.updateFilterLine(true);
	}
};
oFF.AuGdsFilterLine.prototype.queueProcessing = function()
{
	this.m_isProcessingActive = false;
	this.executePerFilterManager((filterLineManager) => {
		return filterLineManager.queueProcessing();
	});
};
oFF.AuGdsFilterLine.prototype.registerChangeListeners = function()
{
	let queryModel = this.m_queryManager.getQueryModel();
	queryModel.getFilter().registerChangedListener(this, oFF.AuGdsFilterLine.FF_FILTERLINE_FILTER_CHANGE);
	this.m_queryManager.registerVariableProcessorStateChangedListener(this, oFF.AuGdsFilterLine.FF_FILTERLINE_VARIABLE_CHANGE);
};
oFF.AuGdsFilterLine.prototype.resumeProcessing = function()
{
	this.m_isProcessingActive = true;
	this.executePerFilterManager((filterLineManager) => {
		return filterLineManager.resumeProcessing();
	}).onCatch((error) => {
		this.logError(oFF.XStringUtils.concatenate2("Error resuming processing for filter line manager", this.extractMessageFromError(error)));
	});
};
oFF.AuGdsFilterLine.prototype.setConfig = function(config)
{
	this.m_filterLineConfig.setConfig(config);
};
oFF.AuGdsFilterLine.prototype.setFeatureActive = function(feature, isActive)
{
	this.m_featureManager.setActive(feature, isActive);
};
oFF.AuGdsFilterLine.prototype.setQueryManager = function(queryManager, updateCommand)
{
	if (oFF.isNull(updateCommand))
	{
		this.logError("Filter line - cannot set query manager as update command is null");
		throw oFF.XException.createIllegalArgumentException("Command must not be null");
	}
	if (oFF.XObjectExt.isValidObject(this.m_queryManager))
	{
		this.m_queryManager.getQueryModel().getFilter().unregisterChangedListener(this);
		this.m_queryManager.unregisterVariableProcessorStateChangedListener(this);
	}
	this.m_queryManager = oFF.XObjectExt.assertNotNull(queryManager);
	this.m_filterLineManagers = this.createFilterManagers(updateCommand);
	this.m_isUpdateInProgress = false;
	this.m_isUpdateQueued = false;
	if (!this.m_isProcessingActive)
	{
		this.queueProcessing();
	}
	this.m_menu = this.createAddFilterMenu();
	this.m_addFilterButtonLayout.clearItems();
	this.m_addFilterButtonLayout.addItem(this.m_menu.getFilterLineMenuButton());
	this.m_menu.createMenuItems();
	this.registerChangeListeners();
	this.updateFilterLine(false);
};
oFF.AuGdsFilterLine.prototype.setVisible = function(visible)
{
	if (!visible && this.m_featureManager.isActive(oFF.AuGdsFilterLineFeature.LAZY_MODE))
	{
		this.queueProcessing();
	}
	else
	{
		this.resumeProcessing();
	}
	return oFF.AuGdsDfWidget.prototype.setVisible.call( this , visible);
};
oFF.AuGdsFilterLine.prototype.setupWidget = function()
{
	this.m_filterLineConfig = oFF.AuGdsFilterLineConfig.create();
	this.m_featureManager = oFF.AuGdsFilterLineFeatureManager.create();
	this.m_isProcessingActive = true;
	oFF.AuGdsFilterLine.FF_FILTERLINE_FILTER_CHANGE = oFF.XStringValue.create("FF_FILTERLINE_FILTER_CHANGE_LISTENER");
	oFF.AuGdsFilterLine.FF_FILTERLINE_VARIABLE_CHANGE = oFF.XStringValue.create("FF_FILTERLINE_VARIABLE_CHANGE_LISTENER");
	oFF.AuGdsFilterLine.FF_FILTERLINE_RS_CHANGE = oFF.XStringValue.create("FF_FILTERLINE_RS_CHANGE_LISTENER");
};
oFF.AuGdsFilterLine.prototype.update = function()
{
	if (oFF.notNull(this.m_queryManager))
	{
		this.onModelComponentChanged(null, oFF.AuGdsFilterLine.FF_FILTERLINE_RS_CHANGE);
	}
};
oFF.AuGdsFilterLine.prototype.updateFilterLine = function(updateMenu)
{
	this.m_updateWaitingForSubmit = false;
	if (updateMenu)
	{
		this.updateFilterLineMenu();
	}
	if (this.m_isUpdateInProgress)
	{
		this.m_isUpdateQueued = true;
	}
	else
	{
		this.updateFilterLineTokens();
	}
};
oFF.AuGdsFilterLine.prototype.updateFilterLineMenu = function()
{
	this.m_menu.updateMenuItems();
};
oFF.AuGdsFilterLine.prototype.updateFilterLineTokens = function()
{
	this.m_isUpdateInProgress = true;
	this.m_grid.clearItems();
	this.executePerFilterManager((filterLineManager) => {
		return filterLineManager.updateFilterLine();
	}).onCatch((error) => {
		this.logError(oFF.XStringUtils.concatenate2("Error running filter line manager update", this.extractMessageFromError(error)));
	}).onFinally(() => {
		this.m_isUpdateInProgress = false;
		this.m_grid.setGridVisible(this.hasFilters());
		this.m_grid.focus();
		if (this.m_isUpdateQueued)
		{
			this.m_isUpdateQueued = false;
			this.updateFilterLine(true);
		}
	});
};

