oFF.AuGdsPaginator.prototype.updateState = function()
{
	let estimatedEnd = this.m_maxPageGetter().getInteger();
	let currentPage = this.m_pageGetter().getInteger();
	this.m_pageField.setValue(oFF.XInteger.convertToString(currentPage + 1));
	let hasPrevious = currentPage > 0;
	this.m_startButton.setEnabled(hasPrevious);
	this.m_backButton.setEnabled(hasPrevious);
	let hasNext = currentPage < estimatedEnd - 1;
	this.m_nextButton.setEnabled(hasNext);
	this.m_endButton.setEnabled(hasNext);
	let shouldBeVisible = this.m_visibilityChecker();
	if (this.isVisible() !== shouldBeVisible)
	{
		this.setVisible(shouldBeVisible);
	}
};

