oFF.AuGdsQueryDetails.prototype.addRankInfoLink = function(cmd, rankInfo)
{
	let isUniversalAccountModel = cmd.getQueryModel().isUniversalAccountModel();
	let isTwoStructure = cmd.getQueryModel().getStructureCount() === 2;
	let isNonVersionDimensionSelected = oFF.AuGdsQueryDetails.isNonVersionDimensionSelected(cmd.getQueryModel());
	let isBwAndNoFlatDimensionSelected = oFF.AuGdsQueryDetails.isBwAndNoFlatDimensionSelected(cmd.getQueryModel());
	let isNonVersionDimensionMissing = (isUniversalAccountModel || isTwoStructure) && !isNonVersionDimensionSelected;
	if (isBwAndNoFlatDimensionSelected || isNonVersionDimensionMissing)
	{
		return;
	}
	this.addSeparatorIfNecessary();
	let localization = this.getLocalization();
	let comparisonOperator = rankInfo.getComparisonOperator();
	let topNPrefix = localization.getTextWithPlaceholder(comparisonOperator === oFF.ConditionComparisonOperator.BOTTOM_N ? oFF.AuGdsQueryBuilderI18n.MSG_BOTTOM_N : oFF.AuGdsQueryBuilderI18n.MSG_TOP_N, oFF.XInteger.convertToString(rankInfo.getMaxRows()));
	let rankInfoLinkWrapper = this.m_modelDetails.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
	rankInfoLinkWrapper.setDirection(oFF.UiFlexDirection.ROW);
	rankInfoLinkWrapper.setAlignItems(oFF.UiFlexAlignItems.CENTER);
	let link = rankInfoLinkWrapper.addNewItemOfType(oFF.UiType.LINK).addCssClass(oFF.AuGdsQueryDetails.LINK_CSS_CLASS);
	let measure = this.getDimensionMember(rankInfo.getMeasure());
	let secondaryMeasure = this.getDimensionMember(rankInfo.getSecondaryMeasure());
	let measureInfix = "";
	let versionDimension = rankInfo.getVersionDimension();
	let versionMember = null;
	if (oFF.notNull(versionDimension))
	{
		let versionId = rankInfo.getVersionElementId();
		versionMember = versionDimension.getDimensionMember(versionId);
	}
	let finalVersionMember = versionMember;
	if (oFF.notNull(measure) && oFF.notNull(secondaryMeasure) && secondaryMeasure.getDimension().getAllStructureMembers().size() > 1)
	{
		measureInfix = oFF.XStringUtils.concatenate3(this.getTextWithFallback(measure), ", ", this.getTextWithFallback(secondaryMeasure));
	}
	else if (oFF.notNull(measure))
	{
		measureInfix = this.getTextWithFallback(measure);
	}
	else if (oFF.notNull(secondaryMeasure))
	{
		measureInfix = this.getTextWithFallback(secondaryMeasure);
	}
	link.setText(oFF.XStringUtils.concatenate3(topNPrefix, " ", measureInfix));
	link.setEmphasized(true);
	link.registerOnPress(oFF.AuGdsLambdaListenerWithEvent.create((evEd) => {
		let prgStartData = oFF.ProgramStartData.create();
		prgStartData.putXObject(oFF.OuTopNDialog.PRG_DATA_MEASURE, measure);
		prgStartData.putXObject(oFF.OuTopNDialog.PRG_DATA_SECONDARY_MEASURE, secondaryMeasure);
		prgStartData.putXObject(oFF.OuTopNDialog.PRG_DATA_VERSION, finalVersionMember);
		prgStartData.putXObject(oFF.OuTopNDialog.PRG_DATA_N_VALUE, oFF.XIntegerValue.create(rankInfo.getMaxRows()));
		prgStartData.putXObject(oFF.OuTopNDialog.PRG_DATA_TOP_OR_BOTTOM_VALUE, oFF.XStringValue.create(comparisonOperator === oFF.ConditionComparisonOperator.BOTTOM_N ? oFF.OuTopNDialog.BOTTOM : oFF.OuTopNDialog.TOP));
		prgStartData.putXObject(oFF.DfOuDialogProgram.PRG_DATA_QUERY_MANAGER, this.m_queryManager.getQueryManager());
		prgStartData.putXObject(oFF.DfOuDialogProgram.PRG_DATA_OK_PROCEDURE, oFF.XProcedureHolder.create(this.m_updateProcedure));
		let ccDlg = oFF.ProgramRunner.createRunner(this.m_queryManager.getProcess(), oFF.OuTopNDialog.DEFAULT_PROGRAM_NAME);
		ccDlg.setProgramStartData(prgStartData);
		ccDlg.runProgram();
	}));
	let iconWidget = rankInfoLinkWrapper.addNewItemOfType(oFF.UiType.ICON);
	iconWidget.setColor(oFF.UiColor.BLUE);
	iconWidget.setHeight(oFF.UiCssLength.create("0.8em"));
	iconWidget.setIcon("fpa/cancel");
	iconWidget.setMargin(oFF.UiCssBoxEdges.create("0 0 0 0.25rem"));
	iconWidget.registerOnPress(oFF.AuGdsLambdaListenerWithEvent.create((evDel) => {
		cmd.clearRank(rankInfo.getConditionName());
		this.m_updateProcedure();
	}));
};
oFF.AuGdsQueryDetails.prototype.addSeparatorIfNecessary = function()
{
	if (oFF.XCollectionUtils.hasElements(this.m_modelDetails.getItems()) && this.m_modelDetails.getItems().get(this.m_modelDetails.getItems().size() - 1).getUiType().isEqualTo(oFF.UiType.SEPARATOR))
	{
		this.m_modelDetails.addNewItemOfType(oFF.UiType.SEPARATOR).setHeight(oFF.UiCssLength.create("0.5em")).setMargin(oFF.UiCssBoxEdges.create("0 5px 0 5px"));
	}
};
oFF.AuGdsQueryDetails.prototype.addTopNWarning = function(warningMessageKey, measureName)
{
	let localization = this.getLocalization();
	let flexLayoutConsumer = (fl) => {
		let warnings = oFF.XList.create();
		let warningMessageText = localization.getTextWithPlaceholder(warningMessageKey, measureName);
		warnings.add(warningMessageText);
		this.complementDetailsPopOver(fl, localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_QUERY_OPENED_WITH_WARNINGS), warnings);
	};
	this.prepareDetailsPopOver(oFF.AuGdsQueryDetails.ERROR_ICON, " ", flexLayoutConsumer);
};
oFF.AuGdsQueryDetails.prototype.complementDetailsPopOver = function(flexLayout, header, popOverDetails)
{
	flexLayout.addNewItemOfType(oFF.UiType.SPACER).setHeight(oFF.UiCssLength.create("0.5em")).setFlex("none");
	let headerLabel = flexLayout.addNewItemOfType(oFF.UiType.TITLE).setWrapping(true).setTitleStyle(oFF.UiTitleLevel.H_5).setTitleLevel(oFF.UiTitleLevel.H_5);
	headerLabel.setText(header);
	if (oFF.XCollectionUtils.hasElements(popOverDetails))
	{
		let iterator = popOverDetails.getIterator();
		while (iterator.hasNext())
		{
			flexLayout.addNewItemOfType(oFF.UiType.SPACER).setHeight(oFF.UiCssLength.create("0.5em")).setFlex("none");
			flexLayout.addNewItemOfType(oFF.UiType.LABEL).setText(iterator.next()).setWrapping(true);
		}
	}
};
