oFF.AuGdsQueryDetails.prototype.getDescriptionWithFallback = function(condition)
{
	let descriptionText = condition.getText();
	if (oFF.XStringUtils.isNullOrEmpty(descriptionText))
	{
		descriptionText = condition.getDescription();
	}
	if (oFF.XStringUtils.isNullOrEmpty(descriptionText))
	{
		descriptionText = condition.getName();
	}
	return descriptionText;
};
oFF.AuGdsQueryDetails.prototype.getDimensionMember = function(memberName)
{
	let queryModel = this.m_queryManager.getQueryModel();
	let measure = queryModel.getDimensionByType(oFF.DimensionType.MEASURE_STRUCTURE);
	let secondStructure = queryModel.getDimensionByType(oFF.DimensionType.SECONDARY_STRUCTURE);
	let account = queryModel.getDimensionByType(oFF.DimensionType.ACCOUNT);
	let memberNode = null;
	if (oFF.notNull(measure))
	{
		memberNode = measure.getStructureMember(memberName);
	}
	if (oFF.isNull(memberNode) && oFF.notNull(secondStructure))
	{
		memberNode = secondStructure.getStructureMember(memberName);
	}
	if (oFF.isNull(memberNode) && oFF.notNull(account))
	{
		memberNode = account.getStructureMember(memberName);
	}
	return memberNode;
};
