oFF.AuGdsQueryDetails.prototype.prepareDetailsPopOver = function(icon, linkText, flexLayoutConsumer)
{
	this.addSeparatorIfNecessary();
	let popoverEventListener = oFF.AuGdsLambdaListenerWithEvent.create((event) => {
		this.m_popover.setContent(null);
		this.m_popover.setPlacement(oFF.UiPlacementType.BOTTOM);
		let scrollContainer = this.m_popover.setNewContent(oFF.UiType.SCROLL_CONTAINER);
		scrollContainer.setHeight(oFF.UiCssLength.create("100%"));
		let flexLayout = scrollContainer.setNewContent(oFF.UiType.FLEX_LAYOUT);
		flexLayout.setHeight(oFF.UiCssLength.AUTO);
		flexLayout.setDirection(oFF.UiFlexDirection.COLUMN);
		flexLayoutConsumer(flexLayout);
		this.m_popover.openAt(event.getControl());
	});
	if (oFF.XStringUtils.isNotNullAndNotEmpty(icon))
	{
		let iconWidget = this.m_modelDetails.addNewItemOfType(oFF.UiType.ICON);
		iconWidget.setIcon(icon);
		iconWidget.setMargin(oFF.UiCssBoxEdges.create("0 0 0 0.5rem"));
		iconWidget.registerOnPress(popoverEventListener);
		iconWidget.registerOnHover(popoverEventListener);
		iconWidget.addCssClass("sapMLnk");
		this.m_modelDetails.addNewItemOfType(oFF.UiType.SPACER).setHeight(oFF.UiCssLength.create("0.5em")).setFlex("none");
	}
	let link = this.m_modelDetails.addNewItemOfType(oFF.UiType.LINK).addCssClass(oFF.AuGdsQueryDetails.LINK_CSS_CLASS);
	link.setEmphasized(true);
	link.setText(linkText);
	link.registerOnPress(popoverEventListener);
	return link;
};
oFF.AuGdsQueryDetails.prototype.reRender = function()
{
	let optionalQueryManager = this.getOptionalQueryManager();
	let optionalQueryModel = this.getOptionalQueryModel();
	if (optionalQueryModel.isPresent() && optionalQueryManager.isPresent())
	{
		this.reRenderTitle(optionalQueryModel.get(), optionalQueryManager.get().getActiveResultSetContainer());
	}
};
oFF.AuGdsQueryDetails.prototype.reRenderTitle = function(queryModel, rsContainer)
{
	this.updateTitleText(queryModel);
	this.m_modelDetails.clearItems();
	this.m_unitLabel = null;
	let localization = this.getLocalization();
	let cmd = queryModel.getConvenienceCommands();
	let rankInfo;
	let measureName = "";
	let isRankActive = false;
	if (queryModel.getModelCapabilities().supportsConditions())
	{
		let condManager = queryModel.getConditionManager();
		let conditions = condManager.getActiveConditions();
		let plainConditions = oFF.XList.create();
		for (let i = 0; i < conditions.size(); i++)
		{
			let condition = conditions.get(i);
			rankInfo = cmd.getRank(condition.getName());
			if (oFF.notNull(rankInfo))
			{
				isRankActive = true;
				this.addRankInfoLink(cmd, rankInfo);
				measureName = this.getTextWithFallback(this.getDimensionMember(rankInfo.getMeasure()));
			}
			else if (condition.isBackendCondition() && condition.isApplicable())
			{
				plainConditions.add(condition);
			}
		}
		let plainConditionsSize = plainConditions.size();
		let conditionHeader;
		let conditionList;
		if (plainConditionsSize === 1)
		{
			conditionHeader = localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_ONE_CONDITION_APPLIED);
			conditionList = oFF.XCollectionUtils.singletonList(this.getDescriptionWithFallback(plainConditions.get(0)));
		}
		else if (plainConditionsSize > 1)
		{
			conditionHeader = localization.getTextWithPlaceholder(oFF.AuGdsQueryBuilderI18n.MSG_N_CONDITIONS_APPLIED, oFF.XInteger.convertToString(plainConditionsSize));
			conditionList = oFF.XStream.of(plainConditions).collect(oFF.XStreamCollector.toListOfString((c) => {
				return this.getDescriptionWithFallback(c);
			}));
		}
		else
		{
			conditionList = null;
			conditionHeader = null;
		}
		let flexLayoutConsumerConditions = (cl) => {
			this.complementDetailsPopOver(cl, conditionHeader, conditionList);
		};
		if (oFF.notNull(conditionHeader) && oFF.notNull(conditionList))
		{
			this.prepareDetailsPopOver(null, conditionHeader, flexLayoutConsumerConditions);
		}
	}
	else
	{
		rankInfo = cmd.getRank(null);
		if (oFF.notNull(rankInfo))
		{
			this.addRankInfoLink(cmd, rankInfo);
		}
	}
	if (oFF.notNull(rsContainer))
	{
		let cursorResultSet = rsContainer.isCursorResultSetAvailable() ? rsContainer.getCursorResultSet() : null;
		let state = oFF.isNull(cursorResultSet) ? null : cursorResultSet.getState();
		let icon = null;
		let overallMessage = null;
		if (rsContainer.hasErrors())
		{
			icon = oFF.AuGdsQueryDetails.ERROR_ICON;
			overallMessage = this.getLocalization().getText(oFF.AuGdsQueryBuilderI18n.MSG_BACKEND_ERRORS);
		}
		else if (rsContainer.hasWarnings() && oFF.XCollectionUtils.hasElements(this.getMessageList(rsContainer.getWarnings())))
		{
			icon = oFF.AuGdsQueryDetails.WARNING_ICON;
			overallMessage = " ";
		}
		else if (state === oFF.ResultSetState.NO_DATA_AVAILABLE)
		{
			icon = oFF.AuGdsQueryDetails.WARNING_ICON;
			overallMessage = localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_RESULTSET_NO_DATA);
		}
		else if (oFF.notNull(state) && !state.hasData())
		{
			icon = state.isErrorState() ? oFF.AuGdsQueryDetails.ERROR_ICON : oFF.AuGdsQueryDetails.WARNING_ICON;
			overallMessage = localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_RESULTSET_RENDERING_ISSUE);
		}
		else if (oFF.notNull(cursorResultSet) && rsContainer.getMaxColumns() > -1 && this.m_maxTableCols > 0 && this.m_maxTableCols < cursorResultSet.getCursorColumnsAxis().getTuplesCountTotal())
		{
			icon = oFF.AuGdsQueryDetails.MESSAGE_ICON;
			overallMessage = " ";
		}
		else if (oFF.notNull(cursorResultSet) && rsContainer.getMaxColumns() > -1 && this.m_maxTableColRecommendation > 0 && this.m_maxTableColRecommendation < cursorResultSet.getCursorColumnsAxis().getTuplesCountTotal())
		{
			icon = oFF.AuGdsQueryDetails.MESSAGE_ICON;
			overallMessage = " ";
		}
		else if (queryModel.getMeasureDimension() === null)
		{
			icon = oFF.AuGdsQueryDetails.MESSAGE_ICON;
			overallMessage = " ";
		}
		let flexLayoutConsumer = (fl) => {
			if (rsContainer.hasErrors())
			{
				this.complementDetailsPopOver(fl, localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_COULD_NOT_OPEN_QUERY), this.getMessageList(rsContainer.getErrors()));
			}
			if (rsContainer.hasWarnings())
			{
				let warnings = this.getMessageList(rsContainer.getWarnings());
				if (oFF.XCollectionUtils.hasElements(warnings))
				{
					this.complementDetailsPopOver(fl, localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_QUERY_OPENED_WITH_WARNINGS), warnings);
				}
			}
			if (oFF.notNull(state) && !state.hasData() && state !== oFF.ResultSetState.INITIAL)
			{
				this.complementDetailsPopOver(fl, localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_WARNING_MESSAGE), oFF.XCollectionUtils.singletonList(oFF.AuGdsQueryResultMessageMapper.getMessageStringRsState(localization, state)));
			}
			if (oFF.notNull(cursorResultSet) && rsContainer.getMaxColumns() > -1 && this.m_maxTableCols > 0 && this.m_maxTableCols < cursorResultSet.getCursorColumnsAxis().getTuplesCountTotal())
			{
				this.complementDetailsPopOver(fl, localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_WARNING_MESSAGE), oFF.XCollectionUtils.singletonList(localization.getTextWithPlaceholder2(oFF.AuGdsQueryBuilderI18n.MSG_COLUMN_LIMIT_EXCEEDED, oFF.XInteger.convertToString(this.m_maxTableCols), oFF.XInteger.convertToString(cursorResultSet.getCursorColumnsAxis().getTuplesCountTotal()))));
			}
			else if (oFF.notNull(cursorResultSet) && rsContainer.getMaxColumns() > -1 && this.m_maxTableColRecommendation > 0 && this.m_maxTableColRecommendation < cursorResultSet.getCursorColumnsAxis().getTuplesCountTotal())
			{
				this.complementDetailsPopOver(fl, localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_WARNING_MESSAGE), oFF.XCollectionUtils.singletonList(localization.getTextWithPlaceholder2(oFF.AuGdsQueryBuilderI18n.MSG_COLUMN_LIMIT_RECOMMENDATION_EXCEEDED, oFF.XInteger.convertToString(this.m_maxTableColRecommendation), oFF.XInteger.convertToString(cursorResultSet.getCursorColumnsAxis().getTuplesCountTotal()))));
			}
			if (queryModel.getMeasureDimension() === null)
			{
				this.complementDetailsPopOver(fl, localization.getText(oFF.AuGdsQueryBuilderI18n.MSG_QUERY_DOES_NOT_CONTAIN_MEASURES), null);
			}
		};
		if (oFF.notNull(icon) && oFF.notNull(overallMessage))
		{
			this.prepareDetailsPopOver(icon, overallMessage, flexLayoutConsumer);
		}
	}
	this.updateStyles(queryModel.getVisualizationManager());
	if (isRankActive)
	{
		let isNonVersionDimensionSelected = oFF.AuGdsQueryDetails.isNonVersionDimensionSelected(queryModel);
		if (!isNonVersionDimensionSelected)
		{
			let isVersionDimensionInDatasource = queryModel.getVersionDimension() !== null;
			let topNWarningKey = isVersionDimensionInDatasource ? oFF.AuGdsQueryBuilderI18n.MSG_TOP_N_CANNOT_BE_APPLIED_NO_VALID_NON_VERSION_DIMENSION : oFF.AuGdsQueryBuilderI18n.MSG_TOP_N_CANNOT_BE_APPLIED_NO_VALID_DIMENSION;
			this.addTopNWarning(topNWarningKey, measureName);
		}
		else if (oFF.AuGdsQueryDetails.isBwAndNoFlatDimensionSelected(queryModel))
		{
			let topNHierarchyWarningKey = oFF.AuGdsQueryBuilderI18n.MSG_TOP_N_CANNOT_BE_APPLIED_BW_HIERARCHY;
			this.addTopNWarning(topNHierarchyWarningKey, measureName);
		}
	}
};
