oFF.AuGdsFileManager.prototype.saveContentToFile = function(outputFile, contentToSave, showSuccessToast, consumer)
{
	outputFile.processSave(oFF.SyncType.NON_BLOCKING, oFF.XLambdaFileSavedListener.create((extResult) => {
		if (!extResult.hasErrors() && showSuccessToast)
		{
			let msg = this.getController().getGlobalLocalization().getText(oFF.AuGalaxyDataStudioI18n.SAVE_INSIGHT_SUCCESS);
			this.getMessageCenter().showSuccessToast(msg);
		}
		if (oFF.notNull(consumer))
		{
			consumer(extResult);
		}
	}), null, contentToSave, oFF.CompressionType.NONE, null, oFF.XFileSaveMode.AUTO);
};
