oFF.AuFlexLayoutProgram.prototype.buildUi = function(genesis)
{
	this.m_layout = genesis.newRoot(oFF.UiType.FLEX_LAYOUT);
	this.m_layout.setBackgroundColor(oFF.UiColor.LIGHT_GREY);
	this.m_layout.setName(this.m_layoutName);
	this.m_layout.setTooltip(this.m_layoutName);
	this.m_layout.useMaxSpace();
	this.m_layout.setDirection(this.m_flexDirection);
	this.m_layout.setAlignItems(oFF.UiFlexAlignItems.CENTER);
	this.m_layout.setJustifyContent(oFF.UiFlexJustifyContent.SPACE_AROUND);
	this.m_layout.setWrap(oFF.UiFlexWrap.NO_WRAP);
	this.createContainers();
	this.getProcess().getProgramContainer().setTitle(this.m_layoutName);
	oFF.XCollectionUtils.forEach(this.m_styleNames, (style) => {
		this.m_layout.addCssClass(oFF.XStringUtils.concatenate2("ffCw", style));
	});
};
oFF.AuFlexLayoutProgram.prototype.createContainers = function()
{
	if (oFF.notNull(this.m_layout))
	{
		for (let i = 0; i < this.m_containerDetails.size(); i++)
		{
			let containerStructure = this.m_containerDetails.getStructureAt(i);
			let name = containerStructure.getStringByKey("ContainerName");
			let widthString = containerStructure.getStringByKeyExt("Width", null);
			let heightString = containerStructure.getStringByKeyExt("Height", null);
			let stylesType = containerStructure.getElementTypeByKey("Styles");
			let stylesList = oFF.XList.create();
			if (oFF.notNull(stylesType) && stylesType !== oFF.PrElementType.THE_NULL)
			{
				oFF.XCollectionUtils.forEach(containerStructure.getListByKey("Styles"), (element) => {
					stylesList.add(element.getString());
				});
			}
			let isRowLayout = this.m_flexDirection === oFF.UiFlexDirection.ROW || this.m_flexDirection === oFF.UiFlexDirection.ROW_REVERSE;
			let tempWrapper = this.m_layout.addNewItemOfType(oFF.UiType.CONTENT_WRAPPER);
			if (oFF.XStringUtils.isNullOrEmpty(widthString))
			{
				tempWrapper.useMaxWidth();
			}
			if (oFF.XStringUtils.isNullOrEmpty(heightString))
			{
				tempWrapper.useMaxHeight();
			}
			if (!isRowLayout)
			{
				if (oFF.XStringUtils.isNotNullAndNotEmpty(widthString))
				{
					tempWrapper.setWidth(oFF.UiCssLength.create(widthString));
				}
				if (oFF.XStringUtils.isNotNullAndNotEmpty(heightString))
				{
					tempWrapper.setFlex("none");
					tempWrapper.setHeight(oFF.UiCssLength.create(heightString));
				}
			}
			else
			{
				if (oFF.XStringUtils.isNotNullAndNotEmpty(heightString))
				{
					tempWrapper.setHeight(oFF.UiCssLength.create(heightString));
				}
				if (oFF.XStringUtils.isNotNullAndNotEmpty(widthString))
				{
					tempWrapper.setFlex("none");
					tempWrapper.setWidth(oFF.UiCssLength.create(widthString));
				}
			}
			tempWrapper.setName(name);
			tempWrapper.setBackgroundColor(oFF.UiColor.TRANSPARENT);
			if (!stylesList.isEmpty())
			{
				oFF.XCollectionUtils.forEach(stylesList, (style) => {
					tempWrapper.addCssClass(oFF.XStringUtils.concatenate2("ffCwBatch", style));
				});
			}
			else
			{
				tempWrapper.addCssClass("ffCwBatchCard");
			}
		}
	}
};
