oFF.AuPivotTableProgram.prototype.setDataProviderFromEnvironment = function()
{
	let dataProvider = this.getDataProviderFromDataApplication(this.m_dataProviderName);
	if (oFF.isNull(dataProvider))
	{
		dataProvider = this.getDataProviderFromPool(this.m_dataProviderName);
	}
	this.unsubscribeDataProviderEvents();
	this.m_dataProvider = oFF.OlapDataProviderOlapAccess.getOlapInterface(dataProvider);
	this.subscribeDataProviderEvents();
	if (oFF.notNull(this.m_dataProvider) && this.m_dataProvider.getQueryManager() !== null)
	{
		this.m_view.setDataProvider(this.m_dataProvider);
	}
	else
	{
		this.m_view.setDataProvider(null);
	}
	let hasValidQueryManager = oFF.XObjectExt.isValidObject(this.m_dataProvider) && oFF.XObjectExt.isValidObject(this.m_dataProvider.getQueryManager());
	if (hasValidQueryManager)
	{
		let vizDef = this.m_dataProvider.getQueryManager().getQueryModel().getVisualizationManager().getCurrentActiveVisualizationDefinition();
		let applicationSettings = vizDef.getApplicationSettings();
		applicationSettings.setMaxRows(this.m_rows);
		applicationSettings.setMaxColumns(this.m_cols);
		applicationSettings.setAllowTextEdit(this.m_allowTextEdit);
		this.m_view.refreshView();
		this.getGenesis().setRoot(this.m_view.getView());
	}
	else
	{
		let message = this.getGenesis().newRoot(oFF.UiType.ILLUSTRATED_MESSAGE);
		message.setIllustrationType(oFF.UiIllustratedMessageType.ERROR_SCREEN);
		message.setIllustrationSize(oFF.UiIllustratedMessageSize.AUTO);
		message.setTitle("Data provider error");
		message.setDescription("No data provider available to render table");
	}
};
