oFF.AuGdsQbChartSettingsPanel.prototype.updateControlByCurrentChartType = function()
{
	this.m_root.clearItems();
	this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.CHART_TYPE));
	let primaryChartType = this.getChartSetting().getChartType();
	let secondaryChartType = this.getChartSetting().getChartType2();
	if (primaryChartType.isTypeOf(oFF.ChartType.BAR_COLUMN) || primaryChartType === oFF.ChartType.AREA || primaryChartType === oFF.ChartType.LINE)
	{
		if (primaryChartType.isTypeOf(oFF.ChartType.BAR_COLUMN))
		{
			this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.SECONDARY_CHART_TYPE));
		}
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.ORIENTATION));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.STACKING_TYPE));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.VALUE.getName()));
		if (secondaryChartType !== oFF.ChartType.NONE)
		{
			this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.VALUE_B.getName()));
		}
	}
	else if (primaryChartType === oFF.ChartType.RADAR)
	{
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.VALUE.getName()));
	}
	else if (primaryChartType === oFF.ChartType.BOX_PLOT)
	{
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.ORIENTATION));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationAxisType.CATEGORY_X.getName()));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.VALUE.getName()));
	}
	else if (primaryChartType === oFF.ChartType.TIME_SERIES)
	{
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.ORIENTATION));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.STACKING_TYPE));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.VALUE.getName()));
	}
	else if (primaryChartType === oFF.ChartType.HEAT_MAP)
	{
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.ORIENTATION));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.COLOR.getName()));
	}
	else if (primaryChartType === oFF.ChartType.PACKED_BUBBLE || primaryChartType === oFF.ChartType.BUBBLE || primaryChartType === oFF.ChartType.SCATTER_PLOT || primaryChartType === oFF.ChartType.VARI_WIDE)
	{
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.ORIENTATION));
		if (primaryChartType === oFF.ChartType.VARI_WIDE)
		{
			this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.STACKING_TYPE));
		}
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.VALUE.getName()));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.VALUE_B.getName()));
		if (primaryChartType === oFF.ChartType.BUBBLE || primaryChartType === oFF.ChartType.PACKED_BUBBLE)
		{
			this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.SIZE.getName()));
		}
	}
	else if (primaryChartType === oFF.ChartType.METRIC)
	{
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.VALUE.getName()));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.VALUE_B.getName()));
	}
	else if (primaryChartType === oFF.ChartType.PIE || primaryChartType === oFF.ChartType.DOUGHNUT)
	{
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.SIZE.getName()));
	}
	else if (primaryChartType === oFF.ChartType.TREE_MAP)
	{
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.AuGdsQbChartSettingsPanel.ORIENTATION));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.COLOR.getName()));
		this.m_root.addItem(this.m_listLayouts.getByKey(oFF.VisualizationValueType.WEIGHT.getName()));
	}
};
oFF.AuGdsQbChartSettingsPanel.prototype.updateQbPanelUi = function()
{
	this.m_category.clearItems();
	this.m_secondaryCategory.clearItems();
	this.m_colorCategory.clearItems();
	this.m_texture.clearItems();
	this.m_shape.clearItems();
	this.m_distribution.clearItems();
	this.m_time.clearItems();
	this.m_values.clearItems();
	this.m_secondaryValues.clearItems();
	this.m_colorValue.clearItems();
	this.m_size.clearItems();
	this.m_weight.clearItems();
	if (oFF.isNull(this.m_visualizationDefinition))
	{
		return;
	}
	if (this.getChartSetting().getChartType() === null)
	{
		this.getChartSetting().setChartType(oFF.ChartType.BAR);
	}
	if (this.getChartSetting().getChartType2() === null)
	{
		this.getChartSetting().setChartType2(oFF.ChartType.NONE);
	}
	if (this.getChartSetting().getChartOrientation() === null)
	{
		this.getChartSetting().setChartOrientation(oFF.ChartOrientation.HORIZONTAL);
	}
	if (this.getChartSetting().getChartStackingType() === null)
	{
		this.getChartSetting().setChartStackingType(oFF.ChartStackingType.NONE);
	}
	this.m_stackingType.setSelectedName(this.getChartSetting().getChartStackingType().getName());
	this.m_orientation.setSelectedName(this.getChartSetting().getChartOrientation().getName());
	this.m_chartType.setSelectedName(this.getChartSetting().getChartType().getName());
	this.m_secondaryChartType.setSelectedName(this.getChartSetting().getChartType2().getName());
	this.updateValuesList(this.m_values, oFF.VisualizationValueType.VALUE);
	this.updateValuesList(this.m_secondaryValues, oFF.VisualizationValueType.VALUE_B);
	this.updateValuesList(this.m_size, oFF.VisualizationValueType.SIZE);
	this.updateValuesList(this.m_weight, oFF.VisualizationValueType.WEIGHT);
	this.updateValuesList(this.m_colorValue, oFF.VisualizationValueType.COLOR);
	this.updateControlByCurrentChartType();
	this.updateLabels();
};
oFF.AuGdsQbChartSettingsPanel.prototype.updateValuesList = function(list, valueType)
{
	let values = this.getChartSetting().getTypedValueSelectionsForType(valueType);
	for (let i = 0; i < values.size(); i++)
	{
		let val = values.get(i);
		let dragItem = this.buildValueItem(val);
		list.addItem(dragItem);
	}
	if (oFF.notNull(this.m_visualizationDefinition))
	{
		list.setDropInfo(oFF.UiDropInfo.create(oFF.UiDropPosition.BETWEEN, oFF.UiDropEffect.MOVE, oFF.UiDropLayout.DEFAULT, oFF.UiAggregation.ITEMS));
		list.setDropCondition(oFF.UiDropCondition.createSimple(null, this.getChartConfiguration().getKeyFigureDimension().getName(), null));
	}
};

