oFF.AuGdsQbNavigationPanel.prototype.buildQbPanelUi = function(genesis)
{
	this.addStyleClass("ffGdsQbNavigationPanel");
	let parentDocument = this.getParentDocument();
	let globalConfig = parentDocument.getGlobalConfiguration();
	let docConfig = parentDocument.getGdsConfiguration().getConfigJsonForDocumentType(parentDocument.getDocumentType());
	let calculations = docConfig.getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_CALCULATIONS);
	let calculationsGenAi = docConfig.getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_CALCULATIONS_GEN_AI);
	let calcOnSecondaryStruct = docConfig.getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_CALCULATIONS_SECONDARY_STRUCTURE);
	let chartingPhase2Enabled = docConfig.getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_CHARTING_PHASE2);
	let chartingPhase_3Enabled = docConfig.getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_CHARTING_LIST_BASED_RENDERING);
	let chartingNewTypes = docConfig.getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_NEW_CHART_TYPES);
	let configJson = oFF.AuGdsQbPanelConfigHelper.getConfigJsonForPanelType(parentDocument.getGdsConfiguration(), this.getPanelType());
	let showGroupPresentation = configJson.getBooleanByKey(oFF.AuGdsQbPanelConfigHelper.SECTION_NAVIGATION_SHOW_GROUP_PRESENTATION_MENU);
	let showExpandCollapseOptions = configJson.getBooleanByKey(oFF.AuGdsQbPanelConfigHelper.SECTION_NAVIGATION_SHOW_GROUP_EXPAND_COLLAPSE_OPTIONS);
	let defaultGroupPresentationString = configJson.getStringByKey(oFF.AuGdsQbPanelConfigHelper.SECTION_NAVIGATION_DEFAULT_GROUP_PRESENTATION);
	let groupDimensionsKey = oFF.CoGlobalConfigurationUtils.GROUP_DIMENSIONS;
	let isGroupDimensionsConfiguredGlobally = globalConfig.isPropertyDirty(groupDimensionsKey);
	let shouldGroupDimensions = globalConfig.getBooleanByKey(groupDimensionsKey);
	if (isGroupDimensionsConfiguredGlobally)
	{
		if (!shouldGroupDimensions)
		{
			showExpandCollapseOptions = false;
			defaultGroupPresentationString = oFF.OuInventoryViewGroupPresentation.FLAT.getName();
		}
	}
	let rightClickDimension = configJson.getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_RIGHT_CLICK_DIMENSION);
	let rightClickAttribute = configJson.getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_RIGHT_CLICK_ATTRIBUTE);
	let rightClickMember = configJson.getBooleanByKey(oFF.AuGdsQbConstants.CONFIG_RIGHT_CLICK_MEMBER);
	let config = oFF.OuInventoryViewConfiguration.createInventoryViewConfig(this.getParentDocument().getApplication());
	config.setDragElementTag(oFF.AuGdsQbConstants.QD_UI_DRAG_ELEMENT);
	config.setDefaultPresentation(this.getPresentationType());
	config.setMenuProvider(oFF.AuGdsGridAxesMenuProvider.create(this.getGenesis(), this.getParentDocument().getMenuManager(), this.getParentDocument()));
	config.setCalculationsEnabled(calculations);
	config.setCalculationsGenAiEnabled(calculationsGenAi);
	config.setCalculationsOnSecondaryStructEnabled(calcOnSecondaryStruct);
	config.setChartingPhase2Enabled(chartingPhase2Enabled);
	config.setChartingPhase_3Enabled(chartingPhase_3Enabled);
	config.setChartingNewTypesEnabled(chartingNewTypes);
	config.setShowGroupPresentationMenu(showGroupPresentation);
	config.setMessageCenter(oFF.UiMessageCenter.createMessageCenter(genesis));
	config.setShowGroupExpandCollapseOptions(showExpandCollapseOptions);
	config.setDefaultGroupPresentation(oFF.OuInventoryViewGroupPresentation.lookup(defaultGroupPresentationString));
	config.setShowCustomDimension2(configJson.getBooleanByKey(oFF.AuGdsQbPanelConfigHelper.SECTION_NAVIGATION_SHOW_CUSTOMDIMENSION2));
	config.setShowDimensionMoreButton(configJson.getBooleanByKey(oFF.AuGdsQbPanelConfigHelper.SECTION_NAVIGATION_DIMENSION_MORE_BUTTON));
	config.setRightClickContextMenuForDimensionEnabled(rightClickDimension);
	config.setRightClickContextMenuForAttributeEnabled(rightClickAttribute);
	config.setRightClickContextMenuForMemberEnabled(rightClickMember);
	let process = this.getParentDocument().getProcess();
	this.m_view = oFF.OuInventoryView.createView(process, genesis, config);
	genesis.setRoot(this.m_view.getView());
	let i18n = this.getParentDocument().getLocalizationProvider();
	this.setTitle(i18n.getText(oFF.AuGdsQueryBuilderI18n.NAV_AVAILABLE_ITEMS));
	let moreButton = this.getOrCreateMoreButton();
	moreButton.addCssClass("ffGdsQbNavigationPanelMoreButton");
	moreButton.registerOnPress(oFF.UiLambdaPressListener.create((evt) => {
		if (oFF.isNull(this.m_moreMenu))
		{
			this.m_moreMenu = genesis.newControl(oFF.UiType.MENU);
			this.m_displayMenuUpdateFunction = this.buildDisplayMenu(this.m_moreMenu);
		}
		if (oFF.notNull(this.m_displayMenuUpdateFunction))
		{
			this.m_displayMenuUpdateFunction();
		}
		if (oFF.notNull(this.m_sortMenuUpdateFunction))
		{
			this.m_sortMenuUpdateFunction();
		}
		this.m_moreMenu.openAt(evt.getControl());
	}));
};
