oFF.AuGdsQbConditionalFormattingRuleDialog.prototype.buildDefinedOnSection = function(mainInfoLayout)
{
	let definedOnLayout = mainInfoLayout.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
	definedOnLayout.addCssClass("ffAuGdsCFDefinedOnContainer");
	definedOnLayout.addCssClass("ffAuGdsCFMainInfoContainer");
	definedOnLayout.setDirection(oFF.UiFlexDirection.COLUMN);
	let dropdownLabelText = this.getLocalization().getText(oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_DEFINED_ON_DROPDOWN_LABEL);
	let dropdownLabel = definedOnLayout.addNewItemOfType(oFF.UiType.LABEL);
	dropdownLabel.setText(dropdownLabelText);
	dropdownLabel.setTooltip(dropdownLabelText);
	dropdownLabel.setShowColon(true);
	this.m_structureDropdown = definedOnLayout.addNewItemOfType(oFF.UiType.DROPDOWN);
	this.m_structureDropdown.addCssClass("ffAuGdsCFDefinedOnDropdown");
	this.m_structureDropdown.registerOnSelect(oFF.UiLambdaSelectListener.create((structureSelectedEvent) => {
		let selectedStructure = structureSelectedEvent.getSelectedItem().getCustomObject();
		this.handleDefinedOnStructureChanged(mainInfoLayout, selectedStructure);
		this.updateUiMeasureDropdowns();
	}));
	dropdownLabel.setLabelFor(this.m_structureDropdown);
	let primaryStruct = this.m_queryModelWrapper.getPrimaryStructure();
	let primaryDropdownItem = this.m_structureDropdown.addNewItem();
	primaryDropdownItem.setText(this.getStructureDimensionLabel(primaryStruct));
	primaryDropdownItem.setCustomObject(primaryStruct);
	let secondaryStruct = this.m_queryModelWrapper.getSecondaryStructure().get();
	let secondaryDropdownItem = this.m_structureDropdown.addNewItem();
	secondaryDropdownItem.setText(this.getStructureDimensionLabel(secondaryStruct));
	secondaryDropdownItem.setCustomObject(secondaryStruct);
	let selectedStructure = primaryStruct;
	if (this.m_structure.isPresent())
	{
		if (oFF.XString.isEqual(this.m_structure.get().getName(), secondaryStruct.getName()))
		{
			this.m_structureDropdown.setSelectedItem(secondaryDropdownItem);
			selectedStructure = secondaryStruct;
		}
		this.m_structureDropdown.setEnabled(false);
	}
	this.handleDefinedOnStructureChanged(mainInfoLayout, selectedStructure);
};
