oFF.AuGdsQbConditionalFormattingRuleDialog.prototype.buildMainInfoSection = function()
{
	let mainInfoLayout = this.m_mainLayout.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
	mainInfoLayout.addCssClass("ffAuGdsCFSection");
	mainInfoLayout.addCssClass(this.m_isDefinedOnDropdownEnabled ? "ffAuGdsCFMainInfoDefinedOn" : "ffAuGdsCFMainInfo");
	mainInfoLayout.setDirection(oFF.UiFlexDirection.COLUMN);
	let i18nProvider = this.getLocalization();
	let nameLayout = mainInfoLayout.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
	nameLayout.addCssClass("ffAuGdsCFNameContainer");
	let nameLabelText = i18nProvider.getText(oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_NAME_LABEL);
	let nameLabel = nameLayout.addNewItemOfType(oFF.UiType.LABEL);
	nameLabel.setRequired(true);
	nameLabel.setText(nameLabelText);
	nameLabel.setTooltip(nameLabelText);
	if (this.m_isDefinedOnDropdownEnabled)
	{
		nameLayout.addCssClass("ffAuGdsCFMainInfoContainer");
		nameLayout.setDirection(oFF.UiFlexDirection.COLUMN);
		nameLabel.setShowColon(true);
	}
	this.m_nameInput = nameLayout.addNewItemOfType(oFF.UiType.INPUT);
	nameLabel.setLabelFor(this.m_nameInput);
	this.m_nameInput.setValue(this.getRuleName());
	this.m_nameInput.setTooltip(this.m_nameInput.getValue());
	this.m_nameInput.registerOnEditingEnd(oFF.UiLambdaEditingEndListener.create((event) => {
		this.m_nameInput.setTooltip(this.m_nameInput.getValue());
		this.validateState(this.m_nameInput);
	}));
	if (this.m_isDefinedOnDropdownEnabled)
	{
		if (this.m_queryModelWrapper.getSecondaryStructure().isPresent() && this.m_dataProvider.getMemberFilterDimension().isPresent())
		{
			this.buildDefinedOnSection(mainInfoLayout);
		}
		else
		{
			this.handleDefinedOnStructureChanged(mainInfoLayout, this.m_dataProvider.getMemberDimension());
		}
	}
	else
	{
		let measureLayout = mainInfoLayout.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
		measureLayout.addCssClass("ffAuGdsCFMeasureContainer");
		let measureLabelText = this.getMemberTypeLabel();
		let measureLabel = measureLayout.addNewItemOfType(oFF.UiType.LABEL);
		measureLabel.setRequired(true);
		measureLabel.setText(measureLabelText);
		measureLabel.setTooltip(measureLabelText);
		this.m_measureInput = oFF.OuUiMeasureInput.create(this.getProcess(), this.getQueryManager(), this.m_dataProvider);
		this.m_measureInput.renderView(this.getGenesis());
		this.m_measureInput.addCssClass("ffAuGdsCFMeasure");
		this.m_measureInput.setPlaceholder(i18nProvider.getTextWithPlaceholder(oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_SELECT_PLACEHOLDER, measureLabelText));
		measureLayout.addItem(this.m_measureInput.getView());
		this.m_measureInput.attachOnChange((event) => {
			this.updateUiMeasureDropdowns();
			this.validateState(this.m_measureInput.getView());
		});
		measureLabel.setLabelFor(this.m_measureInput.getView());
		if (this.isMemberFilterVisible())
		{
			let memberFiltertLayout = mainInfoLayout.addNewItemOfType(oFF.UiType.FLEX_LAYOUT);
			memberFiltertLayout.addCssClass("ffAuGdsCFMemberFilterContainer");
			let memberFilterLabelText = i18nProvider.getText(this.getMemberFilterTypeLabel());
			let memberFilterLabel = memberFiltertLayout.addNewItemOfType(oFF.UiType.LABEL);
			memberFilterLabel.setText(memberFilterLabelText);
			memberFilterLabel.setTooltip(memberFilterLabelText);
			this.m_memberFilterInput = oFF.AuGdsQbConditionalFormattingMemberInput.create(this.getProcess(), this.getQueryManager(), this.m_dataProvider.getMemberFilterDimension().get());
			this.m_memberFilterInput.renderView(this.getGenesis());
			this.m_memberFilterInput.addCssClass("ffAuGdsCFMemberFilter");
			this.m_memberFilterInput.setPlaceholder(this.getMemberFilterTypePlaceholder());
			memberFiltertLayout.addItem(this.m_memberFilterInput.getView());
			memberFilterLabel.setLabelFor(this.m_memberFilterInput.getView());
			if (this.isEdit())
			{
				this.m_memberFilterInput.setValueByFilter(this.m_ruleFilterManager.getMemberFilter());
			}
		}
	}
	if (this.m_measure.isPresent())
	{
		this.m_measureInput.setValue(this.m_measure.get());
		this.m_measureInput.setEditable(false);
	}
};
