oFF.AuGdsQbConditionalFormattingRuleDialog.prototype.buildThresholdState = function()
{
	let ranges = oFF.XList.create();
	for (let j = 0; j < this.m_rangeWidgetList.size(); j++)
	{
		ranges.add(this.m_rangeWidgetList.get(j).buildState());
	}
	return oFF.AuGdsQbConditionalFormattingThreshold.create(this.getSelectedCompareType(), ranges.getValuesAsReadOnlyList(), this.getSelectedComparedMeasure());
};
