oFF.AuGdsQbConditionalFormattingRuleDialog.prototype.createTitle = function()
{
	if (this.isEdit())
	{
		return this.getLocalization().getText(oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_EDIT_TITLE);
	}
	return this.getLocalization().getText(oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_NEW_TITLE);
};
oFF.AuGdsQbConditionalFormattingRuleDialog.prototype.findFilterToken = function(dimensionName)
{
	return oFF.XStream.of(this.m_filterTokens).find((token) => {
		return oFF.XString.isEqual(token.getFilterItem().getDimension().getName(), dimensionName);
	});
};
oFF.AuGdsQbConditionalFormattingRuleDialog.prototype.findMeasure = function(measureName)
{
	let measures = this.m_dataProvider.getMeasures();
	return oFF.XStream.of(measures).find((measure) => {
		return oFF.XString.isEqual(measureName, measure.getName());
	});
};
oFF.AuGdsQbConditionalFormattingRuleDialog.prototype.geMemberFilter = function()
{
	let filterDimension = this.m_dataProvider.getMemberFilterDimension();
	let values = oFF.XList.create();
	oFF.XStream.of(this.m_memberFilterInput.getValue()).forEach((member) => {
		values.add(oFF.XStringValue.create(member.getName()));
	});
	return oFF.AuGdsQbConditionalFormattingFilterItem.create(filterDimension.get(), values);
};
oFF.AuGdsQbConditionalFormattingRuleDialog.prototype.generateRuleName = function()
{
	let indexOfNewRuleText = oFF.XInteger.convertToString(this.m_ruleAPI.listAllRules().size() + 1);
	return this.getLocalization().getTextWithPlaceholder(oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_NAME_DEFAULT, indexOfNewRuleText);
};
