	measureLabel.setShowColon(true);
	this.m_dataProvider = oFF.AuGdsQbConditionalFormattingRuleDataProviderFactory.createWithStructure(this.getQueryManager().getQueryModel(), structure);
	this.m_measureInput = oFF.OuUiMeasureInput.create(this.getProcess(), this.getQueryManager(), this.m_dataProvider);
	this.m_measureInput.renderView(this.getGenesis());
	this.m_measureInput.addCssClass("ffAuGdsCFMeasure");
	this.m_measureInput.setPlaceholder(this.getLocalization().getTextWithPlaceholder(oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_SELECT_PLACEHOLDER, measureLabelText));
