oFF.AuGdsQbConditionalFormattingRuleDialog.prototype.openFilterDialog = function(dimension, isEdit)
{
	let filterTitle = this.getFilterDialogTitle(dimension);
	let filterDialogRunner = oFF.FilterDialogProgramRunnerFactory.createForDimension(this.getProcess(), this.getQueryManager(), dimension.getName(), filterTitle);
	let filterDialogConfig = oFF.PrFactory.createStructure();
	let filter = this.m_ruleFilterManager.getDimensionFilters(dimension);
	if (oFF.notNull(filter))
	{
		let filterSelection = oFF.XStream.of(filter.getValues()).map((value) => {
			if (oFF.isNull(value))
			{
				return oFF.FilterDialogValueFactory.createNullValue();
			}
			let fdValue = oFF.FilterDialogValueFactory.createValue(value.getStringRepresentation(), null, null);
			if (oFF.XStringUtils.isNotNullAndNotEmpty(filter.getDimension().getHierarchyName()))
			{
				fdValue.setHierarchyName(filter.getDimension().getHierarchyName());
			}
			return fdValue;
		}).collect(oFF.XStreamCollector.toList());
		filterDialogRunner.getProgramStartData().putXObject(oFF.FilterDialog.PRG_DATA_DEFAULT_SELECTION, filterSelection);
	}
	filterDialogConfig.putBoolean(oFF.FilterDialog.PARAM_OFFER_HIERARCHY_CHANGE, true);
	filterDialogConfig.putBoolean(oFF.FilterDialog.PARAM_OFFER_READMODE_EXTENDED_SETTINGS, true);
	filterDialogConfig.putString(oFF.FilterDialog.PARAM_SELECTION_MODE, oFF.UiTableSelectionMode.MULTI_TOGGLE.getName());
	filterDialogRunner.getProgramStartData().putXObject(oFF.FilterDialog.PRG_DATA_LISTENER_CLOSE, oFF.FilterDialogLambdaCloseListener.create((selection) => {
		this.onOkFilterDialog(selection, dimension, isEdit);
	}, () => {
		this.resetDimensionFilterSelection();
	}));
	filterDialogRunner.setConfigStructure(filterDialogConfig);
	return filterDialogRunner.runProgram();
};
