oFF.AuGdsQbConditionalFormattingRuleDialog.prototype.processArguments = function(args)
{
	this.assertQueryManagerSet();
	let queryModel = this.getQueryManager().getQueryModel();
	this.m_rule = oFF.XOptional.empty();
	this.m_structure = oFF.XOptional.empty();
	this.m_measure = oFF.XOptional.empty();
	this.m_ruleAPI = oFF.AuGdsQbConditionalFormattingCRUDLAPI.create(queryModel);
	this.m_queryModelWrapper = oFF.AuGdsQbCFQueryModelWrapper.create(queryModel);
	this.m_dataProvider = oFF.AuGdsQbConditionalFormattingRuleDataProviderFactory.createWithStructure(queryModel, this.m_queryModelWrapper.getPrimaryStructure());
	let ruleId = args.getStringByKey(oFF.AuGdsQbConditionalFormattingRuleDialog.PARAM_RULE_ID);
	let measureName = args.getStringByKey(oFF.AuGdsQbConditionalFormattingRuleDialog.PARAM_MEASURE_NAME);
	this.m_contextEnabled = args.getBooleanByKey(oFF.AuGdsQbConditionalFormattingRuleDialog.PARAM_CONTEXT_ENABLED);
	this.m_isDefinedOnDropdownEnabled = args.getBooleanByKey(oFF.AuGdsQbConditionalFormattingRuleDialog.PARAM_DEFINED_ON_DROPDOWN_ENABLED);
	this.m_ruleFilterManager = oFF.AuGdcQbCFRuleFilterManager.create(this.m_isDefinedOnDropdownEnabled);
	let structureName = null;
	if (oFF.notNull(ruleId))
	{
		let rule = this.m_ruleAPI.readRule(ruleId);
		if (oFF.isNull(rule))
		{
			throw oFF.XException.createIllegalStateException(oFF.XStringUtils.concatenate3("Invalid rule id '", ruleId, "': Rule not found!"));
		}
		this.m_rule = oFF.XOptional.of(rule);
		measureName = rule.getStructureMember().getName();
		structureName = rule.getStructureMember().getDimension().getName();
		this.m_ruleFilterManager.addAllFilters(this.m_rule.get().getFilters());
	}
	if (this.m_isDefinedOnDropdownEnabled && oFF.notNull(structureName))
	{
		this.m_structure = oFF.XOptional.ofNullable(queryModel.getDimensionByName(structureName));
		oFF.XObjectExt.assertTrue(this.m_structure.isPresent());
		this.m_dataProvider = oFF.AuGdsQbConditionalFormattingRuleDataProviderFactory.createWithStructure(this.getQueryManager().getQueryModel(), this.m_structure.get());
	}
	else
	{
		this.m_dataProvider = oFF.AuGdsQbConditionalFormattingRuleDataProviderFactory.create(this.getQueryManager().getQueryModel());
	}
	if (oFF.notNull(measureName))
	{
		this.m_measure = this.findMeasure(measureName);
	}
};
