oFF.AuGdsQbConditionalFormattingRuleDialog.prototype.removeRangeWidget = function(rangeSection, rangeWidget)
{
	let isCleared = false;
	let indexToBeRemoved = this.m_rangeWidgetList.getIndex(rangeWidget);
	let widgetToBeFocused = null;
	if (indexToBeRemoved === this.m_rangeWidgetList.size() - 1)
	{
		this.m_addRangeBtn.focus();
	}
	else
	{
		widgetToBeFocused = this.m_rangeWidgetList.get(indexToBeRemoved + 1);
	}
	this.m_rangeWidgetList.removeAt(indexToBeRemoved);
	rangeWidget.getView().destroy();
	if (this.m_rangeWidgetList.size() === 0)
	{
		isCleared = true;
		this.addThresholdEmptyRange(rangeSection);
	}
	else
	{
		for (let i = 0; i < this.m_rangeWidgetList.size(); i++)
		{
			this.m_rangeWidgetList.get(i).setIndex(i + 1);
		}
	}
	if (oFF.notNull(widgetToBeFocused))
	{
		widgetToBeFocused.focus();
	}
	this.validateState(null);
	this.announceRangeDelete(isCleared ? -1 : indexToBeRemoved + 1);
};
oFF.AuGdsQbConditionalFormattingRuleDialog.prototype.renderRangeWidget = function(rangeSection, rangeWidget)
{
	rangeWidget.setCompareType(this.getSelectedCompareType());
	rangeWidget.renderView(this.getGenesis());
	rangeSection.addItem(rangeWidget.getView());
	rangeWidget.attachOnChange((onChangeObj) => {
		if (rangeWidget.isValidInterval())
		{
			let rangeWidgetIndex = this.m_rangeWidgetList.getIndex(rangeWidget);
			if (rangeWidget.getUpperBound() !== null && rangeWidgetIndex !== this.m_rangeWidgetList.size() - 1)
			{
				let upperBound = rangeWidget.getUpperBound();
				let rangeWidgetNext = this.m_rangeWidgetList.get(rangeWidgetIndex + 1);
				rangeWidgetNext.setLowerBound(upperBound);
			}
		}
		this.validateState(null);
	});
	rangeWidget.attachOnDelete((onDeleteObj) => {
		this.removeRangeWidget(rangeSection, rangeWidget);
	});
	this.m_rangeWidgetList.add(rangeWidget);
	rangeWidget.setIndex(this.m_rangeWidgetList.size());
	rangeWidget.setLabelledBy(this.m_rangeLabel, this.m_rangeNameLabel);
};
