oFF.AuGdsQbConditionalFormattingRuleDialog.prototype.updateUiMeasureDropdowns = function()
{
	this.updateThresholdCompareTypeDD();
	let compareType = this.getSelectedCompareType();
	let isComparedToMeasureSelected = this.isComparedToMeasureSelected();
	this.m_thresholdMeasureLayout.setVisible(isComparedToMeasureSelected);
	let selectedMeasure = this.getSelectedMeasure();
	if (isComparedToMeasureSelected && this.getSelectedComparedMeasure() === selectedMeasure)
	{
		this.m_comparedMeasureInput.setValue(null);
	}
	for (let j = 0; j < this.m_rangeWidgetList.size(); j++)
	{
		this.m_rangeWidgetList.get(j).setCompareType(compareType);
	}
	this.validateState(null);
};
oFF.AuGdsQbConditionalFormattingRuleDialog.prototype.validateState = function(control)
{
	let validState = true;
	let thresholdName = this.m_nameInput.getValue();
	if (oFF.isNull(thresholdName) || oFF.XStringUtils.isNullOrEmpty(oFF.XString.trim(thresholdName)))
	{
		validState = false;
		if (control === this.m_nameInput)
		{
			oFF.AuGdsQbConditionalFormattingUiErrorProcessor.displayInlineError(this.m_nameInput, oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_NAME_MANDATORY);
		}
	}
	else
	{
		let previousThresholdName = this.getRuleName();
		let isChanged = !oFF.XString.isEqual(previousThresholdName, thresholdName);
		if (isChanged && oFF.AuGdsQbConditionalFormattingRuleUIValidator.validateName(this.getQueryManager().getQueryModel(), this.getSelectedMeasure(), thresholdName) === oFF.AuGdsQbCfRuleValidationState.INVALID)
		{
			validState = false;
			oFF.AuGdsQbConditionalFormattingUiErrorProcessor.displayInlineError(this.m_nameInput, oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_NAME_DUPLICATE);
		}
		else
		{
			oFF.AuGdsQbConditionalFormattingUiErrorProcessor.clearInlineError(this.m_nameInput);
		}
	}
	if (this.getSelectedMeasure() === null && !this.m_measureInput.skipValidation())
	{
		validState = false;
		if (control === this.m_measureInput.getView())
		{
			if (this.m_isDefinedOnDropdownEnabled)
			{
				let memberDimensionType = this.m_dataProvider.getMemberDimension().getDimensionType();
				if (oFF.DimensionType.SECONDARY_STRUCTURE.isEqualTo(memberDimensionType))
				{
					oFF.AuGdsQbConditionalFormattingUiErrorProcessor.displayInlineErrorWithPlaceholder(this.m_measureInput.getView(), oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_STRUCTURE_MANDATORY, this.getStructureDimensionLabel(this.m_dataProvider.getMemberDimension()));
				}
				else
				{
					let errorMsgMandatoryKey = oFF.DimensionType.ACCOUNT.isEqualTo(memberDimensionType) ? oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_ACCOUNT_MANDATORY : oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_MEASURE_MANDATORY;
					oFF.AuGdsQbConditionalFormattingUiErrorProcessor.displayInlineError(this.m_measureInput.getView(), errorMsgMandatoryKey);
				}
			}
			else
			{
				let errorMsgMandatory = this.m_queryModelWrapper.hasAccountDimension() ? oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_ACCOUNT_MANDATORY : oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_MEASURE_MANDATORY;
				oFF.AuGdsQbConditionalFormattingUiErrorProcessor.displayInlineError(this.m_measureInput.getView(), errorMsgMandatory);
			}
		}
	}
	else
	{
		oFF.AuGdsQbConditionalFormattingUiErrorProcessor.clearInlineError(this.m_measureInput.getView());
	}
	if (this.m_styleDD.getSelectedItem() === null)
	{
		validState = false;
		if (control === this.m_styleDD)
		{
			oFF.AuGdsQbConditionalFormattingUiErrorProcessor.displayInlineErrorDropdown(this.m_styleDD, oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_STYLE_MANDATORY);
		}
	}
	else
	{
		oFF.AuGdsQbConditionalFormattingUiErrorProcessor.clearInlineError(this.m_styleDD);
	}
	if (this.isComparedToMeasureSelected())
	{
		let comparedMeasureValid = true;
		if (this.getSelectedComparedMeasure() === null)
		{
			comparedMeasureValid = false;
			validState = false;
			if (control === this.m_comparedMeasureInput.getView())
			{
				if (this.m_isDefinedOnDropdownEnabled)
				{
					let memberDimensionType = this.m_dataProvider.getMemberDimension().getDimensionType();
					if (oFF.DimensionType.SECONDARY_STRUCTURE.isEqualTo(memberDimensionType))
					{
						oFF.AuGdsQbConditionalFormattingUiErrorProcessor.displayInlineErrorWithPlaceholder(this.m_comparedMeasureInput.getView(), oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_COMPARED_STRUCTURE_MANDATORY, this.getStructureDimensionLabel(this.m_dataProvider.getMemberDimension()));
					}
					else
					{
						let errorMsgMandatoryKey = oFF.DimensionType.ACCOUNT.isEqualTo(memberDimensionType) ? oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_COMPARED_ACCOUNT_MANDATORY : oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_COMPARED_MEASURE_MANDATORY;
						oFF.AuGdsQbConditionalFormattingUiErrorProcessor.displayInlineError(this.m_comparedMeasureInput.getView(), errorMsgMandatoryKey);
					}
				}
				else
				{
					let errorMsgComparedMandatory = this.m_queryModelWrapper.hasAccountDimension() ? oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_COMPARED_ACCOUNT_MANDATORY : oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_COMPARED_MEASURE_MANDATORY;
					oFF.AuGdsQbConditionalFormattingUiErrorProcessor.displayInlineError(this.m_comparedMeasureInput.getView(), errorMsgComparedMandatory);
				}
			}
		}
		else if (this.getSelectedComparedMeasure() === this.getSelectedMeasure())
		{
			comparedMeasureValid = false;
			validState = false;
			if (control === this.m_comparedMeasureInput.getView())
			{
				let dimensionMemberLabel = this.m_isDefinedOnDropdownEnabled ? this.getStructureDimensionLabel(this.m_dataProvider.getMemberDimension()) : this.getMemberTypeLabel();
				oFF.AuGdsQbConditionalFormattingUiErrorProcessor.displayInlineErrorWithPlaceholder(this.m_comparedMeasureInput.getView(), oFF.AuGdsQbConditionalFormattingI18n.RULE_DIALOG_ERR_THRESHOLD_MEASURE_DUPLICATED, dimensionMemberLabel);
			}
		}
		if (comparedMeasureValid)
		{
			oFF.AuGdsQbConditionalFormattingUiErrorProcessor.clearInlineError(this.m_comparedMeasureInput.getView());
		}
	}
	else
	{
		oFF.AuGdsQbConditionalFormattingUiErrorProcessor.clearInlineError(this.m_comparedMeasureInput.getView());
	}
	let rangeList = oFF.XList.create();
	let rangeWidgtesValid = this.m_rangeWidgetList.size() > 0;
	if (rangeWidgtesValid)
	{
		for (let j = 0; j < this.m_rangeWidgetList.size(); j++)
		{
			let rangeWidget = this.m_rangeWidgetList.get(j);
			rangeWidget.setValidationState(null);
			rangeWidgtesValid = rangeWidgtesValid && rangeWidget.isValid();
			try
			{
				rangeList.add(rangeWidget.getState());
			}
			catch (e)
			{
				continue;
			}
		}
	}
	else
	{
		this.logWarning("rangeWidgetList empty");
	}
	let widgetsOverlapResult = oFF.AuGdsQbConditionalFormattingRuleUIValidator.getRangeListOverlapValidation(rangeList);
	let rangeWidgetsIndexList = widgetsOverlapResult.getKeysAsReadOnlyList();
	for (let k = 0; k < rangeWidgetsIndexList.size(); k++)
	{
		let rangeWidgetKey = rangeWidgetsIndexList.get(k);
		let widgetOverlapResult = widgetsOverlapResult.getByKey(rangeWidgetKey);
		rangeWidgtesValid = rangeWidgtesValid && widgetOverlapResult === oFF.AuGdsQbCfRuleValidationState.VALID;
		this.m_rangeWidgetList.get(rangeWidgetKey.getInteger()).setValidationState(widgetOverlapResult);
	}
	validState = validState && rangeWidgtesValid;
	this.m_okBtn.setEnabled(validState);
};

